INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17264, '2OjCRvkSIfoHF_DSPKynjAan5Uc', 'YM6BSu6AccA', NULL, '{"publishedAt":"2019-03-19T00:00:00Z","channelId":"UC85fpVkTyRDj15AQ5H2Ra9w","title":"YOGA FOR KNOCK KNEES - Knock Knees No More (2019)","description":"Yoga For Knock Knees: Knock-knees are NOT mere cosmetic phenomena. A combination of foot, knee and/or hip imbalances can seriously weaken the structure of your knees and eventually cause you knee, hip and/or ankle pain.\n\nIf you are in pain, the best knock knee yoga therapy is a blend of strengthening and lengthening exercises. Practice these yoga poses for knock knees and learn how to decompress your joints. This easy movement & breathing technique can be helpful for knee, ankle and hip pain, soreness, stiffness, tightness, and other knock knee problems, and you can learn it in under 14 minutes. \n\nYOGA FOR KNOCK KNEES YOUTUBE PLAYLIST:\n\nYoga For Knock Knees - Knock Knees No More: https://www.youtube.com/watch?v=YM6BSu6AccA\nBow Legs Or Knock Knees - What Do You Have? (Do The Ultimate Test!):\nhttps://www.youtube.com/watch?v=trfVm8rvvPg\nKnock Knees Yoga - One To One Yoga Class: https://www.youtube.com/watch?v=YSNAK0qzp2Q\n\nYOUTUBE TIPS PLAYLIST:\n\nYoga For Bow Legs - How To Correct Bow Legs In Adults: https://www.youtube.com/watch?v=jVxxWvK3zUo&t=6s\n3 Yoga Exercises For Bow Legs - Bow Legs No More: https://www.youtube.com/watch?v=binI7nGkc9I&t=13s\nHow To Correct Bow Legs In Adults - Yoga Or Bow Leg Surgery?\nhttps://www.youtube.com/watch?v=Xuk0IbZWxsQ&t=10s\nBow Legs Yoga - How To Correct Bow Legs Fast (And Get Core Strength!):\nhttps://www.youtube.com/watch?v=OxtR6UGN-As&t=4s\nYoga For Bow Legs - How Long Does It Take To Fix Bow Legs In Adults? (In 2019):\nhttps://www.youtube.com/watch?v=GRhNP2hjtJc\nBow Legs Yoga For Athletes - How To Correct Bow Legs (in JUST 1 session!):\nhttps://www.youtube.com/watch?v=-Dk43esrifc\nBow Legs Yoga Exercise - How Many Times Do I Have To Repeat It? (Guess What???!!!): https://www.youtube.com/watch?v=UoLS1n_1TU4\nBow Legs Yoga - Why Correcting Your Bow Legs Is So Complicated?!?\nhttps://www.youtube.com/watch?v=TpMgyO6Q0AQ\nBow Legs Yoga - Can You Correct A Bone Naturally?\nhttps://www.youtube.com/watch?v=dkCfmhqmHvM&t=122s\n-----\n\nIf you want custom yoga work-ins for your unique situation, do your online quiz, submit the questionnaire, and receive free customized yoga training designed to relieve your unique health concerns:\n\nhttp://thebodyconditioner.com\n\n\"I decided to try yoga with Chi as a last resort to treating a terrible upper back pain I have lived with for close to 10 years. All I can say is I wish I''d started 9 years and 11 months ago! It has done wonders as I no longer feel the constant pain, and I''m also aware of some bad habits which aggravated my condition so I''m correcting myself. I recommend this to anyone who cares to listen now. It''s a great workout, and I love the personal nature of the practice even in a class of 8 people.\" - Lolade from Lagos, Nigeria\n\nThe Body Conditioner \"is about reconnecting to your body in its most elemental way...muscle to muscle, joint to joint, ligament to ligament and vertebra to vertebra. You will begin to feel like yourself again after practicing with Chi. She seems to know exactly what you need even if you don''t know what you need.\" - Rayna Rokicki from the United States\n\nThe Body Conditioner is a program for beginners and intermediate yoga practitioners who want to stop fixing and start healing now. If you want to get a deeper understanding of the essence of yoga and how to heal yourself inside and out while owning your own unique, personalized yoga practice, visit me at http://thebodyconditioner.com.\n\nDISCLAIMER: The content of this video is for educational and informational purposes only, and is not intended as medical advice. The information contained in this video is not intended to be used to diagnose, treat or prevent any disease, health concern, or illness. The purpose of this video is to inspire you to make informed decisions about your body and overall health after consulting with a qualified health professional. By watching this video, you acknowledge that you are responsible for your own health decisions. You need to consult with a qualified health professional prior to making any health changes, especially any changes related to a specific diagnosis or condition.\n\nI am not a medical or naturopathic doctor and do not dispense medical advice or prescribe treatment. If you feel or suspect that you have a medical problem, contact your health care provider immediately. Always consult with your medical doctor and/or health care provider before taking any medication, nutritional supplements, and/or making any other health-related changes.\n\nI am not responsible for any adverse effects or consequences that might result if you choose to make use of this video or apply any of the information that you have read on thebodyconditioner.com. By watching this video, visiting thebodyconditioner.com, and/or otherwise engaging with this material, you acknowledge that you are solely responsible for any health decisions you make.\n\n#YogaForKnockKnees #KnockKneesYoga #TheBodyConditioner","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/YM6BSu6AccA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/YM6BSu6AccA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/YM6BSu6AccA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/YM6BSu6AccA/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/YM6BSu6AccA/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"The Body Conditioner","tags":["Yoga for knock knees","chisyoga","thebodyconditioner","knock knees yoga","yoga poses for knock knees","yoga for knock knees correction","kn