ormed decisions about your body and overall health after consulting with a qualified health professional. By watching this video, you acknowledge that you are responsible for your own health decisions. You need to consult with a qualified health professional prior to making any health changes, especially any changes related to a specific diagnosis or condition.\n\nI am not a medical or naturopathic doctor and do not dispense medical advice or prescribe treatment. If you feel or suspect that you have a medical problem, contact your health care provider immediately. Always consult with your medical doctor and/or health care provider before taking any medication, nutritional supplements, and/or making any other health-related changes.\n\nI am not responsible for any adverse effects or consequences that might result if you choose to make use of this video or apply any of the information that you have read on thebodyconditioner.com. By watching this video, visiting thebodyconditioner.com, and/or otherwise engaging with this material, you acknowledge that you are solely responsible for any health decisions you make.\n\n#YogaForKnockKnees #KnockKneesYoga #TheBodyConditioner"},"defaultAudioLanguage":"en"}', '{"duration":"PT13M43S","dimension":"2d","definition":"hd","caption":"true","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"10095","likeCount":"171","dislikeCount":"6","favoriteCount":"0","commentCount":"40"}', '''2019'':9A ''knee'':4A,6A ''knock'':3A,5A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17265, 'BuW4V6YGXk6K5RhiIkZ6AK_RZ6c', '9RAnO4pPAVk', NULL, '{"publishedAt":"2020-05-18T11:30:00Z","channelId":"UC_xYALq063ZWm-26IeG9cCQ","title":"5 Yoga Poses to relieve heartburn | Yoga for acidity","description":"Usually, antacids are prescribed by the doctor for the treatment of acidity. There are also many home remedies for acidity. You can cure acidity or acid reflux by practicing some specific yoga poses. \n\nHere is a list of 5 yoga asanas for reliving heartburn.\n\nAdho mukha svanasana - This asana can be practiced by any beginner too and with all its benefits, one should include it as a part of daily yoga practice.\n\nWind-Relieving Pose  It is a reclined yoga posture that is suitable for everyone, from beginners to advanced practitioners. The pose gently massages the abdominal organs, releasing tension in the belly area and low back. \n\nMarjariasana - A simple seated posture that Improves posture and balance\nStrengthens and stretches the spine & neck.\n\nSpinal twist - It is a restorative yoga pose that promotes good digestion and encourages spinal mobility. Twisting postures help tone the belly, massage internal organs and can help relieve lower back pain.\n\nBhujangasana - Cobra Pose is a reclining back-bending asana. It is commonly performed in a cycle of asanas in Surya Namaskar and it works on loosening the spine effectively.\n\n#acidity #Yogasequence #acidreflux\n\nFacebook : https://www.facebook.com/VentunoYoga\nTwitter : https://www.twitter.com/VentunoYoga\nYouTube : https://www.youtube.com/user/VentunoYoga\nInstagram : https://www.instagram.com/ventunoyoga\n\nA Ventuno Production https://www.ventunotech.com\n\nDISCLAIMER:\n\nWe strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/9RAnO4pPAVk/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/9RAnO4pPAVk/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/9RAnO4pPAVk/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/9RAnO4pPAVk/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/9RAnO4pPAVk/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"VENTUNO YOGA","tags":["Yoga for acidity","acidity","yoga","acid reflux","yoga for acid reflux","yoga for beginners","gerd","morning yoga","yoga pose","constipation","heartburn","yoga for digestion","yoga for gas","indigestion","health","patanjali","yoga asanas","ira trivedi","gentle yoga","divya sharma","yoga for healing","gastroesophageal reflux disease","acid reflux treatment","back stretches","kathryn morgan","yoga for balance","hip flexor stretch","flexibility routine","yoga flexibility","stretching routine","follow along"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"5 Yoga Poses to relieve heartburn | Yoga for acidity","description":"Usually, antacids are prescribed by the doctor for the treatment of acidity. There are also many home remedies for acidity. You can cure acidity or acid reflux by practicing some specific yoga poses. \n\nHere is a list of 5 yoga asanas for reliving heartburn.\n\nAdho mukha svanasana - This asana can be practiced by any beginner too and with all its benefits, one should include it as a part of daily yoga practice.\n\nWind-Relieving Pose  It is a reclined yoga posture that is suitable for everyone, from beginners to advanced practitioners. The pose gently massages the abdominal organs, releasing tension in the belly area and low back. \n\nMarjariasana - A simple seated posture that Improves posture and balance\nStrengthens and stretches the spine & neck.\n\nSpinal twist - It is a restorative yoga pose that promotes good digestion and encourages spinal mobility. Twisting postures help tone the belly, massage internal organs and can help relieve lower back pain.\n\nBhujangasana - Cobra Pose is a reclining back-bending asana. It is commonly performed in a cycle of asanas in Surya Namaskar and it works on loosening the spine effectively.\n\n#acidity #Yogasequence #acidreflux\n\nFacebook : https://www.facebook.com/VentunoYoga\nTwitter : https://www.twitter.com/VentunoYoga\nYouTube : https://www.youtube.com/user/VentunoYoga\nInstagram : https://www.instagram.com/ventunoyoga\n\nA Ventuno Production https://www.ventunotech.com\n\nDISCLAIMER:\n\nWe strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself."},"defaultAudioLanguage":"en"}', '{"duration":"PT7M20S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2773","likeCount":"96","dislikeCount":"2","favoriteCount":"0","commentCount":"2"}', '''5'':1A ''acid'':9A ''heartburn'':6A ''pose'':3A ''reliev'':5A ''yoga'':2A,7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
