INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17271, 'czojCYGIjkTQSaG_76DODKEFFrg', 'oXY-RWWTiB4', NULL, '{"publishedAt":"2015-09-30T12:41:10Z","channelId":"UCUsiJHQxzSphf6flxYREjFg","title":"Yoga For Vata Dosha","description":"Ayurveda tells us that Vata Dosha, present in all of us to various degrees, can easily become out of balance, especially in the Fall and Winter seasons, when the nature itself shares characteristics with it: dry, light, and cold. We can feel better with a grounding Yoga practice.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/oXY-RWWTiB4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/oXY-RWWTiB4/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/oXY-RWWTiB4/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/oXY-RWWTiB4/sddefault.jpg","width":640,"height":480}},"channelTitle":"Anna Mikheeva","tags":["yoga","ayurveda","practice","vata","dosha","grounding","liberated","anna","mikheeva","hips","pelvis"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga For Vata Dosha","description":"Ayurveda tells us that Vata Dosha, present in all of us to various degrees, can easily become out of balance, especially in the Fall and Winter seasons, when the nature itself shares characteristics with it: dry, light, and cold. We can feel better with a grounding Yoga practice."}}', '{"duration":"PT25M46S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"74341","likeCount":"865","dislikeCount":"31","favoriteCount":"0","commentCount":"67"}', '''dosha'':4A ''vata'':3A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17272, 'hiXol5D8Pery_w1uBEzanS1dBv0', 'c_XZEOeaPQk', true, '{"publishedAt":"2020-06-21T19:24:33Z","channelId":"UCjvu_7m1s5GwfJUy9ULab2w","title":"A-Z of Aerial Yoga - ''R'' is for Rocking:  Why and How to incorporate Rocking into your Aerial Yoga.","description":"The rocking movement is great for your body and nervous system. The aerial yoga swing makes rocking easy. In this video we''ll show you three simple ways to incorporate rocking into your aerial sessions. You''ll learn how to transform stress into relaxation by activating the bodies relaxation response. How to avoid the perils of over-stretching and injury whilst improving sensitivity to your own body and, finally, how to improve mobility and maintain youthfulness. Better still - all the material we show you is easy and accessible to all. Join us and let''s start ''harvesting gravity'' together.\n\nFOLLOW US:\nWebsite: https://www.teachingaerialyoga.com/\nFacebook: https://www.facebook.com/teachingaerialyoga/\nInstagram: @aerial.yoga.london https://www.instagram.com/aerial.yoga.london/?hl=en\n\nCheck out our teacher training courses:\nhttps://www.teachingaerialyoga.com/teacher-training\n\nOnline Classes:\nhttps://www.teachingaerialyoga.com/online-classes\n\nWelcome to Teaching Aerial Yoga. We have over 8 years of teaching experience and believe that aerial yoga is something that can be accessible for everybody. On our channel you will find a mixture of short aerial yoga classes for you to try at home. Teaching tips videos for aerial teachers and would-be teachers. And our ''A-Z of Aerial Yoga'' series that aims to broaden people''s horizons about what aerial yoga is and how it might be incorporated into your own yoga practice. Our mission is to spread understanding of and participation in aerial yoga. Help us by subscribing to this channel and sharing awareness of our work.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/c_XZEOeaPQk/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/c_XZEOeaPQk/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/c_XZEOeaPQk/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/c_XZEOeaPQk/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/c_XZEOeaPQk/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Teaching Aerial Yoga","tags":["aerial yoga","aerial yoga class","aerial yoga teacher training","aerial yoga swing","aerial hammock","aerial yoga flow","aerial yoga for beginners","aerial yoga tutorial","aerial fitness","yoga swing","aerial yoga classes","air yoga","yoga trapeze","aerial practice","aerial yoga basics","aerial yoga lesson"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"A-Z of Aerial Yoga - ''R'' is for Rocking:  Why and How to incorporate Rocking into your Aerial Yoga.","description":"The rocking movement is great for your body and nervous system. The aerial yoga swing makes rocking easy. In this video we''ll show you three simple ways to incorporate rocking into your aerial sessions. You''ll learn how to transform stress into relaxation by activating the bodies relaxation response. How to avoid the perils of over-stretching and injury whilst improving sensitivity to your own body and, finally, how to improve mobility and maintain youthfulness. Better still - all the material we show you is easy and accessible to all. Join us and let''s start ''harvesting gravity'' together.\n\nFOLLOW US:\nWebsite: https://www.teachingaerialyoga.com/\nFacebook: https://www.facebook.com/teachingaerialyoga/\nInstagram: @aerial.yoga.london https://www.instagram.com/aerial.yoga.london/?hl=en\n\nCheck out our teacher training courses:\nhttps://www.teachingaerialyoga.com/teacher-training\n\nOnline Classes:\nhttps://www.teachingaerialyoga.com/online-classes\n\nWelcome to Teaching Aerial Yoga. We have over 8 years of teaching experience and believe that aerial yoga is something that can be accessible for everybody. On our channel you will find a mixture of short aerial yoga classes for you to try at home. Teaching tips videos for aerial teachers and would-be teachers. And our ''A-Z of Aerial Yoga'' series that aims to broaden people''s horizons about what aerial yoga is and how it might be incorporated into your own yoga practice. Our mission is to spread understanding of and participation in aerial yoga. Help us by subscribing to this channel and sharing awareness of our work."},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT9M38S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"18","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''a-z'':1A ''aerial'':5A,19A ''incorpor'':15A ''r'':7A ''rock'':10A,16A ''yoga'':6A,20A ''z'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
