INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17372, '90JiFiUT0M8Nq3WvHITkwSg9VHo', '0FL4HrosI7o', NULL, '{"publishedAt":"2020-06-21T18:49:38Z","channelId":"UC7g-kar9MKZreenvj37h3lQ","title":"Yoga RX | Rotator Cuff","description":"Here''s a short video addressing just some of the issues you might have in the shoulder/rotator cuff.  We''ll show you one way you can strengthen this area of the body with three different intensifications, and three stretches to address movement of the tissues in various poses.  You really don''t even need a mat for this one, so, if you''ve got 15 minutes and access to a floor, join me in this short practice to stretch, mobilize and strengthen the rotator cuff.\n\nEnjoy!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/0FL4HrosI7o/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/0FL4HrosI7o/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/0FL4HrosI7o/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/0FL4HrosI7o/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/0FL4HrosI7o/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Explore Yoga","categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Yoga RX | Rotator Cuff","description":"Here''s a short video addressing just some of the issues you might have in the shoulder/rotator cuff.  We''ll show you one way you can strengthen this area of the body with three different intensifications, and three stretches to address movement of the tissues in various poses.  You really don''t even need a mat for this one, so, if you''ve got 15 minutes and access to a floor, join me in this short practice to stretch, mobilize and strengthen the rotator cuff.\n\nEnjoy!"}}', '{"duration":"PT14M40S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"