INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17301, 'DEF-iRDWf_PYj4c2n-ZCk2m_6kc', '1lZCPPlRNjg', NULL, '{"publishedAt":"2019-08-13T20:55:50Z","channelId":"UCoFdHpe0eGury-0sslOwIFg","title":"Yoga Workouts by Daily Burn - Vinyasa Tutorial","description":"Ever wished your yoga instructor would just slow down and explain the poses? Us too. Thats why we created Daily Burn Yoga Tutorialsshort, simple videos that offer a judgement-free how-to for common yoga postures. Just getting started in your practice? These videos make for an awesome introduction to yoga for beginners, guided by the ber-knowledgeable Yanik Flaylayev. \n\nIn this beginner yoga video, were reviewing how to do a Vinyasaa three-part series of poses that link Downward-Facing Dog, Chaturanga, and Upward-Facing Dog together to create a vinyasa flow sequence. Youll find this cue called out in a lot of yoga classes, so whether youre just getting started with practicing yoga at home or want to review what your instructor said mid-class, this short video will help you break it down (dog). To get started, all you need is your mat, clothes you can move in, and two minutes of your time. What are you waiting for? Lets get to work! \n\nAre you a vinyasa master now? If you tried this two minute tutorial, comment below to let us know how it went! And while youre at it, make sure to like this video and follow Daily Burn for more awesome how-tos and Mini Burn workouts.\n\nStart your free trial now! https://itunes.apple.com/us/app/yoga-workouts-by-daily-burn/id1441637708","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/1lZCPPlRNjg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/1lZCPPlRNjg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/1lZCPPlRNjg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/1lZCPPlRNjg/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/1lZCPPlRNjg/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Daily Burn","tags":["vinyasa flow","beginner vinyasa flow","yoga at home for beginners","daily burn","daily burn workouts","home workout","yoga workout","yoga flow","power yoga","yoga workout video","vinyasa tutorial","yoga tutorial","yoga","Yoga for beginners guided","Morning vinyasa flow beginner","Beginner yoga video","yoga flow at home","vinyasa yoga","yoga for weight loss","yoga asana at home","yoga class online","free yoga workout full","vinyasa flow free"],"categoryId":"17","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"Yoga Workouts by Daily Burn - Vinyasa Tutorial","description":"Ever wished your yoga instructor would just slow down and explain the poses? Us too. Thats why we created Daily Burn Yoga Tutorialsshort, simple videos that offer a judgement-free how-to for common yoga postures. Just getting started in your practice? These videos make for an awesome introduction to yoga for beginners, guided by the ber-knowledgeable Yanik Flaylayev. \n\nIn this beginner yoga video, were reviewing how to do a Vinyasaa three-part series of poses that link Downward-Facing Dog, Chaturanga, and Upward-Facing Dog together to create a vinyasa flow sequence. Youll find this cue called out in a lot of yoga classes, so whether youre just getting started with practicing yoga at home or want to review what your instructor said mid-class, this short video will help you break it down (dog). To get started, all you need is your mat, clothes you can move in, and two minutes of your time. What are you waiting for? Lets get to work! \n\nAre you a vinyasa master now? If you tried this two minute tutorial, comment below to let us know how it went! And while youre at it, make sure to like this video and follow Daily Burn for more awesome how-tos and Mini Burn workouts.\n\nStart your free trial now! https://itunes.apple.com/us/app/yoga-workouts-by-daily-burn/id1441637708"}}', '{"duration":"PT2M1S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"497","likeCount":"9","dislikeCount":"0","favoriteCount":"0"}', '''burn'':5A ''daili'':4A ''tutori'':7A ''vinyasa'':6A ''workout'':2A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17303, 'Szv49FQTe_MJXm2A4fnwbFt_WVA', 'ODgDWaR3_pM', NULL, '{"publishedAt":"2015-12-24T21:35:44Z","channelId":"UCkSw5U4T6Sc5L7nJLp8-SCQ","title":"Create A Themed Yoga Lesson Plan In Under 5 Minutes | GeorgeWatts.org","description":"http://georgewatts.org | Video of BWY yoga teacher George Watts creating a themed yoga lesson plan using The Yoga Genie Lesson Planner (available at http://georgewatts.org).  \n\n======================\nYoga Lesson Plan Theme\n======================\n\nYou Don''t Need Permission To Shine \n\n====================\nLesson Plan Description\n====================\n\nThe sanskrit for Sun Salutation is Surya Namaskara, which means \"salute to the sun\". During today''s lesson you''re going to discover that you don''t need permission to shine. You''ll discover the biggest mistake we humans make is to think that we need someone''s approval to feel good. You''ll discover that radiating light and love for one hour in a yoga class each week isn''t enough, and that it''s your moral responsibility to shine constantly...just like the sun.  You''ll discover how to naturally flow from your inner light. You''ll discover that being yourself is the best way to shine your inner light upon the world.\n\nRepeating the mantra \"I don''t need permission to shine\" after each pose will reinforce the message. \n\nRaised Arms: (\"I don''t need permission to shine.\")\nForward Bend: (\"I don''t need permission to shine.\")\nLunge: (\"I don''t need permission to shine.\")\nPlank: (\"I don''t need permission to shine.\")\nSalute With 8 Points: (\"I don''t need permission to shine.\")\nCobra: (\"I don''t need permission to shine.\")\nDown Dog: (\"I don''t need permission to shine.\")\nLunge: (I don''t need permission to shine)\nForward Bend: (I don''t need permission to shine)\nRaised Arms: (I don''t need permission to shine)\nMountain: (I don''t need permission to shine)\n\nThe richest place on Planet Earth is not a bank vault filled with gold. It''s our graveyards, because they are filled with people that didn''t give themselves permission to shine. They took their talents, gifts and brilliance to their grave in unexpressed potential. The greatest human tragedy is a life half lived, so go forth and shine.\n\n=================\nYoga Lesson Planner \n=================\n\nTo create yoga lesson plans using Drag & Drop technology, take a quick peak at The Yoga Lesson Planner available within The Yoga Teacher Lesson Plan Kit at: http://georgewatts.org","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/ODgDWaR3_pM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/ODgDWaR3_pM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/ODgDWaR3_pM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/ODgDWaR3_pM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/ODgDWaR3_pM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"George Watts Videos","tags":["yoga lesson plans","yoga lesson plan","yoga class plans","yoga class plan","yoga lesson planning software"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Create A Themed Yoga Lesson Plan In Under 5 Minutes | GeorgeWatts.org","description":"http://georgewatts.org | Video of BWY yoga teacher George Watts creating a themed yoga lesson plan using The Yoga Genie Lesson Planner (available at http://georgewatts.org).  \n\n======================\nYoga Lesson Plan Theme\n======================\n\nYou Don''t Need Permission To Shine \n\n====================\nLesson Plan Description\n====================\n\nThe sanskrit for Sun Salutation is Surya Namaskara, which means \"salute to the sun\". During today''s lesson you''re going to discover that you don''t need permission to shine. You''ll discover the biggest mistake we humans make is to think that we need someone''s approval to feel good. You''ll discover that radiating light and love for one hour in a yoga class each week isn''t enough, and that it''s your moral responsibility to shine constantly...just like the sun.  You''ll discover how to naturally flow from your inner light. You''ll discover that being yourself is the best way to shine your inner light upon the world.\n\nRepeating the mantra \"I don''t need permission to shine\" after each pose will reinforce the message. \n\nRaised Arms: (\"I don''t need permission to shine.\")\nForward Bend: (\"I don''t need permission to shine.\")\nLunge: (\"I don''t need permission to shine.\")\nPlank: (\"I don''t need permission to shine.\")\nSalute With 8 Points: (\"I don''t need permission to shine.\")\nCobra: (\"I don''t need permission to shine.\")\nDown Dog: (\"I don''t need permission to shine.\")\nLunge: (I don''t need permission to shine)\nForward Bend: (I don''t need permission to shine)\nRaised Arms: (I don''t need permission to shine)\nMountain: (I don''t need permission to shine)\n\nThe richest place on Planet Earth is not a bank vault filled with gold. It''s our graveyards, because they are filled with people that didn''t give themselves permission to shine. They took their talents, gifts and brilliance to their grave in unexpressed potential. The greatest human tragedy is a life half lived, so go forth and shine.\n\n=================\nYoga Lesson Planner \n=================\n\nTo create yoga lesson plans using Drag & Drop technology, take a quick peak at The Yoga Lesson Planner available within The Yoga Teacher Lesson Plan Kit at: http://georgewatts.org"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT34M10S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1751","likeCount":"19","dislikeCount":"1","favoriteCount":"0","commentCount":"0"}', '''5'':9A ''creat'':1A ''georgewatts.org'':11A ''lesson'':5A ''minut'':10A ''plan'':6A ''theme'':3A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
