INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17316, 'cFf5lWpHZIqYExoXjDlSY-hV_QM', '47YlVxYUDL4', NULL, '{"publishedAt":"2018-06-24T00:43:44Z","channelId":"UCd676LpOiZ2fgLK97MfjNHA","title":"Strong and Sturdy Yoga Series with Sherry Zak Morris, C-IAYT","description":"If you have trouble with your balance, if you have had a stumble or fall, or if you feel your legs are not as strong as you would like them to be... this Series is for you. This is a 7-class series and we will focus on  Balancing, Standing, Holding and Core Work Poses using different props and methods in each one to keep it fun and motivating. \n\nGet Strong with Me!  Join my full Yoga series at https://yogavista.tv/programs/sherry-zak-morris-strong-and-sturdy-yoga-series\n\nAfter a \"weak knee\" episode before I ventured out on a 14-day hiking trip, I knew I had to do something to get my legs feeling strong and sturdy again. This Standing Yoga Class series will make your legs feel powerful, strong and stable once again. Remember... if you do the work it works!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/47YlVxYUDL4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/47YlVxYUDL4/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/47YlVxYUDL4/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/47YlVxYUDL4/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/47YlVxYUDL4/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"YogaJP","tags":["yoga for strong legs","yoga for strong bones","yoga for weak legs","sherry zak morris"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Strong and Sturdy Yoga Series with Sherry Zak Morris, C-IAYT","description":"If you have trouble with your balance, if you have had a stumble or fall, or if you feel your legs are not as strong as you would like them to be... this Series is for you. This is a 7-class series and we will focus on  Balancing, Standing, Holding and Core Work Poses using different props and methods in each one to keep it fun and motivating. \n\nGet Strong with Me!  Join my full Yoga series at https://yogavista.tv/programs/sherry-zak-morris-strong-and-sturdy-yoga-series\n\nAfter a \"weak knee\" episode before I ventured out on a 14-day hiking trip, I knew I had to do something to get my legs feeling strong and sturdy again. This Standing Yoga Class series will make your legs feel powerful, strong and stable once again. Remember... if you do the work it works!"},"defaultAudioLanguage":"en"}', '{"duration":"PT1M14S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1575","likeCount":"27","dislikeCount":"1","favoriteCount":"0","commentCount":"0"}', '''c'':11A ''c-iayt'':10A ''iayt'':12A ''morri'':9A ''seri'':5A ''sherri'':7A ''strong'':1A ''sturdi'':3A ''yoga'':4A ''zak'':8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
