INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17318, 'pbKH3OR-x5kgCp8hZ-gaLPQE-Og', 'xftrhA9zvMg', NULL, '{"publishedAt":"2017-02-17T19:46:31Z","channelId":"UCU7ZIP2KKrcOwOuSbaaITnQ","title":"Yin / Yang Yoga Quick Flow 1","description":"This is a 20 minute yin/yang yoga practice. Includes some hatha yoga, yin yoga, pranayama, mindfulness, and mind/body awareness. The intention for this practice is to alleviate or lessen discomfort from cramps but men and women alike may find this quick flow to help with sciatic nerve pain, lower back pain as well as hip discomfort. This practice is very simple and most likely fine for beginners. Intermediate & advanced yogis should find this practice very accessible and quite gentle. This yoga practice is intended to be therapeutic for mind and body, please avoid poses or shapes that are painful in any way (uncomfortable-as-cuss is not the same as painful, try to stick with it if you are not in pain).","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/xftrhA9zvMg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/xftrhA9zvMg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/xftrhA9zvMg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/xftrhA9zvMg/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/xftrhA9zvMg/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"MedicYine Yoga","categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Yin / Yang Yoga Quick Flow 1","description":"This is a 20 minute yin/yang yoga practice. Includes some hatha yoga, yin yoga, pranayama, mindfulness, and mind/body awareness. The intention for this practice is to alleviate or lessen discomfort from cramps but men and women alike may find this quick flow to help with sciatic nerve pain, lower back pain as well as hip discomfort. This practice is very simple and most likely fine for beginners. Intermediate & advanced yogis should find this practice very accessible and quite gentle. This yoga practice is intended to be therapeutic for mind and body, please avoid poses or shapes that are painful in any way (uncomfortable-as-cuss is not the same as painful, try to stick with it if you are not in pain)."}}', '{"duration":"PT22M59S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"98","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''1'':6A ''flow'':5A ''quick'':4A ''yang'':2A ''yin'':1A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
