INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17327, 'aqbYooD0qebMd2eQa4Qndt93HlA', 'MWpNoFdGh4Q', NULL, '{"publishedAt":"2017-05-15T12:15:26Z","channelId":"UCnP_T4dI2JYG7BnH42PC9qw","title":"30-Minute Beginner HIIT Yoga for Slimmer Legs | HER Network","description":" Full 30-minute Yoga + HIIT workout with Nika Karan for stronger & slimmer legs. Filmed at Be Urban Wellness:  http://beurbanwellness.com\n Snap & Share pictures of your progress. Tag us @JoannaSohOfficial @NikaKaran #JSohActive #HERNetwork\n LIKE, SHARE this video & SUBSCRIBE http://www.youtube.com/joannasohofficial Support us in reaching 1 million subscribers!!! xx\n\nPolish-bred and Malaysia-based Nika Karan, is a holistic health coach & yoga teacher. As a busy entrepreneur and mum of 2 boys, she''s on a mission to teach other mums how to get in the best shape of their lives while eating better, cooking faster and exercising smarter. You can find more info about Nika''s signature transformation programs at https://www.nikakaran.com\n\n\nHER Network is an online network by Joanna Soh comprised of strong, passionate and like-minded women, driven by the same vision of wanting to support other women across the world to be the best version of themselves from inside and out.\n\nHer Network is an extension of Joannas current YouTube channel: https://www.youtube.com/user/joannasohofficial SUBSCRIBE for exciting content every Monday, Wednesday and Friday.\n\n\"We aim to offer you meaningful content that will continue to add value in your life. The videos will range from health & fitness, food, lifestyle, beauty, fashion, travel, life guide, parenting, and more.\"\n\nStay connected and follow us:\nhttps://www.instagram.com/hernetwork.tv/ https://www.facebook.com/hernetwork.tv/\n \n\nThis workout combines relaxing yoga sequence with high intensity exercises to help you burn fat more effectively, and at the same time, give you the \"relaxation\" you need. \n\nExercises Sequence:\n- Mindful Warmup\n- Sun Salutations (5 reps)\n- HIIT High Lunge (10 reps)\n- HIIT Chair Squats  (10 reps)\n- HIIT Goddess Squat (10 reps)\n- HIIT Hip Bridge (10 reps)\n- Deep Stretches \n\nTotal Workout Time: 31 minutes (2 sets)\nEstimated Calories Burned: 230 - 270Cals\nBest Results: Do this workout on alternate days. You can mix it up with other high intensity or strength training for best results.\n\nHere are more workout videos to guide you through your journey:\nhttps://www.youtube.com/playlist?list=PLyP8pbBMxcsgLVKBNr5cjXyazQ_Rc6vTV\n\n\nPlease LIKE, SHARE & SUBSCRIBE. Follow us!\n\nHER Network:\nhttps://www.hernetwork.tv\nhttps://www.facebook.com/hernetwork.tv\nhttps://www.instagram.com/hernetwork.tv\n\nNika Karan:\nhttps://www.nikakaran.com\nhttps://www.facebook.com/coachnikakaran/\nhttps://www.instagram.com/nikakaran/\n\nJoanna Soh\nhttp://joannasoh.com/\nhttps://www.instagram.com/joannasohofficial/\nhttps://www.facebook.com/joannasohofficial/\nhttps://www.youtube.com/user/joannasohofficial\nhttps://twitter.com/Joanna_Soh","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/MWpNoFdGh4Q/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/MWpNoFdGh4Q/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/MWpNoFdGh4Q/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/MWpNoFdGh4Q/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/MWpNoFdGh4Q/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Joanna Soh Official","tags":["how","to","do","exercise","library","joanna","soh","jsoh","fitness","fit","women","health","workout","routine","plan","beginner","guide","living","weight","loss","lose","home","nutrition","eat","clean","healthy","recipes","easy","homecooked","tips","nika karan","her network","yoga","hiit yoga","slim legs","slim","slimmer","leg fat","thigh fat","strong","beginner yoga"