INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17371, 'Sz1cWULmwC8edKMPVRS0ElPdh-c', 'KeO4CygGK3o', NULL, '{"publishedAt":"2020-04-10T23:09:10Z","channelId":"UCxDYyHLKJPyAdF9E3b9FLEQ","title":"Yoga for Tight Hips (And lower back ) | Episode 3 - Open | Yoga With Yana","description":"Hello my friends , \n\nWelcome to yoga with Yana! Today we will be doing a 10 min hip opening yoga class, as part of your Yoga for Tight Hips series. This class is perfect for those who wish to squeeze in a quick yoga practice and still experience the benefits of having more open and flexible hips. Its amazing how even a quick 10 minutes of hip opening yoga poses a day can change the structure of your hips and help you release tension, aches and tightness. This yoga class is designed for ALL levels, so if you are a beginner yogi, dont worry I will provide beginner variations for each pose! This class will also help you open up your inner thighs, inner groin and lower back! \n\nI hope by the end of this class, youre feeling much more flexible, open and happy! Also, I would love to hear what your favorite hip opening pose is! Please let me know in the comments below and I will be sure to incorporate it in the next few classes! \n\nFrom my heart to yours, \nNamaste!  \n\n\nCheck out facebook : https://www.facebook.com/yoga.with.yana/\nCheck our instagram : https://www.instagram.com/yanathompson_/\n---------------------------------\nYoga with Yana recommends that you consult your physician regarding the applicability of any recommendations and follow all safety instructions before beginning any exercise program. When participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself\n\n Outro Music: www.bensound.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/KeO4CygGK3o/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/KeO4CygGK3o/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/KeO4CygGK3o/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/KeO4CygGK3o/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/KeO4CygGK3o/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Yana","tags":["gentle yoga","yoga hips","hip opening stretches","hip yoga","yin yoga for beginners","beginners yoga","yoga for back pain","stretching routine","yoga (sport)","yoga for runners","yoga for low back pain","yoga stretch","yoga video","at home yoga","yoga for flexibility","hip openers for runners","hip flexor stretches for beginners","hip openers exercise","hip stretches","yin yoga","yoga stretches","yoga class","online yoga class","deep hip opening stretches","yoga for tight hips","yoga with yana"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga for Tight Hips (And lower back ) | Episode 3 - Open | Yoga With Yana","description":"Hello my friends , \n\nWelcome to yoga with Yana! Today we will be doing a 10 min hip opening yoga class, as part of your Yoga for Tight Hips series. This class is perfect for those who wish to squeeze in a quick yoga practice and still experience the benefits of having more open and flexible hips. Its amazing how even a quick 10 minutes of hip opening yoga poses a day can change the structure of your hips and help you release tension, aches and tightness. This yoga class is designed for ALL levels, so if you are a beginner yogi, dont worry I will provide beginner variations for each pose! This class will also help you open up your inner thighs, inner groin and lower back! \n\nI hope by the end of this class, youre feeling much more flexible, open and happy! Also, I would love to hear what your favorite hip opening pose is! Please let me know in the comments below and I will be sure to incorporate it in the next few classes! \n\nFrom my heart to yours, \nNamaste!  \n\n\nCheck out facebook : https://www.facebook.com/yoga.with.yana/\nCheck our instagram : https://www.instagram.com/yanathompson_/\n---------------------------------\nYoga with Yana recommends that you consult your physician regarding the applicability of any recommendations and follow all safety instructions before beginning any exercise program. When participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself\n\n Outro Music: www.bensound.com"}}', '{"duration":"PT12M22S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"204","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''3'':9A ''back'':7A ''episod'':8A ''hip'':4A ''lower'':6A ''open'':10A ''tight'':3A ''yana'':13A ''yoga'':1A,11A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
