INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17348, 'gBvdxxmJCF3cJKEDFDispR3L6rQ', 'AMoGCywVuJA', NULL, '{"publishedAt":"2019-10-23T12:15:31Z","channelId":"UCj3MHWqk0uLOZKXVCA3C-nA","title":"Varanasi Music Center - Yoga and Music Retreats -  Bhagsu -  short -  Bairagi","description":"Watch first part of our short video-memories from our yoga and music retreats at Varanasi Music Center\n\nOur summer home is located in Bhagsu, Dharamsala, Himachal Pradesh. Nestled in the Himalayan foothills of Northern India, Bhagsu is just 2kms away from Mcleodganj (Dharamsala), also known as Little Tibet. Serving as the home of His Holiness the Dalai Llama, the area attracts tourists from around the world every year.\n\nCaptivating views, deep spiritual practice, nature walks and peace are a few reasons people flock here every year.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/AMoGCywVuJA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/AMoGCywVuJA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/AMoGCywVuJA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/AMoGCywVuJA/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/AMoGCywVuJA/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Varanasi music center","tags":["Dharamsala","tabla","sithar","singing classes","flute","yoga","music","retreats","djembe","Mcleodganj"],"categoryId":"19","liveBroadcastContent":"none","localized":{"title":"Varanasi Music Center - Yoga and Music Retreats -  Bhagsu -  short -  Bairagi","description":"Watch first part of our short video-memories from our yoga and music retreats at Varanasi Music Center\n\nOur summer home is located in Bhagsu, Dharamsala, Himachal Pradesh. Nestled in the Himalayan foothills of Northern India, Bhagsu is just 2kms away from Mcleodganj (Dharamsala), also known as Little Tibet. Serving as the home of His Holiness the Dalai Llama, the area attracts tourists from around the world every year.\n\nCaptivating views, deep spiritual practice, nature walks and peace are a few reasons people flock here every year."}}', '{"duration":"PT1M8S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"69","likeCount":"23","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''bairagi'':10A ''bhagsu'':8A ''center'':3A ''music'':2A,6A ''retreat'':7A ''short'':9A ''varanasi'':1A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
