INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17368, 'QjJZZQoJim8kDTrIye5Wo1rJFRs', 'oOFxDzBskM8', NULL, '{"publishedAt":"2020-06-13T20:48:56Z","channelId":"UCDBizofTVWVUib_JsxwxBWg","title":"Mothers  Day Partner Yoga","description":"Grab a partner for this live yoga class with Stacy McCarthy and her daughter Kylie as they celebrate Mother''s Day during the pandemic quarantine. The class begins with a short introduction followed by a dynamic warm up. Partner poses for core strength, hip and shoulder flexibility, twists and a surprise connection exercise at the end. \nStacy taught her first mother daughter yoga class almost 25 years ago and she continues to share the joy of partner yoga for all ages and experience levels.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/oOFxDzBskM8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/oOFxDzBskM8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/oOFxDzBskM8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/oOFxDzBskM8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/oOFxDzBskM8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Stacy McCarthy","tags":["Partner Yoga","Mother daughter yoga","parent child yoga","Mothers Day Yoga","yoga class"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Mothers  Day Partner Yoga","description":"Grab a partner for this live yoga class with Stacy McCarthy and her daughter Kylie as they celebrate Mother''s Day during the pandemic quarantine. The class begins with a short introduction followed by a dynamic warm up. Partner poses for core strength, hip and shoulder flexibility, twists and a surprise connection exercise at the end. \nStacy taught her first mother daughter yoga class almost 25 years ago and she continues to share the joy of partner yoga for all ages and experience levels."}}', '{"duration":"PT33M30S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"38","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''day'':2A ''mother'':1A ''partner'':3A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17376, 'lLTV0xl7JK5nRc_6iPToSDarQGY', 'f9vcgPFEkII', NULL, '{"publishedAt":"2020-06-21T04:59:24Z","channelId":"UCYJwuSC55Lnp6rmhOZov7tA","title":"International Yoga Day 2020: Yoga for Health - Yoga at Home | Yoga Day 2020 Celebration | Gradeup","description":"6th International Yoga Day 2020 |  International Yoga Day-Yoga for Health - Yoga at Home | Gradeup\nInternational Yoga Day is celebrated on 21st June throughout the world since 2015.\n\nYoga is an ancient physical, mental and spiritual practice that originated in India. The word yoga derives from Sanskrit and means to join or to unite, symbolizing the union of body and consciousness.Today it is practiced in various forms around the world and continues to grow in popularity.\nThe International Day of Yoga was proposed by India and endorsed by a record 175 member states. The proposal was first introduced by Prime Minister Narendra Modi in his address during the opening of the 69th session of the General Assembly, in which he said: Yoga is an invaluable gift from our ancient tradition. Yoga embodies unity of mind and body, thought and action ,it is a way to discover the sense of oneness with yourself, the world and the nature.\n\nUGC NET Green Card is a one-stop destination for all aspirants who are appearing for the UGC NET Exam. It includes UGC NET Paper 1 Mocks, Sectional Test, Previous Year Papers and much more.\n\nDo subscribe and press the  bell icon to get notifications for all new videos: http://bit.ly/2LC9sHl \n\nWatch complete series of UGC NET December 2019: http://bit.ly/2NuWWuG\n\nJoin us on Telegram: https://t.me/gradeupugcnet\n\nJoin us on Telegram: https://t.me/Commerceugcnetgradeup\n\nJoin us on Telegram: https://t.me/Politicalscienceugcnetgradeup\n\nPrep Smart. Score Better. Go Gradeup.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/f9vcgPFEkII/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/f9vcgPFEkII/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/f9vcgPFEkII/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/f9vcgPFEkII/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/f9vcgPFEkII/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Gradeup: UGC NET JRF, CSIR & Other SET Exams Prep","tags":["ugc net june 2020","nta ugc net june 2020","ugc net","ugc net paper 1","ugc net 2020 exam date","ugc net 2020","ugc net june 2020 exam pattern","ugc net jrf","nta ugc net","ugc net exam pattern","ugc net 2020 june","yoga","21 june","kush pandey","international yoga day","day","gradeup","yoga day","international yoga day 2020","international yoga day live"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"International Yoga Day 2020: Yoga for Health - Yoga at Home | Yoga Day 2020 Celebration | Gradeup","description":"6th International Yoga Day 2020 |  International Yoga Day-Yoga for Health - Yoga at Home | Gradeup\nInternational Yoga Day is celebrated on 21st June throughout the world since 2015.\n\nYoga is an ancient physical, mental and spiritual practice that originated in India. The word yoga derives from Sanskrit and means to join or to unite, symbolizing the union of body and consciousness.Today it is practiced in various forms around the world and continues to grow in popularity.\nThe International Day of Yoga was proposed by India and endorsed by a record 175 member states. The proposal was first introduced by Prime Minister Narendra Modi in his address during the opening of the 69th session of the General Assembly, in which he said: Yoga is an invaluable gift from our ancient tradition. Yoga embodies unity of mind and body, thought and action ,it is a way to discover the sense of oneness with yourself, the world and the nature.\n\nUGC NET Green Card is a one-stop destination for all aspirants who are appearing for the UGC NET Exam. It includes UGC NET Paper 1 Mocks, Sectional Test, Previous Year Papers and much more.\n\nDo subscribe and press the  bell icon to get notifications for all new videos: http://bit.ly/2LC9sHl \n\nWatch complete series of UGC NET December 2019: http://bit.ly/2NuWWuG\n\nJoin us on Telegram: https://t.me/gradeupugcnet\n\nJoin us on Telegram: https://t.me/Commerceugcnetgradeup\n\nJoin us on Telegram: https://t.me/Politicalscienceugcnetgradeup\n\nPrep Smart. Score Better. Go Gradeup."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT19M51S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"482","likeCount":"42","dislikeCount":"1","favoriteCount":"0","commentCount":"6"}', '''2020'':4A,13A ''celebr'':14A ''day'':3A,12A ''gradeup'':15A ''health'':7A ''home'':10A ''intern'':1A ''yoga'':2A,5A,8A,11A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17378, 'rUKcmHOKnu_6xDhDvX-37LzL-6I', 'fbyfE9atbDg', NULL, '{"publishedAt":"2020-04-06T12:16:16Z","channelId":"UC029CQxPO_w-ENYRuhK1Q_g","title":"Chest Opening Yoga for Runners: Upper Back Mobility","description":"#TogetherWeMove #runningisNOTcancelled\n\nFollow along with Ashley as she leads us through an energizing yoga sequence for runners that helps us better our posture, increase our thoracic spine mobility (which helps our alignment and running form) and feel energized for the day. \n\nAll we need to follow along is a yoga mat or soft surface on which to practice. \n\nReady? Let''s go!\nMB01DXMFD1KKHII","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/fbyfE9atbDg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/fbyfE9atbDg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/fbyfE9atbDg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/fbyfE9atbDg/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/fbyfE9atbDg/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Fleet Feet","categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Chest Opening Yoga for Runners: Upper Back Mobility","description":"#TogetherWeMove #runningisNOTcancelled\n\nFollow along with Ashley as she leads us through an energizing yoga sequence for runners that helps us better our posture, increase our thoracic spine mobility (which helps our alignment and running form) and feel energized for the day. \n\nAll we need to follow along is a yoga mat or soft surface on which to practice. \n\nReady? Let''s go!\nMB01DXMFD1KKHII"},"defaultAudioLanguage":"en"}', '{"duration":"PT22M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2359","likeCount":"58","dislikeCount":"1","favoriteCount":"0","commentCount":"2"}', '''back'':7A ''chest'':1A ''mobil'':8A ''open'':2A ''runner'':5A ''upper'':6A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17383, 'F_c1y94jOEvlqVU2L-R5vv-3-ZA', '2SC9QqIDCd4', NULL, '{"publishedAt":"2020-04-09T06:54:05Z","channelId":"UC5ByHtqzP38Eutw0PtcfR4g","title":"Short yoga flow for a healthy spine (7 minutes!)","description":"This is a series of 4 mat-based exercises (yoga flows that link breath to movement) to keep your back and spine healthy. These back stretches/exercises are perfect for home-based office workers who spend most of their time behind a desk. You can do this yoga sequence around 10am and/or 3pm for your morning and afternoon break. It keeps your spine happy and gives you a little energy boost as well.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/2SC9QqIDCd4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/2SC9QqIDCd4/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/2SC9QqIDCd4/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/2SC9QqIDCd4/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/2SC9QqIDCd4/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Sabijn Linssen Yoga","tags":["yoga","healthy spine","corporate wellness","corporate yoga","spinal exercises","back exercises","healthy back stretches"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Short yoga flow for a healthy spine (7 minutes!)","description":"This is a series of 4 mat-based exercises (yoga flows that link breath to movement) to keep your back and spine healthy. These back stretches/exercises are perfect for home-based office workers who spend most of their time behind a desk. You can do this yoga sequence around 10am and/or 3pm for your morning and afternoon break. It keeps your spine happy and gives you a little energy boost as well."},"defaultAudioLanguage":"en"}', '{"duration":"PT7M35S","dimension":"2d