INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17406, 'I5WNpOcZ5LIiO7Uq7O7Tq-nPvCk', 'WkbrwKLT3d8', NULL, '{"publishedAt":"2018-02-08T01:30:00Z","channelId":"UCvDc7jgAYAjbNqvWjbovVQw","title":"NEW! - WITH INSTRUCTION Arm & Shoulders Collection. Iyengar Yoga for Beginners.","description":"NEW - WITH INSTRUCTION! Arm & Shoulders Collection. Iyengar Yoga for Beginners. Yoga Challenge. Yoga poses for Flexibility in Shoulders and Arms. Beginners to yoga practice, follow Leo in turquoise, more Advanced yoga students, follow Lin in white.\n\nYoga with Lin and Leo for free yoga classes. See the Yoga for Beginners series for online yoga workouts. Check out our 30 days of yoga series for a 30 day yoga challenge. Yoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies. Stiffness in the shoulders and upper back is often associated with headache and migraine.\n\nIn the Arms and Shoulders Challenge Collection we show an 8 minute yoga sequence, combining poses from the Arms & Shoulders Yoga Challenge. These arm and shoulder exercises are done in Virasana: Urdhva Hastasana, Gomukasana, (Cow Face Pose) Garudasana (Eagle Pose) and Pashima Namaskarasana (Reverse Prayer). Purvottasana is done at the end of this yoga sequence. Lin shows the classic yoga poses and Leo shows modified versions which make the poses more accessible for yoga students who need to improve extension, alignment or balance in the poses. \n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing; indeed many studies have shown that yoga can have remarkable effects on problems with back pain, shoulder pain and neck pain as well as demonstrating positive effects on mental health problems such as depression. http://www.huffingtonpost.com/2013/10/28/body-on-yoga_n_4109595.html?ncid=engmodushpmg00000004\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start here! Get out your mat and build the foundation of your own yoga practice with this home yoga video. Enjoy!\n\n\nStay connected~\n\nFor more structured online yoga classes, visit My Yoga Tutor: http://myyogatutor.com/\n\nFor booking face to face Iyengar Yoga classes, with us at the Maidstone Yoga Centre in Kent, (first class free!): http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://twitter.com/MaidstoneYoga\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n Welcome to our channel, Yoga with Lin and Leo. Safe, detailed instruction from experienced Iyengar yoga teachers. \n\nThis Upper Body Challenge yoga practice will certainly get you going and give you a physical workout, but more importantly, these programmes are designed to harmonise mind, body and breath. Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to free your mind, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/WkbrwKLT3d8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/WkbrwKLT3d8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/WkbrwKLT3d8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/WkbrwKLT3d8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/WkbrwKLT3d8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Lin and Leo","tags":["yoga","yoga for beginners","iyengar yoga","yoga with lin and leo","iyengar yoga for beginners","shoulder pain","neck pain","upper back pain","shoulder impingement","arm pain","gomukasana","garudasana","cow face pose","eagle pose","depression","anxiety","back pain","yoga for the stiffer body","30 days of yoga","tone arms","stretching","yoga for shoulders","yoga sequence","yoga for upper body","rotator cuff","bingo wings","rotator cuff exercise","shoulder stretch","shoulder stretches for pain","lose arm fat"],"categoryId":"1","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"NEW! - WITH INSTRUCTION Arm & Shoulders Collection. Iyengar Yoga for Beginners.","description":"NEW - WITH INSTRUCTION! Arm & Shoulders Collection. Iyengar Yoga for Beginners. Yoga Challenge. Yoga poses for Flexibility in Shoulders and Arms. Beginners to yoga practice, follow Leo in turquoise, more Advanced yoga students, follow Lin in white.\n\nYoga with Lin and Leo for free yoga classes. See the Yoga for Beginners series for online yoga workouts. Check out our 30 days of yoga series for a 30 day yoga challenge. Yoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies. Stiffness in the shoulders and upper back is often associated with headache and migraine.\n\nIn the Arms and Shoulders Challenge Collection we show an 8 minute yoga sequence, combining poses from the Arms & Shoulders Yoga Challenge. These arm and shoulder exercises are done in Virasana: Urdhva Hastasana, Gomukasana, (Cow Face Pose) Garudasana (Eagle Pose) and Pashima Namaskarasana (Reverse Prayer). Purvottasana is done at the end of this yoga sequence. Lin shows the classic yoga poses and Leo shows modified versions which make the poses more accessible for yoga students who need to improve extension, alignment or balance in the poses. \n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing; indeed many studies have shown that yoga can have remarkable effects on problems with back pain, shoulder pain and neck pain as well as demonstrating positive effects on mental health problems such as depression. http://www.huffingtonpost.com/2013/10/28/body-on-yoga_n_4109595.html?ncid=engmodushpmg00000004\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start here! Get out your mat and build the foundation of your own yoga practice with this home yoga video. Enjoy!\n\n\nStay connected~\n\nFor more structured online yoga classes, visit My Yoga Tutor: http://myyogatutor.com/\n\nFor booking face to face Iyengar Yoga classes, with us at the Maidstone Yoga Centre in Kent, (first class free!): http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://twitter.com/MaidstoneYoga\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n Welcome to our channel, Yoga with Lin and Leo. Safe, detailed instruction from experienced Iyengar yoga teachers. \n\nThis Upper Body Challenge yoga practice will certainly get you going and give you a physical workout, but more importantly, these programmes are designed to harmonise mind, body and breath. Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to free your mind, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class."}}', '{"duration":"PT7M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"906","likeCount":"16","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''arm'':4A ''beginn'':10A ''collect'':6A ''instruct'':3A ''iyengar'':7A ''new'':1A ''shoulder'':5A ''yoga'':8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
