INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17410, 'RE7nnxDY3GKuif-B563TYLHu-yg', 'Hz20YQHxgdI', NULL, '{"publishedAt":"2018-02-28T12:46:31Z","channelId":"UCzURdhNt-04XXlH8I3L0r3w","title":"Dancing Warrior Yoga Sequence - ChristiansDoYoga.com","description":"Need more fun and energy in your life? Head over to http://dailysoulcare.com to download our FREE soul care guide and make yourself a priority!  \n\nHey yogis! In this video we cover a short yoga sequence of standing poses called \"Dancing Warrior\" to strengthen, energize, and open up the body.\n\n\nIts perfect for those days when you want to move but youre not looking for something heavy or intense. Dont get me wrong...you can get in a solid workout with this and youll feel great after! But its not as intense as a power flow. \n\nIt has a beautiful, fluid movement to it, almost like a dance. Hence the name :)\n\nWell flow from Mountain pose into Warrior I, to Warrior II, and into Triangle pose. Then up into Reverse Triangle. Then well go back to Warrior II, to Warrior I, and into Warrior III for a little balance work. Then back to Warrior I, and back to Mountain pose.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Hz20YQHxgdI/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Hz20YQHxgdI/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Hz20YQHxgdI/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Hz20YQHxgdI/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Hz20YQHxgdI/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Christians Do Yoga","tags":["christian yoga","holy yoga","christians do yoga","christiansdoyoga.com","yoga tutorial","warrior pose","dancing warrior","dancing warrior sequence","warrior I","warrior II","warrior III","warrior 1","warrior 2","warrior 3","triangle pose","side angle pose","reverse triangle pose","mountain pose","christian yoga for beginners","yoga for beginners","need more energy","feeling tired","easy workout","fast workout","quick workout"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Dancing Warrior Yoga Sequence - ChristiansDoYoga.com","description":"Need more fun and energy in your life? Head over to http://dailysoulcare.com to download our FREE soul care guide and make yourself a priority!  \n\nHey yogis! In this video we cover a short yoga sequence of standing poses called \"Dancing Warrior\" to strengthen, energize, and open up the body.\n\n\nIts perfect for those days when you want to move but youre not looking for something heavy or intense. Dont get me wrong...you can get in a solid workout with this and youll feel great after! But its not as intense as a power flow. \n\nIt has a beautiful, fluid movement to it, almost like a dance. Hence the name :)\n\nWell flow from Mountain pose into Warrior I, to Warrior II, and into Triangle pose. Then up into Reverse Triangle. Then well go back to Warrior II, to Warrior I, and into Warrior III for a little balance work. Then back to Warrior I, and back to Mountain pose."}}', '{"duration":"PT7M5S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"712","likeCount":"31","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''christiansdoyoga.com'':5A ''danc'':1A ''sequenc'':4A ''warrior'':2A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
