INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17414, 'K-2RxdkY6dUc1ZgKuJ1VyS21YY8', 'qXXxFvKBadQ', NULL, '{"publishedAt":"2017-02-01T19:05:26Z","channelId":"UCxXSonb3zhnlI-MGcD3eotw","title":"Hip Stretches for Jiu Jitsu Grapplers | Free Yoga Flow Class | Yoga for BJJ","description":"MORE OF THIS? Join us \nhttps://yogaforbjj.live/special In this video Sebastian leads you through a simple hip stretching yoga sequence, similar to the kind you can find on the website. \n\nTight hips are common in jiu jitsu and because we use our hips so much we need to stretch them out to improve flexibility, rate of motion and improve as an athlete. Do this free yoga flow class to feel the benefits of stretching your hips every day. Having flexible hips will help your jiu jitsu grappling and improve your game.\n \nNormally Sebastian demonstrates the video himself, but today averagely flexible Miha Perhavec assumes that role. Please find some space to do the  video and report back with results.\n\nCheck out https://www.yogaforbjj.net for more!\nNew videos every week for grapplers that want to optimize the body for BJJ and life!\nTrain smart - Fight Forever","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/qXXxFvKBadQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/qXXxFvKBadQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/qXXxFvKBadQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/qXXxFvKBadQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/qXXxFvKBadQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga for BJJ","tags":["BJJ","brazilian jiu-jitsu","jiujitsu","yoga","yoga for bjj","stretching","flexibility","range of motion","hip mobility for bjj","yoga before bjj","yoga warmup","yoga bjj warmup","stiff hips bjj","yoga for rocks","stretches for bjj","stre