INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17426, 'MHqZKIJwOTVxRge5ymBz4iZJi-A', 'b_LVAGF5sqw', NULL, '{"publishedAt":"2018-03-28T17:31:52Z","channelId":"UC0Y8h0EnJ9FwjemU3KCsSxA","title":"Adaptive Yoga for Goldeners and Stroke Survivors","description":"Enjoy today''s yoga snack that I created for goldeners and stroke survivors, or anyone with adaptive needs. This practice will strengthen and stretch the psoas, and get your spine moving in a safe way. You''ll need a chair, a block, and maybe a caretaker. Make sure to listen to your body, and get a doctor''s consent before practicing this or any other movement video. \n\nLove & health,\nAbigail\n\nhttp://wellwithabigail.com/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/b_LVAGF5sqw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/b_LVAGF5sqw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/b_LVAGF5sqw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/b_LVAGF5sqw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/b_LVAGF5sqw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Abigail Atkinson","tags":["yoga for stroke survivors","stroke survivor exercises","stroke recovery exercises","abigail atkinson","abbierox101","silver sneakers","silver yoga","yoga for goldeners","dynamic aging","adaptive yoga","yoga for adaptive needs","yoga for recovery"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Adaptive Yoga for Goldeners and Stroke Survivors","description":"Enjoy today''s yoga snack that I created for goldeners and stroke survivors, or anyone with adaptive needs. This practice will strengthen and stretch the psoas, and get your spine moving in a safe way. You''ll need a chair, a block, and maybe a caretaker. Make sure to listen to your body, and get a doctor''s consent before practicing this or any other movement video. \n\nLove & health,\nAbigail\n\nhttp://wellwithabigail.com/"},"defaultAudioLanguage":"en"}', '{"duration":"PT9M22S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1902","likeCount":"20","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''adapt'':1A ''golden'':4A ''stroke'':6A ''survivor'':7A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17429, 'VF62qYQmbooRNoP0wVN81WiUJ_Q', '-g1_guS12AU', NULL, '{"publishedAt":"2020-06-20T19:57:07Z","channelId":"UCYjF5z1SYXAM62gKqV9aNCg","title":"International Day of Yoga 2020","description":"A short practice for anyone and everyone.  I find these poses put together in my own way very grounding.  You can practice it as many times as you like, just be mindful, make any necessary adjustments and have fun as always.  Feel the body, move the body, feel the breath move the body.  Please excuse the portrait style camera work it was filmed in my home and not the studio and spot the new and improved ''lock-down'' pot belly!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-g1_guS12AU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/-g1_guS12AU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/-g1_guS12AU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/-g1_guS12AU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/-g1_guS12AU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Country Wellness Hub","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"International Day of Yoga 2020","description":"A short practice for anyone and everyone.  I find these poses put together in my own way very grounding.  You can practice it as many times as you like, just be mindful, make any necessary adjustments and have fun as always.  Feel the body, move the body, feel the breath move the body.  Please excuse the portrait style camera work it was filmed in my home and not the studio and spot the new and improved ''lock-down'' pot belly!"}}', '{"duration":"PT32M7S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"6","