INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17453, 'Z7Z5lFOjO1eqsbqBJQsf33_ODdI', 'BQUyjrKqWJE', NULL, '{"publishedAt":"2019-05-08T09:54:42Z","channelId":"UCGG8PnkMHmqrxWI__K_EYxA","title":"Yoga For Shoulders And Upper Back","description":"In this basic yoga sequence I''ll walk you through ''Yoga for shoulders and upper back.'' If you have tight shoulders and neck from the stress of sitting at a desk all day then this is a perfect yoga practice for you. \n\nOnly 20 minutes long even yoga beginners can do this short session.\n\nIf you''ve got the time please try our yoga for back strengthening as a warm up to this video practice I''m sure you''d really enjoy that for the days when you have a little more time for your yoga practice.\n\nMost of these simple yoga movements are here to relieve tension and stress from your shoulders and neck as well as increase your body awareness for when you''re sitting at your desk.\n\nIf you have chronic pain in your shoulders or back please seek help from your health professionals before taking up yoga. Just to be on the safe side.\n\nI hope you enjoy the practice. I''ll see you on the mat soon Kxx\n\nSay hi on social:\nFacebook: https://www.facebook.com/yogainmotionaus\nInstagram: https://www.instagram.com/yoga_in_motion\nVlog: www.yogainmotion.com.au","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/BQUyjrKqWJE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/BQUyjrKqWJE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/BQUyjrKqWJE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/BQUyjrKqWJE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/BQUyjrKqWJE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga in Motion","tags":["Yoga for shoulders and upper back","yoga for shoulders and neck","simple yoga routine for shoulders","yoga for stress and tension","simple yoga routine for beginners","yoga for upper back and neck","yoga sequence for beginners","short yoga practice for desk workers","Yoga to improve shoulder mobility","Yoga to relieve upper back"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga For Shoulders And Upper Back","description":"In this basic yoga sequence I''ll walk you through ''Yoga for shoulders and upper back.'' If you have tight shoulders and neck from the stress of sitting at a desk all day then this is a perfect yoga practice for you. \n\nOnly 20 minutes long even yoga beginners can do this short session.\n\nIf you''ve got the time please try our yoga for back strengthening as a warm up to this video practice I''m sure you''d really enjoy that for the days when you have a little more time for your yoga practice.\n\nMost of these simple yoga movements are here to relieve tension and stress from your shoulders and neck as well as increase your body awareness for when you''re sitting at your desk.\n\nIf you have chronic pain in your shoulders or back please seek help from your health professionals before taking up yoga. Just to be on the safe side.\n\nI hope you enjoy the practice. I''ll see you on the mat soon Kxx\n\nSay hi on social:\nFacebook: https://www.facebook.com/yogainmotionaus\nInstagram: https://www.instagram.com/yoga_in_motion\nVlog: www.yogainmotion.com.au"},"defaultAudioLanguage":"en"}', '{"duration":"PT19M31S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"200","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''back'':6A ''shoulder'':3A ''upper'':5A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
