esented by Anna McDevitt, a certified yoga instructor at Westside Yoga in Atlanta, GA.\n\nConnect with Anna McDevitt: https://instagram.com/mrs_mcd\n\nConnect with Westside Yoga: \nhttps://www.westsideyoga.com\nhttps://instagram.com/westsideyoga\n\nConnect with The Strong Community:\nWebsite: https://www.thestrongcommunity.com\nInstagram: https://instagram.com/thestrongcommunity\nTwitter: https://twitter.com/thestrongcom\nFacebook: https://facebook.com/thestrongcommunity\nLinkedIn: https://linkedin.com/in/thestrongcommunity"},"defaultAudioLanguage":"en"}', '{"duration":"PT1M23S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"118","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''eagl'':4A ''quick'':2A ''tip'':3A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17463, 'se5W2zFCtB131XN7EnPYfqmf_Gs', 'JUYtix41P0Y', NULL, '{"publishedAt":"2017-08-24T07:35:46Z","channelId":"UCw1XqEl0jSke6Av6zMhIBpQ","title":"Simple Yoga Asanas To Reduce Hypertension | Beginners Yoga for Stress Relief, Depression & Anxiety","description":"Watch other interesting videos on Yoga for Weight Loss, Yoga For Arthritis, Yoga for Diabetes, Yoga for Beginners and many more on \nhttps://goo.gl/YxVbFK\n\nPresented by : Dr.Ananda Balayogi Bhavanani Of Ananda Ashram ICYER Pondicherry\n\nGomukha Asana - 00:09\nVakra Asana - 02:15\nPurvottana Asana - 03:42\nEka Pada Uttanpada Asana - 04:23\nDwi Pada Uttanpada Asana - 06:26\n\nYoga can be a very beneficial therapy for controlling and lowering high blood pressure naturally. The gentle, soothing practice of yoga asanas settles both mind and body and reduces stress - a leading cause of hypertension.\n\nYoga asana offers several postures that help cleanse, stimulate, aid, and encourage good digestive function. It''s best not to practice yoga right after a meal, but if you''re feeling any kind of bloating, gas, or indigestion a few hours after a meal or the morning after, here are five yoga postures to improve digestion.\n\nYoga is a group of physical, mental, and spiritual practices or disciplines which originated in ancient India. Yoga means union of the individual consciousness or soul with the Universal Consciousness or Spirit.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/JUYtix41P0Y/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/JUYtix41P0Y/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/JUYtix41P0Y/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/JUYtix41P0Y/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/JUYtix41P0Y/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Geethanjali - Yoga","tags":["Yoga","asanas","yoga asana","yoga for hypertension","yoga for stress relief","yoga for beginners","yoga poses","yoga exercises","hypertension","fitness","yoga workout","beginners yoga","yoga routine","easy yoga","yoga class","yoga for relaxation","yoga for blood pressure cure","yoga to reduce high blood pressure","morning yoga","yoga for flexibility","yoga beginners","5 Poses to Reduce Hypertension","high blood pressure","yoga for high blood pressure","yoga to reduce blood pressure","workout","vakrasana"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Simple Yoga Asanas To Reduce Hypertension | Beginners Yoga for Stress Relief, Depression & Anxiety","description":"Watch other interesting videos on Yoga for Weight Loss, Yoga For Arthritis, Yoga for Diabetes, Yoga for Beginners and many more on \nhttps://goo.gl/YxVbFK\n\nPresented by : Dr.Ananda Balayogi Bhavanani Of Ananda Ashram ICYER Pondicherry\n\nGomukha Asana - 00:09\nVakra Asana - 02:15\nPurvottana Asana - 03:42\nEka Pada Uttanpada Asana - 04:23\nDwi Pada Uttanpada Asana - 06:26\n\nYoga can be a very beneficial therapy for controlling and lowering high blood pressure naturally. The gentle, soothing practice of yoga asanas settles both mind and body and reduces stress - a leading cause of hypertension.\n\nYoga asana offers several postures that help cleanse, stimulate, aid, and encourage good digestive function. It''s best not to practice yoga right after a meal, but if you''re feeling any kind of bloating, gas, or indigestion a few hours after a meal or the morning after, here are five yoga postures to improve digestion.\n\nYoga is a group of physical, mental, and spiritual practices or disciplines which originated in ancient India. Yoga means union of the individual consciousness or soul with the Universal Consciousness or Spirit."},"defaultAudioLanguage":"en"}', '{"duration":"PT7M36S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"74168","likeCount":"666","dislikeCount":"31","favoriteCount":"0","commentCount":"6"}', '''anxieti'':13A ''asana'':3A ''beginn'':7A ''depress'':12A ''hypertens'':6A ''reduc'':5A ''relief'':11A ''simpl'':1A ''stress'':10A ''yoga'':2A,8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
