INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17479, 'u5JIERyx2ngb2EP0mIIApvUELaU', 'UAHie1TL9I0', NULL, '{"publishedAt":"2017-09-20T13:38:29Z","channelId":"UCXAHpX2xDhmjqtA-ANgsGmw","title":"Yoga Mats: 5 Fast Facts","description":"See The 10 Best Yoga Mats on Ezvid Wiki  https://wiki.ezvid.com/best-yoga-mats\n\nFact #1. Yoga had its humble beginning over 5000 years ago. Since the first asana, yogis favored natural yoga mats to support their bodies during the postures. In the beginning, this was as simple as using the natural earth. From there, yogis moved their practice onto rugs made of kusha grass, native to India. More affluent yogis practiced on a deerskin rug, and the most bold practiced on a rug made of tiger skin.\n\nFact #2. Since the early days of yoga mats, many different styles have emerged. The global spread of yoga practitioners created an evolution in yoga mats. In the west, it was originally most common to see yogis spread out on beach towels or cotton mats designed for yoga. Over time, rubber pads were introduced below the cotton mats to prevent slipping. Eventually, the entire mat was made of rubber or various PVC products.\n\nFact #3. Physically, the yoga mat provides many benefits. First and foremost it provides traction. Various poses, such as downward-facing dog, can require a lot of traction. If someone intends to do these poses on the flat wooden floor of many studios, they will be met with a slippery, unsafe surface. A yoga mat provides the necessary traction. This ensures that your focus can be on the pose itself.\n\nFact #4. An unmentioned benefit of a yoga mat is sweat collection. Most mats are made of non-porous materials. They don''t collect sweat as much as they simply allow it a place to sit. Many yoga mats are also made extra thick. This provides padding to delicate bodies on hard surfaces. These mats make it easy to do yoga anywhere, indoors or outdoors. In the winter months, this padding also means that yoga mats provide insulation and warmth for the body.\n\nFact #5. Yoga provides benefits to the body''s all around fitness levels. A cumulative review indicated that in both healthy and diseased populations, yoga may be as effective as basic exercises at improving a variety of health indicators. Yoga also keeps the practitioner mentally and emotionally balanced. It improves the mood and modulates the body''s stress response, too.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/UAHie1TL9I0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/UAHie1TL9I0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/UAHie1TL9I0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/UAHie1TL9I0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/UAHie1TL9I0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Ezvid Wiki","categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga Mats: 5 Fast Facts","description":"See The 10 Best Yoga Mats on Ezvid Wiki  https://wiki.ezvid.com/best-yoga-mats\n\nFact #1. Yoga had its humble beginning over 5000 years ago. Since the first asana, yogis favored natural yoga mats to support their bodies during the postures. In the beginning, this was as simple as using the natural earth. From there, yogis moved their practice onto rugs made of kusha grass, native to India. More affluent yogis practiced on a deerskin rug, and the most bold practiced on a rug made of tiger skin.\n\nFact #2. Since the early days of yoga mats, many different styles have emerged. The global spread of yoga practitioners created an evolution in yoga mats. In the west, it was originally most common to see yogis spread out on beach towels or cotton mats designed for yoga. Over time, rubber pads were introduced below the cotton mats to prevent slipping. Eventually, the entire mat was made of rubber or various PVC products.\n\nFact #3. Physically, the yoga mat provides many benefits. First and foremost it provides traction. Various poses, such as downward-facing dog, can require a lot of traction. If someone intends to do these poses on the flat wooden floor of many studios, they will be met with a slippery, unsafe surface. A yoga mat provides the necessary traction. This ensures that your focus can be on the pose itself.\n\nFact #4. An unmentioned benefit of a yoga mat is sweat collection. Most mats are made of non-porous materials. They don''t collect sweat as much as they simply allow it a place to sit. Many yoga mats are also made extra thick. This provides padding to delicate bodies on hard surfaces. These mats make it easy to do yoga anywhere, indoors or outdoors. In the winter months, this padding also means that yoga mats provide insulation and warmth for the body.\n\nFact #5. Yoga provides benefits to the body''s all around fitness levels. A cumulative review indicated that in both healthy and diseased populations, yoga may be as effective as basic exercises at improving a variety of health indicators. Yoga also keeps the practitioner mentally and emotionally balanced. It improves the mood and modulates the body''s stress response, too."},"defaultAudioLanguage":"en"}', '{"duration":"PT2M50S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"3478","likeCount":"22","dislikeCount":"6","favoriteCount":"0","commentCount":"0"}', '''5'':3A ''fact'':5A ''fast'':4A ''mat'':2A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
