INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17485, 'PviSCtTCLBw5fRPfKmm2escHuQA', '7XpGF_YU3Fw', NULL, '{"publishedAt":"2020-05-29T18:38:16Z","channelId":"UCO-m7IlmBuYYqtwxxIyg9og","title":"Yoga Technique: Challenging Tortoise Pose to Tripod Headstand Transition Sequence","description":"Today''s Yoga Transition tutorial demonstrates an intermediate transition from Tortoise Pose (Kurmasana) to Firefly Pose (Titibasana) to Tripod Headstand. This transition calls for flexibility, strength and disciplined focus. It''s also a lot of fun to try. \n\nTo master more advanced yoga transitions - linking postures together with appropriate movement and breathing - you simply need to develop fundamentals and interweave them with consistent effort over time. \n\nDoing so by practicing short yoga sequences like this one will make arm balance poses and inversions more comfortable and accessible. Start with the modification that suits you best, and you''ll be able to use your strength more effectively and increase your capacity and duration in each pose.  \n\nAlong the way, you''ll be developing strength in the core, arms, hands, shoulders, wrists, and back as well as confidence and patience - two staples of a peaceful life. \n\nTake a few Sun Salutations and try it yourself!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/7XpGF_YU3Fw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/7XpGF_YU3Fw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/7XpGF_YU3Fw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/7XpGF_YU3Fw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/7XpGF_YU3Fw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Glueck Yoga Arts","tags":["yoga transitions","advanced yoga transitions","arm balances","inversions","how to do tripod headstand","yoga sequence for strength","yoga sequence for balance","firefly pose","tortoise pose","benefits of arm balances","benefits of inversions","how do you build strength for arm balances in yoga","how to improve arm balances in yoga"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Yoga Technique: Challenging Tortoise Pose to Tripod Headstand Transition Sequence","description":"Today''s Yoga Transition tutorial demonstrates an intermediate transition from Tortoise Pose (Kurmasana) to Firefly Pose (Titibasana) to Tripod Headstand. This transition calls for flexibility, strength and disciplined focus. It''s also a lot of fun to try. \n\nTo master more advanced yoga transitions - linking postures together with appropriate movement and breathing - you simply need to develop fundamentals and interweave them with consistent effort over time. \n\nDoing so by practicing short yoga sequences like this one will make arm balance poses and inversions more comfortable and accessible. Start with the modification that suits you best, and you''ll be able to use your strength more effectively and increase your capacity and duration in each pose.  \n\nAlong the way, you''ll be developing strength in the core, arms, hands, shoulders, wrists, and back as well as confidence and patience - two staples of a peaceful life. \n\nTake a few Sun Salutations and try it yourself!"}}', '{"duration":"PT3M40S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"60","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''challeng'':3A ''headstand'':8A ''pose'':5A ''sequenc'':10A ''techniqu'':2A ''tortois'':4A ''transit'':9A ''tripod'':7A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
