INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17498, 'Lz0Xp7RvgFvU6ZsdPVND_QEyV1g', 'cH-Ck8U9ByU', NULL, '{"publishedAt":"2019-06-18T10:00:07Z","channelId":"UCzZ3dVro6gtu4DrWQ5lVTXw","title":"Quick Hands Free Yoga | 5 Minutes","description":"In this short 5 minute class, we start by hanging out in a forward fold and letting gravity do its work. Then, we flow through a couple sun salutations and end the class standing. This is a great class to come to when you''re short on time in the morning or need a quick pick-me-up in the afternoon!\n\nPlease like, comment, and subscribe if you enjoyed this video \n\nWant more content like this? Or have any requests for classes? Let me know in the comments! \n\n#NoWrists #HandsFree #MorningYoga\n\nConnect with me:\n\nWebsite: https://yogawithkathleen.com/\nInstagram: https://www.instagram.com/yogawithkathleen\nFacebook: https://www.facebook.com/yogawithkathleenh","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/cH-Ck8U9ByU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/cH-Ck8U9ByU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/cH-Ck8U9ByU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/cH-Ck8U9ByU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/cH-Ck8U9ByU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Kathleen","tags":["yoga","morning yoga","wrists free","no wrists","sun salutations"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Quick Hands Free Yoga | 5 Minutes","description":"In this short 5 minute class, we start by hanging out in a forward fold and letting gravity do its work. Then, we flow through a couple sun salutations and end the class standing. This is a great class to come to when you''re short on time in the morning or need a quick pick-me-up in the afternoon!\n\nPlease like, comment, and subscribe if you enjoyed this video \n\nWant more content like this? Or have any requests for classes? Let me know in the comments! \n\n#NoWrists #HandsFree #MorningYoga\n\nConnect with me:\n\nWebsite: https://yogawithkathleen.com/\nInstagram: https://www.instagram.com/yogawithkathleen\nFacebook: https://www.facebook.com/yogawithkathleenh"}}', '{"duration":"PT6M49S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"30","likeCount":"4","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''5'':5A ''free'':3A ''hand'':2A ''minut'':6A ''quick'':1A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17499, 'wPoUfF21X83qLTJMafF5GaUDzug', '_pFi-TROyik', NULL, '{"publishedAt":"2019-05-30T13:00:04Z","channelId":"UCo3GoRLFsOehQ4tIoKZHzNA","title":"Yoga For Weight Loss (Cardio Workout to Burn Fat)","description":"Yoga for weight loss is a cardio workout to burn fat. It is a circular (mandala) flow, that moves quickly to create heat as well as build strength in the body.\nTry my total body yoga workout here https://www.youtube.com/watch?v=Qy6UFO9zfDI&t=1288s\n\nYoga Dose is about longer classes and challenging poses. \n\nYou will find yoga classes that are designed to push you out of your comfort zone. This yoga channel is meant to inspire you. To light a fire within you! You can become comfortable in your own skin. You can be flexible, strong, and balanced!\n\nLet my passion for yoga transfer over to you.\n\nNew yoga classes every Thursday. (Always long and challenging!)\n\nSubscribe to Yoga Dose so you never miss an opportunity to become stronger.\n\nCC","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/_pFi-TROyik/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/_pFi-TROyik/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/_pFi-TROyik/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/_pFi-TROyik/sddefault.jpg","width":640,"height":480}},"channelTitle":"Yoga Dose","tags":["yoga for weight loss","yoga","cardio yoga","intermediate yoga","advanced yoga","yoga dose","weight loss yoga","1 hour yoga","1 hr yoga","weight loss","yoga workout","fat burning","yoga to lose weight","cardio yoga workout","yoga for weightloss","cardio workout","how to lose weight with yoga","vinyasa flow","yoga flow","total body","total body yoga workout","yoga practice","lose weight","yoga asanas for weight loss","hatha yoga","free yoga class","yoga channel","yoga videos","yoga for"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga For Weight Loss (Cardio Workout to Burn Fat)","description":"Yoga for weight loss is a cardio workout to burn fat. It is a circular (mandala) flow, that moves quickly to create heat as well as build strength in the body.\nTry my total body yoga workout here https://www.youtube.com/watch?v=Qy6UFO9zfDI&t=1288s\n\nYoga Dose is about longer classes and challenging poses. \n\nYou will find yoga classes that are designed to push you out of your comfort zone. This yoga channel is meant to inspire you. To light a fire within you! You can become comfortable in your own skin. You can be flexible, strong, and balanced!\n\nLet my passion for yoga transfer over to you.\n\nNew yoga classes every Thursday. (Always long and challenging!)\n\nSubscribe to Yoga Dose so you never miss an opportunity to become stronger.\n\nCC"}}', '{"duration":"PT54M19S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"27712","likeCount":"631","dislikeCount":"27","favoriteCount":"0","commentCount":"59"}', '''burn'':8A ''cardio'':5A ''fat'':9A ''loss'':4A ''weight'':3A ''workout'':6A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17503, 'Uvb2DVg-ZzumvM3TXpwdnrgGVM0', 'symsBU2-0Oc', NULL, '{"publishedAt":"2019-11-09T17:46:24Z","channelId":"UCd676LpOiZ2fgLK97MfjNHA","title":"Yoga for Strength & Flexibility with Sherry Zak Morris, Certified Yoga Therapist","description":"This 20-minute practice is a great way to start the morning!  Set your intention for a NEW day and come join me as we work on strengthening our entire body while still keeping ourselves fluid and flexible. (I share some great Somatic movements in this class that I know you will love!)\n\nIf you are serious about getting stronger in your body, then join me in the full 5-class Hometown Yoga Series available at https://www.YogaVista.TV","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/symsBU2-0Oc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/symsBU2-0Oc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/symsBU2-0Oc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/symsBU2-0Oc/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/symsBU2-0Oc/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"YogaJP","tags":["free yoga class","hatha yoga class","yoga for strong legs","yoga for legs","yoga for flexibility","yoga for stiff joints"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Yoga for Strength & Flexibility with Sherry Zak Morris, Certified Yoga Therapist","description":"This 20-minute practice is a great way to start the morning!  Set your intention for a NEW day and come join me as we work on strengthening our entire body while still keeping ourselves fluid and flexible. (I share some great Somatic movements in this class that I know you will love!)\n\nIf you are serious about getting stronger in your body, then join me in the full 5-class Hometown Yoga Series available at https://www.YogaVista.TV"},"defaultAudioLanguage":"en"}', '{"duration":"PT23M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"21957","likeCount":"412","dislikeCount":"14","favoriteCount":"0","commentCount":"38"}', '''certifi'':9A ''flexibl'':4A ''morri'':8A ''sherri'':6A ''strength'':3A ''therapist'':11A ''yoga'':1A,10A ''zak'':7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17504, '6WlRtTQHlDSVs3VnyS0pEwP6oEU', 'sR2Q0j0He58', NULL, '{"publishedAt":"2020-06-20T21:00:11Z","channelId":"UC8uFPz1-8FqJ_dFh7nQHh0g","title":"Yoga for Pregnancy - Ideal Birthing Positions","description":"Join us every Saturday at 2pm (PDT) for a new Prenatal Yoga class. All levels, trimesters and bodies are welcome! Whether you''ve done yoga before, or are completely new to the practice, this gentle Hatha Flow will allow you to explore movement and challenge yourself within your own personal limits! Its our intention to help you feel strong, not get fit. That said, you will feel the fire in all the right places, getting your body, mind and spirit ready for your birthand for the beyond! \n\nAlways listen to your bodys cues, ensuring that youre moving in a way that feels good for you. Lastly, remember that my cues are suggestions! Take them or leave them. Embrace and celebrate every new stage along your journey to motherhood.\n\nYoga Mat by SupportedSoul.com\nYoga Pants by Bewildher.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/sR2Q0j0He58/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/sR2Q0j0He58/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/sR2Q0j0He58/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/sR2Q0j0He58/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/sR2Q0j0He58/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Kukoon Yoga","tags":["#Pregnancy","#KukoonYoga","#Birth","#PrenatalYoga","#PrenatalJourney","#BirthPrep","#FirstTrimester","#SecondTrimester","#ThirdTrimester","#YogaforPregnancy","#YogaForPregnantWoman","#FourthTrimester","#BirthJourney","#BumpsAndBeyond","#SupportForMama","#Community","#HoldSpace","#YogaForAllBumps","#Babies","#MamaStrong","#FeelStrongNotFit","#InformationIsPower"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga for Pregnancy - Ideal Birthing Positions","description":"Join us every Saturday at 2pm (PDT) for a new Prenatal Yoga class. All levels, trimesters and bodies are welcome! Whether you''ve done yoga before, or are completely new to the practice, this gentle Hatha Flow will allow you to explore movement and challenge yourself within your own personal limits! Its our intention to help you feel strong, not get fit. That said, you will feel the fire in all the right places, getting your body, mind and spirit ready for your birthand for the beyond! \n\nAlways listen to your bodys cues, ensuring that youre moving in a way that feels good for you. Lastly, remember that my cues are suggestions! Take them or leave them. Embrace and celebrate every new stage along your journey to motherhood.\n\nYoga Mat by SupportedSoul.com\nYoga Pants by Bewildher.com"}}', '{"duration":"PT26M7S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"49","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''birth'':5A ''ideal'':4A ''posit'':6A ''pregnanc'':3A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17505, 'x9Vt7xMF7vAlgFJPe7l959MDnlQ', 'TSndpWHSVyI', NULL, '{"publishedAt":"2020-06-07T08:13:38Z","channelId":"UCwFzZN7U8VhmochUCOEKWiA","title":"Yoga for ovulation to implantation","description":"Implantation may occur 6 - 12 days after ovulation. This class is designed to be practiced during this time. It will help you visualise the womb space as inviting and nourishing and help you to manage the anxiety you may feel at this time.\n\nIf you would like classes for the other stages of the cycle please check out the links below.\n\nFree fertility yoga guide - https://bettinarae.activehosted.com/f/3\n\nFour part fertility yoga series - https://www.bettinarae.com/product/fertility-yoga-four-stages-cycle/\n\nFertility yoga course - https://www.bettinarae.com/28-day-fertility-yoga-online-course/\n\nFertility goodnight series - https://www.bettinarae.com/product/goodnight-fertility-yoga-series/\n\nHealing after miscarriage series - https://www.bettinarae.com/product/yoga-for-healing-after-miscarriage/\n\nYoga for IVF - https://www.bettinarae.com/product/fertility-yoga-for-ivf/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/TSndpWHSVyI/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/TSndpWHSVyI/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/TSndpWHSVyI/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/TSndpWHSVyI/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/TSndpWHSVyI/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Bettina Rae","tags":["yoga for implantation","yoga for ovulation","implantation","encourage implantation","implantation yoga","fertility","fertility yoga","yoga for trying to conceive","yoga to get pregnant","get pregnant"],"categoryId":"27","liveBroadcastContent":"none","localize