INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17517, '1RliuI2anaQIWk_9qDqP4PlNJhY', '-rpOQ0nGVvg', NULL, '{"publishedAt":"2020-06-20T14:00:00Z","channelId":"UCHVQ4hzKunp6hW5iyHeONdg","title":"10 Minute FULL BODY YOGA INTERVAL Workout | ALL LEVELS YOGA HIIT","description":"Hi Yogis! If you enjoyed this class, please consider donating (thank you so much!): https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=UHJW5ZMKWLJ5W&source=url\n\nThis is a YogaFit Interval Class. It is like a HIIT class, but the movements are yoga inspired! There are 20 \"exercises\", and each one is 30 seconds long, giving us a nice 10 minute yoga workout for all levels. This class is perfect if you want to strengthen and lengthen your muscles in a short amount of time; toning and not bulking. If you want to challenge yourself, do this workout every day for a week and let me know how you feel! I hope that you enjoy this class and have an amazing week!\n\nPoses in this class: Birddog, Downward Dog, Chair, Plank\n\nClick here for more videos like this: https://www.youtube.com/watch?v=-YBzrVptM5s&list=PLc5bNijHfUO1dv0RFoScfbaRxQMqs8Hno\n\n__________________________________________\n\n#yoga #yogaworkout #YogaFit #yogainterval\n\nClick here to subscribe and support the channel (thank you loves!!): https://www.youtube.com/channel/UCHVQ4hzKunp6hW5iyHeONdg?sub_confirmation=1\n\nClick here for more (free!) high quality yoga classes: https://www.youtube.com/playlist?list=PLc5bNijHfUO0NNpKtqnE-OA3e7cBIiaWZ\n\nLots of love!!\n________________________________________\n\nIf you''re new here...\nWelcome to the Young Yogi, where we put a fun, new, interesting spin on yoga! I''m so happy that you found this channel. I''m May, a 16 year old yoga instructor with a passion for anything health and fitness related. I created this channel to provide free, high quality yoga classes for everyone! I know that there are many yoga channels here on youtube (and that''s amazing!), and by subscribing to my channel you will be getting a new spin on yoga classes. Whether it''s an upbeat yoga class with fun music or a relaxing ASMR yoga class, I promise that I will make every class exciting and special! If any of this seems interesting to you, consider subscribing (it''s free!) to support my mission! I am so grateful for every one of you!\n\nLove and Light,\nMay (The Young Yogi)\n\n___________________________________________\n\nLet''s stay connected!!\n\nInstagram: https://www.instagram.com/1may.may1/\nFacebook: https://www.facebook.com/1may.may1/\nTwitter: https://twitter.com/may63487386\nSnapchat: https://www.snapchat.com/add/may.sapling\nSpotify: https://open.spotify.com/user/maymaytunes\nSoundcloud: https://soundcloud.com/user-255189962","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-rpOQ0nGVvg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/-rpOQ0nGVvg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/-rpOQ0nGVvg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/-rpOQ0nGVvg/sddefault.jpg","width":640,"height":480}},"channelTitle":"The Young Yogi","tags":["yoga","yoga videos","fitness","beginner yoga","yoga tutorial","The Young Yogi","yoga for beginners","yoga workout","relaxing yoga","flexibility","yogafit","interval workout","yoga interval workout","yoga HIIT","hiit workout","yoga hiit workout","yoga hiit","fat burning workout","10 minute yoga workout","ab workout","full body yoga workout","full body yoga workout for beginners","full body yoga workout at home","10 minute yoga hiit fusion blast","yoga fitness","yoga fit tuber","yoga fitness blender"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"10 Minute FULL BODY YOGA INTERVAL Workout | ALL LEVELS YOGA HIIT","description":"Hi Yogis! If you enjoyed this class, please consider donating (thank you so much!): https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=UHJW5ZMKWLJ5W&source=url\n\nThis is a YogaFit Interval Class. It is like a HIIT class, but the movements are yoga inspired! There are 20 \"exercises\", and each one is 30 seconds long, giving us a nice 10 minute yoga workout for all levels. This class is perfect if you want to strengthen and lengthen your muscles in a short amount of time; toning and not bulking. If you want to challenge yourself, do this workout every day for a week and let me know how you feel! I hope that you enjoy this class and have an amazing week!\n\nPoses in this class: Birddog, Downward Dog, Chair, Plank\n\nClick here for more videos like this: https://www.youtube.com/watch?v=-YBzrVptM5s&list=PLc5bNijHfUO1dv0RFoScfbaRxQMqs8Hno\n\n__________________________________________\n\n#yoga #yogaworkout #YogaFit #yogainterval\n\nClick here to subscribe and support the channel (thank you loves!!): https://www.youtube.com/channel/UCHVQ4hzKunp6hW5iyHeONdg?sub_confirmation=1\n\nClick here for more (free!) high quality yoga classes: https://www.youtube.com/playlist?list=PLc5bNijHfUO0NNpKtqnE-OA3e7cBIiaWZ\n\nLots of love!!\n________________________________________\n\nIf you''re new here...\nWelcome to the Young Yogi, where we put a fun, new, interesting spin on yoga! I''m so happy that you found this channel. I''m May, a 16 year old yoga instructor with a passion for anything health and fitness related. I created this channel to provide free, high quality yoga classes for everyone! I know that there are many yoga channels here on youtube (and that''s amazing!), and by subscribing to my channel you will be getting a new spin on yoga classes. Whether it''s an upbeat yoga class with fun music or a relaxing ASMR yoga class, I promise that I will make every class exciting and special! If any of this seems interesting to you, consider subscribing (it''s free!) to support my mission! I am so grateful for every one of you!\n\nLove and Light,\nMay (The Young Yogi)\n\n___________________________________________\n\nLet''s stay connected!!\n\nInstagram: https://www.instagram.com/1may.may1/\nFacebook: https://www.facebook.com/1may.may1/\nTwitter: https://twitter.com/may63487386\nSnapchat: https://www.snapchat.com/add/may.sapling\nSpotify: https://open.spotify.com/user/maymaytunes\nSoundcloud: https://soundcloud.com/user-255189962"},"defaultAudioLanguage":"en"}', '{"duration":"PT11M4S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"27","likeCount":"6","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''10'':1A ''bodi'':4A ''full'':3A ''hiit'':11A ''interv'':6A ''level'':9A ''minut'':2A ''workout'':7A ''yoga'':5A,10A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
