ine to help strengthen your spine so that you can sit taller and more comfortably.\nDo it with me at home.\n\nIf youd like to do a short warm up before this practice I highly recommend it please follow the link below:\n\nIf youd like to access a free download to a stress busting practice youll find it at \nwww.yogainmotion.com.au\n\nThanks so much for watching Kxx\n\nSay hi on social:\nFacebook: https://www.facebook.com/yogainmotionaus\nInstagram: https://www.instagram.com/yoga_in_motion"},"defaultAudioLanguage":"en"}', '{"duration":"PT19M49S","dimension":"2d","definition":"hd","caption":"true","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"117","likeCount":"4","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''back'':3A ''strengthen'':4A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17519, 'Pv9Krx69GqI-9oT_fLXuWyi3f0Y', 'P48uHJ-j6AI', NULL, '{"publishedAt":"2020-06-15T11:00:09Z","channelId":"UCeu6JUF9JBM8HuqL5RpFf2g","title":"Yoga for Tight Hips","description":"Hello yoga friends. Welcome to Sarah Mapes Yoga.\n\nThis yoga flow is all about opening tight hips.  There are multiple factors that can contribute to tight hips, such as tight hamstrings, tight hip flexors, or weak or overworked psoas muscles.  Healthy open hips strengthen our back muscles, improve circulation in our lower bodies, and increase our range of motion.  This yoga flow will guide you through therapeutic hip stretches to improve your range of motion and strength building exercises for your hips and lower back.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/P48uHJ-j6AI/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/P48uHJ-j6AI/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/P48uHJ-j6AI/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/P48uHJ-j6AI/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/P48uHJ-j6AI/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Sarah Mapes","tags":["yoga","tight hips","sarah mapes","hip flexibility","hip therapy"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga for Tight Hips","description":"Hello yoga friends. Welcome to Sarah Mapes Yoga.\n\nThis yoga flow is all about opening tight hips.  There are multiple factors that can contribute to tight hips, such as tight hamstrings, tight hip flexors, or weak or overworked psoas muscles.  Healthy open hips strengthen our back muscles, improve circulation in our lower bodies, and increase our range of motion.  This yoga flow will guide you through therapeutic hip stretches to improve your range of motion a