INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17531, 'Xm10eWxGPmOVGKN4dO91jHftpCk', 'gx39R1Y8EPE', NULL, '{"publishedAt":"2015-07-27T10:38:44Z","channelId":"UC_U1U_86sRTfdYXwPCvaZRQ","title":"Vikasa Yoga Level I - Trikonasana Sequence","description":"Instructions:\n\nThis video is a part of my training system. The system is very easy to use. There are about 20 short videos in total, they are all named \"Vikasa Yoga Level I - *module name*\". Each video can be downloaded. After downloading, you can arrange the videos in a playlist. Modules can be combined in any order, so regardless of how you rearrange them, they will always flow as a continuous practice. You can start by practicing few modules a day, building up to more complete practice that will take 60+ minutes. The advantage of this system is that you do not need to follow the same routine every day. You do not need to be a yoga teacher to create various routines, just use the modules as building blocks, and you will not go wrong. Vikasa Yoga Level I focuses on basic physical fitness and strengthening of the spine and major joints of the body. Enjoy this basic yoga system and share with friends and family.\n\nAnother note, the music in the background can be used for counting your breath. When you practice, count 4-5 beats as you inhale, and 4-5 beats as you exhale... try to become aware of your breathing pattern, and lengthen/deepen your breath. This concentration and control of breath will make it a real yoga practice, instead of just fitness.\n\nHope you enjoy this. Once you build up the necessary strength, you can follow my complete sequence videos, which are recorded during the teacher training practice sessions. Also be sure to check out the video on pranayamas.\n\nwww.vikasa.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/gx39R1Y8EPE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/gx39R1Y8EPE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/gx39R1Y8EPE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/gx39R1Y8EPE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/gx39R1Y8EPE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Vikasa Yoga Retreat","tags":["Trikonasana","Yoga (Sport)","vikasa yoga","yoga","yoga in thailand","yoga on the beach","beach yoga","yoga retreat","yoga retreat thailand","vikasa","yoga training","fitness","kosta miachin","triangle pose"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Vikasa Yoga Level I - Trikonasana Sequence","description":"Instructions:\n\nThis video is a part of my training system. The system is very easy to use. There are about 20 short videos in total, they are all named \"Vikasa Yoga Level I - *module name*\". Each video can be downloaded. After downloading, you can arrange the videos in a playlist. Modules can be combined in any order, so regardless of how you rearrange them, they will always flow as a continuous practice. You can start by practicing few modules a day, building up to more complete practice that will take 60+ minutes. The advantage of this system is that you do not need to follow the same routine every day. You do not need to be a yoga teacher to create various routines, just use the modules as building blocks, and you will not go wrong. Vikasa Yoga Level I focuses on basic physical fitness and strengthening of the spine and major joints of the body. Enjoy this basic yoga system and share with friends and family.\n\nAnother note, the music in the background can be used for counting your breath. When you practice, count 4-5 beats as you inhale, and 4-5 beats as you exhale... try to become aware of your breathing pattern, and lengthen/deepen your breath. This concentration and control of breath will make it a real yoga practice, instead of just fitness.\n\nHope you enjoy this. Once you build up the necessary strength, you can follow my complete sequence videos, which are recorded during the teacher training practice sessions. Also be sure to check out the video on pranayamas.\n\nwww.vikasa.com"}}', '{"duration":"PT8M9S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1152","likeCount":"15","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''level'':3A ''sequenc'':6A ''trikonasana'':5A ''vikasa'':1A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
