INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17546, 'uuttsSevUk8QMcDHy2oWKuHzF2s', 'eRqSdWV8DUo', NULL, '{"publishedAt":"2020-06-21T08:00:11Z","channelId":"UCvhED0q5EgmHHR-Qpt-24-A","title":"Sun Salutation Yoga Sequence for Pregnancy","description":"This short Yoga sequence guides you through a series of gentle Sun Salutations which are suitable to practise during Pregnancy.  This sequence will help you to connect with your breath, nourish your body and calm your mind.  Sun Salutations are energising and offer a great option for a morning practice.  \n\nThis sequence is suitable from 12 weeks when your pregnancy is well established.  If you feel any discomfort, dizziness, sickness or rapid change in body temperature return to hands and knees.  As always listen to your baby and your body and move with lots of awareness.\n\nStruggling to sleep? Check out my e-book: A GUIDE TO A GOOD NIGHTS SLEEP WITH PREGNANCY YOGA here: https://pranamamayoga.mykajabi.com/pl...\n\nIf you''d like to find out more about Prana Mama Yoga and our classes, check out our website: http://www.pranamamayoga.co.uk\n\nFor more content from Lis, follow her social media channels:\nFacebook: https://www.facebook.com/PranaMamaYoga/\nInstagram: https://www.instagram.com/pranamamayoga/\nPregnancy Yoga Facebook Group: https://www.facebook.com/groups/prana...\n\nDISCLAIMER: The creators of this video, its distributors, and performers are not liable for any injury, accident, or health impairment befalling and viewer of this video or any individual utilising the techniques suggested in this video. \nLike any exercise, always seek the advice of your health care professional with any questions or concerns before starting or changing any exercise program or making a lifestyle change.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/eRqSdWV8DUo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/