INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17563, 'SJWvZukfYWZHNxqzXItQIgcwtj8', 'DSoFEerSOrc', NULL, '{"publishedAt":"2017-07-21T15:00:03Z","channelId":"UC9xRcqG8V6yNi6Hum92EoGg","title":"Beach Training, Plyometrics, Free Kicks & Yoga Routine | A Day In The Life Of A Soccer Player | Ep.3","description":"In this day in the life of a soccer player episode, I show you my beach training session, plyometric workout, free kick training session and yoga routine. As the season has come to an end, I also discuss my plans for off season. Enjoy!\n\nFOLLOW MY JOURNEY ON SOCIAL MEDIA:\nInstagram: @michaellewiscunningham\nFacebook: facebook.com/michaellewiscunningham\nTwitter: @CunnyGoesHam\nEmail: michaellewiscunningham@gmail.com\n\nBeach Training Workout:\nT Agility Drill: 5 reps\nLateral Hurdles/ Agility Ladder: 5 reps\nDiagonal Agility Course: 5 reps\nObstacle course with pass/receive: 5 reps\nJuggling: 2-3 minutes\n\nPlyometric Training Session:\nBox jumps to depth jumps: 3 sets of 10 reps\nLateral Skates: 3 x 10 reps\nCross Hops: 3 x 5 reps\nJump Lunges: 3 x 10 reps\nJump Squats: 3 x 10 reps\nLateral Jumps: 3 x 20 reps\nSingle leg lateral jumps: 3 x 20 reps (each leg)\nPower ropes: 3 x 30 seconds\nIron man ladder lunges: 5 reps\n\nFree Kicks: 30-50 reps\n\nYoga: \nBack bend to forward fold: x5\nDownward facing dog with calf stretch: x 10 reps\nDownward facing dog to upward facing dog: x 10\nPigeon pose: 10 seconds each leg\nLunge with shoulders back: x 10 seconds each leg\nT pose: x 10 seconds each leg\nWarrior series: 3 times each side\nTree pose: 10 seconds each leg\n\n\n\nMusic:\n\n1. Track: Waysons - Running [NCS Release]\nMusic provided by NoCopyrightSounds.\nWatch: https://youtu.be/Y5TnYaZ31b0\nFree Download / Stream: http://ncs.io/RunningYO\n\n2. Track: Jensation - Delicious [NCS Release]\nMusic provided by NoCopyrightSounds.\nFree Download / Stream: http://ncs.io/DeliciousYO\n\n3. Voyage by LEMMiNO https://soundcloud.com/lemmino\nCreative Commons  Attribution-ShareAlike 3.0 Unported CC BY-SA 3.0 \nhttp://creativecommons.org/licenses/b...","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/DSoFEerSOrc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/DSoFEerSOrc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/DSoFEerSOrc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/DSoFEerSOrc/sddefault.jpg","width":640,"height":480}},"channelTitle":"7mlc","tags":["soccer","plyometrics","training","football","free kick","7mlc","how to dribble like messi","how to play like messi","professional soccer training","beach soccer training","beach soccer drills","plyometric soccer training","plyometric speed training","free kick training session","curling free kicks","yoga for soccer players","yoga routine for soccer players","yoga for athletes","a day in the life of a soccer player","how to become a professional soccer player","how i became a professional"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Beach Training, Plyometrics, Free Kicks & Yoga Routine | A Day In The Life Of A Soccer Player | Ep.3","description":"In this day in the life of a soccer player episode, I show you my beach training session, plyometric workout, free kick training session and yoga routine. As the season has come to an end, I also discuss my plans for off season. Enjoy!\n\nFOLLOW MY JOURNEY ON SOCIAL MEDIA:\nInstagram: @michaellewiscunningham\nFacebook: facebook.com/michaellewiscunningham\nTwitter: @CunnyGoesHam\nEmail: michaellewiscunningham@gmail.com\n\nBeach Training Workout:\nT Agility Drill: 5 reps\nLateral Hurdles/ Agility Ladder: 5 reps\nDiagonal Agility Course: 5 reps\nObstacle course with pass/receive: 5 reps\nJuggling: 2-3 minutes\n\nPlyometric Training Session:\nBox jumps to depth jumps: 3 sets of 10 reps\nLateral Skates: 3 x 10 reps\nCross Hops: 3 x 5