INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17581, '7Ca6RatWEAqUXeWRYPMG4I1cCyo', '1r3_MkgbQSE', NULL, '{"publishedAt":"2020-06-16T20:49:05Z","channelId":"UCmacCMkgVxGP-XZMj8FTA1Q","title":"Hatha with Harry - Covid Blues Yoga: Quarantine buster yoga for office (and home) workers.","description":"This video is for those people who work on a computer or tablet and anyone stuck at home, due to the global lock-down.\n\nPart one is a twenty minute, full body stretch, specifically designed for people who spend all day sitting at a desk. During this period of homeworking, often the workstation is not optimal. \n\nPart two is a very short sequence that you should do every hour during your working day.\n\nLastly, part three is a bonus section on office ergonomics. Tips and tricks to keep you healthy, in what can be a very unhealthy environment.\n\nDSE and office ergonomics information:\n\nhttps://content.api.worksafe.vic.gov.au/sites/default/files/2018-06/ISBN-Officewise-guide-to-health-and-safety-in-the-office-2006-01.pdf \n\nhttps://www.hse.gov.uk/pubns/indg36.htm \n\n0:00 Credit roll\n0:13 Introduction\n2:49 Twenty minute lunchtime yoga\n23:07 Hourly break\n24:43 Office ergonomics\n27:43 Outro\n29:25 Final thoughts","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/1r3_MkgbQSE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/1r3_MkgbQSE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/1r3_MkgbQSE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/1r3_MkgbQSE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/1r3_MkgbQSE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Harry Tinders","tags":["Yoga","Yoga flow","Slower yoga","Injury-free","Injury-free yoga","Mindfulness","Slow yoga","Whole body wortkout","Urdva hasta","Leg strengthening","Back bends",