INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17586, '-wz1u6r0d6h3fb5_xsXdlyl9B6M', 'fUMyRpWKXFQ', true, '{"publishedAt":"2019-05-29T04:39:00Z","channelId":"UCC-_Ex2PFXtyMrKHKOzlpqg","title":"YOGA for FERTILITY ENDOMETRIOSIS with YogaYin","description":"\"Hi I followed your videos for about 2-3 months and I was pregnant after 2-3 months of following your yoga routines. We were try for approximately 2 years, tried fertility medicines and also went for an IUI but everything failed. I am do glad to came across your channel, it helped me alot. In past 2 days you mayve seen a boost in your subscribers count as I also have a channel www.youtube.com/user/cutekavya I gave you a shout out. Keep up the Good work. Thank you so much\"  Kayva (Face the Glam) 05/25/19\nJoin Yoga Therapist Allannah as she continues to have fantastic success with fertility students. This sequence is for endo & adhesions. Endometriosis affects 1 in 10 women. 30-40% of those struggle with fertility. Symptoms include: pain, nausea, bowel and bladder issues, infertility among many. This video aims to reduce adhesions and pain & targets the pelvis for a greater chance of conception.\nContact Allannah @ https://www.facebook.com/Yogayin/\nThanks for subscribing!! xxx","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/fUMyRpWKXFQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/fUMyRpWKXFQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/fUMyRpWKXFQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/fUMyRpWKXFQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/fUMyRpWKXFQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"YogaYin","tags":["fertility","get pregnant","get pregnant fast","get pregnant sooner","2ww","two week wait","tww","ttc endometriosis","ivf","iui","fet","et","pof","ttc