INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17311, 'KSkZLKfBlRy1dl3QA4kxfUqOf-o', 'BLTdQNqYVpM', true, '{"publishedAt":"2017-04-25T07:07:04Z","channelId":"UCw1XqEl0jSke6Av6zMhIBpQ","title":"Yoga For Diabetes | 5 Effective Yoga Asanas to Keep Diabetes Under Control and Weight Loss","description":"Watch other interesting videos on Yoga for Weight Loss, Yoga For Arthritis, Yoga for Diabetes, Yoga for Beginners and many more on \nhttps://goo.gl/YxVbFK\n\nPresented by : Dr.Ananda Balayogi Bhavanani Of Ananda Ashram ICYER Pondicherry\n\nVajra Asana - 00:03\nArdha Matsyendra Asana - 01:27\nGomukha Asana - 03:19\nVriksha Kriya - 05:24\nJanu Sirasa Sarvanga Asana - 09:33\n\nYoga is a group of physical, mental, and spiritual practices or disciplines which originated in ancient India. Yoga means union of the individual consciousness or soul with the Universal Consciousness or Spirit.\n\nThe science of Yoga imbibe itself the complete essence of the Way of Life, including - Gyan Yoga or philosophy, Bhakti Yoga or path of devotional bliss, Karma Yoga or path of blissful action, and Raja Yoga or path of mind control. Raja Yoga is further divided into eight parts. At the heart of the Raja Yoga system, balancing and unifying these various approaches, is the practice of Yoga Asana.\n\n#yogafordiabetes #howtocurediabetes #yogaasanastocurediabetes #yogaworkout","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/BLTdQNqYVpM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/BLTdQNqYVpM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/BLTdQNqYVpM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/BLTdQNqYVpM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/BLTdQNqYVpM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Geethanjali - Yoga","tags":["Yoga","yoga asanas","