INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17373, '5N_b3Y4vJlBjLL4PNY5KFX6nlrc', 'EG-Qf-5VX_g', true, '{"publishedAt":"2019-03-21T01:05:27Z","channelId":"UCe_XyihUtxuG7IyUnNRz1_g","title":"Rid Yourself of Rigidity Yoga Challenge for Strength and Mobility","description":"Discover new ways to move, release rigidity, and create functional strength and mobility. In this six-class program with Rocky Heron, youll explore the space around you fully and do nontraditional practices that require different muscular activation and coordination than you may be used to. \n\nSign up and get three classes a week for two weeks, delivered directly to your inbox!\n\nThroughout this program, youll prioritize free-flowing movement over alignment and youll use props in unique wayssuch as using a chair to explore vinyasa elements, blocks to increase sensory awareness, and a long dowel (or broomstick) to find deep whole-body release (and more).\n\nThis all-levels program is an ideal experience for anyone who feels theyre stuck in a practice rut or simply wants to get a little more creative in asana.\n\nTake the Course  https://yogainternational.com/ecourse/rid-yourself-of-rigidity-challenge\n\nBecome a Yoga International member and launch your home practice with a free two-week trial: http://bit.ly/2d8SfW1","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/EG-Qf-5VX_g/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/EG-Qf-5VX_g/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/EG-Qf-5VX_g/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/EG-Qf-5VX_g/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/EG-Qf-5VX_g/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga International","tags":["Functional Movement","functional yoga","functional movement and yoga","yoga challenge","functional movement challenge","online yoga challenge","rocky heron","online yoga class","yoga international","yoga and anatomy","yoga for mobility","yoga and joint mobility","yoga therapy","yoga and physical therapy","physical therapy and yoga"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Rid Yourself of Rigidity Yoga Challenge for Strength and Mobility","description":"Discover new ways to move, release rigidity, and create functional strength and mobility. In this six-class program with Rocky Heron, youll explore the space around you fully and do nontraditional practices that require different muscular activation and coordination than you may be used to. \n\nSign up and get three classes a week for two weeks, delivered directly to your inbox!\n\nThroughout this program, youll prioritize free-flowing movement over alignment and youll use props in unique wayssuch as using a chair to explore vinyasa elements, blocks to increase sensory awareness, and a long dowel (or broomstick) to find deep whole-body release (and more).\n\nThis all-levels program is an ideal experience for anyone who feels theyre stuck in a practice rut or simply wants to get a little more creative in asana.\n\nTake the Course  https://yogainternational.com/ecourse/rid-yourself-of-rigidity-challenge\n\nBecome a Yoga International member and launch your home practice with a free two-week trial: http://bit.ly/2d8SfW1"}}', '{"duration":"PT1M1S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1394","likeCount":"25","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''challeng'':6A ''mobil'':10A ''rid'':1A ''rigid'':4A ''strength'':8A ''yoga'':5A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
