INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17441, 'Rivu6J3LWgvl6mac5g0F5UqE4qE', 'SeheoO2wmOs', true, '{"publishedAt":"2020-06-19T07:08:52Z","channelId":"UC4rRkJnJL8bUFaYJWqRhRew","title":"Pilates Arms & Abs / Pilates and Yoga with Jade","description":"Keeping it short and sweet, this routine will target your arms and abdominals. Creating lovely definition in the arms and helping to tighten those tummy muscles. \n\nPlease always go at your own pace, take your time and make sure the sequence feels comfortable for you. \n\nI always love to hear your feedback, I would love to read your comments below. \n\nWould be amazing if you could subscribe to my YouTube channel and follow me on Instagram @pilatesandyogawithjade \n\n#pilates #workout #core\n\n\nBefore you take part in any form of physical activity it is best to make sure you are physically fit to do so. If you have any concerns please contact your doctor prior to participation in each session. Listen to your body throughout the sessions and take options in activities where you feel this may be necessary. Pilates and Yoga with Jade will not be responsible or liable for any injury you may sustain as a result of our online fitness videos","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/SeheoO2wmOs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/SeheoO2wmOs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/SeheoO2wmOs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/SeheoO2wmOs/sddefault.jpg","width":640,"height":480}},"channelTitle":"Pilates and Yoga with Jade","tags":["pilates","yoga","arm workout","ab workout","abs","core","strength","free workout","free ab workout","free yoga","free pilates","home workout"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Pilates Arms & Abs / Pilates and Yoga with Jade","description":"Keeping it short and sweet, this routine will target your arms and abdominals. Creating lovely definition in the arms and helping to tighten those tummy muscles. \n\nPlease always go at your own pace, take your time and make sure the sequence feels comfortable for you. \n\nI always love to hear your feedback, I would love to read your comments below. \n\nWould be amazing if you could subscribe to my YouTube channel and follow me on Instagram @pilatesandyogawithjade \n\n#pilates #workout #core\n\n\nBefore you take part in any form of physical activity it is best to make sure you are physically fit to do so. If you have any concerns please contact your doctor prior to participation in each session. Listen to your body throughout the sessions and take options in activities where you feel this may be necessary. Pilates and Yoga with Jade will not be responsible or liable for any injury you may sustain as a result of our online fitness videos"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT15M37S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"38","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''ab'':3A ''arm'':2A ''jade'':8A ''pilat'':1A,4A ''yoga'':6A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17459, 'ThV_qFJkw77Iwey4ODS3xiJxh0A', 'v0pqjkKoSJE', true, '{"publishedAt":"2020-05-31T10:53:53Z","channelId":"UCxX1LIUdJM2gVoT-4Fs3GKA","title":"Yoga for Freediving with Brinkley Davies - Diaphragm Stretching ( UddiyanaBanda ) and basic flow","description":"Hey everyone,\n\nHere is another free-diving tutorial! \n\nGreat for if you are stuck somewhere cold, or just interested is some exercises to help you with your free-diving from home, these are great to do a few times a week regardless. \nThis video focuses on the basics to diaphragm stretching, and lung warm ups. These diaphragm exercises are know in Yoga as Uddiyana Banda''s, \" Uddiyana \" meaning Upwards Flying, and \" Banda \" meaning hold, lock or tighten. \nDoing these warm-ups help your body to be more comfortable with the feelings of compression when you start diving deeper, having flexible, and strong lungs, diaphragm and surrounding muscles will benefit many different areas of your freediving. \nFollowing this is also a basic yoga flow, for your hips, neck, and feet/ ankle areas, which I like to do before a dive, or when I wake up in the morning. \n\nAs always, never push any movement to the point of pain, progressing in free-diving, and yoga, is about getting to know your body, and being patient. \n\nLet me know in the comments how you went, and SUBSCRIBE for more videos!\n\nINSTAGRAM - for daily adventures below \nwww.instagram.com/brinkleydavies/\n\nWebsite for everything else\nwww.brinkleydavies.com\n\nJewellery I am wearing in my clips \n\nComing soon, watch this space :\n\nhttps://www.instagram.com/bandicoot_bybrinkley/\n\nThanks for watching!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/v0pqjkKoSJE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/v0pqjkKoSJE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/v0pqjkKoSJE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/v0pqjkKoSJE/sddefault.jpg","width":640,"height":480}},"channelTitle":"Brinkley Davies","tags":["Dive","Freedive","Yoga","Training","Breathing","Home","Workout","Ocean","Health","Fitness","Exercise","BrinkleyDavies"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Yoga for Freediving with Brinkley Davies - Diaphragm Stretching ( UddiyanaBanda ) and basic flow","description":"Hey everyone,\n\nHere is another free-diving tutorial! \n\nGreat for if you are stuck somewhere cold, or just interested is some exercises to help you with your free-diving from home, these are great to do a few times a week regardless. \nThis video focuses on the basics to diaphragm stretching, and lung warm ups. These diaphragm exercises are know in Yoga as Uddiyana Banda''s, \" Uddiyana \" meaning Upwards Flying, and \" Banda \" meaning hold, lock or tighten. \nDoing these warm-ups help your body to be more comfortable with the feelings of compression when you start diving deeper, having flexible, and strong lungs, diaphragm and surrounding muscles will benefit many different areas of your freediving. \nFollowing this is also a basic yoga flow, for your hips, neck, and feet/ ankle areas, which I like to do before a dive, or when I wake up in the morning. \n\nAs always, never push any movement to the point of pain, progressing in free-diving, and yoga, is about getting to know your body, and being patient. \n\nLet me know in the comments how you went, and SUBSCRIBE for more videos!\n\nINSTAGRAM - for daily adventures below \nwww.instagram.com/brinkleydavies/\n\nWebsite for everything else\nwww.brinkleydavies.com\n\nJewellery I am wearing in my clips \n\nComing soon, watch this space :\n\nhttps://www.instagram.com/bandicoot_bybrinkley/\n\nThanks for watching!"},"defaultAudioLanguage":"en"}', '{"duration":"PT28M56S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"15704","likeCount":"360","dislikeCount":"12","favoriteCount":"0","commentCount":"24"}', '''basic'':11A ''brinkley'':5A ''davi'':6A ''diaphragm'':7A ''flow'':12A ''freediv'':3A ''stretch'':8A ''uddiyanabanda'':9A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
