INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17502, 'xcSa2wWNrw9mXxKibAaa30_2fcE', '-IVL7TmRK0w', true, '{"publishedAt":"2017-10-17T13:25:43Z","channelId":"UCfC_bmRHcIOrM-qne0idX-w","title":"The Grateful Giraffe - A Kids Yoga Stories Audio Feelings Yoga Book for Kids","description":"Express your feelings through yoga poses for toddlers!\n\nAvailable here: https://www.kidsyogastories.com/product/grateful-giraffe-english/\n\nJoin our six yoga kids from around the world as they learn about various animals and relate their behaviors to our feelings. Be a caring koala, a cranky crocodile, or a curious cat. Visit countries around the world, learn about various animals, and talk about feelings! This feelings yoga book for toddlers and preschoolers includes a list of kids yoga poses and a parent-teacher guide. Ages 2+.\n\nAs a father and as a kid''s yoga teacher, I think this book is simply awesome. It''s a wonderful voyage that invites the kids to travel around the world, to learn about several animals, and also it introduces some different emotions by addressing simple feelings. The text is simple, which is very useful when you are reading stories to kids from 2 to 5 years old, but it can be easily expanded. The yoga poses correspond with pictures, and as they are in a good order, it helps a lot with the class flow. Also, you can encourage the children to make animal noises, making the class much more fun and also letting the kids spend more time on the poses. In addition, the feelings listed in the book can give you an excellent opportunity to work with the kids the expression of their own feelings. Finally, the parent-teacher guide is a wonderful tool ify ou are a parent and you want to introduce yoga to your children, or if youre a kids yoga teacher, it can simply be a source or a reminder of how to teach yoga to children in a properly and funny way. - Martin\n\nThe Grateful Giraffe is a wonderful literacy prompt to encourage even the youngest children to communicate about their feelings. It''s beautifully illustrated, and the corresponding pictures of the yoga poses are great visuals to support the mind-body connection. The text is simple, but provides the perfect starting point for both adults and children to be creative in deciding how to integrate music or props to extend the story and the yoga poses. The parent-teacher guide at the end is also a helpful tool for those who don''t necessarily have a background in yoga or teaching. The Grateful Giraffe is another great resource by Giselle at Kids Yoga Stories to add to your collection! - Vicki\n\nThe Grateful Giraffe is a wonderful book for you and your child. The beautiful illustrations and easy-to-follow yoga poses are a great way to help your child learn and understand different emotions. The yoga sequence is appropriate for children still developing skills and is even more fun when you incorporate the sound effects from the story. The story also includes tips for flowing between theposes and advice for parents or teachers as they guide children on the journey to understand emotions. - Sarah\n\nThe Grateful Giraffe: A Feelings Yoga Book for Toddlers\nby Giselle Shardlow\nKids Yoga Stories\nISBN: 978-1-943648-18-4\nAges 2 to 5\nBuy on the Kids Yoga Stories website: https://www.kidsyogastories.com/product/grateful-giraffe-english/\nBuy on Amazon: https://www.amazon.com/Grateful-Giraffe-Kids-Yoga-Feelings/dp/1943648182/ref=sr_1_1?ie=UTF8&qid=1508246567&sr=8-1&keywords=grateful+giraffe","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-IVL7TmRK0w/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/-IVL7TmRK0w/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/-IVL7TmRK0w/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/-IVL7TmRK0w/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/-IVL7TmRK0w/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"KidsYogaStories","tags":["feelings yoga","yoga books","yoga books for kids","kids yoga stories","yoga poses for toddlers","toddler yoga","kids yoga","yoga in schools","yoga for children","yoga stories","emotions yoga"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"The Grateful Giraffe - A Kids Yoga Stories Audio Feelings Yoga Book for Kids","description":"Express your feelings through yoga poses for toddlers!\n\nAvailable here: https://www.kidsyogastories.com/product/grateful-giraffe-english/\n\nJoin our six yoga kids from around the world as they learn about various animals and relate their behaviors to our feelings. Be a caring koala, a cranky crocodile, or a curious cat. Visit countries around the world, learn about various animals, and talk about feelings! This feelings yoga book for toddlers and preschoolers includes a list of kids yoga poses and a parent-teacher guide. Ages 2+.\n\nAs a father and as a kid''s yoga teacher, I think this book is simply awesome. It''s a wonderful voyage that invites the kids to travel around the world, to learn about several animals, and also it introduces some different emotions by addressing simple feelings. The text is simple, which is very useful when you are reading stories to kids from 2 to 5 years old, but it can be easily expanded. The yoga poses correspond with pictures, and as they are in a good order, it helps a lot with the class flow. Also, you can encourage the children to make animal noises, making the class much more fun and also letting the kids spend more time on the poses. In addition, the feelings listed in the book can give you an excellent opportunity to work with the kids the expression of their own feelings. Finally, the parent-teacher guide is a wonderful tool ify ou are a parent and you want to introduce yoga to your children, or if youre a kids yoga teacher, it can simply be a source or a reminder of how to teach yoga to children in a properly and funny way. - Martin\n\nThe Grateful Giraffe is a wonderful literacy prompt to encourage even the youngest children to communicate about their feelings. It''s beautifully illustrated, and the corresponding pictures of the yoga poses are great visuals to support the mind-body connection. The text is simple, but provides the perfect starting point for both adults and children to be creative in deciding how to integrate music or props to extend the story and the yoga poses. The parent-teacher guide at the end is also a helpful tool for those who don''t necessarily have a background in yoga or teaching. The Grateful Giraffe is another great resource by Giselle at Kids Yoga Stories to add to your collection! - Vicki\n\nThe Grateful Giraffe is a wonderful book for you and your child. The beautiful illustrations and easy-to-follow yoga poses are a great way to help your child learn and understand different emotions. The yoga sequence is appropriate for children still developing skills and is even more fun when you incorporate the sound effects from the story. The story also includes tips for flowing between theposes and advice for parents or teachers as they guide children on the journey to understand emotions. - Sarah\n\nThe Grateful Giraffe: A Feelings Yoga Book for Toddlers\nby Giselle Shardlow\nKids Yoga Stories\nISBN: 978-1-943648-18-4\nAges 2 to 5\nBuy on the Kids Yoga Stories website: https://www.kidsyogastories.com/product/grateful-giraffe-english/\nBuy on Amazon: https://www.amazon.com/Grateful-Giraffe-Kids-Yoga-Feelings/dp/1943648182/ref=sr_1_1?ie=UTF8&qid=1508246567&sr=8-1&keywords=grateful+giraffe"}}', '{"duration":"PT3M","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"14069","likeCount":"55","dislikeCount":"6","favoriteCount":"0","commentCount":"0"}', '''audio'':8A ''book'':11A ''feel'':9A ''giraff'':3A ''grate'':2A ''k