ga is a great alternative for active kids.\n\nRead more about the benefits of climbing for kids:\nhttps://www.climbfitkirrawee.com/blog/2019/4/24/indoor-rock-climbing-for-kids-the-benefits\n\nJenny Mills is our resident yoga instructor and runs classes at our gym every week. Check out some 20min sequences for climbers here:\nhttps://www.youtube.com/playlist?list=PLp7z-hoVmx1k2JqTf1fvtUCL_F5U_33ch\n\nhttps://www.climbfit.com.au/"}}', '{"duration":"PT4M58S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"22","likeCount":"0","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''climb'':1A,6A ''fit'':2A ''kid'':5A ''shape'':7A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
