INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17570, 'brHr7Ir2gunMddPg50Opo_cbO68', 'cUucdmXsunw', true, '{"publishedAt":"2017-01-26T17:15:11Z","channelId":"UCuKSwJVbbyIimwv3ic9slZw","title":"Puppy Pose - Yoga for Beginners","description":"Puppy Pose is an excellent yoga pose to open your shoulders, lengthen your spine, and ease pain in the lower back. Keep returning to this video and practice this pose regularly to receive these awesome benefits.\n\nTo do Puppy Pose, come to your hands and knees. Stack your hips over your knees. Press your shins and tops of feet into the ground. Keeping your hands shoulder distance apart, walk the hands forward until your forehead comes to the ground. If the shoulders aren''t as open place a yoga block or large book under the forehead. Avoid letting your back arch and your belly/ribs thrust forward to the ground. Keep a long straight spine. Take 10+ breaths here for sweet benefits.\n\nSubscribe to the channel so we can grow your yoga practice together!\nFor more yoga tips and fun! HTTPS://briyoga.com\nInstagram: http://instagram.com/brianadeckard\nFacebook: https://www.facebook.com/Yoga-With-Bri-557387274410249/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/cUucdmXsunw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/cUucdmXsunw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/cUucdmXsunw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/cUucdmXsunw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/cUucdmXsunw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Bri","tags":["Puppy pose","yoga pose","beginners yoga"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Puppy Pose - Yoga for Beginners","description":"Puppy Pose is an excellent yoga pose to open your shoulders, lengthen your spine, and ease pain in the lower back. Keep returning to this video and practice this pose regularly to receive these awesome benefits.\n\nTo do Puppy Pose, come to your hands and knees. Stack your hips over your knees. Press your shins and tops of feet into the ground. Keeping your hands shoulder distance apart, walk the hands forward until your forehead comes to the ground. If the shoulders aren''t as open place a yoga block or large book under the forehead. Avoid letting your back arch and your belly/ribs thrust forward to the ground. Keep a long straight spine. Take 10+ breaths here for sweet benefits.\n\nSubscribe to the channel so we can grow your yoga practice together!\nFor more yoga tips and fun! HTTPS://briyoga.com\nInstagram: http://instagram.com/brianadeckard\nFacebook: https://www.facebook.com/Yoga-With-Bri-557387274410249/"}}', '{"duration":"PT3M30S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"36932","likeCount":"197","dislikeCount":"11","favoriteCount":"0","commentCount":"13"}', '''beginn'':5A ''pose'':2A ''puppi'':1A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
