INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17842, 'yRo_Kl4NYX3ftdp4qWYBBmumWPs', 'pGAP8a40-iU', NULL, '{"publishedAt":"2020-04-07T06:00:16Z","channelId":"UC_1Md-K61-ps1Rs18VAYmkw","title":"LOCKDOWN VINYASA FLOW - IMPROVE YOUR yoga PRACTICE | Build up to WARRIOR 2 pose | 40 min sequence.","description":"Lockdown vinyasa flow yoga. This is a great 40 min sequence for you to build up to warrior 2 pose. This class is perfect for you if you are new to yoga, a beginner, or just looking to improve your yoga practice, your body positioning and alignment in the foundational yoga poses. This class is also great for athletes looking to take a break or supplement their training with slower work that balances the body. \n\nAll you need is a mat or a carpet and an open mind. \n\nNew vinyasa flows available Monday through Friday at 8am, followed by live classes each Saturday morning at 9!\n\nLockdown Vinyasa Flow Series:\nWeek 1 - Beginner yoga\nWeek 2 - Build up to basic poses\nWeek 3 - Journey to the core\n\nJoin the Pow!tribe. \n\nWebsite: https://www.powtribeyoga.com/\nInstagram: https://www.instagram.com/powtribeyoga/\nFacebook: https://bit.ly/powtribefb\n\nPeace + love\nLuke\n\n****\n\nPow!tribe is a yoga + lifestyle brand that seeks to build resilient, whole-hearted people through yoga. Life is full of uncertainty. There is so much we cannot control. We can, however, control what we think and what we do: by connecting our bodies and our minds through yoga we build mindfulness. \n\nRather than being reactive, and operating from an unconscious place of fear, doubt, and mistrust, we learn to slow down and be receptive. We learn to meet the world from a place of patience, curiosity, balance, and trust. \n\nThank you so much for watching and subscribing to our channel!\n\n\n\nDISCLAIMER:\n\nAll content on our channel is subject to copyright or other intellectual property ownership by Pow!trib