n":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"56","likeCount":"9","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''2'':12A ''40'':14A ''build'':8A ''flow'':3A ''improv'':4A ''lockdown'':1A ''min'':15A ''pose'':13A ''practic'':7A ''sequenc'':16A ''vinyasa'':2A ''warrior'':11A ''yoga'':6A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18148, 'aLCCPmxer9eeMTa_gQ0OuUzSm-U', 'n2btl9nU-QA', NULL, '{"publishedAt":"2020-07-21T21:15:18Z","channelId":"UC1vTlARSd51P8neARPucMsQ","title":"45 min Yin Yoga for Glutes, Hip Flexors, Hamstrings and IT Bands ... Perfect for Hikers!","description":"Hello friends, \n\nI am offering a 45 minute, yin yoga practice filmed on the beautiful Bay of Fundy in Saint John, Canada. We hang out in shapes for 3-5 minutes to target the four quadrants of the thigh. This practice is for anyone....but it might feel extra juicy if you''ve been doing a little more hiking lately\n\nI don''t offer the use of any props; however, if you prefer to use props, please do! \n\nPractice Outline:\nButterfly\nDragon\nSleeping Swan/ Figure 4\nHalf Butterfly\nCorpse\n\nThank you so much for subscribing and sharing with friends\n\nHappy Hiking, \n\nBrittany Timberlake\n\n#yinyoga #yinyogawithoutprops #timberlakeyoga\n\n\n Prefer music when practicing with me? Feel free to listen to my \"Yin Vibes\" playlist on Spotify:\n\nhttps://open.spotify.com/playlist/27ldweGwyJgc6UVJSex6x5?si=RDfKM1p8TXCevcYTlmFPWQ\n\n\nTimberlake Yoga - Disclaimer:\nPlease consult with your physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Timberlake Yoga from any and all claims or causes of action, known or unknown, arising out of Timberlake Yogas negligence.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/n2btl9nU-QA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/n2btl9nU-QA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/n2btl9nU-QA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.