all risk of injury to yourself, and agree to release and discharge Timberlake Yoga from any and all claims or causes of action, known or unknown, arising out of Timberlake Yogas negligence."}}', '{"duration":"PT45M57S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"288","likeCount":"20","dislikeCount":"1","favoriteCount":"0","commentCount":"3"}', '''45'':1A ''and'':10A ''bands'':12A ''flexors'':8A ''for'':5A,14A ''glutes'':6A ''hamstrings'':9A ''hikers'':15A ''hip'':7A ''it'':11A ''min'':2A ''perfect'':13A ''yin'':3A ''yoga'':4A', '2020-07-24 09:35:22.027738', '2020-07-24 09:35:22.027738');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18233, 'qpe-9fykYthDLZ6VWvrcHVxxiaw', 'Vn3aXKgMXTs', NULL, '{"publishedAt":"2019-09-29T10:30:43Z","channelId":"UCfbpaTTbw2FKqCgcKQMPlyw","title":"30 Minutes HATHA YOGA CLASS w. VINYASA INFLUENCE (all levels) by Filippo in Maastricht Netherlands","description":"Yoga - anytime - anywhere. With SoultoSoul. \nStart your Yoga experience today with SoultoSoul Yoga. \n\nJoin our 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) with Filippo from Germany in Maastricht, Netherlands and you will see how easy it is to enter the world of Yoga without feeling any discomfort or having to be flexible! Yoga will support your overall happiness and health! Today Filippo is sharing his own personal beautiful 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! All the beautiful benefits of Yoga are explained in a simple and easy to understand way on our website, so please enjoy this 130 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) and then have a look at our website! \n\nOn our website each single pose is described which will support you getting into the benefits of this 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) with Filippo! All our Yoga content is organised in a way that gives everyone the possibility to start their own Yoga journey anytime anywhere. Join Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) now and read through the explanation of each posture on the website to improve your practice.\n\nIf you like Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) in Maastricht, Netherlands please continue with our other classes, to get a broad variety of Yoga classes to practice Yoga at home anytime anywhere. \n\nhttps://youtu.be/1XaPrUasz8k\nA 30 Minutes beginners class if you are totally new to Yoga! Ally is a fabulous Yoga teacher from Australia that makes your start to Yoga easier than you could''ve ever imagined! With her beautiful smile and easy to understand explanation and demonstration of each posture, Ally''s 30 minutes beginners class is a good addition if Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) looks too challenging for you or if you simply want to practice more simple today or get into the basics of Hatha Yoga! \n\nhttps://youtu.be/u-SFdqQQ6Zo\nSurya Namaskar (Sun Salutation) with Ally is for everyone who wants to learn the Surya Namaskar Sequence (Sun Salutation) in particular including how to breathe! Surya Namaskar (Sun Salutation) is a great addition to Filippos 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) in Maastricht, Netherlands!\n\nhttps://youtu.be/5lsvR4Q1Nmg\nThe most relaxed form of Yoga is surely Yoga Nidra! In our 15 Minutes Yoga Nidra Practice with Filippo and Gopi you will step into a yoga practice that does not require any movement! Filippos 15 Minutes Yoga Nidra Practice is a great counter practice for the 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) and will bring you peace and make you relax on a much deeper level than even sleep. \n\nhttps://youtu.be/ihSqUpwjNQo\nAnd last but not least! Filippos 10 Minutes Pranayama Practice (Yogic Breathing)! Pranayama is part of every yoga class, so also of Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! See how Filippo explains and practices Pranayama (Yogic Breathing) in a detailed video and let Pranayama become part of your practice! Filippos 10 Minutes Pranayama Practice (Yogic Breathing) is fantastic before you start his 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! \n\nYoga anytime, anywhere with Filippo''S 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! \n\nStart your daily dose of short Yoga Practice with Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! \n\nYou still think Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) is not enough? You feel hungry or your ears are longing for some music? \n\nhttps://youtu.be/26awW1ubzHE\nCheck out our Cookbook \"Yoga Food by SoultoSoul Kitchen\" and find beautiful Sattvic recipes, all vegetarian and free from any eggs onion and garlic for your personal yogic diet! This cookbook supports your practice from Zoes 10 Minutes Hatha Yoga Sequence! \n\nhttps://youtu.be/8p_JpJGZVS0\nOur music album is a mix of ancient yogic chants from the east and meaningful songs from the west! 23 Songs, now available on one album on all platforms! Get it now on Spotify, iTunes, Amazon, Google Play and CDBaby Store! More Infos on our website! \n\nOr you can listen to all Songs conveniently here: \nhttps://youtu.be/_s_geXn37uY\n\nThanks for tuning! \n\n( SoultoSoul Yoga - Yoga Netherlands - Beginners Yoga in Holland - Beginner Yoga Klasse in Holland- Yoga in Holland - Maastricht Yoga - Yoga with Filippo - 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) - 30 Minutes Yoga - 30 Minutes Yoga Sequence - 30 Minutes Hatha Yoga Sequence - Yoga teacher training Mayapur - 30 Minutes online Yoga - Short yoga sequence - Anytime Yoga - Anywhere Yoga - Yoga in Mayapur, India - Yoga in India - Yoga in Europe - Outdoor Yoga )","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Vn3aXKgMXTs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Vn3aXKgMXTs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Vn3aXKgMXTs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Vn3aXKgMXTs/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Vn3aXKgMXTs/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"SoultoSoul","tags":["SoultoSoulFriends","Soul to Soul","SoultoSoul","Filippo Oglialoro","Pippo Om","Beginners Yoga","Yoga in Holland","Netherlands Yoga","Yoga in Maastricht","SoultoSoul Yoga","Mayapur Yoga","Short Yoga","Easy Yoga Class","Simple Yoga Class","Beginners Yoga Class","Advanced Yoga Class","Introduction to Yoga","daily yoga class","weekly yoga class","easy yoga sequence","yoga at home","yoga introduction","Yoga in Mayapur","Yoga in India","Online yoga India","30 Minutes Hatha Yoga Class","Everyday Yoga"],"categoryId":"27","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"30 Minutes HATHA YOGA CLASS w. VINYASA INFLUENCE (all levels) by Filippo in Maastricht Netherlands","description":"Yoga - anytime - anywhere. With SoultoSoul. \nStart your Yoga experience today with SoultoSoul Yoga. \n\nJoin our 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) with Filippo from Germany in Maastricht, Netherlands and you will see how easy it is to enter the world of Yoga without feeling any discomfort or having to be flexible! Yoga will support your overall happiness and health! Today Filippo is sharing his own personal beautiful 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! All the beautiful benefits of Yoga are explained in a simple and easy to understand way on our website, so please enjoy this 130 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) and then have a look at our website! \n\nOn our website each single pose is described which will support you getting into the benefits of this 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) with Filippo! All our Yoga content is organised in a way that gives everyone the possibility to start their own Yoga journey anytime anywhere. Join Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) now and read through the explanation of each posture on the website to improve your practice.\n\nIf you like Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) in Maastricht, Netherlands please continue with our other classes, to get a broad variety of Yoga classes to practice Yoga at home anytime anywhere. \n\nhttps://youtu.be/1XaPrUasz8k\nA 30 Minutes beginners class if you are totally new to Yoga! Ally is a fabulous Yoga teacher from Australia that makes your start to Yoga easier than you could''ve ever imagined! With her beautiful smile and easy to understand explanation and demonstration of each posture, Ally''s 30 minutes beginners class is a good addition if Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) looks too challenging for you or if you simply want to practice more simple today or get into the basics of Hatha Yoga! \n\nhttps://youtu.be/u-SFdqQQ6Zo\nSurya Namaskar (Sun Salutation) with Ally is for everyone who wants to learn the Surya Namaskar Sequence (Sun Salutation) in particular including how to breathe! Surya Namaskar (Sun Salutation) is a great addition to Filippos 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) in Maastricht, Netherlands!\n\nhttps://youtu.be/5lsvR4Q1Nmg\nThe most relaxed form of Yoga is surely Yoga Nidra! In our 15 Minutes Yoga Nidra Practice with Filippo and Gopi you will step into a yoga practice that does not require any movement! Filippos 15 Minutes Yoga Nidra Practice is a great counter practice for the 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) and will bring you peace and make you relax on a much deeper level than even sleep. \n\nhttps://youtu.be/ihSqUpwjNQo\nAnd last but not least! Filippos 10 Minutes Pranayama Practice (Yogic Breathing)! Pranayama is part of every yoga class, so also of Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! See how Filippo explains and practices Pranayama (Yogic Breathing) in a detailed video and let Pranayama become part of your practice! Filippos 10 Minutes Pranayama Practice (Yogic Breathing) is fantastic before you start his 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! \n\nYoga anytime, anywhere with Filippo''S 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! \n\nStart your daily dose of short Yoga Practice with Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels)! \n\nYou still think Filippo''s 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) is not enough? You feel hungry or your ears are longing for some music? \n\nhttps://youtu.be/26awW1ubzHE\nCheck out our Cookbook \"Yoga Food by SoultoSoul Kitchen\" and find beautiful Sattvic recipes, all vegetarian and free from any eggs onion and garlic for your personal yogic diet! This cookbook supports your practice from Zoes 10 Minutes Hatha Yoga Sequence! \n\nhttps://youtu.be/8p_JpJGZVS0\nOur music album is a mix of ancient yogic chants from the east and meaningful songs from the west! 23 Songs, now available on one album on all platforms! Get it now on Spotify, iTunes, Amazon, Google Play and CDBaby Store! More Infos on our website! \n\nOr you can listen to all Songs conveniently here: \nhttps://youtu.be/_s_geXn37uY\n\nThanks for tuning! \n\n( SoultoSoul Yoga - Yoga Netherlands - Beginners Yoga in Holland - Beginner Yoga Klasse in Holland- Yoga in Holland - Maastricht Yoga - Yoga with Filippo - 30 Minutes Hatha Yoga Class with Vinyasa Influence (all levels) - 30 Minutes Yoga - 30 Minutes Yoga Sequence - 30 Minutes Hatha Yoga Sequence - Yoga teacher training Mayapur - 30 Minutes online Yoga - Short yoga sequence - Anytime Yoga - Anywhere Yoga - Yoga in Mayapur, India - Yoga in India - Yoga in Europe - Outdoor Yoga )"},"defaultAudioLanguage":"en"}', '{"duration":"PT36M18S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"94","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''30'':1A ''all'':9A ''by'':11A ''class'':5A ''filippo'':12A ''hatha'':3A ''in'':13A ''influence'':8A ''levels'':10A ''maastricht'':14A ''minutes'':2A ''netherlands'':15A ''vinyasa'':7A ''w'':6A ''yoga'':4A', '2020-07-24 09:35:28.272232', '2020-07-24 09:35:28.272232');
