sion or back pain,  sciatica or pregnancy back pain & more.\n\nEither you are looking for an easy morning yoga flow, power yoga flow,  may be 1 hour total body workout or gentle bedtime yoga stretches you can find it all here. \n\n___________________________\n\n// W A T C H  M O R E \n\n  If you enjoyed this yoga class, find more like this here | http://bit.ly/1hourgayatriyoga\n\n___________________________\n\n\n//  F O L L O W \n\n instagram | http://instagram.com/_kristinamatskevich\n facebook | http://facebook.com/gayatriyogaco\n twitter | http://twitter.com/gayatriyogaco\n pinterest | http://pinterest.com/gayatriyogaco\n\n___________________________\n\n// D I S C L A I M E R\n\n All information is for educational purposes only. Please consult your doctor about participating in any activities suggested in Gayatri Yoga videos. You should be in good physical condition and be able to participate in the exercise without a guidance of a personal instructor. By taking part in these activities you acknowledge the risk of testing your mental & physical limits, which carries the potential for injury. By proceeding to participate in the activities presented in the video you represent & warrant that you are physically fit & have no medical condition that would prevent your full participation in the activity. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume full responsibility for all & any risks , injuries to yourself, damages, known or unknown,  and agree to release and discharge.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/STZYjx_H270/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/STZYjx_H270/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/STZYjx_H270/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/STZYjx_H270/sddefault.jpg","width":640,"height":480},"maxres":{"u