INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17751, 'N1z0tRIfHsQgjozQj3Z9thWlYJ8', 'IgJGrrgZpEE', NULL, '{"publishedAt":"2019-02-24T18:40:32Z","channelId":"UCrtTMWDx4u1dVKMpXNhjwpA","title":"Yoga for your 2nd Chakra - Sacral Chakra Yoga Class - Five Parks Yoga","description":"This yoga class focuses on movements which will stimulate the sacral chakra. The 2nd chakra - sacral chakra - is associated with qualities such as self-expression, transformation, creativity, freedom and pleasure. This class is designed to, get you in the flow. \nThis yoga class begins with deep breathing and an opportunity to set an intention for class. At around the 5-minute mark in class, we begin to move the body by practicing stomach grinds, side bends, and spinal twists with flow. Consistent movement is included throughout the warm-up portion of this class. Enjoy free flowing movements that stimulate your energy, like sunflowers, which flow into sun salutations and a standing posture flow. This yoga class keeps you in almost constant movement, with opportunities for freedom and creativity. Included toward the end of this class is a flowing sequence of balancing poses, which will keep your mind and body engaged. Movement and flow are the heart of this class. I hope you enjoy! Let me know what you think in the comments below!\n\nJoin Erin in Costa Rica! Learn more about Erin''s upcoming yoga retreats!  http://fiveparksyoga.com/yoga-retreats/\n\nWant to help support Erin & Five Parks Yoga create even more classes? Consider becoming a supporter at: \nhttp://fiveparksyoga.com/support/\n\nYoga Instructor: Erin Sampson\nLocation: Tamarindo, Costa Rica\nVenue: Casa Colorado http://CasaColoradoCR.com\n\nVisit us Online: http://FiveParksYoga.com\nFollow us on Facebook: https://www.facebook.com/FiveParksYoga\nFollow us on Instagram: https://www.instagram.com/fiveparksyoga/\n\nSign up for news about Erin''s upcoming yoga retreats!\nhttp://fiveparksyoga.com/yoga-retreats/\n\nDo you have a class request for Erin? Let her know!\nhttp://fiveparksyoga.com/classrequest/\n\nWant to know Erin''s favorite Yoga Mat? Favorite Yoga Pants?\nhttp://fiveparksyoga.com/reviews/\n\nProduced by Tamarindo Films: http://tamarindofilms.com/\n\n#yoga #chakrayoga #fiveparksyoga #SacralChakra","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/IgJGrrgZpEE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/IgJGrrgZpEE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/IgJGrrgZpEE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/IgJGrrgZpEE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/IgJGrrgZpEE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Five Parks Yoga w/ Erin Sampson","tags":["Yoga","vinyasa","yoga class","flow","vinyasa flow","free yoga","Erin Sampson","Erin yoga teacher","Yoga Classes","Free Yoga Class","Five Parks","vinyasa flow yoga class","Costa Rica Yoga Class","Tamarindo Yoga","Free Online Yoga Class","sacral chakra","2nd chakra","chakra yoga class","second chakra","chakra yoga","1 hour yoga","erin sampson yoga","sacral chakra yoga","chakra yoga flow","chakra yoga poses","second chakra yoga","second chakra opening","60 minute yoga","hour long yoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga for your 2nd Chakra - Sacral Chakra Yoga Class - Five Parks Yoga","description":"This yoga class focuses on movements which will stimulate the sacral chakra. The 2nd chakra - sacral chakra - is associated with qualities such as self-expression, transformation, creativity, freedom and pleasure. This class is designed to, get you in the flow. \nThis yoga class begins with deep breathing and an opportunity to set an intention for class. At around the 5-minute mark in class, we begin to move the body by practicing stomach grinds, si