INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18087, 'Z5XCnHp9bFsxddh2YQFwHFMUxLk', '2qLt2M4v-cI', NULL, '{"publishedAt":"2015-06-14T01:36:47Z","channelId":"UCWN2FPlvg9r-LnUyepH9IaQ","title":"Peaceful Yoga Workout  Core & Balance | Jane of the Jungle Flow","description":"www.bohobeautiful.life\n\nThis 10 min yoga sequence will work your core, help you build better balance and get your heart rate up to burn some calories. \nShot at Surf Villa Vistas, in Santa Teresa, Costa Rica.\n\nThis intermediate level yoga practice is here to strengthen those abs and stretch your body all at the same time. A lot of us always wonder how do you improve your sense of balance? What yoga exercises can you do to feel stronger? Im looking to advance my yoga practice for control of my body? We''ll working your abs through a series of standing and seated yoga postures will definitely improve all of that! \n\nThis is a great practice to do earlier in the day so you can feel balanced and energized for the rest of your day. Remember, don''t worry if you can''t get all the poses perfectly. Yoga is not about being perfect, its about what you learn on your journey through the entire process. Each pose will benefit you in different ways so allow yourself to feel completely content wherever you are in the pose at any given time. \n\nStretch, Strengthen, and Enjoy!\n\nxo Juliana \n\nPS. If you want to see more of this villa, check out the Surf Vista Villas website. Great place to stay in Costa Rica!!\n www.surfvistavillas.com \n\n---------------------------------------------------------------------------------------------\n\nThank you so much for watching and subscribing to our channel! \nLet''s Connect!\n\nPinterest- https://www.pinterest.com/bohobeautiful1\nTwitter- https://twitter.com/boho_beautiful\nInstagram- http://instagram.com/bohobeautifullife\n\nhttp://www.bohobeautiful.life\n----------------------------