ove all of that! \n\nThis is a great practice to do earlier in the day so you can feel balanced and energized for the rest of your day. Remember, don''t worry if you can''t get all the poses perfectly. Yoga is not about being perfect, its about what you learn on your journey through the entire process. Each pose will benefit you in different ways so allow yourself to feel completely content wherever you are in the pose at any given time. \n\nStretch, Strengthen, and Enjoy!\n\nxo Juliana \n\nPS. If you want to see more of this villa, check out the Surf Vista Villas website. Great place to stay in Costa Rica!!\n www.surfvistavillas.com \n\n---------------------------------------------------------------------------------------------\n\nThank you so much for watching and subscribing to our channel! \nLet''s Connect!\n\nPinterest- https://www.pinterest.com/bohobeautiful1\nTwitter- https://twitter.com/boho_beautiful\nInstagram- http://instagram.com/bohobeautifullife\n\nhttp://www.bohobeautiful.life\n---------------------------------------------------------------------------------------------\n\nShot In Beautiful Santa Teresa, Costa Rica\nSurf Vista Villas\nwww.surfvistavillas.com\n\nVideo Production- Mark Spicoluk"},"defaultAudioLanguage":"en"}', '{"duration":"PT14M30S","dimension":"2d","definition":"hd","caption":"true","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"387391","likeCount":"4694","dislikeCount":"70","favoriteCount":"0","commentCount":"177"}', '''balance'':5A ''core'':4A ''flow'':10A ''jane'':6A ''jungle'':9A ''of'':7A ''peaceful'':1A ''the'':8A ''workout'':3A ''yoga'':2A', '2020-07-02 06:17:29.228894', '2020-07-02 06:17:29.228894');
