stent yoga practice.\n\nTry one of the free classes on our channel then head over to www.yogaforbjj.net and sign up to unlock video programs specific to your needs and start improving yourself today.\n\nNew videos every week for grapplers that want to optimize the body for Brazilian jiu jitsu and life!\n- Train smart - Fight Forever\n\nWebsite: www.yogaforbjj.net\nFacebook: https://www.facebook.com/yogaforbjj/\nInstagram : https://www.instagram.com/yogaforbjj/?hl=en\nTwitter: https://twitter.com/yogaforbjj"},"defaultAudioLanguage":"en"}', '{"duration":"PT9M25S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"9112","likeCount":"222","dislikeCount":"2","favoriteCount":"0","commentCount":"7"}', '''bjj'':9A ''class'':3A ''flow'':2A ''for'':4A,8A ''hips'':6A ''tight'':5A ''yoga'':1A,7A', '2020-07-02 06:17:29.228894', '2020-07-02 06:17:29.228894');
