INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17750, 'r-SZZob87pjr8CAZj1ENiHCOfs8', 'Ufz_FIVyDp0', NULL, '{"publishedAt":"2020-06-23T15:30:54Z","channelId":"UCzM1uzyY89NFYZxr7jO0KXA","title":"Energy Building Yoga Flow for when You are Exhausted | Yoga for Energy | 40 Minute Yoga Practice","description":"Do you ever come to your yoga mat and feel too tired to move? Then this practice is for you. We''ll start in a resting position, slowly begin to build energy with gentle stretches, and eventually work into a few sun salutations and standing postures followed by strengthening poses. Practice ends with a restorative pose to further help you fill up your inner tank. Sometimes it''s hard to start... this practice honors that and yet - gets you moving! Join me!\n______________\n\nYoga Props I LOVE\nTravel Yoga Mat: http://amzn.to/2zx6xbM\nHome Yoga Mat: http://amzn.to/2yLun3C\nYoga Bolster: http://amzn.to/2jtxb2t\nYoga Block: http://amzn.to/2yMYVBJ\nYoga Blanket: http://amzn.to/2yL7xZS\n______________\n\nJoin me for one of my FREE curated yoga programs (when you sign up you''ll receive emails straight to your inbox from me guiding you step-by-step through the program):\n\n  7-day Love Thyself Yoga Journey\nhttp://www.amypatee.com/lovethyself/\n\n  5-days of Daily Ritual:\nhttp://www.amypatee.com/5-days-of-dai...\n\n  7-day Yoga Detox Journey: \nhttp://www.amypatee.com/detox-journey/\n\n______________\n\nStay connected! \nBe sure to subscribe to my channel as I release new videos often!\n\n  Instagram: https://www.instagram.com/amypatee/\n  Facebook: https://www.facebook.com/AmyPateeYoga/\n  Insight Timer: http://insig.ht/amypatee\n\nLearn about all of my offerings here: https://www.amypatee.com\n______________\n\n*DISCLAIMER: Please consult a doctor or medical professional before bringing any new type of exercise into your routine and work with caution. While the information provided by A