INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17790, 'K52YCkwlisEHYtqdVINRzZy-DAw', 'qmaMm2P6y78', NULL, '{"publishedAt":"2019-09-06T11:30:05Z","channelId":"UC_xYALq063ZWm-26IeG9cCQ","title":"Day 7 - Surya Namaskr | Fifteen days of Yoga for Beginners","description":"Welcome to Day Seven of the 15 days of Yoga series for beginners by Apsara Vydyula. In this class, we learn how to do Sun Salutation or Surya Namaskr\n\n#SuryaNamaskar #BeginnersYoga #SunSalutation\n\nThe Sun Salutation is a sequence of 12 powerful yoga poses. Besides being a great cardiovascular workout, Surya Namaskar is also known to have an immensely positive impact on the body and mind. \n\nBesides good health, Surya Namaskar also provides an opportunity to express gratitude to the sun for sustaining life on this planet.\n\nIn this class Apsaea will show is how to do this effective full body work out.\n\nLocation courtesy - The Park Elanza, Chennai\n\nFacebook : https://www.facebook.com/VentunoYoga\nTwitter : https://www.twitter.com/VentunoYoga\nYouTube : https://www.youtube.com/user/VentunoYoga\nInstagram : https://www.instagram.com/ventunoyoga\n\n\nA Ventuno Production https://www.ventunotech.com\n\n\nDISCLAIMER:\n\nWe strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/qmaMm2P6y78/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/qmaMm2P6y78/mqdefault.jpg","width":320,"height":180},"high":{"u