nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself."},"defaultAudioLanguage":"en"}', '{"duration":"PT16M6S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"9215","likeCount":"233","dislikeCount":"7","favoriteCount":"0","commentCount":"7"}', '''7'':2A ''beginn'':10A ''day'':1A,6A ''fifteen'':5A ''namaskr'':4A ''surya'':3A ''yoga'':8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17804, 'axujuFV4WSjcNOVYQxyUp444m9I', '67GBOodJapM', NULL, '{"publishedAt":"2020-06-26T16:02:13Z","channelId":"UCxXSonb3zhnlI-MGcD3eotw","title":"Yoga for Tight Hips and Lower Back | Yoga for BJJ","description":"Today we start with a massage for our spine by rolling it out a few times. Then we transition to lubricating our joints by enjoying a couple spinal twists.\n\nMoving into King Arthur Pose we practice an active stretch through the hip flexors and quads, while enjoying a stretch to the lower back.\n\nBecause it is our birthday, we get to enjoy the sequence twice in this video (just a little faster the second time around).\n\nYoga for BJJ is designed to help people improve themselves on and off the mats. Using yoga specific stretches and flows that are relevant to jiu jitsu to help you increase your flexibility, rate of motion, balance and injury prevention. \nWhether you are grappling once or twice a week or a full time athlete we like to make sure we have videos for everyone so if you need the complete startup program or our \"yoga for rocks\" program or even our yoga for 40+ series we have it waiting for you.\n\nWe offer a library of videos organized into programs. They include tutorials and they cover all of those areas that grapplers need to work on the most. Stiffness in the lower back, hips, hamstring, shoulders, neck, legs... can all be a thing of the past.\n\nWe don''t offer magical results, but feedback from 1000+ members and our experience makes us confident that you can extend your career on the mats with consistent yoga practice.\n\nTry one of the free classes on our channel then head over to www.yogaforbjj.net and sign up to unlock video programs specific to your needs and start improving yourself today.\n\nNew videos every week for grapplers that want to optimize the body for BJJ and life!\n- Train smart - Fight Forev