INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17621, 'SNf1-YYpJGRod73UgzoD7l2fGcU', '__L1Qbu5CFM', NULL, '{"publishedAt":"2020-06-21T20:03:36Z","channelId":"UCeXYdqx9Sm2L4ONS2aLvLhA","title":"Yoga Phase 0","description":"A short and gentle seated yoga practice, designed for doing sitting in bed or on the floor. It exercises your lungs a little bit, stretches out your back, and begins to engage your legs muscles. Good for those who are not yet getting out of bed much, but want to do a little something to move their body. I put this sequence together for myself after my back started to feel terrible from laying in bed all day. Once I could tolerate sitting up for extended periods, I moved on to Phase 1.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/__L1Qbu5CFM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/__L1Qbu5CFM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/__L1Qbu5CFM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/__L1Qbu5CFM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/__L1Qbu5CFM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Johanna Turk","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga Phase 0","description":"A short and gentle seated yoga practice, designed for doing sitting in bed or on the floor. It exercises your lungs a little bit, stretches out your back, and begins to engage your legs muscles. Good for those who are not yet getting out of bed much, but want to do a little something to move their body. I put this sequence together for myself after my back started to feel terrible from laying in bed all day. Once I could tolerate sitting up for extended periods, I moved on to Phase 1."}}', '{"duration":"PT7M3S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"18","likeCount":"0","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''0'':3A ''phase'':2A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17643, 'nndygBv9rY7zKNOpo9RAtCFJZUQ', 'VGEY6c4-T7Q', NULL, '{"publishedAt":"2020-01-07T01:30:01Z","channelId":"UCvDc7jgAYAjbNqvWjbovVQw","title":"18 Days of Yoga - DAY 7. Iyengar Yoga Sequence","description":"18 Days of Yoga - DAY 7. Iyengar Yoga Sequence\n\nFollowing the success of our 30 Days of Yoga, 13 Days of Yoga and 19 Days of Yoga series, this year we have taken a slightly different approach for our 18 Days of Yoga. Days 1, 7 and 13, are longer sequences where we have done voiceovers, rather than talking to camera. Lin, in the white top, will be showing the classic versions of poses and Leo, in the dark top, will be showing modified versions of the poses using props. The modified versions are for those who find the pose difficult, or who wish to improve their work in the pose. In the subsequent days, we teach three of the poses which are in the previous sequences in more detail. 18th January 2019 will be the fifth annual National Iyengar Yoga Day in the UK and Ireland to celebrate the teachings of Guruji, B.K.S. Iyengar, and to promote Iyengar yoga nationally. Events will include free taster classes and celebrations of his life in Iyengar Yoga Institutes and centres throughout the country. ''Yoga with Lin and Leo'' channel is leading up to this day with a series of sequences. In the Iyengar tradition, these sequences would be regarded as Beginners Yoga poses as they are all taken from the Introductory syllabus, however, they are not suitable for those who are completely new to yoga. If you want Beginners Iyengar Yoga, check out our playlist for an introductory Iyengar yoga course for complete beginners http://bit.ly/2HkKL1J\n\nDay 7 of 18 Days of Yoga - the yoga class comprises the following yoga poses:\nTadasana (Mountain Pose)\nTrikonasana (Triangle Pose)\nUtthita Parsvakonasana (Extended WIde Angle Pose)\nParsvottanasana (Intense Side Stretch - Pyramid Pose)\n\nUttanasana (Standing Forward Bend)\nPadangusthasana (Hand to Big Toe Pose)\nSupta Baddha Konasana (Supine Bound Angle Pose)\n\nJanu Sirsasana (Head to Knee Pose)\nArdha Matsyandrasana (Half Lord of the Fishes Pose)\n\nProne Tadasana (Mountain Pose on front)\nSalabhasana (Locust Pose)\nMakarasana (Crocodile Pose)\n\nGomukasana in Virasana (Cow Face Pose in Hero Pose)\nAdho Mukha Svanasana, (Dog Head Down)\nAdho mukha Virasana\nHalasana (Plough Pose or Plow Pose)\nBent Leg Savasana (Corpse Pose)\n\n\n\n\nIf you are doing the classical yoga poses, you just need your mat, a platform made from 4 pads and a launch pad. If you are doing the modified versions,  you will need the following yoga equipment:\n1 x yoga bolster (you can use 2 x foam pads or a couple of cushions)\n2 x yoga bricks (you can use 2 x foam pads or the seat of a chair)\n1 x yoga belt (you can use cord, rope or even a tea towel)\n5 x Foam pads (you can use folded blankets for your platform with a cushion or similar for the launch pad)\n\nThese sequences aim to improve your extension, alignment and balance in the poses. If you find any of the poses difficult, look at the tutorials which will be released on subsequent days or you can look the poses up in our Yoga Pose Directory, which we are adding to all the time.These tutorials will teach the poses in more detail and sometimes with extra props.\n\n If you are near to Maidstone, in the South East of England, register with the Maidstone Iyengar Yoga Centre and enjoy one of our free classes with us. \nhttp://www.iyengar-yoga.co.uk/\n\nIf you want to try Yoga with Lin and Leo''s  19 Days of Yoga series, check out our Playlist: \nhttp://bit.ly/2kf1Vou\nOr our 13 Days of yoga: \nhttp://bit.ly/2oYRTdc\n\nYoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies.\n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing.\n\n\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\nOr our latest ebook, \"Yoga for the Stressed Body.\" https://amzn.to/2XWp7q6\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n \n Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to increase mindfulness, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/VGEY6c4-T7Q/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/VGEY6c4-T7Q/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/VGEY6c4-T7Q/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/VGEY6c4-T7Q/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/VGEY6c4-T7Q/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Lin and Leo","tags":["iyengar yoga","yoga","iyengar yoga class","iyengar yoga for beginners","iyengar yoga for beginners an introduction to the classic poses","yoga iyengar","halasana","halasana yoga","yoga back pain","back pain relief","hamstring stretch","stretching","30 days of yoga","13 days of yoga","19 days of yoga","yoga course","yoga with lin and leo","day 1","flexibility","mindfulness","ayengar","beginners yoga","yoga for beginners","yoga twists","meditation","18 Days of yoga","ardha matsyendrasana","padangusthasana"],"categoryId":"1","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"18 Days of Yoga - DAY 7. Iyengar Yoga Sequence","description":"18 Days of Yoga - DAY 7. Iyengar Yoga Sequence\n\nFollowing the success of our 30 Days of Yoga, 13 Days of Yoga and 19 Days of Yoga series, this year we have taken a slightly different approach for our 18 Days of Yoga. Days 1, 7 and 13, are longer sequences where we have done voiceovers, rather than talking to camera. Lin, in the white top, will be showing the classic versions of poses and Leo, in the dark top, will be showing modified versions of the poses using props. The modified versions are for those who find the pose difficult, or who wish to improve their work in the pose. In the subsequent days, we teach three of the poses which are in the previous sequences in more detail. 18th January 2019 will be the fifth annual National Iyengar Yoga Day in the UK and Ireland to celebrate the teachings of Guruji, B.K.S. Iyengar, and to promote Iyengar yoga nationally. Events will include free taster classes and celebrations of his life in Iyengar Yoga Institutes and centres throughout the country. ''Yoga with Lin and Leo'' channel is leading up to this day with a series of sequences. In the Iyengar tradition, these sequences would be regarded as Beginners Yoga poses as they are all taken from the Introductory syllabus, however, they are not suitable for those who are completely new to yoga. If you want Beginners Iyengar Yoga, check out our playlist for an introductory Iyengar yoga course for complete beginners http://bit.ly/2HkKL1J\n\nDay 7 of 18 Days of Yoga - the yoga class comprises the following yoga poses:\nTadasana (Mountain Pose)\nTrikonasana (Triangle Pose)\nUtthita Parsvakonasana (Extended WIde Angle Pose)\nParsvottanasana (Intense Side Stretch - Pyramid Pose)\n\nUttanasana (Standing Forward Bend)\nPadangusthasana (Hand to Big Toe Pose)\nSupta Baddha Konasana (Supine Bound Angle Pose)\n\nJanu Sirsasana (Head to Knee Pose)\nArdha Matsyandrasana (Half Lord of the Fishes Pose)\n\nProne Tadasana (Mountain Pose on front)\nSalabhasana (Locust Pose)\nMakarasana (Crocodile Pose)\n\nGomukasana in Virasana (Cow Face Pose in Hero Pose)\nAdho Mukha Svanasana, (Dog Head Down)\nAdho mukha Virasana\nHalasana (Plough Pose or Plow Pose)\nBent Leg Savasana (Corpse Pose)\n\n\n\n\nIf you are doing the classical yoga poses, you just need your mat, a platform made from 4 pads and a launch pad. If you are doing the modified versions,  you will need the following yoga equipment:\n1 x yoga bolster (you can use 2 x foam pads or a couple of cushions)\n2 x yoga bricks (you can use 2 x foam pads or the seat of a chair)\n1 x yoga belt (you can use cord, rope or even a tea towel)\n5 x Foam pads (you can use folded blankets for your platform with a cushion or similar for the launch pad)\n\nThese sequences aim to improve your extension, alignment and balance in the poses. If you find any of the poses difficult, look at the tutorials which will be released on subsequent days or you can look the poses up in our Yoga Pose Directory, which we are adding to all the time.These tutorials will teach the poses in more detail and sometimes with extra props.\n\n If you are near to Maidstone, in the South East of England, register with the Maidstone Iyengar Yoga Centre and enjoy one of our free classes with us. \nhttp://www.iyengar-yoga.co.uk/\n\nIf you want to try Yoga with Lin and Leo''s  19 Days of Yoga series, check out our Playlist: \nhttp://bit.ly/2kf1Vou\nOr our 13 Days of yoga: \nhttp://bit.ly/2oYRTdc\n\nYoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies.\n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing.\n\n\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\nOr our latest ebook, \"Yoga for the Stressed Body.\" https://amzn.to/2XWp7q6\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n \n Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to increase mindfulness, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class."},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT36M34S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1470","likeCount":"30","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''18'':1A ''7'':6A ''day'':2A,5A ''iyengar'':7A ''sequenc'':9A ''yoga'':4A,8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
