icle for each student to experience the limitless potential of the human spirit. You dont have to be strong or flexible to begin the yoga practice, all you need is an open heart and the inspiration to practice yoga. Unroll your mat and do the practice!\r\n\r\nFacebook - http://www.facebook.com/KinoYoga\r\nInstagram - http://www.instagram.com/KinoYoga\r\nBlog - http://www.kinoyoga.com"}}', '{"duration":"PT1H2M52S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"8049","likeCount":"373","dislikeCount":"8","favoriteCount":"0","commentCount":"35"}', '''bodi'':3A ''class'':12A ''energ'':1A ''flexibl'':8A ''flow'':11A ''hour'':10A ''one'':9A ''strength'':6A ''total'':2A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
