INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17934, '3UJobZAqSaO_rQBe0TzEXVvonj0', 'nEoW8NF0tiU', NULL, '{"publishedAt":"2020-06-20T08:55:06Z","channelId":"UClnGVAjgb084SMNIYD1NTxA","title":"HarGharYoga | 21st June | Higher Education| Haryana","description":"The procedure for student participation will be in the manner explained below:\n\n Step 01. \nRegister on the Toll-Free Registration Number by giving a missed call on 7419444449, before 04:00 am on 21 June 2020.\n\n Step 02. \nClick pictures of yourself doing yoga at home or with your family during the Yoga session in any national TV:( Doordardashan,etc) at 06:30 am or Department''s live Yoga Session on it''s official Facebook page from 06:30 am at  https://www.facebook.com/highereduhry/\n( No complusion to take online session at picture''s background. But please ensure proper yoga posture, as the pose may be scrutinized for your eligibility for the draw of lots. )\n\n Step 03. \nUpload these pictures on your social media handle(s) with the hashtags #HarGharYoga and #YogaAtHome, and tag the Departments official page(s), and take a screenshot of your post.\n\n Step 04. \n Log on to the Har Ghar Yoga Portal https://tinyurl.com/HARGHARYOGA \nAnd fill in your details, including your Colleges Name, your College Roll Number, class (stream and year), etc. \n\n Step 05. \nUpload picture(s) of yourself doing yoga at home, or yoga with your family, on the Har Ghar Yoga Portal. Also, upload a screenshot of your social media post, where you had tagged  the Department.\n \n20 lucky participants will be given Rs. 5,000 cash prize each by drawing lots, after due verification of their student status. \n\n Additional Terms and Conditions for Har Ghar Yoga competition 2020: \n\n For Individual Category: \n\nThe participant must be a student of a Higher Education Institute (recognized college or university  Government, Government Funded, or Self financed). He must have filled in correct college name and details on the Portal.\n\nBefore distribution of prize money, if it is found that the details of the student entered do not match documents or are faulty, the Department reserves the right to cancel the prize allocated, and give it to someone else.\n\nThe participant must have completed all the requisite steps to be considered eligible for the prize amount.\n\nThe picture(s) taken must be clear, and decent.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/nEoW8NF0tiU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/nEoW8NF0tiU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/nEoW8NF0tiU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/nEoW8NF0tiU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/nEoW8NF0tiU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"DEPARTMENT OF HIGHER EDUCATION HARYANA","categoryId":"27","liveBroadcastContent":"none","localized":{"title":"HarGharYoga | 21st June | Higher Education| Haryana","description":"The procedure for student participation will be in the manner explained below:\n\n Step 01. \nRegister on the Toll-Free Registration Number by giving a missed call on 7419444449, before 04:00 am on 21 June 2020.\n\n Step 02. \nClick pictures of yourself doing yoga at home or with your family during the Yoga session in any national TV:( Doordardashan,etc) at 06:30 am or Department''s live Yoga Session on it''s official Facebook page from 06:30 am at  https://www.facebook.com/highereduhry/\n( No complusion to take online session at picture''s background. But please ensure proper yoga posture, as the pose may be scrutinized for your eligibility for the draw of lots. )\n\n Step 03. \nUpload these pictures on your social media handle(s) with the hashtags #HarGharYoga and #YogaAtHome, and tag the Departments official page(s), and take a screenshot of your post.\n\n Step 04. \n Log on to the Har Ghar Yoga Portal https://tinyurl.com/HARGHARYOGA \nAnd fill in your details, including your Colleges Name, your College Roll Number, class (stream and year), etc. \n\n Step 05. \nUpload picture(s) of yourself doing yoga at home, or yoga with your family, on the Har Ghar Yoga Portal. Also, upload a screenshot of your social media post, where you had tagged  the Department.\n \n20 lucky participants will be given Rs. 5,000 cash prize each by drawing lots, after due verification of their student status. \n\n Additional Terms and Conditions for Har Ghar Yoga competition 2020: \n\n For Individual Category: \n\nThe participant must be a student of a Higher Education Institute (recognized college or university  Government, Government Funded, or Self financed). He must have filled in correct college name and details on the Portal.\n\nBefore distribution of prize money, if it is found that the details of the student entered do not match documents or are faulty, the Department reserves the right to cancel the prize allocated, and give it to someone else.\n\nThe participant must have completed all the requisite steps to be considered eligible for the prize amount.\n\nThe picture(s) taken must be clear, and decent."}}', '{"duration":"PT1M44S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"14167","likeCount":"441","dislikeCount":"10","favoriteCount":"0","commentCount":"98"}', '''21st'':2A ''educ'':5A ''hargharyoga'':1A ''haryana'':6A ''higher'':4A ''june'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
