INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17589, '1DHuqH1oJe_4ALIEiPrRj9HENSQ', 'Iue6-wxPkVw', NULL, '{"publishedAt":"2020-06-21T07:00:03Z","channelId":"UCsksmxdgJtJp18iMYQpJg0A","title":"Keep Showing Up. Keep Practicing. | International Yoga Day 2020","description":"Think back to your first yoga practice  the excitement, the confusion, the challenge, the wobbles, the sweat, the blissful stretch, the a-ha moment, the glorious savasana. What kept you coming back to the mat? What keeps you there now?\n\nEmbrace your practice today in whatever form it takes. Acknowledge its raw edges and its beauty. Appreciate how far you have come, and the journey that lies ahead. Keep showing up. Keep practicing. #InternationalYogaDay \n\nPractice with Alo Moves: https://alomov.es/KeepPracticing_yt\n\nStay connected with us:\n\n Website: https://www.alomoves.com\n Instagram: https://instagram.com/alomoves\n Facebook:  https://www.facebook.com/alomoves\n Youtube: http://www.youtube.com/subscription_center?add_user=alomoves","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Iue6-wxPkVw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Iue6-wxPkVw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Iue6-wxPkVw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Iue6-wxPkVw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Iue6-wxPkVw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Alo Moves - Online Yoga Videos","tags":["codyapp","cody app","cody fitness","alo moves","alomoves","alo","alo yoga","aloyoga","free workout","free yoga class","yoga class","at home yoga class","home yoga","yoga with adriene","lululemon","online yoga classes","online yoga videos","at home yoga","international yoga day","iyd","iyd2020","international yoga day 2020","yoga day","alo moves yoga day","keep practicing","yoga practice"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Keep Showing Up. Keep Practicing. | International Yoga Day 2020","description":"Think back to your first yoga practice  the excitement, the confusion, the challenge, the wobbles, the sweat, the blissful stretch, the a-ha moment, the glorious savasana. What kept you coming back to the mat? What keeps you there now?\n\nEmbrace your practice today in whatever form it takes. Acknowledge its raw edges and its beauty. Appreciate how far you have come, and the journey that lies ahead. Keep showing up. Keep practicing. #InternationalYogaDay \n\nPractice with Alo Moves: https://alomov.es/KeepPracticing_yt\n\nStay connected with us:\n\n Website: https://www.alomoves.com\n Instagram: https://instagram.com/alomoves\n Facebook:  https://www.facebook.com/alomoves\n Youtube: http://www.youtube.com/subscription_center?add_user=alomoves"},"defaultAudioLanguage":"en"}', '{"duration":"PT53S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2903","likeCount":"96","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''2020'':9A ''day'':8A ''intern'':6A ''keep'':1A,4A ''practic'':5A ''show'':2A ''yoga'':7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17593, 'gh8Va9jrvLE5ldhbnF9aHq60zok', 'wdzg5qvzWcM', NULL, '{"publishedAt":"2020-06-25T17:04:48Z","channelId":"UCgmmCoisJRilHgtnuah7wuA","title":"Desk Yoga | Chair Yoga for Good Posture | Simple Exercises for Healthy Spine | Yogalates with Rashmi","description":"If you have a job that requires you to be seated on a chair in front of a computer, this is a short and simple video of what you can do to ensure some spinal mobility. If you have time or if you can make the time for yourself, it is advisable to practice the longer videos for at least half an hour everyday. This video is good to use if you want to take breaks in between your work to stretch out and ensure your spine stays healthy. Follow me on Social Media\nInstagram: http://www.instagram.com/therashmiramesh\n\nTwitter: http://www.twitter.com/therashmiramesh\n\n Facebook: https://www.facebook.com/therashmiramesh\n\nWebsite: http://www.movewithoris.com\n\nCREDITS \nContent & Direction: Rashmi Ramesh\nProducer, Camera, Sound & Editing: Malay Vadalkar\n\n Copyright Rashmi Ramesh\n\n#yogaforweightloss #24sunsalutations #yogaathome #yoga #rashmiramesh #yogalates #withme","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/wdzg5qvzWcM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/wdzg5qvzWcM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/wdzg5qvzWcM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/wdzg5qvzWcM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/wdzg5qvzWcM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yogalates With Rashmi","tags":["yogalates","yoga","pilates","chair yoga","rashmi ramesh","yogalates with rashmi"],"categoryId":"22","liveBroadcastContent":"upcoming","localized":{"title":"Desk Yoga | Chair Yoga for Good Posture | Simple Exercises for Healthy Spine | Yogalates with Rashmi","description":"If you have a job that requires you to be seated on a chair in front of a computer, this is a short and simple video of what you can do to ensure some spinal mobility. If you have time or if you can make the time for yourself, it is advisable to practice the longer videos for at least half an hour everyday. This video is good to use if you want to take breaks in between your work to stretch out and ensure your spine stays healthy. Follow me on Social Media\nInstagram: http://www.instagram.com/therashmiramesh\n\nTwitter: http://www.twitter.com/therashmiramesh\n\n Facebook: https://www.facebook.com/therashmiramesh\n\nWebsite: http://www.movewithoris.com\n\nCREDITS \nContent & Direction: Rashmi Ramesh\nProducer, Camera, Sound & Editing: Malay Vadalkar\n\n Copyright Rashmi Ramesh\n\n#yogaforweightloss #24sunsalutations #yogaathome #yoga #rashmiramesh #yogalates #withme"},"defaultAudioLanguage":"en"}', '{"duration":"PT6M40S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"0","likeCount":"19","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''chair'':3A ''desk'':1A ''exercis'':9A ''good'':6A ''healthi'':11A ''postur'':7A ''rashmi'':15A ''simpl'':8A ''spine'':12A ''yoga'':2A,4A ''yogal'':13A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17594, 'oLomPS5urtMiPHXybpaUG8-1V-U', 'Rw1dG2FTTNE', NULL, '{"publishedAt":"2020-04-23T17:30:02Z","channelId":"UCOQno3taAl096Vg-OKm3BVQ","title":"A Short, Sweet and very Small Yoga Practice | Sucram Yoga","description":"If you are finding it difficult to fit in a longer yoga practice or only have a limited amount of space and you just need a short and sweet practice this is for you. You body and mind will thank you for it.\n\nAfter recovering from a TLIF operation in 2014 these postures (plus a couple more) were my saving grace for approximately 4 months. I did them nearly everyday and they are what i always return to when i''m checking in with myself and bringing myself back to balance. \nIf you only have a few minutes a day and you are able, do these.\n\nyou should not experience any pain during this session, if you do please stop.\nif you feel dizzy or unwell, please wait til you feel better before doing this practice.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Rw1dG2FTTNE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Rw1dG2FTTNE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Rw1dG2FTTNE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Rw1dG2FTTNE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Rw1dG2FTTNE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Sucram Yoga","tags":["louise hebblewhite","yoga for work","small yoga space","yoga for everyone","yoga for beginners","easy yoga","sucram yoga","yoga","online yoga","yoga for isolation","yoga during quranatine","yoga for","online yoga class","yoga class"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"A Short, Sweet and very Small Yoga Practice | Sucram Yoga","description":"If you are finding it difficult to fit in a longer yoga practice or only have a limited amount of space and you just need a short and sweet practice this is for you. You body and mind will thank you for it.\n\nAfter recovering from a TLIF operation in 2014 these postures (plus a couple more) were my saving grace for approximately 4 months. I did them nearly everyday and they are what i always return to when i''m checking in with myself and bringing myself back to balance. \nIf you only have a few minutes a day and you are able, do these.\n\nyou should not experience any pain during this session, if you do please stop.\nif you feel dizzy or unwell, please wait til you feel better before doing this practice."}}', '{"duration":"PT12M31S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"144","likeCount":"4","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''practic'':8A ''short'':2A ''small'':6A ''sucram'':9A ''sweet'':3A ''yoga'':7A,10A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
