INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17605, 'mKeBYgh9pq-bvN5SLwIPw9TelBc', 'R4ZLKw2wV_0', NULL, '{"publishedAt":"2020-02-07T04:30:01Z","channelId":"UCvymtMzLuKJawPL8KYfPVvw","title":"Travel Yoga Practice | Hips & Hamstrings Flexibility Flow","description":"A short and relaxing yoga flow for hips and hamstrings. It is not very intense so perfect for days when you are really tired and just want a good stretch.\n\nIt is often very difficult to keep up with your yoga practice when on the road. I did not want to complicate matters and had a simple goal of doing at least 10-20 mins of yoga whenever I could. This allowed me to stay in touch with the practice without making it a stressful affair with our very busy travel schedules. I managed to film a few of these videos to share with you!\n\nStay connected with me here:\nInstagram: https://www.instagram.com/yoganama/\nPinterest: https://in.pinterest.com/yoganama/\nWebsite: https://yoganama.com\nLinkedIn: https://www.linkedin.com/in/namitachandra","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/R4ZLKw2wV_0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/R4ZLKw2wV_0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/R4ZLKw2wV_0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/R4ZLKw2wV_0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/R4ZLKw2wV_0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoganama","tags":["yoganama","yoga class","online yoga class","short yoga class","10 min yoga","yoga practice","yoga for travel","free yoga video","home workout","yoga everyday","yoga flow","travel yoga","namita chandra piparaiya","yoga for hips and hamstrings","yoga for hips","yoga for flexibility","relaxing yoga flow","home workout video","yoga for hamstrings","hips and hamstrings","hips and hamstring stretch","hips and hammies","hip stretches for flexibility","hamstring stretches"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Travel Yoga Practice | Hips & Hamstrings Flexibility Flow","description":"A short and relaxing yoga flow for hips and hamstrings. It is not very intense so perfect for days when you are really tired and just want a good stretch.\n\nIt is often very difficult to keep up with your yoga practice when on the road. I did not want to complicate matters and had a simple goal of doing at least 10-20 mins of yoga whenever I could. This allowed me to stay in touch with the practice without making it a stressful affair with our very busy travel schedules. I managed to film a few of these videos to share with you!\n\nStay connected with me here:\nInstagram: https://www.instagram.com/yoganama/\nPinterest: https://in.pinterest.com/yoganama/\nWebsite: https://yoganama.com\nLinkedIn: https://www.linkedin.com/in/namitachandra"}}', '{"duration":"PT14M48S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"168","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''flexibl'':6A ''flow'':7A ''hamstr'':5A ''hip'':4A ''practic'':3A ''travel'':1A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
