INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17608, 'nnKuh93cCcRYDtqhGne_GlgRQ60', '-_FZptbPx4o', NULL, '{"publishedAt":"2018-09-23T21:47:20Z","channelId":"UCAdzgU4QWfAtDu6WSfll6WQ","title":"Morning Prenatal Yoga and Tea | 28 Weeks | Tea Leaves and Tweed","description":"Something a little different for today: Im sharing a time-lapse of my morning yoga routine at 28 weeks pregnant, along with a simple cup of tea. To learn more about my yoga practice while pregnant, check out this post: https://cecinestpasunmommyblog.com/2018/07/17/a-changing-body-how-pregnancy-has-taught-me-more-about-yoga/ \n\nAlso, I based my prenatal yoga practice on this sequence, beautifully illustrated by Tris Bain, which even finishes with the instruction to have a cup of tea: http://mendingwillows.com/blog/2018/1/23/my-prenatal-yoga-routine \n\nThe tea Im drinking at the end of this video is Tai Ping Hou Kui green tea from Teavivre: https://www.amazon.com/Teavivre-Premium-Green-Chinese-Loose/dp/B072JB6ZKT \n\nIf you''re interested in reading more of my thoughts of tea and other topics, follow my blog at https://tealeavesandtweed.com/ \nOr follow me on Instagram: @tealeavesandtweed https://www.instagram.com/tealeavesandtweed/ \n\nIf youre interested in following along with my pregnancy, please follow my pregnancy blog at https://cecinestpasunmommyblog.com/. \n\nMusic: Waltz of the Flowers by Tchaikovsky\n\nNB: I am not a yoga instructor. Please talk to you doctor before starting any exercise program. Tea was purchased and I was not given any incentive to feature it here.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-_FZptbPx4o/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/-_FZptbPx4o/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/-_FZptbPx4o/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/-_FZptbPx4o/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/-_FZptbPx4o/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Tea Leaves and Tweed","tags":["yoga","tea","green tea","morning yoga","exercise","pregnancy","prenatal yoga"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Morning Prenatal Yoga and Tea | 28 Weeks | Tea Leaves and Tweed","description":"Something a little different for today: Im sharing a time-lapse of my morning yoga routine at 28 weeks pregnant, along with a simple cup of tea. To learn more about my yoga practice while pregnant, check out this post: https://cecinestpasunmommyblog.com/2018/07/17/a-changing-body-how-pregnancy-has-taught-me-more-about-yoga/ \n\nAlso, I based my prenatal yoga practice on this sequence, beautifully illustrated by Tris Bain, which even finishes with the instruction to have a cup of tea: http://mendingwillows.com/blog/2018/1/23/my-prenatal-yoga-routine \n\nThe tea Im drinking at the end of this video is Tai Ping Hou Kui green tea from Teavivre: https://www.amazon.com/Teavivre-Premium-Green-Chinese-Loose/dp/B072JB6ZKT \n\nIf you''re interested in reading more of my thoughts of tea and other topics, follow my blog at https://tealeavesandtweed.com/ \nOr follow me on Instagram: @tealeavesandtweed https://www.instagram.com/tealeavesandtweed/ \n\nIf youre interested in following along with my pregnancy, please follow my pregnancy blog at https://cecinestpasunmommyblog.com/. \n\nMusic: Waltz of the Flowers by Tchaikovsky\n\nNB: I am not a yoga instructor. Please talk to you doctor before starting any exercise program. Tea was purchased and I was not given any incentive to feature it here."}}', '{"duration":"PT6M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"136","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''28'':6A ''leav'':9A ''morn'':1A