uence and just a few floor postures followed by a small version of the finishing sequence.\nI will also chant the opening and closing chant as this is a traditional practice.\n\nPlease as always drop a comment to let me know how it went and if you have any questions.\nLike, share and subscribe if you would like to support me \n\nMuch love"}}', '{"duration":"PT52M27S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"70","likeCount":"6","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''50'':3A ''ashtanga'':1A,8A ''beginn'':9A ''erika'':13A ''josa'':14A ''min'':4A ''sequenc'':6A ''shorter'':5A ''yoga'':2A,11A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
