INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17613, 'Ywu0-7_4riZMFkBplLUjn8GqjVs', '6-bm-bay8BI', NULL, '{"publishedAt":"2020-06-25T11:50:20Z","channelId":"UCwjiQumTI6wv1bIntuXFb-w","title":"Happy body: Yoga from head to toe","description":"HOW DOES YOUR BODY FEEL ON A DAILY BASIS?\nDo you feel discomfort somewhere in your body? Do you feel stable? Do you move with grace and ease? Do you have a feeling of lightness in your body? How well do you handle change? According to the yoga tradition, the answers to those questions define our health and wellness. Your yoga practice is meant to make you structurally stable, enable you to move with grace and ease, free you from physical suffering and enable you to withstand changing circumstances.\n\nTHIS YOGA SERIES IS FOR YOU IF YOU:\n1. Experience occasional tension somewhere in your body;\n2. Sit a lot during the day;\n3. Want to use yoga to work with each body part methodically and systematically;\n4. Dont have a lot of time and need a short movement practice;\n5. Want to understand which movements can help specific body areas and why.\n\nThis yoga series will help you:\n Get rid of physical aches and pains,\n Become more stable and balanced,\n Move with grace and ease,\n Feel more vibrant and resilient.\n\nYou can do the practices in order for a complete tour of your body or choose the ones you need most. Start taking care of your body today!\n\nhttps://happyuhub.com/happy-body-yoga-from-head-to-toe/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/6-bm-bay8BI/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/6-bm-bay8BI/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/6-bm-bay8BI/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/6-bm-bay8BI/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/6-bm-bay8BI/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Olga","tags":["yoga","body","happy body","happy yoga"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Happy body: Yoga from head to toe","description":"HOW DOES YOUR BODY FEEL ON A DAILY BASIS?\nDo you feel discomfort somewhere in your body? Do you feel stable? Do you move with grace and ease? Do you have a feeling of lightness in your body? How well do you handle change? According to the yoga tradition, the answers to those questions define our health and wellness. Your yoga practice is meant to make you structurally stable, enable you to move with grace and ease, free you from physical suffering and enable you to withstand changing circumstances.\n\nTHIS YOGA SERIES IS FOR YOU IF YOU:\n1. Experience occasional tension somewhere in your body;\n2. Sit a lot during the day;\n3. Want to use yoga to work with each body part methodically and systematically;\n4. Dont have a lot of time and need a short movement practice;\n5. Want to understand which movements can help specific body areas and why.\n\nThis yoga series will help you:\n Get rid of physical aches and pains,\n Become more stable and balanced,\n Move with grace and ease,\n Feel more vibrant and resilient.\n\nYou can do the practices in order for a complete tour of your body or choose the ones you need most. Start taking care of your body today!\n\nhttps://happyuhub.com/happy-body-yoga-from-head-to-toe/"}}', '{"duration":"PT2M9S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"197","likeCount":"4","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''bodi'':2A ''happi'':1A ''head'':5A ''toe'':7A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
