INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17757, 'xKQvFkuLtW3KyvQbfILYPHDcaTg', 'm3lwfeYBa_A', NULL, '{"publishedAt":"2019-06-20T05:00:03Z","channelId":"UCJygAHaYiCrfYOJyNfEla-g","title":"Prenatal Morning Yoga   Safe for all trimesters   YogaCandi","description":"Namaste mums to be, feel free to add this ''Prenatal Morning Yoga Flow'' into your weekly routine to help gently yet powerfully prep the body for labour. Together we stretch out our pregnancy aches and pains, build full body strength and stamina, use breathing techniques (pranayama) to strengthen our pelvic floor and tighten our transverse abdominal muscles (TVA,) as well as to calm our nervous systems and get us into the zone of ''we can do this''!\n\nI also recommend saving my prenatal yoga playlist to your favourites so that you can pick and choose a class to suit your daily requirements: https://bit.ly/2FAEkWc \n\nOnce you''ve tried this class let me know your thoughts, be gentle, mindful and remember we''re in this together.\n\nSending love and light to you and your little one(s) within,\nCandace\nxoxo \n\nPs, if you like what I''m wearing in the video then check out FittaMamma (https://fittamamma.com/) they have some awesome prenatal yoga fitness wear for all shapes and sizes ;)\n\nYoga is for everyone, together lets be present! \n\n#PrenatalYoga #PrenatalMorningYoga #PrenatalFitness #YogaCandi\n\nMore at: https://www.yogacandi.com/ Instagram: https://www.instagram.com/yogacandi/ Facebook: https://www.facebook.com/yogacandace\n\n\nDISCLAIMER:\nYogaCandi strongly recommends that you consult with your physician before beginning any exercise or exercise program. Please note that YogaCandi is not a licensed medical care provider, with no expertise in diagnosing, examining, or treating medical conditions of any kind, or in determining the effect of any specific exercise on a medical condition.You should understand that