INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17627, '_FS3cL__6M_t3gLZzWiEiNihcU8', 'X4tkQHfNJXY', NULL, '{"publishedAt":"2020-04-07T06:00:08Z","channelId":"UCH4q1Pa3_gFbDmbi-f9XPhA","title":"Neck Mobility  / 5 Min Mini / Yoga / Practice With Kiara","description":"Often the cause for our headaches is tension we carry in our neck and shoulders. Sleeping awkwardly, driving a lot, hunching over to text - our lifestyle is harsh on our neck and shoulders so it''s time to zone in and give our upper body some TLC. Your neck has to be strong and mobile as it''s carrying your very important head! If that''s not reason enough, then I don''t know what is.\n\nThese 5 Min Mini sessions are great for your quick yoga fix. Follow along - you can do these moves anytime anywhere as long as you''ve got five minutes to spare. No need for a mat or equipment. Just your body!\n\n\nNamaste - Kiara x\n\n-------------------------------------------------\nVideo & edit:\nLouis Tierney & Kiara Hirst\n\nMusic:\nGarden Music by Kevin MacLeod\nCreative Commons  Attribution 3.0 Unported CC BY 3.0\nhttps://creativecommons.org/licenses/...\nMusic provided by FreeMusic109 https://youtube.com/FreeMusic109","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/X4tkQHfNJXY/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/X4tkQHfNJXY/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/X4tkQHfNJXY/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/X4tkQHfNJXY/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/X4tkQHfNJXY/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Practice With Kiara","tags":["Kiara yoga","practice with kiara","yoga","hatha yoga","neck problems","neck mobility","neck stiffness","outdoor yoga","upper spine","shoulders","strong neck","calming","yoga at home","yoga teacher"