INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17630, 'fAfcTbR4oQdfHdHkyIb8FFVSGa8', 'Gc5GUD6yyp4', NULL, '{"publishedAt":"2020-03-10T19:37:02Z","channelId":"UC_Db_1dS8weULV2KwfgRZqQ","title":"How yoga helps my body and mind","description":"In this vlog I would like to invite you to a short yoga class.\nRecently I have gotten more into yoga and breathing exercises and it has had a big impact on how I feel on and off stage. It is a matter of practice but I am surely feeling improvement.\nHere yoga teacher Sandra Wilson explains to me how certain exercises calm the mind, strengthen your core, help you to be in the present moment and focus. This has been essential for me in dealing with nerves and have improved my concentration and ability to feel free to express music on stage.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Gc5GUD6yyp4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Gc5GUD6yyp4/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Gc5GUD6yyp4/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Gc5GUD6yyp4/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Gc5GUD6yyp4/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Ella van Poucke","tags":["yoga","yoga lesson","yoga practice","asmr","yoga asmr","relaxing","body","mind","Ella van Poucke","cellist","musician","in the moment","connecting","heart","awareness","meditation"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"How yoga helps my body and mind","description":"In this vlog I would like to invite you to a short yoga class.\nRecently I have gotten more into yoga and breathing exercises and it has had a big impact on how I feel on and off stage. It is a matter of practice but I am surely feeling improvement.\nHere yoga teacher Sandra Wilson explains to me how certain exercises calm the mind, strengthen your core, help you to be in the present moment and focus. This has been essential for me in dealing with nerves and have improved my concentration and ability to feel free to express music on stage."}}', '{"duration":"PT31M6S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"3002","likeCount":"31","dislikeCount":"4","favoriteCount":"0","commentCount":"0"}', '''bodi'':5A ''help'':3A ''mind'':7A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17633, 'IWnrNWarMHYVJEiayIWd5sip0zY', 'SQgnGJOEjsA', NULL, '{"publishedAt":"2019-08-01T05:30:00Z","channelId":"UCKFID_Lqj9hw2jlZvgNcDkg","title":"Iyengar Yoga: Triangle Breath in Asana. 40 min. CdR. OYT. #iyengaryoga #asanaandpranayama","description":"Welcome to this practice that combines Asana with Pranayama in action. A beautiful way to enrich our practice and ignite new levels of awareness. In this sequence we explore ''triangulated breath'', learning how to integrate this shape into our Asana and then observing how the imprint of this shape changes the way we experience the pose. A sensitive exploration of mindful mind-body-breath intelligence. Hope that you enjoy this exploration and that you''ll let me know your experience. Made with love. xox cat.\n\nMore Classes: https://www.youtube.com/user/onlineyogateaching/playlists\nAbout CdR - https://onlineyogateaching.com/home/about/\nDonations: https://paypal.me/OnlineYogaTeaching","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/SQgnGJOEjsA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/SQgnGJOEjsA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/SQgnGJOEjsA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/SQgnGJOEjsA/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/SQgnGJOEjsA/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Online Yoga Teaching","tags":["cat de rham","online yoga teaching","yoga youtube channel","iyengar yoga video","best yoga youtube","yoga alignment workshop","iyengar yoga online free","iyengar yoga youtube","best free iyengar yoga online","iyengar restorative yoga","iyengar gentle yoga sequence","gentle iyengar sequence","iyengar intermediate sequence","iyengar yoga youtube channel","iyengar yin yoga","iyengar yoga immu