INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17649, 'aoj8qh2uiJkD9rE5imDn5slnmPA', '937x6M1-_p4', NULL, '{"publishedAt":"2019-06-22T03:04:19Z","channelId":"UCIXZNvQNioXFkc_Z-dfprrw","title":"Vinyasa Sun Salutation Yoga Class","description":"Happy International Yoga Day! What better way to celebrate than by practicing some yoga? :) This is a 25-minute vinyasa sequence, incorporating variationS on Sun Salutations A & B and a guided Savasana at the end.\n\nSun Salutations are a common and traditional way to begin a yoga practice. They help warm up the body, loosen you up and allow you to practice linking your movement with your breath. Sun Salutations can be used as a morning ritual, a way to wake up and feel energized and they can also be a practice in and of themselves.\n\nIf you enjoy this flow, be sure to give the video a like and subscribe to my channel so you can get notified when I upload new classes.\n\nThanks so much for practicing with me! I''ll see you on the mat.\n\n\n*INTERNATIONAL DAY OF YOGA DISCOUNT*\nI''m practicing on my yoga mat from Liforme. I''ve been using these mats for several years now and they''re the best! Made from natural materials that are non-toxic and biodegradable, non-slip so you have amazing grip during your practice and the alignment markers help take your practice to the next level.\nUse the code ''JESSICAR2019'' for 15% off.\nShop here: http://bit.ly/2uH0xNf\n\nLet''s connect! \nBLOG: https://jessicarichburgyoga.com\nINSTAGRAM: https://instagram.com/Jessicarichburg/\nFACEBOOK: https://www.facebook.com/jessicarichburgyoga\n\nDISCLAIMER:\nThe information and practices on this website are not meant to diagnose, treat or cure any illness and and should not be used as a substitute for professional medical care. As with any exercise program, you take the risk of personal injury when you practice yoga. By participating in these practices, you acknowledge