GRAM: https://instagram.com/Jessicarichburg/\nFACEBOOK: https://www.facebook.com/jessicarichburgyoga\n\nDISCLAIMER:\nThe information and practices on this website are not meant to diagnose, treat or cure any illness and and should not be used as a substitute for professional medical care. As with any exercise program, you take the risk of personal injury when you practice yoga. By participating in these practices, you acknowledge this risk and release Jessica Richburg from any liability. You are responsible for your own body''s well being. Please consult with your physician prior to beginning exercise."}}', '{"duration":"PT26M24S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"13807","likeCount":"401","dislikeCount":"7","favoriteCount":"0","commentCount":"19"}', '''class'':5A ''salut'':3A ''sun'':2A ''vinyasa'':1A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17664, 'xAz4I7lOdTi6HC20I5PuktiWuBU', 'qE8UQtjq19E', NULL, '{"publishedAt":"2019-03-30T14:21:45Z","channelId":"UCTe8ABP94FZadBA-TgpKKzA","title":"1 hour Vinyasa Flow Yoga | 60 minute | Bird of Paradise Pose","description":"Join me for a 60 minute Intermediate Vinyasa Flow Yoga class building and preparing the body for Bird of Paradise pose. Bird of Paradise strengthens the legs and stretches the hamstrings, shoulders and hips. This standing balance pose requires both stability, focus and flexibility. Bird of Paradise symbolises renewal and rebirth. I hope you enjoy and thank you for practising with me!\n\n~  y o g a m u s i c  ~ \n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://open.spotify.com/user/1117036.... \n\n~  f i n d m e  ~ \n\ninstagram | https://www.instagram.com/ailsaburns/ \nmy website | https://www.frostedfeather.com/ \n\n~  a b o u t m e  ~ \n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. I decided to start this YouTube channel because I love teaching yoga and I want to share my yoga classes with as many as people as possible. \n\n~  s u p p o r t m e  ~ \n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. This is one of the ways that I plan to share my love of yoga beyond public classes. If you are person of means and would like to support me to continue making videos for my channel, then please consider supporting me via PayPal: http://bit.ly/2IEx8dR\n\n~  f i l m i n g  ~ \n\nThis video was filmed and edited by Foldout Films: https://www.foldoutfilms.co.uk/ and filmed at Yoga on the Square in Bristol: https://yogaonthesquare.co.uk/."