 in Bristol in the UK. I decided to start this YouTube channel because I love teaching yoga and I want to share my yoga classes with as many as people as possible. \n\n~  s u p p o r t m e  ~ \n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. This is one of the ways that I plan to share my love of yoga beyond public classes. If you are person of means and would like to support me to continue making videos for my channel, then please consider supporting me via PayPal: http://bit.ly/2IEx8dR\n\n~  f i l m i n g  ~ \n\nThis video was filmed and edited by Foldout Films: https://www.foldoutfilms.co.uk/ and filmed at Yoga on the Square in Bristol: https://yogaonthesquare.co.uk/."}}', '{"duration":"PT58M48S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"506","likeCount":"23","dislikeCount":"0","favoriteCount":"0","commentCount":"8"}', '''1'':1A ''60'':6A ''bird'':8A ''flow'':4A ''hour'':2A ''minut'':7A ''paradis'':10A ''pose'':11A ''vinyasa'':3A ''yoga'':5A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
