INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17669, 'v_tcmigHWafiY-Bl04JXQasJS_w', 'ANeIizm-PV8', NULL, '{"publishedAt":"2020-03-22T12:30:00Z","channelId":"UCJSbWGvPYAMvYa_fOHM6GCQ","title":"Yoga for Anxiety and Stress","description":" JOIN MY FACEBOOK COMMUNITY FOR FREE LIVE YOGA PRACTICE EVERY TUESDAY AND COMMUNITY SUPPORT: https://bit.ly/2WvJVnR\n\nWhen life is overwhelming and stressful, use your yoga practice as a refuge.\nThis practice will move slowly and intentionally, offering you the space to breathe and be.\nYou''ll use a block for extra support to allow your body to rest and feel supported.\nPlease take good care of yourself during this time of crisis.\n\n\n------- GET MORE GOOD STUFF BELOW -------\n\n DISCOVER: http://www.ConsciousHealthyMama.com\n INSTALOVE: http://www.instagram.com/ConsciousHealthyMama\n LIKE: http://www.facebook.com/ConsciousHealthyMama\n SUBSCRIBE: https://www.youtube.com/c/NaomiGottliebMiller\n\nNaomi Gottlieb-Miller has been practicing yoga since 1999 and teaching since 2005. Now, as a mom of 3 adorable and active kids, she loves sharing her yoga practice and her yoga mat with them, too!\nHer yoga classes are alignment-based with a creative and playful spirit. She''ll probably encourage you to make animal noises that correspond with their yoga pose. And she''ll probably reference Star Trek at least once (and if not Trek, definitely Buffy the Vampire Slayer or Harry Potter). Everything is yoga.\n\nNaomi is passionate about getting people on their yoga mats every single day because her daily yoga practice has been saving her sanity for nearly 2 decades.\nShe''s also committed to helping moms reclaim their own needs and their own time, one downward facing dog at a time.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/ANeIizm-PV8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/ANeIizm-PV8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/ANeIizm-PV8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/ANeIizm-PV8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/ANeIizm-PV8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Naomi Gottlieb-Miller","tags":["yoga for anxiety and stress","yoga for stress and anxiety","yoga for anxiety","yoga for stress","yoga for stress relief","yoga for stress & anxiety","stress relief yoga","yoga stress anxiety","yoga anxiety stress","yoga in times of stress","yoga to relieve anxiety","naomi gottlieb-miller"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga for Anxiety and Stress","description":" JOIN MY FACEBOOK COMMUNITY FOR FREE LIVE YOGA PRACTICE EVERY TUESDAY AND COMMUNITY SUPPORT: https://bit.ly/2WvJVnR\n\nWhen life is overwhelming and stressful, use your yoga practice as a refuge.\nThis practice will move slowly and intentionally, offering you the space to breathe and be.\nYou''ll use a block for extra support to allow your body to rest and feel supported.\nPlease take good care of yourself during this time of crisis.\n\n\n------- GET MORE GOOD STUFF BELOW -------\n\n DISCOVER: http://www.ConsciousHealthyMama.com\n INSTALOVE: http://www.instagram.com/ConsciousHealthyMama\n LIKE: http://www.facebook.com/ConsciousHealthyMama\n SUBSCRIBE: https://www.youtube.com/c/NaomiGottliebMiller\n\nNaomi Gottlieb-Miller has been practicing yoga since 1999 and teaching since 2005. Now, as a mom of 3 adorable and active kids, she loves sharing her yoga practice and her yoga mat with them, too!\nHer yoga classes are alignment-based with a creative and playful spirit. She''ll probably encourage you to make animal noises that correspond with their yoga pose. And she''ll probably reference Star Trek at least once (and if not Trek, definitely Buffy the Vampire Slayer or Harry Potter). Everything is yoga.\n\nNaomi is passionate about getting people on their yoga mats every single day because her daily yoga practice has been saving her sanity for nearly 2 decades.\nShe''s also committed to helping moms reclaim their own needs and their own time, one downward facing dog at a time."},"defaultAudioLanguage":"en"}', '{"duration":"PT22M1S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"192","likeCount":"10","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''anxieti'':3A ''stress'':5A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
