INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17677, 'EUkCPgceAh9x0XAV1ELoqspzghA', 'NUKvH7VUfmM', NULL, '{"publishedAt":"2018-09-30T00:30:00Z","channelId":"UCvDc7jgAYAjbNqvWjbovVQw","title":"Iyengar Yoga Sequence - Further into Deep Extension","description":"Iyengar Yoga Sequence - Further into Deep Extension. A 40 minute online yoga class which involves strong stretching actions within the whole body to improve flexibility. We would recommend that you practice first \"Towards Deep Extension\" to give a deep stretch to the sides of the body. This yoga class starts in the same way, with asanas which stretch the sides of the body, Lin and Leo will guide you through this strong yoga practice to lengthen and extend the groins, stretch the hamstrings and open the hips. Some of these yoga poses are demanding so this is not a class suitable for beginners or those who are still quite stiff. If you look on our channel''s playlists, we have plenty of videos if you want iyengar yoga for beginners, or yoga for a stiffer body. \nThe poses we cover in this video are:\nTrikonasana - Triangle Pose\nParighasana - Gate Pose\nUpavistha Konasana - WIde Angled Seated Forward Bend\nParivrtta Janu Sirsasana - Revolving Head to Knee Pose\nPaschimottanasana - Seated Forward Bend\nMarichyasana 3 - Seated Twist\nParivrtta Paschimottanasana - Revolving Seated Forward Bend\nBaddha Konasana - Bound Angle Pose (Cobblers Pose, Butterfly Pose) Forward Bend\nSavasana - Corpse Pose\n\nThe equipment you might need for this yoga sequence are:\nyoga mat\n2 x blanket\n1 x yoga chair (or kitchen/dining chair)\n\nThis programme is designed to harmonise mind, body and breath. Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to free your mind, improve your wellbeing and increase your mental resilience. \n\nThis free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class. \n\nThis sequence will help to tone and improve strength and mobility in the legs and hips.\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start here! Get out your mat and build the foundation of your own yoga practice with this 40 minute home yoga video. Enjoy!\n\n\nStay connected~\n\nFor more structured classes: http://myyogatutor.com/\n\nFor booking face to face classes: http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://www.facebook.com/MaidstoneYogaCentre/\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start here! Get out your mat and build the foundation of your own yoga practice with this 1 minute home yoga video. Enjoy!\n\n\nStay connected~\n\nFor more structured classes: http://myyogatutor.com/\n\nFor booking face to face classes: http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://www.facebook.com/MaidstoneYogaCentre/\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/NUKvH7VUfmM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/NUKvH7VUfmM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/NUKvH7VUfmM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/NUKvH7VUfmM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/NUKvH7VUfmM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Lin and Leo","tags":["iyengar yoga","yoga with lin and leo","yoga workout","yoga iyengar","deep stretch yoga","stretching","deep stretch","stretching exercises","stretches for flexibility","hamstring stretch","groin stretches","side stretch","yoga","advanced yoga","intermediate yoga","intermediate yoga poses","advanced yoga pose","b.k.s. iyengar","parivrtta janu sirsasana","parivrtta paschimottanasana","upavistha konasana","paschimottanasana","parighasana","gate pose","trikonasana","iyengar yoga sequence","iyengar yoga class"],"categoryId":"17","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"Iyengar Yoga Sequence - Further into Deep Extension","description":"Iyengar Yoga Sequence - Further into Deep Extension. A 40 minute online yoga class which involves strong stretching actions within the whole body to improve flexibility. We would recommend that you practice first \"Towards Deep Extension\" to give a deep stretch to the sides of the body. This yoga class starts in the same way, with asanas which stretch the sides of the body, Lin and Leo will guide you through this strong yoga practice to lengthen and extend the groins, stretch the hamstrings and open the hips. Some of these yoga poses are demanding so this is not a class suitable for beginners or those who are still quite stiff. If you look on our channel''s playlists, we have plenty of videos if you want iyengar yoga for beginners, or yoga for a stiffer body. \nThe poses we cover in this video are:\nTrikonasana - Triangle Pose\nParighasana - Gate Pose\nUpavistha Konasana - WIde Angled Seated Forward Bend\nParivrtta Janu Sirsasana - Revolving Head to Knee Pose\nPaschimottanasana - Seated Forward Bend\nMarichyasana 3 - Seated Twist\nParivrtta Paschimottanasana - Revolving Seated Forward Bend\nBaddha Konasana - Bound Angle Pose (Cobblers Pose, Butterfly Pose) Forward Bend\nSavasana - Corpse Pose\n\nThe equipment you might need for this yoga sequence are:\nyoga mat\n2 x blanket\n1 x yoga chair (or kitchen/dining chair)\n\nThis programme is designed to harmonise mind, body and breath. Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to free your mind, improve your wellbeing and increase your mental resilience. \n\nThis free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class. \n\nThis sequence will help to tone and improve strength and mobility in the legs and hips.\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start here! Get out your mat and build the foundation of your own yoga practice with this 40 minute home yoga video. Enjoy!\n\n\nStay connected~\n\nFor more structured classes: http://myyogatutor.com/\n\nFor booking face to face classes: http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://www.facebook.com/MaidstoneYogaCentre/\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start here! Get out your mat and build the foundation of your own yoga practice with this 1 minute home yoga video. Enjoy!\n\n\nStay connected~\n\nFor more structured classes: http://myyogatutor.com/\n\nFor booking face to face classes: http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://www.facebook.com/MaidstoneYogaCentre/\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310"}}', '{"duration":"PT37M5S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1406","likeCount":"16","dislikeCount":"1","favoriteCount":"0","commentCount":"5"}', '''deep'':6A ''extens'':7A ''iyengar'':1A ''sequenc'':3A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
