INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17705, 'Mt-q2P-hw-g5nrNp9lzAAlJi9dY', '8b-b1n239eM', NULL, '{"publishedAt":"2020-06-21T02:00:01Z","channelId":"UC8QZDYMwbYyjW71pWK30gog","title":"30 Minutes Full Body Yoga Workout For Beginners At Home | Yoga Day Special 2020 | Mind Body Soul","description":"Going by the theme of International Yoga Day 2020 ''Yoga for Health - Yoga for Home'', Mind Body Soul brings to you a selection of best yoga poses for a 30 minutes full-body workout that you can do easily from the comfort of your home. Full body yoga workout is a deep stretch for your entire body.  It relaxes your muscles, improves flexibility and builds strength. This session will take you through specific yoga poses aiming to relax your different body zones one by one. This beginner''s yoga video has Yoga for eyes, Yoga for toned arms, Yoga to relax tight hips, Yoga for toned legs, Yoga to strengthen the spine, and Yoga for mental relaxation by our yoga hosts Rashmi Ramesh and Aparajita Jamwal. It would be a good idea to incorporate these exercises as your morning yoga routine to feel fresh, relaxed, and strong throughout the day. Whether you are a beginner or an advanced yogi, these yoga poses are sure to make your whole body feel better. \n\nSubscribe us on YouTube: http://bit.ly/MindBodySoulChannel\r\n\nLike us on Facebook: https://www.facebook.com/mindbodysoulTV\r\n\nFollow Us on Twitter: https://twitter.com/MindBodySoulTV\r\n\nFollow Us on Instagram: https://www.instagram.com/mindbodysoultv\r\n\nFollow Us on Pinterest: https://www.pinterest.com/mindbodysoultv","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/8b-b1n239eM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/8b-b1n239eM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/8b-b1n239eM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/8b-b1n239eM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/8b-b1n239eM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Mind Body Soul","tags":["Yoga for beginners","Morning Yoga routine","Yoga workout at home","Full body yoga flow","Yoga Day","Yoga for eyes","Yoga to relax tight hips","Yoga for toned legs","Yoga to strengthen the spine","Yoga for mental relaxation","yoga with adriene","yoga for weight loss","yoga video","30-minute yoga","yoga stretches","yoga asanas","meditation","morning yoga for beginners","beginners yoga","yoga","guided meditation","world yoga day 2020","yoga day special video","shilpa shetty yoga","ramdev baba yoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"30 Minutes Full Body Yoga Workout For Beginners At Home | Yoga Day Special 2020 | Mind Body Soul","description":"Going by the theme of International Yoga Day 2020 ''Yoga for Health - Yoga for Home'', Mind Body Soul brings to you a selection of best yoga poses for a 30 minutes full-body workout that you can do easily from the comfort of your home. Full body yoga workout is a deep stretch for your entire body.  It relaxes your muscles, improves flexibility and builds strength. This session will take you through specific yoga poses aiming to relax your different body zones one by one. This beginner''s yoga video has Yoga for eyes, Yoga for toned arms, Yoga to relax tight hips, Yoga for toned legs, Yoga to strengthen the spine, and Yoga for mental relaxation by our yoga hosts Rashmi Ramesh and Aparajita Jamwal. It would be a good idea to incorporate these exercises as your morning yoga routine to feel fresh, relaxed, and strong throughout the day. Whether you are a beginner or an advanced yogi, these yoga poses are sure to make your whole body feel better. \n\nSubscribe us on YouTube: http://bit.ly/MindBodySoulChannel\r\n\nLike us on Facebook: https://www.facebook.com/mindbodysoulTV\r\n\nFollow Us on Twitter: https://twitter.com/MindBodySoulTV\r\n\nFollow Us on Instagram: https://www.instagram.com/mindbodysoultv\r\n\nFollow Us on Pinterest: https://www.pinterest.com/mindbodysoultv"},"defaultAudioLanguage":"en"}', '{"duration":"PT30M","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"6723","likeCount":"230","dislikeCount":"8","favoriteCount":"0","commentCount":"16"}', '''2020'':14A ''30'':1A ''beginn'':8A ''bodi'':4A,16A ''day'':12A ''full'':3A ''home'':10A ''mind'':15A ''minut'':2A ''soul'':17A ''special'':13A ''workout'':6A ''yoga'':5A,11A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
