INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17710, 'eZC6oUaJx9lEm7zJ6fHnZrcNtbc', 'jeK9pDgcPf0', NULL, '{"publishedAt":"2020-06-16T05:00:08Z","channelId":"UCoDw4lwTMagPIsdNm2jKccQ","title":"Yoga class - 20-minute workout | 16th June 2020","description":"This 20-minute yoga-inspired workout is an ideal warm-up or cool-down routine - or just to try on its own. Let Team Bath trainer Danii Bachrikov guide you through a session which focuses on breathing, mobility, stretches and poses. \n\nThere''s no need for a mat, all you need is a bit of floor space and some loose, comfortable clothing. \n\nYoga classes are a new addition to our Stay In, Work Out fitness timetable. Look out for more from Danii in the coming weeks.\n\n#StayInWorkOut #Yoga #Mobility","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/jeK9pDgcPf0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/jeK9pDgcPf0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/jeK9pDgcPf0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/jeK9pDgcPf0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/jeK9pDgcPf0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"teambathtv","tags":["home work out","home work outs","work out at home","work outs at home","home exercise class","home yoga class","yoga","yoga class","exercise class","mobility","stayinworkout","stay in work out","exercise at home","teembath","teem bath","team bath","bath uni","bath university"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Yoga class - 20-minute workout | 16th June 2020","description":"This 20-minute yoga-inspired workout is an ideal warm-up or cool-down routine - or just to try on its own. Let Team Bath trainer Danii Bachrikov guide you through a session which focuses on breathing, mobility, stretches and poses. \n\nThere''s no need for a mat, all you need is a bit of floor space and some loose, comfortable clothing. \n\nYoga classes are a new addition to our Stay In, Work Out fitness timetable. Look out for more from Danii in the coming weeks.\n\n#StayInWorkOut #Yoga #Mobility"}}', '{"duration":"PT20M52S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"104","likeCount":"1","dislikeCount":"1","favoriteCount":"0","commentCount":"0"}', '''16th'':6A ''20'':3A ''2020'':8A ''class'':2A ''june'':7A ''minut'':4A ''workout'':5A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17742, 'KSVlGIoHzX59rCsD9TyysrjSDaI', 'Qh42U6qRXac', NULL, '{"publishedAt":"2020-06-25T23:21:52Z","channelId":"UCYEXutCc0KcUx0dPnfwzvOw","title":"Gentle Yoga for Hips and Hamstrings with Jacob","description":"This practice targets hips and hamstrings in a deep but gentle way.  Most of the practice in seated or lying on the mat allowing a little more accessible for those with limited mobility or balance.  Suitable for all levels.  Low back pain can sometimes be caused by tight hips and hamstrings so in addressing them you might find some ease up.  This practice is a blend of Hatha and restorative styles of the Asana practice of Yoga.  \n\nIf you enjoyed the class or use this video often at your work,  feel free to donate here https://www.paypal.me/JacobCino. If you don''t have the funds to donate no problem.  Recently as a Yoga teacher, the industry has collapsed so I like many am looking for alternate sources of income.  If you can contribute please do.  \n\nNot all the exercises will be suitable for everyone and are not to be used as a replacement for medical counseling.  These exercises can result in injury. Any user of this exercise program assumes the risk of injury and the creators of this program disclaim any liabilities in connection with the exercise program and advice herein. We suggest you take your time, listen to your body and modify or leave out postures that don''t agree with you.   Things take time so rest when needed and stay present with extended smooth breathe. \n\nPlease do what you can and leave out that which is too much for you.  Enjoy and share.  \n\n\nFilmed in Trinidad. 2020","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Qh42U6qRXac/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Qh42U6qRXac/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Qh42U6qRXac/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Qh42U6qRXac/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Qh42U6qRXac/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Jacob Cino","tags":["gentle yoga","yoga for hips and hamstrings","yoga with jacob cino","jacob cino","hatha yoga","restorative yoga","yoga for tight hips","yoga for legs and low back","yoga trinidad","43 min yoga practice","all level yoga","jacob cino yoga","love","simple yoga practice","yoga for all","yoga on the mat","yoga on the ground","yoga and a strap","do what you can","live is sweet","make it sweeter"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"Gentle Yoga for Hips and Hamstrings with Jacob","description":"This practice targets hips and hamstrings in a deep but gentle way.  Most of the practice in seated or lying on the mat allowing a little more accessible for those with limited mobility or balance.  Suitable for all levels.  Low back pain can sometimes be caused by tight hips and hamstrings so in addressing them you might find some ease up.  This practice is a blend of Hatha and restorative styles of the Asana practice of Yoga.  \n\nIf you enjoyed the class or use this video often at your work,  feel free to donate here https://www.paypal.me/JacobCino. If you don''t have the funds to donate no problem.  Recently as a Yoga teacher, the industry has collapsed so I like many am looking for alternate sources of income.  If you can contribute please do.  \n\nNot all the exercises will be suitable for everyone and are not to be used as a replacement for medical counseling.  These exercises can result in injury. Any user of this exercise program assumes the risk of injury and the creators of this program disclaim any liabilities in connection with the exercise program and advice herein. We suggest you take your time, listen to your body and modify or leave out postures that don''t agree with you.   Things take time so rest when needed and stay present with extended smooth breathe. \n\nPlease do what you can and leave out that which is too much for you.  Enjoy and share.  \n\n\nFilmed in Trinidad. 2020"}}', '{"duration":"PT43M25S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"71","likeCount":"9","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''gentl'':1A ''hamstr'':6A ''hip'':4A ''jacob'':8A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17711, 'sIEKN5n8dhd1pm_Vzr1ZuwUAJyA', 'zt1R0Pw2Na8', NULL, '{"publishedAt":"2016-10-07T04:28:33Z","channelId":"UCafzj64g5i0EFJ7VfjQzrGg","title":"Yin Yoga for Surfers - Deep Stretch for the Hips.","description":"This short, restorative Yin Yoga class opens up the hips and inner thighs with stretches that are help for a number of minutes. \n\nSurfers - If you''ve been paddling and surfing a lot and you find you have lower back pain afterwards, then this class is a good one for you!  \n\nIt''s a great one to do when you get back from a surf (as well as my short shoulder stretch sequence www.youtube.com/watch?v=bMay90e25Gc) to help stretch out the body and balance out of the Yang activities (surfing, running around, generally being busy and active!)\n\nEnjoy!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/zt1R0Pw2Na8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/zt1R0Pw2Na8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/zt1R0Pw2Na8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/zt1R0Pw2Na8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/zt1R0Pw2Na8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Lucy Foster-Perkins","tags":["yoga for surfer","yoga","surfers","surf fit","yin yoga for surfers","yin yoga","hip stretches","hip openers","restorative","bali","surfer chick"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yin Yoga for Surfers - Deep Stretch for the Hips.","description":"This short, restorative Yin Yoga class opens up the hips and inner thighs with stretches that are help for a number of minutes. \n\nSurfers - If you''ve been paddling and surfing a lot and you find you have lower back pain afterwards, then this class is a good one for you!  \n\nIt''s a great one to do when you get back from a surf (as well as my short shoulder stretch sequence www.youtube.com/watch?v=bMay90e25Gc) to help stretch out the body and balance out of the Yang activities (surfing, running around, generally being busy and active!)\n\nEnjoy!"}}', '{"duration":"PT19M38S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"5536","likeCount":"52","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''deep'':5A ''hip'':9A ''stretch'':6A ''surfer'':4A ''yin'':1A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
