INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17715, 'nOcpt2AVZogkQKRrELhJViGriP0', '-MfcxiuY1xM', NULL, '{"publishedAt":"2020-05-13T10:45:00Z","channelId":"UC8HHZ46QBzv9bkNW-v84ksg","title":"SLOW FLOW: Begin to Balance | 40-minute yoga practice with Oceana Mariani","description":"Welcome back to class yogi - today were bringing you a beginner-friendly practice that will allow you to work on your balancing poses. Over the next few weeks well progress this into ever-more advanced yoga balances, building on the solid foundation that were creating here today. Dont be fooled into thinking that this is an easy practice simply because its beginner-friendly! We can almost guarantee that you will be challenged, but hopefully youll be able to laugh off the wobbles and find your steely-eyed focus along the way.\n\nGood balance starts from the ground up so we will be working on truly connecting to the floor which gives us a strong sense of grounding, allowing the rest of the body to become freer in its movement. Finding a focal point directly in front of you or on the floor is also helpful when we first begin to balance  this is referred to as drishti in Sanskrit. Eventually, as your confidence builds you can play with lifting the gaze upwards or closing the eyes completely, which truly makes even the simplest of yoga postures challenging again.\n\nLet us know how you got on in the comments down below and pop any questions you have there too  Oceana will answer as many as she can.\n\nSUBSCRIBE TO THE CHANNEL:\nhttps://www.youtube.com/channel/UC8HHZ46QBzv9bkNW-v84ksg\n\nCONNECT WITH US ELSEWHERE ONLINE:\n CitySport on instagram  https://www.instagram.com/citysportec1/\n Website - https://www.citysport.org.uk/\n Oceana on instagram - https://www.instagram.com/the_surfing_yogi/\n Oceana on YouTube - https://www.youtube.com/channel/UCYEK1akD-V08Pp3GOVE4rzg\n Spotify playlists - https://open.spotify.com/user/oceanamariani\n\n#FreeYoga #SlowFlow #Quarantraining #YouAreNotAlone #WeAreAllInThisTogether #CitySport #CityUniversityOfLondon #WorkoutMotivation #WorkoutFromHome #Fitness #FitnessMotivation #BeActive #StayActive #TheSurfingYogi #OMetcetera","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-MfcxiuY1xM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/-MfcxiuY1xM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/-MfcxiuY1xM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/-MfcxiuY1xM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/-MfcxiuY1xM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"CitySport","tags":["Slow Flow Yoga","Vinyasa Flow","Hatha Flow","Yoga Flow","Yoga Class","Yoga Practice","Free Yoga","Bodyweight","Home Workout","Yoga Workout","Gentle Yoga","Yoga for Beginners","Yoga for Balance","Beginners Yoga","Balance Yoga Flow","Balance Yoga Poses","Balance Yoga Class","Beginners Yoga Flow","Beginners Yoga Workout","Beginners Yoga Course","Better Balance Workout","Better Balance for Seniors","Improve balance","Yoga Flow for Beginners","Yoga Flow Vinyasa","Yoga Flow 40 mins","Yoga Flow Class"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"SLOW FLOW: Begin to Balance | 40-minute yoga practice with Oceana Mariani","description":"Welcome back to class yogi - today were bringing you a beginner-friendly practice that will allow you to work on your balancing poses. Over the next few weeks well progress this into ever-more advanced yoga balances, building on the solid foundation that were creating here today. Dont be fooled into thinking that this is an easy practice simply because its beginner-friendly! We can almost guarantee that you will be challenged, but hopefully youll be able to laugh off the wobbles and find your steely-eyed focus along the way.\n\nGood balance starts from the ground up so we will be working on truly connecting to the floor which gives us a strong sense of grounding, allowing the rest of the body to become freer in its movement. Finding a focal point directly in front of you or on the floor is also helpful when we first begin to balance  this is referred to as drishti in Sanskrit. Eventually, as your confidence builds you can play with lifting the gaze upwards or closing the eyes completely, which truly makes even the simplest of yoga postures challenging again.\n\nLet us know how you got on in the comments down below and pop any questions you have there too  Oceana will answer as many as she can.\n\nSUBSCRIBE TO THE CHANNEL:\nhttps://www.youtube.com/channel/UC8HHZ46QBzv9bkNW-v84ksg\n\nCONNECT WITH US ELSEWHERE ONLINE:\n CitySport on instagram  https://www.instagram.com/citysportec1/\n Website - https://www.citysport.org.uk/\n Oceana on instagram - https://www.instagram.com/the_surfing_yogi/\n Oceana on YouTube - https://www.youtube.com/channel/UCYEK1akD-V08Pp3GOVE4rzg\n Spotify playlists - https://open.spotify.com/user/oceanamariani\n\n#FreeYoga #SlowFlow #Quarantraining #YouAreNotAlone #WeAreAllInThisTogether #CitySport #CityUniversityOfLondon #WorkoutMotivation #WorkoutFromHome #Fitness #FitnessMotivation #BeActive #StayActive #TheSurfingYogi #OMetcetera"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT44M26S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"57","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''40'':6A ''balanc'':5A ''begin'':3A ''flow'':2A ''mariani'':12A ''minut'':7A ''oceana'':11A ''practic'':9A ''slow'':1A ''yoga'':8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
