ou can pause the video at any time a stay in the poses longer. \n\nAquila has a deeply grounding, authentic energy - which entwined with her lightness of being, her commitment to her practice and the joyful encouragement she brings to her teaching - makes for a very special yoga experience.\n\nRETREATS:\nhttp://www.aquilayoga.com/retreats/\n\nAquila Yoga - Disclaimer\nPlease consult with your physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Aquila Yoga from any and all claims or causes of action, known or unknown, arising out of Aquila Yogas negligence."}}', '{"duration":"PT17M25S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"537","likeCount":"8","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''flow'':7A ''go'':5A ''quick'':1A ''wake'':2A ''yoga'':6A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17718, 'Dx-f4mSdMNYBGvBKo4BQtsKfQo8', 'H7nleR5L5KQ', NULL, '{"publishedAt":"2020-03-01T08:25:24Z","channelId":"UCp72a490lmDDTq9DZXPlh0w","title":"Beginner''s Morning Yoga Class, Surya Namaskar, Headstand Prep & Breathing Exercise | Twesha Khanijow","description":"This video is a beginner level introduction to Hatha yoga with Headstand, called the king of all asanas due to its various overall benefits. There are 8 steps to come up in this infamous inverted posture. Here, we have demonstrated a stepwise formation of your headstand along with warming up exercises called the dolphins. The Dolphin exercises are similar to push-ups in the sense that they warm up your arms and bring steadiness to the headstand practice. One is advised to seek medical assistance if you have experienced any neck or spine injury. It is also not advisable for pregnant and menstruating women.  \nNext, we have demonstrated one more asana called sitting forward bend or Paschimottanasana which loosens the rigidity in your body and mind. It allows space to co-exist with chaos. \nUsually, the class begins with Surya namaskar which is Sun Salutation sequences both for the left and right side. 2 set comprises of 12 positions, and 2 sequences of each 12 positions. One can begin the day with Surya Namaskar for flexibility, agility and strength to add vitality and will power to their day. There is no fixed rule for the number of sets one can perform. Usually, for spiritual reasons Yogis prefer to perform 108, 1008 etc. sets!\nWe have ended the video with some Pranayama, which brings vitality and inner peace. Hope you enjoy the session!\n\nShot and edited by Tanya Khanijow","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/H7nleR5L5KQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/H7nleR5L5KQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/H7nleR5L5KQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/H7nleR5L5KQ/sddefault.jpg","width":640,"height":480}},"channelTitle":"Twesha Khanijow","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Beginner''s Morning Yoga Class, Surya Namaskar, Headstand Prep & Breathing Exercise | Twesha Khanijow","description":"This video is a beginner level introduction to Hatha yoga with Headstand, called the king of all asanas due to its various overall benefits. There are 8 steps to come up in this infamous inverted posture. Here, we have demonstrated a stepwise formation of your headstand along with warming up exercises called the dolphins. The Dolphin exercises are similar to push-ups in the sense that they warm up your arms and bring steadiness to the headstand practice. One is advised to seek medical assistance if you have experienced any neck or spine injury. It is also not advisable for pregnant and menstruating women.  \nNext, we have demonstrated one more asana called sitting forward bend or Paschimottanasana which loosens the rigidity in your body and mind. It allows space to co-exist with chaos. \nUsually, the class begins with Surya namaskar which is Sun Salutation sequences both for the left and right side. 2 set comprises of 12 positions, and 2 sequences of each 12 positions. One can begin the day with Surya Namaskar for flexibility, agility and strength to add vitality and will power to their day. There is no fixed rule for the number of sets one can perform. Usually, for spiritual reasons Yogis prefer to perform 108, 1008 etc. sets!\nWe have ended the video with some Pranayama, which brings vitality and inner peace. Hope you enjoy the session!\n\nShot and edited by Tanya Khanijow"}}', '{"duration":"PT11M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"652","likeCount":"37","dislikeCount":"0","favoriteCount":"0","commentCount":"12"}', '''beginn'':1A ''breath'':10A ''class'':5A ''exercis'':11A ''headstand'':8A ''khanijow'':13A ''morn'':3A ''namaskar'':7A ''prep'':9A ''surya'':6A ''twesha'':12A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
