INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17720, 'nZ9OP_l9ucKmJ0v9foTTauNZw7U', 'aW5hAB_FZDo', NULL, '{"publishedAt":"2020-05-23T11:54:51Z","channelId":"UC2XNpyFeGhepfNX9EF_ji5w","title":"TAKE A BREAK // 40 min Dynamic Yoga Class (Vinyasa/Hatha Flow)","description":"This is a 40-min dynamic yoga sequence working all areas of the body. Take a break from your day, take a break for yourself and your practice and roll out your yoga mat.\n\nThis practice is suitable for all levels of practitioners, some variations are more challenging, so listen to your body and your breath to decide which variation to choose.  \n\nSee you on the mat my beautiful yoga friends.\nJanice \n\n-----\n Check out my playlists on Spotify if you like to be accompanied by music during your yoga practice: https://open.spotify.com/user/1214995... \n(Flow Yoga, Slow Yoga and Yin are my top playlists, depending on whether you prefer more upbeat or slower music)\n\n-----\nIf you enjoyed the practice leave a like, a comment and subscribe to my channel. Share the good vibes  \n\nAlso check out my other platforms: \nWeb: https://www.cominghometoyourself.net/\nInstagram: https://www.instagram.com/janice_allermann/ \nFacebook: https://www.facebook.com/janiceallermannyoga/ \n\n-----\nYoga means to me? ''coming home to yourself''\nSelf-sensitivity. Developing awareness and thereby a feeling for oneself  for the body, thoughts and emotions  recognising ones own needs and giving them space.\nChange of perspective. Instead of looking outwards, looking inwards  reviewing expectations (ones own and those of others)  discovering what matters most in life.\nSelf-love. Accepting oneself  getting in touch with ones own life-themes  developing a loving attitude towards oneself and others.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/aW5hAB_FZDo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/aW5hAB_FZDo/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/aW5hAB_FZDo/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/aW5hAB_FZDo/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/aW5hAB_FZDo/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Janice Allermann Yoga","tags":["yoga","yoga flow","yoga class","40 min yoga class","40 min yoga flow","vinyasa","vinyasa flow","hatha","hatha flow","dynamic flow","flow","full body flow","full body dynamic flow","yoga practice","Janice Allermann","Janice Allermann yoga","coming home to yourself"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"TAKE A BREAK // 40 min Dynamic Yoga Class (Vinyasa/Hatha Flow)","description":"This is a 40-min dynamic yoga sequence working all areas of the body. Take a break from your day, take a break for yourself and your practice and roll out your yoga mat.\n\nThis practice is suitable for all levels of practitioners, some variations are more challenging, so listen to your body and your breath to decide which variation to choose.  \n\nSee you on the mat my beautiful yoga friends.\nJanice \n\n-----\n Check out my playlists on Spotify if you like to be accompanied by music during your yoga practice: https://open.spotify.com/user/1214995... \n(Flow Yoga, Slow Yoga and Yin are my top playlists, depending on whether you prefer more upbeat or slower music)\n\n-----\nIf you enjoyed the practice leave a like, a comment and subscribe to my channel. Share the good vibes  \n\nAlso check out my other platforms: \nWeb: https://www.cominghometoyourself.net/\nInstagram: https://www.instagram.com/janice_allermann/ \nFacebook: https://www.facebook.com/janiceallermannyoga/ \n\n-----\nYoga means to me? ''coming home to yourself''\nSelf-sensitivity. Developing awareness and thereby a feeling for oneself  for the body, thoughts and emotions  recognising ones own needs and giving them space.\nChange of perspective. Instead of looking outwards, looking inwards  reviewing expectations (ones own and those of others)  discovering what matters most in life.\nSelf-love. Accepting oneself  getting in touch with ones own life-themes  developing a loving attitude towards oneself and others."}}', '{"duration":"PT39M5S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"86","likeCount":"8","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''40'':4A ''break'':3A ''class'':8A ''dynam'':6A ''flow'':10A ''min'':5A ''take'':1A ''vinyasa/hatha'':9A ''yoga'':7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17721, 'bmOk07IBHwr3nWDltlYdZBGQdLI', 'g6Ylzm7LJ6I', NULL, '{"publishedAt":"2015-03-15T06:09:54Z","channelId":"UCFeEdN5QRUnn2QOJUJBw1Gw","title":"Morning Yoga with Jan Green","description":"Practice this Energising Morning Yoga Sequence to set you up for the rest of the day! This yoga video stretches and strengthens our muscles, while focussing on our breath. Enjoy this practice on an empty stomach and notice how it helps you find your happy place for the rest of the day.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/g6Ylzm7LJ6I/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/g6Ylzm7LJ6I/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/g6Ylzm7LJ6I/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/g6Ylzm7LJ6I/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/g6Ylzm7LJ6I/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"yogalove.LIFE with Jan Green","tags":["morning yoga","yoga","jan green","home yoga","yogaLove","health","fitness","feelgood","awake","energise","happy","morning","weight","workout","exercise","body","mind"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Morning Yoga with Jan Green","description":"Practice this Energising Morning Yoga Sequence to set you up for the rest of the day! This yoga video stretches and strengthens our muscles, while focussing on our breath. Enjoy this practice on an empty stomach and notice how it helps you find your happy place for the rest of the day."}}', '{"duration":"PT19M6S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"944","likeCount":"3","dislikeCount":"1","favoriteCount":"0","commentCount":"1"}', '''green'':5A ''jan'':4A ''morn''