INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17722, 'OQ9Id0TdsblvOpXOWd5Azu4M63Q', 'WFegQPx372I', NULL, '{"publishedAt":"2020-03-26T07:45:39Z","channelId":"UCS8McbG2g67exDhhTqHTKLw","title":"Energizing yoga flow - A dynamic session to start your morning","description":"Join me for 20 minutes of yoga to get energized and live the upcoming day to the fullest!\nIf you have time, a great addition to this session is to sit for 5-10 minutes, and feel grateful for the things in our lives. It can be as simple as being grateful for the sun shining, or for being alive.\nThe power of gratitude is LIMITLESS !\n\nUnroll your mat, hop in some comfy clothes, and let''s get started :).\n\nThis video is NOT intended for pregnant women, as we will be lying on our belly at times.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/WFegQPx372I/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/WFegQPx372I/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/WFegQPx372I/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/WFegQPx372I/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/WFegQPx372I/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga prnatal avec Alex","categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Energizing yoga flow - A dynamic session to start your morning","description":"Join me for 20 minutes of yoga to get energized and live the upcoming day to the fullest!\nIf you have time, a great addition to this session is to sit for 5-10 minutes, and feel grateful for the things in our lives. It can be as simple as being grateful for the sun shining, or for being alive.\nThe power of gratitude is LIMITLESS !\n\nUnroll your mat, hop in some comfy clothes, and let''s get started :).\n\nThis video is NOT intended for pregnant women, as we will be lying on our belly at times."}}', '{"duration":"PT20M12S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"225","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''dynam'':5A ''energ'':1A ''flow'':3A ''morn'':10A ''session'':6A ''start'':8A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
