INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17725, '3HlmjiXDgOlVzZI5cvJHQUHPTtU', 'Qsd0vEwXIqE', NULL, '{"publishedAt":"2019-09-23T08:35:53Z","channelId":"UCL-0tPt23-RHupo4Y7UitMw","title":"Welcome - a short introduction to yoga for MS | MS Society","description":"Yoga teacher Laura helps make sure youre all set for yoga at home. You dont need much to get started, but its worth being safe and prepared - so you can relax and follow the seated yoga flows, breathing and relaxation exercises. Research suggests yoga could improve fatigue, mood, posture, balance and bowel control.  You can find all our exercise videos at https://mssoc.uk/2kxX8ij. Follow the MS Society on Twitter and Instagram @mssocietyuk. Follow Laura on Instagram @lovelemontreeuk.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Qsd0vEwXIqE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Qsd0vEwXIqE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Qsd0vEwXIqE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Qsd0vEwXIqE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Qsd0vEwXIqE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"MS Society","tags":["MS","multiple sclerosis","yoga","yoga for MS","exercises for MS","breathing","relaxation","disability","accessible","exercise","ms society","laura"],"categoryId":"29","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"Welcome - a short introduction to yoga for MS | MS Society","description":"Yoga teacher Laura helps make sure youre all set for yoga at home. You dont need much to get started, but its worth being safe and prepared - so you can relax and follow the seated yoga flows, breathing and relaxation exercises. Research suggests yoga could improve fatigue, mood, posture, balance and bowel control.  