INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17726, 'S4Z1_ttnwOzPVDDfwJIjBeRqeFY', '8yQxN1UQR5U', NULL, '{"publishedAt":"2020-06-24T13:00:05Z","channelId":"UCH-81uaxCwAAaSgxRtxMkxg","title":"Day 24  30 Days of Yoga for Complete Beginners","description":"Day 24  30 Days of Yoga for Complete Beginners works through the basics of how to get started with your yoga practice. If you are a total new beginner this is an awesome series for you to start your yoga journey on. We work through the basics and foundational yoga poses so that you can begin your yoga practice with a solid understanding of technique and alignment. \n\nBe sure to subscribe! \nAlso check out the other daily videos from this month!\nDay 1  30 Days of Yoga for Complete Beginners\nhttps://youtu.be/fqYAOr6LFqM\nDay 2  30 Days of Yoga for Complete Beginners\nhttps://youtu.be/Bl6tGj1fx6s\nDay 3 - 30 Days of Yoga for Complete Beginners\nhttps://youtu.be/4KFN95diW7U\nDay 4  30 Days of Yoga for Complete Beginners\nhttps://youtu.be/gN5vMZS0lnY\nDay 5  30 Days of Yoga for Complete Beginners\nhttps://youtu.be/jdfifzD7AGA\nDay 6  30 Days of Yoga for Complete Beginners\nhttps://youtu.be/H_0i7SHINTk\nDay 7  30 Days of Yoga for Complete Beginners\nhttps://youtu.be/TdNEsU7JKKs\n\n\nAnd of course, you can always watch this video and all my videos commercial free on www.omstars.com.\n\nThis course can be found here: https://omstars.com/30-days-of-yoga-for-complete-beginners\n\nFind my full teaching schedule on my website: www.kinoyoga.com\n\nRead my books too! Find my Amazon author page here: https://www.amazon.com/Kino-MacGregor\n\nFollow me on Instagram www.instagram.com/kinoyoga","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/8yQxN1UQR5U/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/8yQxN1UQR5U/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/8yQxN1UQR5U/hqdefault.