INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17727, 'DSxsUTCvJVrDlPQXobk5NEGnX4w', '74kVut8VXXc', NULL, '{"publishedAt":"2020-06-25T18:31:20Z","channelId":"UC2XNpyFeGhepfNX9EF_ji5w","title":"CORE, TWISTS & BACKBENDS // 35 min Dynamic Yoga Class (Vinyasa/Hatha Flow)","description":"This is a 35-min dynamic yoga sequence working targeting the torso  so we will be working on the core and backbends as well as twists to balance everything out. Core work requires contraction, while backbends require expansion. During the class you will learn how to use your breath to work these to opposing qualities. \n\nThis practice is suitable for all levels of practitioners, only go as deep into a posture as you can still breathe.  \n\nSee you on the mat my beautiful yoga friends.\nJanice \n\n-----\n Check out my playlists on Spotify if you like to be accompanied by music during your yoga practice: https://open.spotify.com/user/1214995... \n(Flow Yoga, Slow Yoga and Yin are my top playlists, depending on whether you prefer more upbeat or slower music)\n\n-----\nIf you enjoyed the practice leave a like, a comment and subscribe to my channel. Share the good vibes  \n\nAlso check out my other platforms: \nWeb: https://www.cominghometoyourself.net/\nInstagram: https://www.instagram.com/janice_allermann/ \nFacebook: https://www.facebook.com/janiceallermannyoga/ \n\n-----\nYoga means to me? ''coming home to yourself''\nSelf-sensitivity. Developing awareness and thereby a feeling for oneself  for the body, thoughts and emotions  recognising ones own needs and giving them space.\nChange of perspective. Instead of looking outwards, looking inwards  reviewing expectations (ones own and those of others)  discovering what matters most in life.\nSelf-love. Accepting oneself  getting in touch with ones own life-themes  developing a loving attitude towards oneself and others.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/74kVut8VXXc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/74kVut8VXXc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/74kVut8VXXc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/74kVut8VXXc/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/74kVut8VXXc/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Janice Allermann Yoga","tags":["yoga","yoga flow","yoga class","35 min yoga class","35 min yoga flow","vinyasa","vinyasa flow","hatha","hatha flow","dynamic flow","flow","core flow","core yoga","backbends","backbending","backbend yoga flow","heart opener","heart opener yoga flow","yoga practice","Janice Allermann","Janice Allermann yoga","coming home to yourself"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"CORE, TWISTS & BACKBENDS // 35 min Dynamic Yoga Class (Vinyasa/Hatha Flow)","description":"This is a 35-min dynamic yoga sequence working targeting the torso  so we will be working on the core and backbends as well as twists to balance everything out. Core work requires contraction, while backbends require expansion. During the class you will learn how to use your breath to work these to opposing qualities. \n\nThis practice is suitable for all levels of practitioners, only go as deep into a posture as you can still breathe.  \n\nSee you on the mat my beautiful yoga friends.\nJanice \n\n-----\n Check out my playlists on Spotify if you like to be accompanied by music during your yoga practice: https://open.spotify.com/user/1214995... \n(Flow Yoga, Slow Yoga and Yin are my top playlists, depending on whether you prefer more upbeat or slower music)\n\n-----\nIf you enjoyed the practice leave a like, a comment and subscribe to my channel. Share the good vibes  \n\nAlso check out my other platforms: \nWeb: https://www.cominghometoyourself.net/\nInstagram: https://www.instagram.com/janice_allermann/ \nFacebook: https://www.facebook.com/janiceallermannyoga/ \n\n-----\nYoga means to me? ''coming home to yourself''\nSelf-sensitivity. Developing awareness and thereby a feeling for oneself  for the body, thoughts and emotions  recognising ones own needs and giving them space.\nChange of perspective. Instead of looking outwards, looking inwards  reviewing expectations (ones own and those of others)  discovering what matters most in life.\nSelf-love. Accepting oneself  getting in touch with ones own life-themes  developing a loving attitude towards oneself and others."}}', '{"duration":"PT36M38S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"37","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''35'':4A ''backbend'':3A ''class'':8A ''core'':1A ''dynam'':6A ''flow'':10A ''min'':5A ''twist'':2A ''vinyasa/hatha'':9A ''yoga'':7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
