INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17763, '3opAYdb7cTh_xl4kyRv_wQqYil8', '1GVNiUcPwOs', NULL, '{"publishedAt":"2020-03-22T01:23:43Z","channelId":"UCUGf0wK5tGdTQhntAiuwqZw","title":"1 HOUR YIN Yoga Sequence; All levels; NO PROPS","description":"Hello beautiful people.  \n\nHope you are all doing well and staying safe and healthy during this time.  In today''s society we are really encouraged to be constantly pushing ourselves to the next level.  In order to keep ourselves balanced, in a state of flow and harmony to avoid burn out, it is critical to take time for ourselves to relax and release the stress and tension that builds up in our bodies.  Hoping this video is helpful and provides you with a relaxing way to wind down and stretch out your muscles.  \n\nIn addition,  if you are interested in the concept of yin and yang and how you can apply the concept of balance and flow into your everyday life off of your yoga mat, please click the link below for an interesting listen to some really wonderful people.\nhttps://www.youtube.com/watch?v=Q8K7Ia-Oj3g","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/1GVNiUcPwOs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/1GVNiUcPwOs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/1GVNiUcPwOs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/1GVNiUcPwOs/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/1GVNiUcPwOs/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Spiritual Enchantress","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"1 HOUR YIN Yoga Sequence; All levels; NO PROPS","description":"Hello beautiful people.  \n\nHope you are all doing well and staying safe and healthy during this time.  In today''s society we are really encouraged to be constantly pushing ourselves to the next level.  In order to keep ourselves balanced, in a state of flow and harmony to avoid burn out, it is critical to take time for ourselves to relax and release the stress and tension that builds up in our bodies.  Hoping this video is helpful and provides you with a relaxing way to wind down and stretch out your muscles.  \n\nIn addition,  if you are interested in the concept of yin and yang and how you can apply the concept of balance and flow into your everyday life off of your yoga mat, please click the link below for an interesting listen to some really wonderful people.\nhttps://www.youtube.com/watch?v=Q8K7Ia-Oj3g"}}', '{"duration":"PT53M29S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"58","likeCount":"4","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''1'':1A ''hour'':2A ''level'':7A ''prop'':9A ''sequenc'':5A ''yin'':3A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
