INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17820, 'Us2uWAbWWh0OqnQhQtHD-uzkdP8', 'v5sspkYd-JQ', NULL, '{"publishedAt":"2018-04-23T05:44:34Z","channelId":"UCJygAHaYiCrfYOJyNfEla-g","title":"Yoga For Balance | Strong Beginner - Intermediate - 40-minutes","description":"As Gandhi wisely said - you''re allowed to make mistakes...so have fun with this week''s yoga flow, yogis! And although it''s more of a strong beginner/ intermediate yoga flow I have one for beginner too, simply click here: https://www.youtube.com/watch?v=OzF6lbopAGk&t=695s\n\nIf you fall out of a pose - LAUGH! Or if you can''t hold on any longer - LET GO! Remember, life is a balance between ''holding on and letting go'', the physical side of yoga is no different, your body knows when it''s had enough, so listen to its whispers, get to know your body as well as you know a good friend or family member. With love and care, your body will reward you in ways you never knew it could. \n\nSending love and light,\nCandace\nxoxo\n\nYoga is for everyone, together lets be present! \n\nMore at: https://www.yogacandi.com/ \nInstagram: https://www.instagram.com/yogacandi/ \nFacebook: https://www.facebook.com/yogacandace\n\n\nDISCLAIMER:\nYogaCandi strongly recommends that you consult with your physician before beginning any exercise or exercise program. Please note that YogaCandi is not a licensed medical care provider, with no expertise in diagnosing, examining, or treating medical conditions of any kind, or in determining the effect of any specific exercise on a medical condition.You should understand that when participating in any exercise or exercise program, that there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, agreeing to release and discharge Yo