r lets be present! \n\nMore at: https://www.yogacandi.com/ \nInstagram: https://www.instagram.com/yogacandi/ \nFacebook: https://www.facebook.com/yogacandace\n\n\nDISCLAIMER:\nYogaCandi strongly recommends that you consult with your physician before beginning any exercise or exercise program. Please note that YogaCandi is not a licensed medical care provider, with no expertise in diagnosing, examining, or treating medical conditions of any kind, or in determining the effect of any specific exercise on a medical condition.You should understand that when participating in any exercise or exercise program, that there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, agreeing to release and discharge YogaCandi from any and all claims or causes of action, known or unknown."},"defaultAudioLanguage":"en"}', '{"duration":"PT37M31S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"522","likeCount":"12","dislikeCount":"1","favoriteCount":"0","commentCount":"4"}', '''40'':7A ''balanc'':3A ''beginn'':5A ''intermedi'':6A ''minut'':8A ''strong'':4A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
