INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17774, 'lMm7gJ5QyRZsh6lXL1eWJmKwo-E', '_Md1RWcGcEQ', NULL, '{"publishedAt":"2020-06-21T19:27:39Z","channelId":"UChGr3Gq2rx1iNbEbKuqMpHw","title":"Acro Yoga for Beginners, AcroYoga 101: Foot to Shin","description":"Acro yoga for beginner basic position Foot to Shin is accesible to beginners. Learn how to do acro yoga poses and conditioning practices as we learn how to fly! An acro yoga tutorial to learn at home!\n\nI began practicing with YouTube years ago, and with the help of teachers I grew my practice enough to become a certified level two teacher with Acroyoga international. Here I hope to plant more seeds for more practitioners in the world to grow inspiration. I have also studied with van city acro and partner acrobatics. Acro yoga is addicting, be careful. \n\nAcroyoga combines yoga, thai massage, and acrobatics. Accesible to all people! Acro yoga brings fun and a sense of accomplishment when we reach new heights and learn to trust one another. \n\nThis video is in a series to teach you how to do your first acro yoga flow. \n\nFilmed in Tamraght Morocco at Nice Base, thanks for hosting us!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/_Md1RWcGcEQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/_Md1RWcGcEQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/_Md1RWcGcEQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/_Md1RWcGcEQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/_Md1RWcGcEQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Mor Acro","tags":["acro yoga","acro yoga for beginners","tutorial","yoga","acroyoga","partner acrobatics","tamraght","morocco","first time acroyoga","acro","yoga teacher"],"categoryId":"24","liveBroadcastContent":"none","localized":{"title":"Acro Yoga for Beginners, AcroYoga 101: Foot to Shin","description":"Acro yoga for beginner basic position Foot to Shin is accesible to beginners. Learn how to do acro yoga poses and conditioning practices as we learn how to fly! An acro yoga tutorial to learn at home!\n\nI began practicing with YouTube years ago, and with the help of teachers I grew my practice enough to become a certified level two teacher with Acroyoga international. Here I hope to plant more seeds for more practitioners in the world to grow inspiration. I have also studied with van city acro and partner acrobatics. Acro yoga is addicting, be careful. \n\nAcroyoga combines yoga, thai massage, and acrobatics. Accesible to all people! Acro yoga brings fun and a sense of accomplishment when we reach new heights and learn to trust one another. \n\nThis video is in a series to teach you how to do your first acro yoga flow. \n\nFilmed in Tamraght Morocco at Nice Base, thanks for hosting us!"},"defaultAudioLanguage":"en-US"}', '{"duration":"PT3M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2249","likeCount":"173","dislikeCount":"3","favoriteCount":"0","commentCount":"35"}', '''101'':6A ''acro'':1A ''acroyoga'':5A ''beginn'':4A ''foot'':7A ''shin'':9A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
