INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17779, 'l-MeSjahIzWKIxvrpv2l8RQY6YA', '5oyvzxTS_Vs', NULL, '{"publishedAt":"2020-06-24T20:49:07Z","channelId":"UCfO5dpmeTDgybKoZh3szBlg","title":"5 Deep Yoga Poses For Back Pain: Gentle Flow For Heart Opening","description":"This 15 minute yoga flow for beginners and advanced yogis alike is a beautiful, gentle flow to relieve back pain, open your heart, and restore the body. Join me in this beautiful woods setting for a short, but deep, yoga class for back pain.\n\nThe 5 yoga poses featured:\n1. Cat/Cow\n2. Wide Child''s Pose\n3. Thread The Needle\n4. Pigeon\n5. Supine Twists\n\nFor more inspiration, follow Kate on Instagram @thedrunkyogiofficial\n\nNamaste :)","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/5oyvzxTS_Vs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/5oyvzxTS_Vs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/5oyvzxTS_Vs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/5oyvzxTS_Vs/sddefault.jpg","width":640,"height":480}},"channelTitle":"The Drunk Yogi","tags":["yoga for beginners","gentle yoga","yoga","back pain","yoga for back pain"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"5 Deep Yoga Poses For Back Pain: Gentle Flow For Heart Opening","description":"This 15 minute yoga flow for beginners and advanced yogis alike is a beautiful, gentle flow to relieve back pain, open your heart, and restore the body. Join me in this beautiful woods setting for a short, but deep, yoga class for back pain.\n\nThe 5 yoga poses featured:\n1. Cat/Cow\n2. Wide Child''s Pose\n3. Thread The Needle\n4. Pigeon\n5. Supine Twists\n\nFor more inspiration, follow Kate on Instagram @thedrunkyogiofficial\n\nNamaste :)"},"defaultAudioLanguage":"en"}', '{"duration":"PT13M51S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"14","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''5'':1A ''back'':6A ''deep'':2A ''flow'':9A ''gentl'':8A ''heart'':11A ''open'':12A ''pain'':7A ''pose'':4A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17879, '9kxKKNfgKDRIeNBguLTRjUP9ZWQ', '9c6XLE1GuXQ', NULL, '{"publishedAt":"2020-04-09T07:36:07Z","channelId":"UCckZLmuYLFUGg4HE-dTNocw","title":"Energising Yoga Practice - Hips & Core","description":"Yesterday was an amazing sunny day so I practiced in the garden and sharing with you the practice. \nIt is a 45 min yoga practice with particular focus on hips and core. \nStarting in a standing position for a short warm up of the joints, followed by some variations of Sun Salutation, with holding plank, side plank and forearm plank. \nIt is a great practice if you are looking for something energetic to build strength in you core and hips but also working on balancing and flexibility. \nEnjoy! \nLove & Peace","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/9c6XLE1GuXQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/9c6XLE1GuXQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/9c6XLE1GuXQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/9c6XLE1GuXQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/9c6XLE1GuXQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Valentina Lia Yoga","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Energising Yoga Practice - Hips & Core","description":"Yesterday was an amazing sunny day so I practiced in the garden and sharing with you the practice. \nIt is a 45 min yoga practice with particular focus on hips and core. \nStarting in a standing position for a short warm up of the joints, followed by some variations of Sun Salutation, with holding plank, side plank and forearm plank. \nIt is a great practice if you are looking for something energetic to build strength in you core and hips but also working on balancing and flexibility. \nEnjoy! \nLove & P