INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17782, 'nQc7o5cxjO7phmZGE0QdfEwiP5c', 'NgHa8QrUIQc', NULL, '{"publishedAt":"2020-06-26T15:52:28Z","channelId":"UCpy8MwHVgo4xaas-zBoiaoA","title":"Yoga for Thyroid | upper Back | Lower Back | Digestive System | Pelvis","description":"Ushtrasana (Camel Pose):\n\nBenefits :\nRegulates the function of thyroid gland\nGood for people with slight back pain as it helps in strengthening the back\nHelps regulate menstrual cycle\n\nContraindications:\nNot to be performed by people suffering from severe back pain\n\nKandharasana (Shoulder Pose):\n\nBenefits:\nStrengthens your whole back\nBest practice for people suffering from thyroid problem\nstrengthens your arms ,shoulder and legs.\n\nBhujangasana (Cobra Pose):\n\nImproves and deepens breathing\nHelp in removing backache\nTones ovaries and uterus\nStimulates thyroid gland\n\nContraindications:\nPeople suffering from hyperthyroidism, hernia, peptic ulcer and intestinal tuberculosis","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/NgHa8QrUIQc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/NgHa8QrUIQc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/NgHa8QrUIQc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/NgHa8QrUIQc/sddefault.jpg","width":640,"height":480}},"channelTitle":"Astitva","tags":["Yogaforthyroid","Yogapractice","Asanas","Ushtrasana","Staytunned","Bhujangasana","Stayhealthy","Kandharasana","Digestivesystem","Upperback","Lowerback"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga for Thyroid | upper Back | Lower Back | Digestive System | Pelvis","description":"Ushtrasana (Camel Pose):\n\nBenefits :\nRegulates the function of thyroid gland\nGood for people with slight back pain as it helps in strengthening the back\nHelps regulate menstrual cycle\n\nContraindic