ghtful yogi''s shop on Amazon through this link http://www.amazon.com/?tag=fightyoga-20\n\nwww.fightmasteryoga.com\nFacebook - https://www.facebook.com/fightmasteryoga\nInstagram - http://instagram.com/fightmasteryoga\nTwitter - https://twitter.com/fightmasteryoga"},"defaultAudioLanguage":"en"}', '{"duration":"PT11M30S","dimension":"2d","definition":"hd","caption":"true","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"18296","likeCount":"543","dislikeCount":"1","favoriteCount":"0","commentCount":"29"}', '''beach'':5A ''celebr'':6A ''morn'':1A ''win'':8A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
