ed and open.\n.\nBe sure to continue for the month of February! All about self-love. You can access the calendar by visiting www.therollingmatadventure.com/landing"}}', '{"duration":"PT12M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"33","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''energi'':3A ''flow'':5A ''quick'':4A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
