 something that will work for YOU!\nYOU are the focus for this to work.\n\nFB Scandinavian group link :\nhttps://www.facebook.com/groups/blncdscandinavia/\nFB International group :\nhttps://www.facebook.com/groups/blncd/\n..............................................................................\n\nThe BLNC-D recipe :\nAligning the rhythm of inner peace, positive vibes and self reflection for that balanced lifestyle. Add a dash of ballet, a pinch of yoga and stir till you reach fulfilment. Decorated with fitness and motivational bites.\n...........\n\nDo not miss our other channels to stay connected with what''s new.\n\nFacebook page : https://www.facebook.com/blncdbymonika\n\nInstagram : https://www.instagram.com/blnc.d/\n..............................................................................\n\nRoyalty free Music from : \nhttps://www.epidemicsound.com/referral/z3argw/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/ratJRPjnwtw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/ratJRPjnwtw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/ratJRPjnwtw/hqdefault.jpg","width":480,"height":360}},"channelTitle":"BLNC-D","tags":["yoga","BLNC-D","balance","balett","mindfulness","morning"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"BLNC-D Yoga Morning session Beginners/ Slow Flow","description":"This morning practice is designed to set you up for a good day. \nAdding that extra time for setting an intention and taking our time in the Yoga poses (asanas).  \nFocus is warm-up and sun salutations. \nPerfect for beginners or for every Yogi who just want a slow flow practice to be able to connect with the body. \n\nWith love and light / Monika\n....\nHi everyone.\nBLNC-D will be released on the 20th of February in  2 steps:\n1) A 5 week course that will get you started on your BLNC-D lifestyle.\n* This 5 week course will include an intro to :\n- BLNC-D Yoga\n- BLNC-D Ballet\n- 