 Total Body and Boost Immune Function ~ https://youtu.be/gEwgPtNhgC8\nYoga to Mobilize and Release Tight Hips ~ https://youtu.be/e-jiIEvtizI\nYoga for Better Posture ~ https://youtu.be/VlTjSI8Pt5Y\nDynamic Movement Yoga Flow ~ https://youtu.be/W1Y9FhAa3SI\n30 Min Total Body Yoga Rebalance ~ https://youtu.be/iGQiDa5FoGA\n\nConnect with me!\nBlog: https://TwistingFitness.com/\nInquiries: jmossmb@yahoo.com\nhttps://www.instagram.com/athletejessicamoss/\nhttps://www.facebook.com/AthleteJessicaMoss\nhttps://www.pinterest.com/JessicaMossBechtold\n\nTrack Title: Out of the Grey\nArtist Name(s): Stephen Keech\nWriter Name: Stephen Keech\nWriter IPI Number: 524988513\nWriter PRO: ASCAP\nWriter Percentage: 50.0%\nPublisher Name: A SOUNDSTRIPE PRODUCTION\nPublisher IPI Number: 00882718598\nPublisher PRO: ASCAP\nPublisher Percentage: 50.0%\n\nDisclaimer: Twisting Fitness recommends as with any fitness or yoga program its important that you consult your physician regarding the applicability of any recommendations and follow all safety instructions before beginning any exercise program. When participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, and assume all risk of injury to yourself.\n\n#yogaforbackpain #backreliefyoga #twistingfitness"}}', '{"duration":"PT49M18S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"49","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''45'':6A ''back'':4A,12A ''feel'':8A ''fit'':15A ''flow'':10A ''good'':9A ''health'':13A ''jess'':17A ''min'':7A ''pain'':5A ''practic'':2A ''twist'':14A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17801, 'RTkDMY2J0VjbqQHvOG7Lpdwr_Jc', 'GyFXARxpPiE', NULL, '{"publishedAt":"2019-01-17T02:30:00Z","channelId":"UCq8UGEYF0mL44A6LT7XoZJQ","title":"Morning Yoga - 40 min Instagram Live Flow","description":"Save this video for a great morning/afternoon flow to warm up your bones and body. \n\nhttp://www.instagram.com/joyscola\nhttp://www.joyscola.com\nhttp://www.facebook.com/joyscola\n\nMusic by: Tyler August\nhttp://www.soundcloud.com/thetyleraugust\nhttp://www.instagram.com/thetyleraugust\nhttp://www.tyleraugustmusic.com\n\nMy Yoga Mat: Jade Yoga Harmony Mat - https://jadeyoga.com/collections/yoga-mats/products/harmony-mat\n\nYoga and breathing aids in relieving depression and anxiety. Steady breath stimulates our PNS which is our at response system responsible for digestion and healing. Our sympathetic nervous system is like Wario and our parasympathetic nervous system is like Mario. \n\nGet to know yoga from the comfort of home and a taste of what a class would be like. Or, if you''re too busy to commit a full hour then this is the morning routine for you. \n\nEach week will offer a new half-hour yoga flow to follow along from home that offers full body stretches and warm up. Won''t make you dripping with sweat but will heat your body and focus your mind. \n\nInstructor: Joy Scola from the YouTube channel, Psychetruth.\n\nI wasn''t born \"bendy\". When I first started my health journey, I couldn''t touch my toes and backbends HURT! They gave me headaches and made me feel cranky. Since I thought backbends were the worst, I decided to make it a focus in my practice. So grunting and while silently cursing in my mind, I stretched. Now, I love backbends! \n\nI still find that if I don''t practice for a while, I get stiff in my body and remember why I started yoga in the first place. Some days you may not feel very up to it. Listen to and be gentle with your body when this arises. Go easy and move with your breath while we gently wake up the body and mind. Moving oxygen into the bloodstream to feel more refreshed, centered, and focused. \n\nYoga Tip: If you struggle with committing to a workout/Yoga practice, try telling yourself, just 5/10 mins and Im done. It takes a great weight off the ego and clears resistance which allows room for small changes and small changes lead to big growth.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/GyFXARxpPiE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/GyFXARxpPiE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/GyFXARxpPiE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/GyFXARxpPiE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/GyFXARxpPiE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Joy Scola","tags":["hatha","instagram","live","video","yoga","teacher","instructor","beginner","friendly","easy","at","home","follow","along","feel","good","better","40","forty","minutes","min","morning","stretch","strengthen","workout","fitness","routine","how","to","flexebility","strength","joy","scola","psychetruth","flow","sequence","poses","hamstrings","core","legs","arms","full","body"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Morning Yoga - 40 min Instagram Live Flow","description":"Save this video for a great morning/afternoon flow to warm up your bones and body. \n\nhttp://www.instagram.com/joyscola\nhttp://www.joyscola.com\nhttp://www.facebook.com/joyscola\n\nMusic by: Tyler August\nhttp://www.soundcloud.com/thetyleraugust\nhttp://www.instagram.com/thetyleraugust\nhttp://www.tyleraugustmusic.com\n\nMy Yoga Mat: Jade Yoga Harmony Mat - https://jadeyoga.com/collections/yoga-mats/products/harmony-mat\n\nYoga and breathing aids in relieving depression and anxiety. Steady breath stimulates our PNS which is our at response system responsible for digestion and healing. Our sympathetic nervous system is like Wario and our parasympathetic nervous system is like Mario. \n\nGet to know yoga from the comfort of home and a taste of what a class would be like. Or, if you''re too busy to commit a full hour then this is the morning routine for you. \n\nEach week will offer a new half-hour yoga flow to follow along from home that offers full body stretches and warm up. Won''t make you dripping with sweat but will heat your body and focus your mind. \n\nInstructor: Joy Scola from the YouTube channel, Psychetruth.\n\nI wasn''t born \"bendy\". When I first started my health journey, I couldn''t touch my toes and backbends HURT! They gave me headaches and made me feel cranky. Since I thought backbends were the worst, I decided to make it a focus in my practice. So grunting and while silently cursing in my mind, I stretched. Now, I love backbends! \n\nI still find that if I don''t practice for a while, I get stiff in my body and remember why I started yoga in the first place. Some days you may not feel very up to it. Listen to and be gentle with your body when this arises. Go easy and move with your breath while we gently wake up the body and mind. Moving oxygen into the bloodstream to feel more refreshed, centered, and focused. \n\nYoga Tip: If you struggle with committing to a workout/Yoga practice, try telling yourself, just 5/10 mins and Im done. It takes a great weight off the ego and clears resistance which allows room for small changes and small changes lead to big growth."},"defaultAudioLanguage":"en"}', '{"duration":"PT43M36S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1175","likeCount":"34","dislikeCount":"0","favoriteCount":"0","commentCount":"16"}', '''40'':3A ''flow'':7A ''instagram'':5A ''live'':6A ''min'':4A ''morn'':1A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
