INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17809, '41MS65Dl-6K7dARIsfJtR7307yM', 'LejNF5ZRXWo', NULL, '{"publishedAt":"2020-06-22T22:00:11Z","channelId":"UCcnlme55QievY9XN73Zjq2Q","title":"Morning Yoga Workout  | Strength & Stretch","description":"A 15 minute yoga workout class which aims to strengthen and stretch your body. It is a perfect way to wakeup your body but also great anytime and almost anywhere. \n\nThe best way to wake up your body in the morning is by combining heart raising exercises, stretching your body and strength building exercises. This 15 minute  yoga class will do exactly that! It will raise your heart rate and get you sweating, while working your abs, shoulders, legs and upper body.  \n\nIf you are looking wake up your body in the morning and focus your mind and energy levels for the day ahead this is the perfect morning yoga class for you. \n\nInstagram: @jenikasmith_\n\nCamera: Canon G7x mark ii\nDrone: Dji Spark\n\nLocation: Brazil, Florianopolis.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/LejNF5ZRXWo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/LejNF5ZRXWo/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/LejNF5ZRXWo/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/LejNF5ZRXWo/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/LejNF5ZRXWo/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Jenika Smith","tags":["yoga","boho beautiful","yoga for beginners","yoga journey","traditional yoga","yoga guru","yoga style","hatha yoga","vinyasa yoga","astanga yoga","yoga discussion","yoga for all levels","yoga for healing","yoga for weight loss","yoga teacher","yogi","traditional yoga classes","yoga workouts","yoga for strength","yoga teacher training","best yoga classes online","yoga online","yoga for beginners. yoga with Adrienne","boho beautiful yoga"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Morning Yoga Workout  | Strength & Stretch","description":"A 15 minute yoga workout class which aims to strengthen and stretch your body. It is a perfect way to wakeup your body but also great anytime and almost anywhere. \n\nThe best way to wake up your body in the morning is by combining heart raising exercises, stretching your body and strength building exercises. This 15 minute  yoga class will do exactly that! It will raise your heart rate and get you sweating, while working your abs, shoulders, legs and upper body.  \n\nIf you are looking wake up your body in the morning and focus your mind and energy levels for the day ahead this is the perfect morning yoga class for you. \n\nInstagram: @jenikasmith_\n\nCamera: Canon G7x mark ii\nDrone: Dji Spark\n\nLocation: Brazil, Florianopolis."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT16M","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"59","likeCount":"11","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''morn'':1A ''strength'':4A ''stretch'':5A ''workout'':3A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
