INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17814, '4nR_nR9VWCrsZ-RBhFSrYPoH-78', 'BOcrtyeU8lQ', NULL, '{"publishedAt":"2019-12-12T12:00:11Z","channelId":"UCTe8ABP94FZadBA-TgpKKzA","title":"1 hour Vinyasa Flow Yoga | 60 minute | Yoga for Runners","description":"60 minute Vinyasa Flow Yoga class specifically designed for runners.  This class is sequenced to strengthen as well as increase flexibility in the legs and the hips. I hope you enjoy! \n\n~  y o g a m u s i c  ~ \r\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://spoti.fi/2VVjtqz\r\n\n~  f i n d m e  ~ \r\n\ninstagram | https://www.instagram.com/ailsaburns/ \r\n\nmy website | https://www.frostedfeather.com/ \r\n\n~  a b o u t m e  ~ \r\n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. I decided to start this YouTube channel because I love teaching yoga and I want to share my yoga classes with as many as people as possible. \r\n\n~  s u p p o r t m e  ~ \r\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. This is one of the ways that I plan to share my love of yoga beyond public classes. If you are person of means and would like to support me to continue making videos for my channel, then please consider supporting me via PayPal: http://bit.ly/2IEx8dR\r\n\n~  f i l m i n g  ~ \r\n\nThis video was filmed by Foldout Films: https://www.foldoutfilms.co.uk/, edited by me and filmed at Yoga on the Square in Bristol: https://yogaonthesquare.co.uk/.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/BOcrtyeU8lQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/BOcrtyeU8lQ/mqdefault.jpg","width":320,"height":180},"