INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17822, 'qNMi58xjKKsFUV9vD0zbWKAvFC8', '4QF6LWEB7NU', NULL, '{"publishedAt":"2016-03-05T23:18:36Z","channelId":"UCIiI9tAbgvSPPL_50gefFtw","title":"morning yoga routine {stress-free, energetic start to the day}","description":"http://www.nourishmovelove.com/\n\n10 morning yoga poses that will make you feel totally energized while decreasing cortisol levels for a stress-free start to the day. {It''s better than coffee for boosting your mood in the morning.}\n\nMorning Yoga Routine:\n1. down dog \n2. 3 legged dog + hip opener\n3. low lunge \n4. low crescent lunge \n5. low lunge + side body stretch \n6. side twist \n7. half splits \n8. low lunge hip opener \n9. side twist + chest expansion  \n10. half pigeon\n\n*Equipment Needed: yoga mat\n**Complete entire sequence and then repeat routine on the other side; holding each pose for a minimum of 3 breathes.\n\nFor more exercises and workouts you can do anywhere, visit the Nourish Move Love Blog at:\nhttp://www.nourishmovelove.com/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/4QF6LWEB7NU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/4QF6LWEB7NU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/4QF6LWEB7NU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/4QF6LWEB7NU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/4QF6LWEB7NU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"nourishmovelove","tags":["morning yoga","yoga","yoga routine","yoga stretch and flow","yoga flow","stress-free","energy","10 morning yoga poses","yoga pose","down dog","3 legged dog","half splits","half pigeon","at home workout","post-workout stretch","stretch","warm up","pre-workout warm up"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"morning yoga rou