INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17824, '6pexIsNfHLKgyQZddnQbrEIUDbM', 'V0CPw49WXCc', NULL, '{"publishedAt":"2016-07-24T23:21:19Z","channelId":"UCVeJWrTWWjfmCa5aqHSXcnw","title":"Chair Yoga Sequence For Arthritis, Injuries & Mobility Issues!","description":"There were many years where I could not complete a \"normal\" yoga practice. I never realized that practicing in a chair can, and will, give you all the benefits of a mat practice as well. This sequence is perfect for chronically fabulous patients thriving with psoriatic arthritis, rheumatoid arthritis, lupus, MS, diabetes, lyme - truly  any and all conditions! If you''ve had an injury or have osteoarthritis, this is also a perfect flow for you. Connecting your breath with your movement has PROFOUND affects on the body. Try this simple chair yoga flow today.\n\nTo learn more details, check out the entire blog post here: http://www.itsjustabadday.com/2016/07/25/chair-yoga-sequence-for-mobility-issues/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/V0CPw49WXCc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/V0CPw49WXCc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/V0CPw49WXCc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/V0CPw49WXCc/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/V0CPw49WXCc/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Julie Croner","tags":["yoga","chair yoga","mobility issues","autoimmune","knee pain","hip pain","modified yoga","spoonie yoga"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"Chair Yoga Sequence For Arthritis, Injuries & Mobility Issues!","description":"There were many years where I could not complete a \"normal\" yoga practice. I never realized that practicing in a chair can, and will, give you all the benefits of a mat practice as well. This sequence is perfect for chronically fabulous patients thriving with psoriatic arthritis, rheumatoid arthritis, lupus, MS, diabetes, lyme - truly  any and all conditions! If you''ve had an injury or have osteoarthritis, this is also a perfect flow for you. Connecting your breath with your movement has PROFOUND affects on the body. Try this simple chair yoga flow today.\n\nTo learn more details, check out the entire blog post here: http://www.itsjustabadday.com/2016/07/25/chair-yoga-sequence-for-mobility-issues/"}}', '{"duration":"PT24M12S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"6581","likeCount":"82","dislikeCount":"2","favoriteCount":"0","commentCount":"4"}', '''arthriti'':5A ''chair'':1A ''injuri'':6A ''issu'':8A ''mobil'':7A ''sequenc'':3A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17825, 'rHl5q2d1Bq6sx8wFaGFxwJAAQSo', 'LwDJ1rUMNbg', NULL, '{"publishedAt":"2020-06-24T01:46:53Z","channelId":"UC-bw9YLGRjcQZMooV-8wZvg","title":"40-Minute Yoga Flow: Back & Balance","description":"This is a 40-minute gentle warm up and back strengthening and balance building practice. You will need a mat, some blocks or stacks of books, or chairs...or whatever you need to help you be successful in today''s practice. We will be doing some foundational movements and you can take them to whatever level you find useful. You''ve got this!!\n****If you are struggling with depression, anxiety, or suicidal thoughts, PLEASE reach out to a mental health professional. The National Suicide Prevention Lifeline is 1-800-273-TALK (8255) or for crisis counseling the SAMHSA Treatment Referral Helpline 1-877-SAMHSA7 (1-877-726-4727). For the Crisis Textline, text HOME to 741741. For domestic violence, rape, abuse, incest or human trafficking contact RAINN at 1-800-656-HOPE (4673) or the National Domestic Violence Hotline: 1-800-799-SAFE (7233). In the Bakersfield area call The Alliance Against Family Violence and Sexual Assault toll free: 1-800-273-7713, LGBTQ Hotline: 661-322-2869, 24 Hour Crisis Hotline: 661-327-1091\n*Disclaimer: I strive to bring you authentic content from my own journey through trauma recovery, my traumatology counseling graduate and doctoral work, and the most recent empirically supported research in my psychoeducation. While I am a certified ACE fitness professional and certified Trauma Center Trauma Sensitive Yoga (TCTSY) facilitator, at this time I am not a licensed mental health professional and the views and opinions I express in the areas of mental health are my own and are not supported by an institution or governing body of professionals. If you are curious about therapy animal programs, PetPartners.org is a great place to start. Remember, you are seen, you are heard, you have a voice and you have a choice. Be empowered through Gods word and healthy psychoeducation; knowledge is power and compassion gives life. Be blessed today!!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/LwDJ1rUMNbg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/LwDJ1rUMNbg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/LwDJ1rUMNbg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/LwDJ1rUMNbg/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/LwDJ1rUMNbg/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Empowered for the Journey","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"40-Minute Yoga Flow: Back & Balance","description":"This is a 40-minute gentle warm up and back strengthening and balance building practice. You will need a mat, some blocks or stacks of books, or chairs...or whatever you need to help you be successful in today''s practice. We will be doing some foundational movements and you can take them to whatever level you find useful. You''ve got this!!\n****If you are struggling with depression, anxiety, or suicidal thoughts, PLEASE reach out to a mental health professional. The National Suicide Prevention Lifeline is 1-800-273-TALK (8255) or for crisis counseling the SAMHSA Treatment Referral Helpline 1-877-SAMHSA7 (1-877-726-4727). For the Crisis Textline, text HOME to 741741. For domestic violence, rape, abuse, incest or human trafficking contact RAINN at 1-800-656-HOPE (4673) or the National Domestic Violence Hotline: 1-800-799-SAFE (7233). In the Bakersfield area call The Alliance Against Family Violence and Sexual Assault toll free: 1-800-273-7713, LGBTQ Hotline: 661-322-2869, 24 Hour Crisis Hotline: 661-327-1091\n*Disclaimer: I strive to bring you authentic content from my own journey through trauma recovery, my traumatology counseling graduate and doctoral work, and the most recent empirically supported research in my psychoeducation. While I am a certified ACE fitness professional and certified Trauma Center Trauma Sensitive Yoga (TCTSY) facilitator, at this time I am not a licensed mental health professional and the views and opinions I express in the areas of mental health are my own and are not supported by an institution or governing body of professionals. If you are curious about therapy animal programs, PetPartners.org is a great place to start. Remember, you are seen, you are heard, you have a voice and you have a choice. Be empowered through Gods word and healthy psychoeducation; knowledge is power and compassion gives life. Be blessed today!!"}}', '{"duration":"PT40M30S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"7","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''40'':1A ''back'':5A ''balanc'':6A ''flow'':4A ''minut'':2A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
