INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17829, 'C7GSB5AaacWF6hKKf_Zy83rXl2s', 'pMsgqt52qgs', NULL, '{"publishedAt":"2020-06-23T23:51:18Z","channelId":"UCeZojUTzvZZJ3QOjRX-BvIg","title":"40-Min Yoga Flow for Beginners \"Gentle Hips Release\"","description":"This Yoga practice is a gentle flow focused on strengthening and opening the hips. The stiffness in that part of the body can produce pain in our back and legs, and it can even affect our emotions, manifesting our fears and vulnerabilities.\n\nSo this 40-minute sequence is good not only to let go of the tension in that area and all the physical pain that comes with it but also to heal those feelings that are holding us back. \n\n I hope you enjoy it, and if so you can try my EXCLUSIVE ONLINE YOGA and PILATES CLASSES by clicking in the next link  https://www.patreon.com/nena4real\n\n  Subscribe to N4R channel for more free workouts videos https://www.youtube.com/nena4real","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/pMsgqt52qgs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/pMsgqt52qgs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/pMsgqt52qgs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/pMsgqt52qgs/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/pMsgqt52qgs/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Nena4Real","tags":["yoga for beginners","yoga flow beginners","vinyasa yoga","vinyasa flow","vinyasa flow beginner","yoga gentle hips","yoga","yoga hips opening","hip opening yoga","hip openers","hip release yoga","hip release","hip opening flow","hip stretches","yoga for hips","yoga for hip pain","yoga for hip pain relief","free yoga","free yoga class","yoga at home","online yoga","online yoga class","beginners yoga","yoga videos","home yoga practice"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"40-Min Yoga Flow for Beginners \"Gentle Hips Release\"","description":"This Yoga practice is a gentle flow focused on strengthening and opening the hips. The stiffness in that part of the body can produce pain in our back and legs, and it can even affect our emotions, manifesting our fears and vulnerabilities.\n\nSo this 40-minute sequence is good not only to let go of the tension in that area and all the physical pain that comes with it but also to heal those feelings that are holding us back. \n\n I hope you enjoy it, and if so you can try my EXCLUSIVE ONLINE YOGA and PILATES CLASSES by clicking in the next link  https://www.patreon.com/nena4real\n\n  Subscribe to N4R channel for more free workouts videos https://www.youtube.com/nena4real"},"defaultAudioLanguage":"en"}', '{"duration":"PT43M13S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"21","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''40'':1A ''beginn'':6A ''flow'':4A ''gentl'':7A ''hip'':8A ''min'':2A ''releas'':9A ''yoga'':3A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
