INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17855, 'q07PYK6seucpBgou4TRCMIowMUM', 'x98sjxTAhuQ', NULL, '{"publishedAt":"2018-08-30T22:33:38Z","channelId":"UCAHbtzUcIQPW21Q4rxaNhww","title":"Yoga (Quick) For Energy","description":" Subscribe to us on YouTube: \n\nhttps://www.youtube.com/channel/UCAHbtzUcIQPW21Q4rxaNhww\n\n\n Carley on Insta: \n\n\nhttps://www.instagram.com/carleyraefit/\n\n Twitter: \n\nhttps://twitter.com/selfmasteryduo\n\n\n\n\nA little about me. My name is Carley Schroeder I am a fitness enthusiast and I love movement. I am certified through NASM and ACSM as a personal trainer am yoga and TRX certified as well. I studied for my bachelor''s degree in health and fitness and I now work as a teacher and life coach. I create awesome fun videos in my spare time as well as research and blog. If you have any questions about better health, mental or physical strength be sure to check out blog selfmasteryduo.com for related articles. I hope you enjoy these free workouts and you hold yourself responsible to make healthy decisions every day. \n\nPlease note: I am not a doctor. Practice these workouts at your own level. If you have any concerns or notice any abnormalities contact your physician.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/x98sjxTAhuQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/x98sjxTAhuQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/x98sjxTAhuQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/x98sjxTAhuQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/x98sjxTAhuQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Carley Schroeder","tags":["Yoga","Energy","Home Yoga","Woroutathome","Yoga stretch","Yoga Beginner","Yoga Happy"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga (Quick) For Energy","description":" Subscribe to us on YouTube: \n\nhttps://www.youtube.com/channel/UCAHbtzUcIQPW21Q4rxaNhww\n\n\n Carley on Insta: \n\n\nhttps://www.instagram.com/carleyraefit/\n\n Twitter: \n\nhttps://twitter.com/selfmasteryduo\n\n\n\n\nA little about me. My name is Carley Schroeder I am a fitness enthusiast and I love movement. I am certified through NASM and ACSM as a personal trainer am yoga and TRX certified as well. I studied for my bachelor''s degree in health and fitness and I now work as a teacher and life coach. I create awesome fun videos in my spare time as well as research and blog. If you have any questions about better health, mental or physical strength be sure to check out blog selfmasteryduo.com for related articles. I hope you enjoy these free workouts and you hold yourself responsible to make healthy decisions every day. \n\nPlease note: I am not a doctor. Practice these workouts at your own level. If you have any concerns or notice any abnormalities contact your physician."}}', '{"duration":"PT16M41S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"57","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''energi'':4A ''quick'':2A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
