liosis","how to cure scoliosis","treating scoliosis","spinal health","curved spine","curvature"],"categoryId":"25","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"How Yoga for Scoliosis Helped an 86-year-old Woman Transform Her Body | New York Post","description":"At 85 years young, Anna Pesce discovered yoga, which transformed her life and her body. Anna suffered from decades of severe scoliosis and was even wheelchair-bound. But her fierce determination and diligent practice with back care specialist Rachel Jesien proved the remarkably transformative effects that yoga therapy can have on the body.\n\nThe New York Post is your source for breaking news, news about New York, sports, business, entertainment, opinion, real estate, culture, fashion, and more.\n\nCatch the latest news and gossip here: \nhttps://nypost.com/video/\nFollow The New York Post on:\nTwitter - https://twitter.com/nypost\nFacebook - https://www.facebook.com/NYPost"},"defaultAudioLanguage":"en"}', '{"duration":"PT41S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"340733","likeCount":"447","dislikeCount":"12","favoriteCount":"0","commentCount":"10"}', '''86'':7A ''bodi'':14A ''help'':5A ''new'':15A ''old'':10A ''post'':17A ''scoliosi'':4A ''transform'':12A ''woman'':11A ''year'':9A ''year-old'':8A ''yoga'':2A ''york'':16A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
