belly fat kaise mitaaye","how to burn belly fat","belly fat burn karne ki tips","weight loss yoga hindi","yoga se weight loss","how to lose weight","weight kam karne ka tareeka","weight loss tips hindi","wazan kaise kam kare"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"5 Yogasana For Weightloss and Flat Tummy - Hindi","description":"We all know that yoga can help you lose weight and burn fat faster. It can help you lose body fat as well and you can get in shape with ease. however, many people do not know what kind of yoga they should do for weight loss or how they should do yoga to lose weight. If you have these questions in your mind, this video is for you. In this video we are sharing five simple yet highly effective yogasan for weight loss.\n\nWe are sure if you can follow these tips and if you can do these 5 yogasan at home for weight loss you can lose weight fast. With these Tips you will not only lose weight fast but you will also be able to have many other amazing health benefits including higher immunity, flexiblity and much more.\n\nSo, if you desire to lose weight fast, make sure you follow these five weight loss yogasan and burn body fast faster to have a flat tummy\n\n#FlatTummy #WeightLoss #Yoga"}}', '{"duration":"PT8M12S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"27731","likeCount":"646","dislikeCount":"23","favoriteCount":"0","commentCount":"8"}', '''5'':1A ''flat'':6A ''hindi'':8A ''tummi'':7A ''weightloss'':4A ''yogasana'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17875, 'u9Et2x-BKSy9MdqchJi6_I1sT7g', 'gbbQI-QQuDQ', NULL, '{"publishedAt":"2020-06-22T05:00:06Z","channelId":"UCKAZRryU0PmYvdZNve3BiaA","title":"YOGA FOR SCIATICA","description":"#herniatedL4disk #spinalstenosis #sciatica\n\nThis video is the 9th video sharing my journey to healing of herniated L4 disk, sciatica and spinal stenosis. In this practice I share a yoga routine specially designed to deal with sciatica whether it comes from a herniated disk or pinched nerve. \nI hope you find it helpful. \n\nPLAYLIST where all videos in this series are kept: \nhttps://www.youtube.com/playlist?list=PLsrjmq2oBC8baNa4LMHnxcNo_SXCIExDF\n\nSIGN UP FOR ANITA''s NEWSLETTER:\nhttp://anitagoa.com/anita/newsletter/\n\nFOLLOW ANITA ON SOCIAL MEDIA :\n*INSTAGRAM:\n https://instagram.com/AnitaGoa \n*FACEBOOK: http://www.facebook.com/anitagoatv\n*WEBSITE: http://www.anitagoa.com\n\nDISCLAIMER: This video series is documenting my own personal journey of rehabilitating a herniated L4 disk and mild spinal stenosis. Please consult your GP and a PT to know what your own diagnosis is. Be mindful if you participate in this video or series. It might not be right for you. I take no responsibility for any pain, discomfort, or injury it might cause. If you choose to participate in this practice practice responsibly and stop if it hurts or feels painful.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/gbbQI-QQuDQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/gbbQI-QQuDQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/gbbQI-QQuDQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/gbbQI-QQuDQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/gbbQI-QQuDQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Anita Goa","tags":["sciatica","herniated disk","spinal stenosis","yoga for sciatica","yoga for herniated disk","yoga for spinal stenosis","yoga for back","yoga with anita","yoga with anita goa","yoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"YOGA FOR SCIATICA","description":"#herniatedL4disk #spinalstenosis #sciatica\n\nThis video is the 9th video sharing my journey to healing of herniated L4 disk, sciatica and spinal stenosis. In this practice I share a yoga routine specially designed to deal with sciatica whether it comes from a herniated disk or pinched nerve. \nI hope you find it helpful. \n\nPLAYLIST where all videos in this series are kept: \nhttps://www.youtube.com/playlist?list=PLsrjmq2oBC8baNa4LMHnxcNo_SXCIExDF\n\nSIGN UP FOR ANITA''s NEWSLETTER:\nhttp://anitagoa.com/anita/newsletter/\n\nFOLLOW ANITA ON SOCIAL MEDIA :\n*INSTAGRAM:\n https://instagram.com/AnitaGoa \n*FACEBOOK: http://www.facebook.com/anitagoatv\n*WEBSITE: http://www.anitagoa.com\n\nDISCLAIMER: This video series is documenting my own personal journey of rehabilitating a herniated L4 disk and mild spinal stenosis. Please consult your GP and a PT to know what your own diagnosis is. Be mindful if you participate in this video or series. It might not be right for you. I take no responsibility for any pain, discomfort, or injury it might cause. If you choose to participate in this practice practice responsibly and stop if it hurts or feels painful."}}', '{"duration":"PT37M55S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"482","likeCount":"26","dislikeCount":"0","favoriteCount":"0","commentCount":"10"}', '''sciatica'':3A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17876, 'X7MLCHta2GWrWUuTJi6SAvQFfaM', 'GXbcUuORiKY', NULL, '{"publishedAt":"2016-12-13T23:36:12Z","channelId":"UCoI2HuJP6NHFk9kRZstmAug","title":"Recover from Leg Day! [Yoga for Weightlifters]","description":"Sore from lifting or other athletic ventures? Give this flow a go! In this video, we work on warming and relaxing the hamstrings, quadriceps, glutes, and hip flexors to help you recover and improve flexibility. Enjoy :)\n\nNEW FREE YOUTUBE CLASSES EVERY WEEK!!\n*Leave requests/suggestions in comments\n\n[Flow With Adee] I am a registered yoga teacher with a B.S. in Exercise Physiology. Movement is essential to a happy, healthy lifestyle and I believe there is a form of movement for everyone. With roots in dance, much of my yoga is free flowing and therefore looks different on every body. That is the beauty of it! Allow your body to MOVE YOU. I hope my classes can provide you some peace and a time to tune in to your body and let go. xx\n\nWebsite:\nAdisonBriana.com\n\nSocial Medias:\nInstagram @AdeeOnEarth\nFacebook @Flow With Adee\nSnapchat @Adi.Bri\nVegan-Vibrations.tumblr.com\n\nContact Me:\nAdisonBrianaCoaching@gmail.com\n\nMusic Credit:\nYou''re free to use this song and monetize your video, but you must include the following in your video description:\nLight Awash by Kevin MacLeod is licensed under a Creative Commons Attribution license (https://creativecommons.org/licenses/by/4.0/)\nSource: http://incompetech.com/music/royalty-free/index.html?isrc=USUAN1100175\nArtist: http://incompetech.com/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/GXbcUuORiKY/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/GXbcUuORiKY/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/GXbcUuORiKY/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/GXbcUuORiKY/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/GXbcUuORiKY/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Adison Briana","tags":["yoga","flow with adee","adisonbriana","adee yoga","yoga with adee","free yoga","yoga girl","fitness","workout","yoga for weightlifters","leg day recovery","prana","yoga pants","adeeonearth","vegan-vibrations","hamstrings","glutes","quads","yoga for lifting","sore legs","recovery","stretching","lifting","leg day","muscles","yoga at home","workout at home"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Recover from Leg Day! [Yoga for Weightlifters]","description":"Sore from lifting or other athletic ventures? Give this flow a go! In this video, we work on warming and relaxing the hamstrings, quadriceps, glutes, and hip flexors to help you recover and improve flexibility. Enjoy :)\n\nNEW FREE YOUTUBE CLASSES EVERY WEEK!!\n*Leave requests/suggestions in comments\n\n[Flow With Adee] I am a registered yoga teacher with a B.S. in Exercise Physiology. Movement is essential to a happy, healthy lifestyle and I believe there is a form of movement for everyone. With roots in dance, much of my yoga is free flowing and therefore looks different on every body. That is the beauty of it! Allow your body to MOVE YOU. I hope my classes can provide you some peace and a time to tune in to your body and let go. xx\n\nWebsite:\nAdisonBriana.com\n\nSocial Medias:\nInstagram @AdeeOnEarth\nFacebook @Flow With Adee\nSnapchat @Adi.Bri\nVegan-Vibrations.tumblr.com\n\nContact Me:\nAdisonBrianaCoaching@gmail.com\n\nMusic Credit:\nYou''re free to use this song and monetize your video, but you must include the following in your video description:\nLight Awash by Kevin MacLeod is licensed under a Creative Commons Attribution license (https://creativecommons.org/licenses/by/4.0/)\nSource: http://incompetech.com/music/royalty-free/index.html?isrc=USUAN1100175\nArtist: http://incompetech.com/"}}', 