INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17897, '-wOiDM_pzWo0j5u4YI-6U81Dszs', 'h5mOPyO-o6w', NULL, '{"publishedAt":"2020-06-23T04:10:07Z","channelId":"UCP_qG8xwDcJzlyf9JPHZdjg","title":"20-Minute Yoga Flow - Heart, Hips, and Handstands","description":"Enjoy this challenging, inversion full, quick under 20 minute yoga class. There is a lot less cueing here, so a bit of posture knowledge is expected for this fast paced flow. \n\nFeel free to pause and play around for longer with the inversions. Likewise, option to pause and spend more time in the hip opening and savasana. This is a great in and out yoga class for the busy yogi who wants to practice inversions and get their heart pumping. I hope you enjoy this class, it is heavy on the heart and hip opening, with a healthy dose of handstands too!\n\nFollow Laura Mary on Facebook (www.facebook.com/lauramarylinsley) and Instagram (@lauramarylinsley), or check out her website (https://www.lauramarylinsley.com/).","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/h5mOPyO-o6w/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/h5mOPyO-o6w/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/h5mOPyO-o6w/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/h5mOPyO-o6w/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/h5mOPyO-o6w/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Laura Mary Linsley","tags":["chaturanga","handstand","yogawithlauramary","forearmstand","inversions","arm balance","magic island","yoga outside","hawaii","yoga hawaii","laura mary linsley","laura mary yoga","LM Yoga","hip focused yoga","half moon","ardha chandrasana","magic island hawaii"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"20-Minute Yoga Flow - Heart, Hips, and Handstands","description":"Enjoy this 