INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17902, '1u55BOJ8OBnEPGv_K0aaEW9VzwA', 'PiPSLVSGigc', NULL, '{"publishedAt":"2020-05-08T19:38:42Z","channelId":"UCxDYyHLKJPyAdF9E3b9FLEQ","title":"Yoga for Fitness| 20 min Strengthening Yoga Fitness Class| Yoga with Yana","description":"Hello all, \n\nToday we have a quick & dynamic 20 minute Yoga for Fitness class for you! This class is not a traditional yoga class, but focuses more on strengthening the entire body. When we have a stronger core, and stronger muscles in general, our entire body benefits from it. Our posture becomes better, our back pains significantly get better (as there is more support for the spine and the extra pressure is removed), our blood circulation improves, the digestive organs are stimulated and I can go on about the benefits. I sincerely believe it is important to dedicate time to strengthen the body whenever we can in order to live a healthier and happier life! For this reason, I have decided to create yoga for fitness classes. I encourage you to focus on your breath throughout the entire practice and flow with your breath. This will make it easier for you to get into each pose and keep a mind and body connection. I hope you find this class enjoyable & challenging and feel much more strong, empowered & elevated in your mood afterwards.\n\nPlease let me know in the comments section if you enjoy these type of classes and would like to see more classes like this once in a while! \n\nSending much love your way and from my heart to yours, \nNamaste!\n\nCheck out our facebook : https://www.facebook.com/yoga.with.yana/\nCheck our instagram : https://www.instagram.com/yanathompson_/\nCheck out our Twitter: https://twitter.com/YanaThompson3\n---------------------------------\nYoga with Yana recommends that you consult your physician regarding the applicability of any recommendations and follow all safety instructions before beginning any exercise program. When participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself.\n\n Outro Music: www.bensound.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/PiPSLVSGigc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/PiPSLVSGigc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/PiPSLVSGigc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/PiPSLVSGigc/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/PiPSLVSGigc/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Yana","tags":["yoga workout","yoga for strength","power yoga","yoga for weight loss","20 minute yoga","power yoga workout","weight loss yoga","yoga class","full body yoga","yoga strength","yoga for weightloss","20 min yoga","20 minute yoga workout","free yoga","yoga with yana","20 minute power yoga","yoga for core","yoga for abs","yoga tone","20 minute workout","full body yoga workout for weight loss","full body yoga workout","yoga for athletes","power yoga for strength","core workout"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga for Fitness| 20 min Strengthening Yoga Fitness Class| Yoga with Yana","description":"Hello all, \n\nToday we have a quick & dynamic 20 minute Yoga for Fitness class for you! This class is not a traditional yoga class, but focuses more on strengthening the entire body. When we have a stronger core, and stronger muscles in general, our entire body benefits from it. Our posture becomes better, our back pains significantly get better (as there is more support for the spine and the extra pressure is removed), our blood circulation improves, the digestive organs are stimulated and I can go on about the benefits. I sincerely believe it is important to dedicate time to strengthen the body whenever we can in order to live a healthier and happier life! For this reason, I have decided to create yoga for fitness classes. I encourage you to focus on your breath throughout the entire practice and flow with your breath. This will make it easier for you to get into each pose and keep a mind and body connection. I hope you find this class enjoyable & challenging and feel much more strong, empowered & elevated in your mood afterwards.\n\nPlease let me know in the comments section if you enjoy these type of classes and would like to see more classes like this once in a while! \n\nSending much love your way and from my heart to yours, \nNamaste!\n\nCheck out our facebook : https://www.facebook.com/yoga.with.yana/\nCheck our instagram : https://www.instagram.com/yanathompson_/\nCheck out our Twitter: https://twitter.com/YanaThompson3\n---------------------------------\nYoga with Yana recommends that you consult your physician regarding the applicability of any recommendations and follow all safety instructions before beginning any exercise program. When participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself.\n\n Outro Music: www.bensound.com"}}', '{"duration":"PT20M18S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"425","likeCount":"19","dislikeCount":"0","favoriteCount":"0","commentCount":"7"}', '''20'':4A ''class'':9A ''fit'':3A,8A ''min'':5A ''strengthen'':6A ''yana'':12A ''yoga'':1A,7A,10A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
