","yoga for back pain relief in hindi"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"5 Yoga for Back Pain Relief | Easy Asanas for Back Pain |       Yoga","description":"How can I relieve back pain at home? if you are looking for the answers, then follow this 5 min yoga asanas for back pain relief. \n\nDoes your back pain due to sitting or standing for long hours? Do this simple yoga exercise anytime, anywhere, and be free from backpain in just 5 minutes with breath in-out.\n\n5 Min | 5 Yoga Asanas for Back pain Relief\n1) Paschimottanasana (Seated Forward Bend)\n2) Meru vakrasana (Spinal Twist Pose)\n3) Marjariasana (Cat Pose)\n4) Adho mukha svanasana ( downward Facing Dog)\n5) Shirshasana (Child Pose)\n\nFor Yoga for Diabetes | 5 Yoga Asanas for Diabetes\nhttps://www.youtube.com/watch?v=pVsVa5pOpk4\n\nFor daily yoga asanas routine, you can follow this video: https://www.youtube.com/watch?v=80hR8mqPCAM\n\nSUBSCRIBE TO MY YOUTUBE CHANNEL NOW and press Bell button. https://www.youtube.com/channel/UCxlkFbyqrfVbpQkiA0NC3cQ\n\n#yoga #Yogaasanas #yogaforbackpain #yogaforbackpainrelife #yogaathome"},"defaultAudioLanguage":"en"}', '{"duration":"PT5M9S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"88","likeCount":"15","dislikeCount":"0","favoriteCount":"0","commentCount":"5"}', '''5'':1A ''asana'':8A ''back'':4A,10A ''easi'':7A ''pain'':5A,11A ''relief'':6A ''yoga'':2A,18A '''':16A '''':13A '''':12A '''':15A '''':17A '''':14A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
