INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17732, 'ylKvSmmAF0U9jxUlbx6_wsEWfEc', '8Z7cfV0th58', true, '{"publishedAt":"2020-06-27T00:00:34Z","channelId":"UCLs5eE4OwDLBSxgO67qwUZw","title":"Flow for a Strong Core and More...","description":"Build strength in your core in this short 30 minute Yoga Flow. \n\n\n\n\n\nThanks for reading this far. I truly believe that Yoga is for every-body. Yoga has taught me to breathe & to bend. Yes, I was doing these things before, but I would also break down, blow up & occasionally just plain freak out. I still have those moments - thanks to my yoga practice, they just happen a lot less. This practice benefits your whole being - your body, mind, spirit & heart, but you have to practice. Get on your mat when you want to. Get on your mat when you dont want to. Get on your mat with me & Breathe, Sweat & Transform. \n\n\nPlease subscribe and hit the bell so you can get notified when new videos come out.\n\n\nHeather\n\n\nP.S.\n\nCheck out the bent yogi blog and website. \nhttps://thebentyogi.liveeditaurora.com/pages/home\n\n\nFollow me on instagram, Free streaming classes every week! \nhttps://www.instagram.com/thebentyogi/ \n\n\nPlease visit my studio website. If youre in CT, Please drop in for a class!\nhttp://sanctuarypoweryoga.com/\n\n\nStudio (and online) Class schedule here\nhttp://sanctuarypoweryoga.com/pages/schedule\n\n\nVisit us at Facebook! (everyone else is!)\nhttps://www.facebook.com/Sanctuary-Power-Yoga-196718727030849/\n\nFollow on Twitter:\nhttps://twitter.com/sanctuarypower\n\nOh, and BE MY HERO (or just buy me a cup of coffee!)\nhttps://venmo.com/   donate to Sanctuary Power Yoga! Thanks!\n\n\n\n\nTake care of yourself, take care of each other, and Ill see you on your mat!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/8Z7cfV0th58/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/8Z7cfV0th58/mqdef