INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17914, '6BkUfCXQzi3ECBcV_oY6q_oxcOY', 'Fq6fuLgcGOw', NULL, '{"publishedAt":"2020-05-06T18:00:06Z","channelId":"UCP_9ghsRpMaBeamcG3QfrvQ","title":"Power Flow Yoga Class. Vinyasa Yoga. Yoga Wednesday","description":"This class is about one hour long with a strong emphasis on core. I do not think that my flow classes are particularly fast but we will still be moving a good bit in some places, like during the Sun Salutations. \n\nYou will need a strap or something like a strap, a belt, or a towel will work fine.\n\nAlthough I think that it is fine for all levels from beginners to advanced always remember to check in with yourself during your practice and rest when you need it. \n\nPoses Included:\nCat Cow\nBridge\nDown Dog\nUstrasana\nWarrior II\nTriangle\nCrow Pose\nPlank\nPaschimotanasana\nSurya Namaskar A and B\nMalasana\nHalf Hero''s\nNavasana (Boat Pose)\n\n\nCheck out the link to the Spotify playlist for the class for some good tunes to flow to. \n\nSpotify: \nhttps://open.spotify.com/user/ktza5wtezxh4kllduzfkst57v/playlist/7tl2Uwadr4Lw3Dj2DCZXU7?si=r2dqe7NhQB6g1H0BCPFyOw\n\nRemember to Like and Subscribe: http://www.youtube.com/c/TheYogaMonger","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Fq6fuLgcGOw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Fq6fuLgcGOw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Fq6fuLgcGOw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Fq6fuLgcGOw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Fq6fuLgcGOw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"The Yoga Monger","tags":["yoga","yoga class","yoga for everyone","morning yoga routine","morning yoga practice","thirty minute yoga","yoga for men","yoga for women","all levels yoga","yoga for beginners",