INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17922, 'TkZK6m0G942nDfaNSnY3nNN_dXo', '6xrkb4O__J0', NULL, '{"publishedAt":"2020-04-20T11:30:00Z","channelId":"UC_xYALq063ZWm-26IeG9cCQ","title":"5 Yoga Poses to strengthen your arms | Yoga for biceps | How to build arms","description":"Yoga is an incredible way to build upper body strength and tone and sculpt all the muscles in the arms  The key is building up enough arm strength, so that the hips and chest stay lifted as you lower down, while the elbows stay hugged in at your sides.\n\nThese 5 poses will help you cultivate long, lean muscles in your arms without creating bulk.\n\nChaturanga Dandasana - Four-Limbed Staff pose, also known as Low Plank, is an asana in which a straight body parallel to the ground is supported by the toes and palms, with elbows at a right angle.\n\nUpward Plank Pose - It is an intermediate back-bending yoga pose that builds strength and flexibility. It is used as a counter-pose to forward folds, such as Four-Limbed Staff Pose \n\nSide plank - It strengthens the oblique abdominal muscles, which don''t get worked during ab exercises such as crunches. You will hold your body on your side in straight position supported only by one arm and the side of one foot.\n\nBakasana - The crow pose is a great starting point for progressing into more advanced arm balances. It also strengthens your core and wrists, improves your balance.\n\nUrdhva Mukha Shvanasana - Upward Facing Dog Pose is a back-bending asana in modern yoga as exercise. It is commonly part of the widely-performed Surya Namaskar sequence\n\n#armstrength  #Yogasequence #armworkout\n\nFacebook : https://www.facebook.com/VentunoYoga\nTwitter : https://www.twitter.com/VentunoYoga\nYouTube : https://www.youtube.com/user/VentunoYoga\nInstagram : https://www.instagram.com/ventunoyoga\n\nA Ventuno Production https://www.ventunotech.com\n\nDISCLAIMER:\n\nWe strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/6xrkb4O__J0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/6xrkb4O__J0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/6xrkb4O__J0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/6xrkb4O__J0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/6xrkb4O__J0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"VENTUNO YOGA","tags":["Bakasana","Yoga","Arm Strength","Chaturanga Dandasana","Urdhva Mukha Shvanasana","Upward Plank Pose","yoga for beginners","kino yoga","beginners yoga","beginner yoga","yoga at home","yoga for weight loss","yoga class","yoga workout","morning yoga","yoga flow","power yoga","yoga for flexibility","yoga with adrienne","yoga with adriene","vinyasa yoga","yoga with kassandra","total body yoga","20 minute yoga","hatha yoga","yoga 10 min","yoga for strength","full body stretch yoga","yoga 10","easy yoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"5 Yoga Poses to strengthen your arms | Yoga for biceps | How to build arms","description":"Yoga is an incredible way to build upper body strength and tone and sculpt all the muscles in the arms  The key is building up enough arm strength, so that the hips and chest stay lifted as you lower down, while the elbows stay hugged in at your sides.\n\nThese 5 poses will help you cultivate long, lean muscles in your arms without creating bulk.\n\nChaturanga Dandasana - Four-Limbed Staff pose, also known as Low Plank, is an asana in which a straight body parallel to the ground is supported by the toes and palms, with elbows at a right angle.\n\nUpward Plank Pose - It is an intermediate back-bending yoga pose that builds strength and flexibility. It is used as a counter-pose to forward folds, such as Four-Limbed Staff Pose \n\nSide plank - It strengthens the oblique abdominal muscles, which don''t get worked during ab exercises such as crunches. You will hold your body on your side in straight position supported only by one arm and the side of one foot.\n\nBakasana - The crow pose is a great starting point for progressing into more advanced arm balances. It also strengthens your core and wrists, improves your balance.\n\nUrdhva Mukha Shvanasana - Upward Facing Dog Pose is a back-bending asana in modern yoga as exercise. It is commonly part of the widely-performed Surya Namaskar sequence\n\n#armstrength  #Yogasequence #armworkout\n\nFacebook : https://www.facebook.com/VentunoYoga\nTwitter : https://www.twitter.com/VentunoYoga\nYouTube : https://www.youtube.com/user/VentunoYoga\nInstagram : https://www.instagram.com/ventunoyoga\n\nA Ventuno Production https://www.ventunotech.com\n\nDISCLAIMER:\n\nWe strongly recommend that you consult with your physician before beginning any exercise program.\n\nYou should be in good physical condition and be able to participate in the exercise.\n\nYou should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself."},"defaultAudioLanguage":"en"}', '{"duration":"PT8M36S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"6016","likeCount":"216","dislikeCount":"1","favoriteCount":"0","commentCount":"2"}', '''5'':1A ''arm'':7A,14A ''bicep'':10A ''build'':13A ''pose'':3A ''strengthen'':5A ''yoga'':2A,8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
