INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17736, 'vdmeTTRElq1BIU2cJ-wD1SMbV7A', '-rQKc0f1eM0', true, '{"publishedAt":"2020-04-18T06:20:01Z","channelId":"UC-aXG-0sCRkvNU-PztfgtHQ","title":"Day 5: Morning Yoga Challenge - Energy","description":"This 10 minute morning sequence is a little more fast paced than the other classes, as we aim to build a bit of heat and energy in the body with a few rounds of sun salutations. \n\nIf you liked this video and would love to see more - please like and subscribe to my channel. \n\nEvery Wednesday I''ll be posting a FREE yoga class. Each class will have a different theme - so this is a great way to build your practice and maybe try something new. Drop me an email if there is something you would love to see or something you are currently working with :) Or sign up below to stay updated.\n\nYoga with Kelly\nWebsite: https://www.kellysheldrick.com\nFacebook: www.facebook.com/YogawithKellyS \nInstagram: https://www.instagram.com/kellyjsheldrick\nEmail: me@kellysheldrick.com\n\nSupport me on Pateron for as little 2 a month (less than 50p per class) - this will help me buy, maintain and upgrade equipment required to provide these free classes https://www.patreon.com/yogawithkelly\n\nAnd please remember yoga can be challenging, but should never be painful, so if you do feel any pain, please listen to your body and gently come out of the pose. It''s up to the individual to assess whether they are ready for the class that they have chosen. Yoga with Kelly assumes no responsibility for injuries suffered while practicing these classes.\n\nThank you for practicing with me today! \n\nStay safe! Kelly Xx\n\n#stayhome #withme #letsyoga #yogachallenge\n\nEQUIPMENT USED:\nGoPro 7: https://amzn.to/30pn5TG\nLED ring light: https://amzn.to/2XNJkkx\nYoga mat: https://amzn.to/3dPT7Mw","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-rQKc0f1eM0/default.jpg","