ile practicing these classes.\n\nThank you for practicing with me today! \n\nStay safe! Kelly Xx\n\n#stayhome #withme #letsyoga #yogachallenge\n\nEQUIPMENT USED:\nGoPro 7: https://amzn.to/30pn5TG\nLED ring light: https://amzn.to/2XNJkkx\nYoga mat: https://amzn.to/3dPT7Mw"}}', '{"duration":"PT14M58S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"29","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''5'':2A ''challeng'':5A ''day'':1A ''energi'':6A ''morn'':3A ''yoga'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
