INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17929, 'LHxgzNEWjSOUkBrfh_j9n5OGu0k', 'OvxQBDK5Fig', NULL, '{"publishedAt":"2018-07-02T19:00:00Z","channelId":"UCoI2HuJP6NHFk9kRZstmAug","title":"Yoga for Athletes: Hamstring Rehab #LiveULTRA","description":"This flow is designed to relieve muscle soreness and tension in your hamstrings. Especially great for athletes and workout recovery.\n\nBrought to you by Michelob Ultra. \n\n[Flow With Adee] I am a registered yoga teacher with a B.S. in Exercise Physiology. Movement is essential to a happy, healthy lifestyle and I believe there is a form of movement for everyone. With roots in dance, much of my yoga is free flowing and therefore looks different on every body. That is the beauty of it! Allow your body to MOVE YOU. I hope my classes can provide you some peace and a time to tune in to your body and let go. xx\n\nInstagram @FlowWithAdee\n\nhttps://www.facebook.com/FlowWithAdee/\n\n\nContact Me:\nAdisonBrianaCoaching@gmail.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/OvxQBDK5Fig/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/OvxQBDK5Fig/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/OvxQBDK5Fig/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/OvxQBDK5Fig/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/OvxQBDK5Fig/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Adison Briana","tags":["yoga","fitness","stretching","flexibility training","flexibility","yoga class","hamstrings","hamstring flexibility","yoga for athletes","improve flexibility","recovery","sore muscles","flow with adee","flow","adisonbriana"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga for Athletes: Hamstring Rehab #LiveULTRA","description":"This flow is designed to relieve muscle soreness and tension in your hamstrings. Especially great for athletes and workout recovery.\n\nBrought to you by Michelob Ultra. \n\n[Flow With Adee] I am a registered yoga teacher with a B.S. in Exercise Physiology. Movement is essential to a happy, healthy lifestyle and I believe there is a form of movement for everyone. With roots in dance, much of my yoga is free flowing and therefore looks different on every body. That is the beauty of it! Allow your body to MOVE YOU. I hope my classes can provide you some peace and a time to tune in to your body and let go. xx\n\nInstagram @FlowWithAdee\n\nhttps://www.facebook.com/FlowWithAdee/\n\n\nContact Me:\nAdisonBrianaCoaching@gmail.com"}}', '{"duration":"PT11M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"28168","likeCount":"805","dislikeCount":"13","favoriteCount":"0","commentCount":"77"}', '''athlet'':3A ''hamstr'':4A ''liveultra'':6A ''rehab'':5A ''yoga'':1A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17931, 'vNyzrjRlLDJeHDKHeK5asHyIAJ8', '5icC4h-GdQ4', NULL, '{"publishedAt":"2019-01-09T16:00:01Z","channelId":"UCvDc7jgAYAjbNqvWjbovVQw","title":"19 Days of Yoga - Day 9. Iyengar Yoga Sequence","description":"Day 9 - 19 Days of Yoga. Iyengar Yoga Sequence.\n\nWe introduced Halasana (Plough or Plow Pose) in Day 4, which requires a platform. The yoga routine in Day 9 comprises the following yoga poses:\n\nAdho Mukha Svanasana, (Dog Head Down)\nUttanasana, (Forward Bend)\n Adho Mukha Svanasana, (Dog Head Down)\nUttanasana, (Forward Bend)\nParivrtta Trikonasana (Revolved Triangle Pose)\nParivrtta Parsvakonasana (Revolved Wide Angle Pose)\nParva Dandasana ( Twist in Staff or Stick Pose)\nMalasana (Garland Pose)\nHalasana (Plow or Plough Pose)\nSarvangasana (Shoulder Stand)\nSupta Baddha Konasana- Feet raised. (Supine Bound Angle or Supine Cobblers Pose).\nSavasana (Corpse Pose)\n \nThe platform for Halasana and Sarvangasana can be made from either 4 foam pads (plus another for a launchpad) or folded blankets with a cushion. Cover this support with a sticky mat. The platform dimensions need to be app:\n\n24\" (60cm) w x 16\" (40cm) l x 2\" (5cm) h\n\n In addition to your platform, if you are doing the classical yoga poses, you will just need your mat. If you are doing the modified versions, as well as your mat and platform you will need the following yoga equipment:\n1 x yoga bolster (you can use 2 x foam pads or a couple of cushions)\n2 x yoga bricks (you can use 2 x foam pads or the seat of a chair)\n1 x chair\n\n\nFollowing the success of our 30 Days of Yoga and 13 Days of Yoga series, this year we have taken a slightly different approach. We have done voiceovers, rather than talking to camera. Lin, in the white top, will be showing the classic versions of poses and Leo, in the dark top, will be showing modified versions of the poses using props. The modified versions are for those who find the pose difficult, or who wish to improve their work in the pose. 19th January 2018 will be the fourth annual National Iyengar Yoga Day in the UK and Ireland to celebrate the teachings of Guruji, B.K.S. Iyengar, and to promote Iyengar yoga nationally. Events will include free taster classes and celebrations of his life in Iyengar Yoga Institutes and centres throughout the country. ''Yoga with Lin and Leo'' channel is leading up to this day with a series of 19 yoga sequences. \n\nIn the Iyengar tradition, these sequences would be regarded as \"Beginners Yoga\" as all the asanas are taken from the Introductory syllabus, however, they are not suitable for those who are completely new to yoga. We will be doing a series in the New Year which will be a Foundations of Yoga series to introduce those who have never practiced yoga to the subject and which will help to prepare new yoga students for yoga classes or yoga workshops at their local Iyengar Yoga centre and help them practice between classes when they want to do yoga at home..\n\n\nThese sequences aim to improve your extension, alignment and balance in the poses. If you find any of the poses difficult, you can look the poses up in our Yoga Pose Directory, which we are adding to all the time. In the Pose Directory you will find yoga tutorials on many of the poses you will encounter in the 19 Days of Yoga Series. These tutorials will teach the poses in more detail and sometimes with extra props.\n\n If you are near to Maidstone, in the South East of England, register with the Maidstone Iyengar Yoga Centre and enjoy one of our free classes with us. \nhttp://www.iyengar-yoga.co.uk/\n\nIf you want to try Yoga with Lin and Leo''s 30 Days of Yoga series, check out our Playlist: \nhttp://bit.ly/2ykAyPY\nOr our 13 Days of yoga: https://www.youtube.com/watch?v=vP0ZtUZ7txI&list=PLLTwDvdKnrC402WmB-SdWrgZWOgp74S4x\n\nYoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies.\n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing; indeed many studies have shown that yoga can have remarkable effects on problems with back pain, shoulder pain and neck pain as well as demonstrating positive effects on mental health problems such as depression. http://www.huffingtonpost.com/2013/10/28/body-on-yoga_n_4109595.html?ncid=engmodushpmg000000\nWe will be posting videos for all levels but the free online yoga classes in 19 Days of Yoga can be practiced at home by fit, healthy adults who have some experience of Iyengar yoga.\n\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/5icC4h-GdQ4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/5icC4h-GdQ4/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/5icC4h-GdQ4/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/5icC4h-GdQ4/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/5icC4h-GdQ4/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Lin and Leo","tags":["yoga","yoga iyengar","30 days of yoga","iyengar yoga","19 days of yoga","13 days of yoga","parivrtta parsvakonasana","yoga lessons","yoga class","iyengar yoga class","yoga course","ayengar yoga","iyengar yoga sequence","yoga sequence","yoga routine","yoga at home","b.k.s. iyengar","iyengar yoga for beginners","iyengar yoga for beginners youtube","iyengar yoga for back pain","yoga for strength","stretching","yoga for flexibility","yoga with lin and leo","weight loss yoga","30 day yoga challenge"],"categoryId":"24","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"19 Days of Yoga - Day 9. Iyengar Yoga Sequence","description":"Day 9 - 19 Days of Yoga. Iyengar Yoga Sequence.\n\nWe introduced Halasana (Plough or Plow Pose) in Day 4, which requires a platform. The yoga routine in Day 9 comprises the following yoga poses:\n\nAdho Mukha Svanasana, (Dog Head Down)\nUttanasana, (Forward Bend)\n Adho Mukha Svanasana, (Dog Head Down)\nUttanasana, (Forward Bend)\nParivrtta Trikonasana (Revolved Triangle Pose)\nParivrtta Parsvakonasana (Revolved Wide Angle Pose)\nParva Dandasana ( Twist in Staff or Stick Pose)\nMalasana (Garland Pose)\nHalasana (Plow or Plough Pose)\nSarvangasana (Shoulder Stand)\nSupta Baddha Konasana- Feet raised. (Supine Bound Angle or Supine Cobblers Pose).\nSavasana (Corpse Pose)\n \nThe platform for Halasana and Sarvangasana can be made from either 4 foam pads (plus another for a launchpad) or folded blankets with a cushion. Cover this support with a sticky mat. The platform dimensions need to be app:\n\n24\" (60cm) w x 16\" (40cm) l x 2\" (5cm) h\n\n In addition to your platform, if you are doing the classical yoga poses, you will just need your mat. If you are doing the modified versions, as well as your mat and platform you will need the following yoga equipment:\n1 x yoga bolster (you can use 2 x foam pads or a couple of cushions)\n2 x yoga bricks (you can use 2 x foam pads or the seat of a chair)\n1 x chair\n\n\nFollowing the success of our 30 Days of Yoga and 13 Days of Yoga series, this year we have taken a slightly different approach. We have done voiceovers, rather than talking to camera. Lin, in the white top, will be showing the classic versions of poses and Leo, in the dark top, will be showing modified versions of the poses using props. The modified versions are for those who find the pose difficult, or who wish to improve their work in the pose. 19th January 2018 will be the fourth annual National Iyengar Yoga Day in the UK and Ireland to celebrate the teachings of Guruji, B.K.S. Iyengar, and to promote Iyengar yoga nationally. Events will include free taster classes and celebrations of his life in Iyengar Yoga Institutes and centres throughout the country. ''Yoga with Lin and Leo'' channel is leading up to this day with a series of 19 yoga sequences. \n\nIn the Iyengar tradition, these sequences would be regarded as \"Beginners Yoga\" as all the asanas are taken from the Introductory syllabus, however, they are not suitable for those who are completely new to yoga. We will be doing a series in the New Year which will be a Foundations of Yoga series to introduce those who have never practiced yoga to the subject and which will help to prepare new yoga students for yoga classes or yoga workshops at their local Iyengar Yoga centre and help them practice between classes when they want to do yoga at home..\n\n\nThese sequences aim to improve your extension, alignment and balance in the poses. If you find any of the poses difficult, you can look the poses up in our Yoga Pose Directory, which we are adding to all the time. In the Pose Directory you will find yoga tutorials on many of the poses you will encounter in the 19 Days of Yoga Series. These tutorials will teach the poses in more detail and sometimes with extra props.\n\n If you are near to Maidstone, in the South East of England, register with the Maidstone Iyengar Yoga Centre and enjoy one of our free classes with us. \nhttp://www.iyengar-yoga.co.uk/\n\nIf you want to try Yoga with Lin and Leo''s 30 Days of Yoga series, check out our Playlist: \nhttp://bit.ly/2ykAyPY\nOr our 13 Days of yoga: https://www.youtube.com/watch?v=vP0ZtUZ7txI&list=PLLTwDvdKnrC402WmB-SdWrgZWOgp74S4x\n\nYoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies.\n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing; indeed many studies have shown that yoga can have remarkable effects on problems with back pain, shoulder pain and neck pain as well as demonstrating positive effects on mental health problems such as depression. http://www.huffingtonpost.com/2013/10/28/body-on-yoga_n_4109595.html?ncid=engmodushpmg000000\nWe will be posting videos for all levels but the free online yoga classes in 19 Days of Yoga can be practiced at home by fit, healthy adults who have some experience of Iyengar yoga.\n\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/"}}', '{"duration":"PT19M43S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2364","likeCount":"22","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''19'':1A ''9'':6A ''day'':2A,5A ''iyengar'':7A ''sequenc'':9A ''yoga'':4A,8A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
