INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17947, 'UcG-O5Sc9u8d92Rg7Ft40IEbYtk', 'fvMP3qQnJpE', NULL, '{"publishedAt":"2020-06-24T14:47:10Z","channelId":"UC5OBITYFwhOVUXewTts5Fpw","title":"40 min Total Body Power Yoga Flow | FEEL STRONG","description":"Yoga can be done at home, but  especially for the beginner  it is important to try a class or two that is taught by a seasoned instructor, in a private or group setting, to be sure you are doing the yoga exercises safely\n\nPower yoga, on the other hand, is a vinyasa- or ashtanga-style, flow yoga; power yogis move quickly between poses, but the poses often focus on building strength rather than flexibility. This power flow Yoga practice is 40 minutes long while it is fun, yet still challenging. Do your best,  remember to have fun and smile. \nYou can always modify the poses, you want to be comfortable in the yoga poses and wear a comfortable clothing.  It is open to all levels, all you need to start this practice: the dedication time and meeting your self on your mat. \n\n#totalbodyyoga #yogaflow #beginneryoga #feelstrong \nRoll out your mat. Have fun and challenge yourself to move your body. Movement is key.\n\nSUBSCRIBE to the Om Green Wellness channel for more yoga videos and to bring yoga to the grass-root levels\nhttps://www.youtube.com/channel/UC5OB...\n- - - - - - - - - - \n\nVisit me on instagram @omgreenwellness\n Facebook @omgreenwellness\nYoutube: omgreenwellness\ntwitter: omgreenwellness\n\n\nQuote of the day: Be giving, forgiving, compassionate and loving","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/fvMP3qQnJpE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/fvMP3qQnJpE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/fvMP3qQnJpE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/fvMP3qQnJpE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/fvMP3qQnJpE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Om Green Wellness","tags":["yoga at home","morning yoga","morning yoga for beginners","power yoga flow","Om Green Wellness","vinyasa flow","quick yoga class","black yoga youtubers","yoga sequence for beginners 1 hour","yoga for beginners men","yoga for beginners weight loss","full body yoga workout","quick power vinyasa flow","yoga for weight loss","black owned","total body yoga flow","yoga total body","yoga for strength","feels strong yoga","yoga sculpt","40 min yoga flow","black girl yoga","black yoga teacher"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"40 min Total Body Power Yoga Flow | FEEL STRONG","description":"Yoga can be done at home, but  especially for the beginner  it is important to try a class or two that is taught by a seasoned instructor, in a private or group setting, to be sure you are doing the yoga exercises safely\n\nPower yoga, on the other hand, is a vinyasa- or ashtanga-style, flow yoga; power yogis move quickly between poses, but the poses often focus on building strength rather than flexibility. This power flow Yoga practice is 40 minutes long while it is fun, yet still challenging. Do your best,  remember to have fun and smile. \nYou can always modify the poses, you want to be comfortable in the yoga poses and wear a comfortable clothing.  It is open to all levels, all you need to start this practice: the dedication time and meeting your self on your mat. \n\n#totalbodyyoga #yogaflow #beginneryoga #feelstrong \nRoll out your mat. Have fun and challenge yourself to move your body. Movement is key.\n\nSUBSCRIBE to the Om Green Wellness channel for more yoga videos and to bring yoga to the grass-root levels\nhttps://www.youtube.com/channel/UC5OB...\n- - - - - - - - - - \n\nVisit me on instagram @omgreenwellness\n Facebook @omgreenwellness\nYoutube: omgreenwellness\ntwitter: omgreenwellness\n\n\nQuote of the day: Be giving, forgiving, compassionate and loving"},"defaultAudioLanguage":"en-US"}', '{"duration":"PT40M24S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"27","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''40'':1A ''bodi'':4A ''feel'':8A ''flow'':7A ''min'':2A ''power'':5A ''strong'':9A ''total'':3A ''yoga'':6A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
