INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17950, 'm0f98JQ-RAaQjPSwgZ_RVpVKgzw', 'T-qiQ9L4Yhg', NULL, '{"publishedAt":"2020-06-22T19:00:07Z","channelId":"UCGWY5yQ9zNACrkPkLqOmA1w","title":"Wake Up: A Front Line Flow | Vinyasa | Yoga Wild","description":"Great for anyone on their feet all day, including emergency responders, hospital staff, or protester on the front line! Front Line Flow is a nourishing 10-minute standing yoga flows to support your work on the front lines. This class will wake you up and heighten your awareness. Great for front line workers or anyone looking for a short class --- no mat or yoga clothes needed.\n\nEffort Scale \n\n BECOME A PATRON with memberships starting at $5/month: https://www.patreon.com/yogawild \n SUBSCRIBE to support free yoga \n CLICK THE BELL to turn on channel notifications\n\nInstagram: https://instagram.com/beyogawild/ \nFacebook: https://facebook.com/beyogawild/\nWebsite: https://beyogawild.com \n\nMeet Kara:\nKaras love of yoga has been building for over 20 years and her practice has been fueled by the restorative and centering power yoga has had in her life. Along with yoga, Kara teaches dance at TAM and is a teaching artist for Dance for Parkinson''s and Keeping the Faith prison arts program.\n\n Nature Mural (left) by Lovesome Dove | @lovesomedove\n Typography Mural (right) by Bryce MacDonald | @amocatacoma\n Intro Footage by 2 Cedars Photography | @2cedarsphoto \n\nABOUT YOGA WILD: We aim to reach a population outside of the typical yoga demographic and bring people together through nature, community, and yoga. Stay connected with Yoga Wild and learn from our team on all platforms for more tutorials, tips, meditations, and classes!\n\nDISCLAIMER\nPlease consult with your physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntaril