tion of the would-be 50th anniversary of Glastonbury.\n\nPrepare yourself for a busy festival day with a calming morning yoga session with the lovely Maria.\nMaria is an artworker at Talking Tables and a trained hatha yoga teacher. Ideal for beginners, the class includes breathing exercise, asanas and easy stretches.\nSo put on something comfortable and head to our IGTV for the 15 minute hatha yoga class.\n\nNamaste.\n.\n.\n.\n#yoga #igtv #ttfest #hostyourownfestival #festival #festivalmemories #Glastonbury  #carryoncelebrating #brightertimesahead #createsmilesandmemories #ttit #gathertogethersmile #allinittogther #togetherathome #talkingtables"}}', '{"duration":"PT15M","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"3","likeCount":"0","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''class'':8A ''festiv'':6A ''host'':3A ''tabl'':2A ''talk'':1A ''yoga'':7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
