INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17618, 'v42o0Hh5br9NkgEjA8WHmOx4yRc', 'cNk3Ke9_QzE', true, '{"publishedAt":"2018-07-22T16:14:31Z","channelId":"UCdKCRyTOH4lu6I4GYREOAbw","title":"Scoliosis Yoga Flow | Corsica Timelapse 2018","description":"MY SCOLIOSIS YOGA FLOW // CORSICA TIMELAPSE!\n\nHey guys!! A lot of people have asked me what yoga poses I do to help my scoliosis back pain so I thought I would record me doing a short yoga time lapse! This is a very simple, short sequence which could be really good if you are just starting yoga! I hope this is useful and if you have any questions feel free to leave a comment and I will reply!! Love you all! :) xxx\n\nPoses in this sequence:\n1. Downwards dog\n2. Cat/cow pose \n3. Spinx pose \n4. Cobra pose\n5. Childs pose \n\n-----------------------\n Other places you can find me!:\n INSTAGRAM: https://instagram.com/zenouskaw\n SNAPCHAT: Zenouskasnaps","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/cNk3Ke9_QzE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/cNk3Ke9_QzE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/cNk3Ke9_QzE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/cNk3Ke9_QzE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/cNk3Ke9_QzE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Zenouska W","tags":["yoga","scoliosis","yoga for scoliosis","yoga flow","yoga for back pain","yoga class","yoga timelapse","timelapse","corse","corsica","bonifacio","france","yoga girl","speed up","pilates","skies","views","vinyasa","teen yoga","hipster","boho","shorts","bum","scenery","fitness","training","splits","bikini","downwards dog","cat pose","cow pose","childs pose","cobra pose","spinx pose"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Scoliosis Yoga Flow | Corsica Timelapse 2018","description":"MY SCOLIOSIS YOGA FLOW // CORSICA TIMELAPSE!\n\nHey guys!! A lot of people have asked me what yoga poses I do to help my scoliosis back pain so I thought I would record me doing a short yoga time lapse! This is a very simple, short sequence which could be really good if you are just starting yoga! I hope this is useful and if you have any questions feel free to leave a comment and I will reply!! Love you all! :) xxx\n\nPoses in this sequence:\n1. Downwards dog\n2. Cat/cow pose \n3. Spinx pose \n4. Cobra pose\n5. Childs pose \n\n-----------------------\n Other places you can find me!:\n INSTAGRAM: https://instagram.com/zenouskaw\n SNAPCHAT: Zenouskasnaps"}}', '{"duration":"PT1M16S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"297","likeCount":"26","dislikeCount":"1","favoriteCount":"0","commentCount":"8"}', '''2018'':6A ''corsica'':4A ''flow'':3A ''scoliosi'':1A ''timelaps'':5A ''yoga'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
