INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17963, 'poeaXboMq1y5NuGANj5QgAOmjnI', 'V0m2E4liJ8w', NULL, '{"publishedAt":"2020-06-24T19:16:08Z","channelId":"UCm-qu7ox2yScwaY853D6GAg","title":"5 Exercises for Stronger Yoga Inversions: Handstands & Forearm Stands","description":"Looking to add inversions to your yoga practice?  These are 5 exercises to help you build the strength, stability and mobility required to get upside-down.   Building the necessary bio-mechanic framework for inversions will help us get up efficiently and sustainably!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/V0m2E4liJ8w/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/V0m2E4liJ8w/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/V0m2E4liJ8w/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/V0m2E4liJ8w/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/V0m2E4liJ8w/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Helix Alternative Movement Studio","tags":["yoga","handstands","how to handstand","yoga handstands","inversions","yoga inversions","exercises for handstand","exercises for forearm stand","how to practice pincha mayurasana","handstand tutorial","arm balancing"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"5 Exercises for Stronger Yoga Inversions: Handstands & Forearm Stands","description":"Looking to add inversions to your yoga practice?  These are 5 exercises to help you build the strength, stability and mobility required to get upside-down.   Building the necessary bio-mechanic framework for inversions will help us get up efficiently and sustainably!"}}', '{"duration":"PT13M3S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"11","likeCount":"0","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''5'':1A ''exercis'':2A ''forearm'':8A ''handstand'':7A ''invers'':6A ''stand'':9A ''stronger'':4A ''yoga'':5A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17964, 'FBtukaCqmt1AaL8r8WHTBdJ2y8A', '73bIbcNUzck', NULL, '{"publishedAt":"2019-12-03T08:02:47Z","channelId":"UCPdb58AJIC6oJuREIBj8ixA","title":"Yoga to Open your Hips | 20 minute Hip Opener Yoga Class","description":"Hello Beautiful Souls,\n\nToday I have a quick video for you that is packed with super useful stretches to open your hips. I absolutely love hip openers, because working on them really helps me to find a comfortable seat. But that doesn''t make them easy.\n\nAll of these stretches are suitable for beginners, but maybe your approach of them will look different, because you are at a different stage. That is perfectly fine!\n\nPlease avoid comparing your practice to mine, as the purpose of the video is simply to demonstrate the stretches, so if you are unable to go that far (yet! with practice your hips will open up as well), please don''t get discouraged.\n\nGo with baby steps, practice on a regular basis and you''ll see your hip openers will pay off! You''ll feel more comfort throughout the day and essentially you will be able to go deeper into each stretch. \n\nBut remember what I always say: building long muscles with stretches takes time, the same way as building big muscles as a weight lifter! You know that just because you did one workout in the gym you will not transform your body.\n\nMake sure you do these stretches regularly, especially if you are aiming to really improve your hip openers. That being said, make sure you also rest adequately. Find the perfect balance, if you worked hard one day and feel soar, make sure you take some time off the next day so you can recover. And get back to the practice when you feel like it, preferably in the next couple of days.\n\nBut most importantly allow your practice to be fun and challenging in an enjoyable way. It should not become a burden. \n\nThere are many muscles involved in opening your hips, so be very careful and always stop I you feel any pain in the knees! That is essential. \n\nI hope you enjoyed these stretches, please let me know how you got on with them!\n\n Thank you for sharing your practice with me today. \n\nTake very good care of yourself and I shall see you in the next class!\n\nVeronika\n\n\n\nTUSCANY Yoga Retreat with Karuna Yoga\n\nDates: \n 21st-28th September, 2020\n 1st-8th October, 2020\n\nDetails of retreat: www.kraunayogauk.com\n\n Book your place now with  30% non-refundable but transferrable deposit. \n Flexible payment plans are available, just message me on karuna.yoga.uk@gmail.com \n\n\n\nFOLLOW ME ON:\n\n Instagram: https://www.instagram.com/karuna.yoga.uk\n\nCHECK OUT MY WEBSITE:\n\n Website: https://www.karunayogauk.com\n\nGIVE A LIKE AND FOLLOW ON:\n\n Facebook: https://www.facebook.com/karuna.yoga.uk\n\nGIVE SOME SUPPORT ON:\n\n Patreon: https://www.patreon.com/karunayogauk","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/73bIbcNUzck/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/73bIbcNUzck/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/73bIbcNUzck/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/73bIbcNUzck/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/73bIbcNUzck/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Karuna Yoga","tags":["hipopeneryoga","yogahipopener","hipopener","yogahipopenerclass","yogahipopenervideo","yogastretcheshipopener","yogaclasshipopener","yogabeginnershipopener","yogavideohipopener","karunayogaukhipopenerclass","yogahipopenerexercises","exerciseshipopeneryoga","yogaexerciseshipopener","hipopeneryogaonline","onlineyogahipopener","hipopeneryogamoves","hipopeneryogaposes","yogaposeshipopener","yogahipopenerpose","hipopenerstretches","5stretcheshipopener","quickhipopeneryoga","beginnerhipopeneryoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga to Open your Hips | 20 minute Hip Opener Yoga Class","description":"Hello Beautiful Souls,\n\nToday I have a quick video for you that is packed with super useful stretches to open your hips. I absolutely love hip openers, because working on them really helps me to find a comfortable seat. But that doesn''t make them easy.\n\nAll of these stretches are suitable for beginners, but maybe your approach of them will look different, because you are at a different stage. That is perfectly fine!\n\nPlease avoid comparing your practice to mine, as the purpose of the video is simply to demonstrate the stretches, so if you are unable to go that far (yet! with practice your hips will open up as well), please don''t get discouraged.\n\nGo with baby steps, practice on a regular basis and you''ll see your hip openers will pay off! You''ll feel more comfort throughout the day and essentially you will be able to go deeper into each stretch. \n\nBut remember what I always say: building long muscles with stretches takes time, the same way as building big muscles as a weight lifter! You know that just because you did one workout in the gym you will not transform your body.\n\nMake sure you do these stretches regularly, especially if you are aiming to really improve your hip openers. That being said, make sure you also rest adequately. Find the perfect balance, if you worked hard one day and feel soar, make sure you take some time off the next day so you can recover. And get back to the practice when you feel like it, preferably in the next couple of days.\n\nBut most importantly allow your practice to be fun and challenging in an enjoyable way. It should not become a burden. \n\nThere are many muscles involved in opening your hips, so be very careful and always stop I you feel any pain in the knees! That is essential. \n\nI hope you enjoyed these stretches, please let me know how you got on with them!\n\n Thank you for sharing your practice with me today. \n\nTake very good care of yourself and I shall see you in the next class!\n\nVeronika\n\n\n\nTUSCANY Yoga Retreat with Karuna Yoga\n\nDates: \n 21st-28th September, 2020\n 1st-8th October, 2020\n\nDetails of retreat: www.kraunayogauk.com\n\n Book your place now with  30% non-refundable but transferrable deposit. \n Flexible payment plans are available, just message me on karuna.yoga.uk@gmail.com \n\n\n\nFOLLOW ME ON:\n\n Instagram: https://www.instagram.com/karuna.yoga.uk\n\nCHECK OUT MY WEBSITE:\n\n Website: https://www.karunayogauk.com\n\nGIVE A LIKE AND FOLLOW ON:\n\n Facebook: https://www.facebook.com/karuna.yoga.uk\n\nGIVE SOME SUPPORT ON:\n\n Patreon: https://www.patreon.com/karunayogauk"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT20M20S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"80","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''20'':6A ''class'':11A ''hip'':5A,8A ''minut'':7A ''open'':3A,9A ''yoga'':1A,10A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
