 Practice these set of exercises told in previous video & current video.\nThere are many reasons why people gain belly fat, including poor diet, lack of exercise, and stress. Improving nutrition, increasing activity, reducing stress, and making other lifestyle changes can all help people lose unwanted belly fat. You can simply follow these workouts in your home itself by spending half an hour in a day."},"defaultAudioLanguage":"hi"}', '{"duration":"PT7M23S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"719","likeCount":"59","dislikeCount":"0","favoriteCount":"0","commentCount":"26"}', '''2'':6A ''anil'':11A ''beginn'':9A ''belli'':1A ''fat'':2A ''kumar'':12A ''loss'':3A ''pandey'':13A ''part'':5A ''tip'':4A ''yoga'':7A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
