INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17639, 's8vV-F7ZkfXcdseSwsRXwRUm9LY', 'zDLJDzjZafM', true, '{"publishedAt":"2020-06-22T07:10:48Z","channelId":"UCigSqW6G9DgpR-wV1WxTdyg","title":"60 Minute Vinyasa Flow - Free your side body, hips and shoulders","description":"This is a 60 minute vinyasa flow class to free your side body, hips and shoulders. Class moves fluidly through some creative lateral side bends as we flow, facilitating more room in your torso to breathe a deeper breath. Lateral side bends also help to restore symmetry to the left and right side of your body. \n\nThe pace is slow, rhythmic and accessible. It''s easeful and designed to breathe more space into your body. Enjoy!\n\nMusic:\nIf you''d like to practice along with music, I have a spotify playlist for this class https://open.spotify.com/playlist/0TJIseP7mpKpDnE8Fr0nLH?si=PVWNYv-5TSmXblgF-GbDaQ\n\nPatreon\nIf you''re enjoying the videos and would like to support me creating and posting each week, I''m on Patreon. https://www.patreon.com/user?u=34675514\n& \nPaypal: \nhttps://paypal.me/FIONALANSLEY?locale.x=en_AU","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/zDLJDzjZafM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/zDLJDzjZafM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/zDLJDzjZafM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/zDLJDzjZafM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/zDLJDzjZafM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Two Birds Yoga","tags":["60 minute vinyasa flow free your side body hips shoulders","60 minute vinyasa flow","yoga for hips shoulders side body","twobirds yoga","yoga with fiona"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"60 Minute Vinyasa Flow - Free your side body, hips and shoul