INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17707, 'yqt3HSrcCfQqgcl4P6BMlkxmOtc', 'FWh6Qm9JF3w', true, '{"publishedAt":"2020-06-25T15:41:41Z","channelId":"UCu2IUja1ASnGIr_ORrtLReg","title":"AgeWise TV: Episode 101","description":"Enjoy curated content for older adults including yoga instruction, art project  \"Heart Maps\" and documentary films on American soldiers'' boots and people dealing with memory loss.\n\nIn this episode:\n\nPike Market Senior Center Exercise Yoga #1: A yoga class focusing on a healthy range of motion in the joints, strength, balance, and mindfulness. Created and facilitated by Emily Denton ERYT200 and the Pike Market Senior Center  \n\nBIMA Art In Action - Heart Maps: Wonder & King is taking over Art in Action! Danielle Gordon is here to lead you through a quick, mindful gratitude project called Heart Maps! #BIMAfromHome \n\n\"The Corporal''s Boots\" is the story of one soldier''s boots in the national exhibit, \"Eyes Wide Open.\" The film is a journey through the boots of American soldiers who died in Iraq. The boots were sectioned by state and arranged in rows as if the soldiers were standing at parade rest. When it stopped in Washington State, a viewer who had a son in the military went to see it. She tells her moving story. Personal, intense, and profound with a haunting, original score. Directed by Patricia Boiko, West Seattle Senior Center member.  \n\nOut of the desire to be advocates, members of The Gathering Place program who are living with memory loss chose to create this short documentary, \"Living with Memory Loss: In Our Own Words.\" Memory loss currently carries an immense stigma, fear, and shame, so they wanted to share some more holistic narratives about their experiences. Created by PNA Greenwood Senior Center.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/FWh6Qm9JF3w/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/FWh6Qm9JF3w/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/FWh6Qm9JF3w/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/FWh6Qm9JF3w/sddefault.jpg","width":640,"height":480}},"channelTitle":"Seattle Channel","tags":["Seattle Channel","Seattle"],"categoryId":"25","liveBroadcastContent":"none","localized":{"title":"AgeWise TV: Episode 101","description":"Enjoy curated content for older adults including yoga instruction, art project  \"Heart Maps\" and documentary films on American soldiers'' boots and people dealing with memory loss.\n\nIn this episode:\n\nPike Market Senior Center Exercise Yoga #1: A yoga class focusing on a healthy range of motion in the joints, strength, balance, and mindfulness. Created and facilitated by Emily Denton ERYT200 and the Pike Market Senior Center  \n\nBIMA Art In Action - Heart Maps: Wonder & King is taking over Art in Action! Danielle Gordon is here to lead you through a quick, mindful gratitude project called Heart Maps! #BIMAfromHome \n\n\"The Corporal''s Boots\" is the story of one soldier''s boots in the national exhibit, \"Eyes Wide Open.\" The film is a journey through the boots of American soldiers who died in Iraq. The boots were sectioned by state and arranged in rows as if the soldiers were standing at parade rest. When it stopped in Washington State, a viewer who had a son in the military went to see it. She tells her moving story. Personal, intense, and profound with a haunting, original score. Directed by Patricia Boiko, West Seattle Senior Center member.  \n\nOut of the desire to be advocates, members of The Gathering Place program who are living with memory loss chose to create this short documentary, \"Living with Memory Loss: In Our Own Words.\" Memory loss currently carries an immense stigma, fear, and shame, so they wanted to share some more holistic narratives about their experiences. Created by PNA Greenwood Senior Center."},"defaultAudioLanguage":"en"}', '{"duration":"PT59M15S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"53","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''101'':4A ''agewis'':1A ''episod'':3A ''tv'':2A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
