INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17739, '-IaxRWQFopSHJEMkZI3Y-l3AvQE', 'hWImk_YVCXY', true, '{"publishedAt":"2020-06-23T02:05:52Z","channelId":"UCsgFF8vl3Cnw9U9-RuJfB7g","title":"YOGA FOR   DIABETES  , short video  1 , 22/06/2020.","description":"Hi , \nNamaste  everyone  , \n\n\n\nYoga for Diabetes: Yoga helps in prevention and management of diabetes by lifestyle change (diet, exercise, habits and stress reduction) through mind management. Nearly 100 research publications in indexed international journals from around the world has shown that, yoga helps in several ways\nDiabetes is of two types - \nType 1,where there is no production of insulin and\nType 2,where the pancreas does not produce enough insulin. In many cases, it is also easy to ignore diabetes in its early stage, especially, when you do not experience any symptoms.\n\nIn this video  i have  demonstrated  & explained  few normal Yogic Breathing techniques Yoga postures  through  which  you all can  cure Diabetes  problem  . \n\nBenefits of Yoga for Diabetes\n\nEveryone benefits from yoga - if they undergo proper training and continue with the\n\npractice. Regular practice of Yoga  benefits the body in the following ways which :\n\nIt improves digestion, circulation, and immunity\n\nYoga enhances function of neurological and endocrine organs\n\nIt can prevents and provides relief from chronic illnesses\n\nOverall the body feels healthier, more energetic\n\n\n\n\n\nNote  :-  \nConsult your Yoga therapist / teacher or  doctor  before start the  practice . \n\nMore details   contact :-\n_______________________\nE-Mail:- omprakash.kurial@gmail.com \nWhatsApp  :- +91 9560068017","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/hWImk_YVCXY/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/hWImk_YVCXY/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/hWImk_YVCXY/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/hWImk_YVCXY/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/hWImk_YVCXY/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Omprakash Kuriyal","categoryId":"1","liveBroadcastContent":"none","localized":{"title":"YOGA FOR   DIABETES  , short video  1 , 22/06/2020.","description":"Hi , \nNamaste  everyone  , \n\n\n\nYoga for Diabetes: Yoga helps in prevention and management of diabetes by lifestyle change (diet, exercise, habits and stress reduction) through mind management. Nearly 100 research publications in indexed international journals from around the world has shown that, yoga helps in several ways\nDiabetes is of two types - \nType 1,where there is no production of insulin and\nType 2,where the pancreas does not produce enough insulin. In many cases, it is also easy to ignore diabetes in its early stage, especially, when you do not experience any symptoms.\n\nIn this video  i have  demonstrated  & explained  few normal Yogic Breathing techniques Yoga postures  through  which  you all can  cure Diabetes  problem  . \n\nBenefits of Yoga for Diabetes\n\nEveryone benefits from yoga - if they undergo proper training and continue with the\n\npractice. Regular practice of Yoga  benefits the body in the following ways which :\n\nIt improves digestion, circulation, and immunity\n\nYoga enhances function of neurological and endocrine organs\n\nIt can prevents and provides relief from chronic illnesses\n\nOverall the body feels healthier, more energetic\n\n\n\n\n\nNote  :-  \nConsult your Yoga therapist / teacher or  doctor  before start the  practice . \n\nMore details   contact :-\n_______________________\nE-Mail:- omprakash.kurial@gmail.com \nWhatsApp  :- +91 9560068017"}}', '{"duration":"PT23M47S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount