ry day is different, each side can feel different. Skip what you need to skip. Take modifications and rest when needed. \n\nThank you for showing up! I appreciate you!\n\nI do not own the rights to any music played in this video."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT28M22S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"7","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''30'':8A ''bodi'':13A ''challeng'':3A ''class'':11A ''full'':12A ''got'':6A ''min'':9A ''vinyasa'':1A ''workout'':14A ''yoga'':2A,10A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
