INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17771, '-JUzp_zpdhaPfGVbNFMV21Zi5xE', 'yEKCf_TxWpU', true, '{"publishedAt":"2016-11-28T04:11:35Z","channelId":"UCoBG9_FFeUoudsC1Vf_DG2w","title":"Leg Balance Challenge Yoga Poses | Concentration and Strength | vyfhealth","description":"Develop your concentration and boost your legs strength in Rishikesh, India in front of Holly Ganga. This is unique challenging leg balance poses including Vriksasana or Tree Pose, Virbhadrasana or Worrier Pose, Natrajasana, Garudasana or Eagle Pose, Utthita Hasta Padangusthasana or Standing Big Toe Pose and Eka Pada Baddha Padma Uttanasana or One leg bound lotus standing forward bend pose. Demonstrated by Yoga Guru Dheeraj, Vashistha Yoga. \n\n\n100 Poses+Pranayama : http://vyfhealth.com/\n\nFollow us on Instagram : https://www.instagram.com/vashistha_yoga/ \n\nJoin us on facebook : https://www.facebook.com/VashisthaYoga/\n\nTweet us : https://twitter.com/vashisthayoga","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/yEKCf_TxWpU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/yEKCf_TxWpU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/yEKCf_TxWpU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/yEKCf_TxWpU/sddefault.jpg","width":640,"height":480}},"channelTitle":"Vashistha Yoga Ashram","tags":["Yoga","Ashtangayoga","Vinyasaflow","Poweryoga","Hathayoga","Mysoreyoga","vyfhealth","Vashisthayoga","Yogavasistha","vasistha","Yogaindia","Balance Pose","Yoga Balance","Balance in Yoga","Legs Balance","Leg Strength","concentration","Yoga for concentration","Mindfulness","Yoga Class","Yoga Videos","Yoga for You","Strength Training","Yoga Training","dheeraj vashistha","Yoga in Ahmedabad","Vinyasa Yoga","Yoga Challenge","Health","Fitness","Exercise","Workout","Wellness","YogaFit","Yoga for Health","Yoga Teacher"],"cat