INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17773, '0DUarKrbSLc6da6C739AtBQyDD8', 'flw7G-bC4Yg', true, '{"publishedAt":"2020-04-10T23:43:41Z","channelId":"UCBaaaQt9PqoNeGy3CWHIxYA","title":"FULL CLASS FREE! Yummy Sweaty Twisty Backbend  Level 2/3 Vinyasa 90-Minute","description":"ok...90-ISH minutes.  Option to leave out the flow repetitions if you are shorter on time, but I have to say I think they are worth it.  This class will focus on spinal segmentation, engaging the front body even in backbends, and a short skill session on going from flip dog to wheel pose and back.  Fun transition from Skandasana to Gate Pose and back, options for Eka Pada Koundinyasana 2 and 1, and then a few seated poses to cool down before Savasana.  Jam-packed and will leave your spine feeling supple and delicious.  Comment below if you enjoy it! \nFind me on Instagram at @Jill.Lynch.Yoga or Facebook at Jill Lynch Yoga.  Visit www.jilllynchyoga.com to subscribe for more classes!\n\nDISCLAIMER\nNot all exercises are suitable for everyone.  Before you take this class, you should have permission from your physician to participate in moderate to vigorous exercise.  It is the students responsibility to modify or scale back exercises as needed.  The instructions in this video are not medical advice and should not be taken as such.  The creators of this program disclaim any liability, loss, or injury in connection with the exercises presented herein.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/flw7G-bC4Yg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/flw7G-bC4Yg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/flw7G-bC4Yg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/flw7G-bC4Yg/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/flw7G-bC4Yg/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Jill Lynch Yoga","categoryId":"17","liveBroadcastContent":"none","localized":{"title":"FULL CLASS FREE! Yummy Sweaty Twisty Backbend  Level 2/3 Vinyasa 90-Minute","description":"ok...90-ISH minutes.  Option to leave out the flow repetitions if you are shorter on time, but I have to say I think they are worth it.  This class will focus on spinal segmentation, engaging the front body even in backbends, and a short skill session on going from flip dog to wheel pose and back.  Fun transition from Skandasana to Gate Pose and back, options for Eka Pada Koundinyasana 2 and 1, and then a few seated poses to cool down before Savasana.  Jam-packed and will leave your spine feeling supple and delicious.  Comment below if you enjoy it! \nFind me on Instagram at @Jill.Lynch.Yoga or Facebook at Jill Lynch Yoga.  Visit www.jilllynchyoga.com to subscribe for more classes!\n\nDISCLAIMER\nNot all exercises are suitable for everyone.  Before you take this class, you should have permission from your physician to participate in moderate to vigorous exercise.  It is the students responsibility to modify or scale back exercises as needed.  The instructions in this video are not medical advice and should not be taken as such.  The creators of this program disclaim any liability, loss, or injury in connection with the exercises presented herein."}}', '{"duration":"PT1H41M1S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"139","likeCount":"6","dislikeCount":"0","favoriteCount":"0","commentCount":"6"}', '''2/3'':9A ''90'':11A ''backbend'':7A ''class'':2A ''free'':3A ''full'':1A ''level'':8A ''minut'':12A ''sweati'':5A ''twisti'':6A ''vinyasa'':10A ''yummi'':4A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
