INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17799, 'qPNZrcJaHeqE4IrI20xFULLq7Do', 'BMMTbJUrKuA', true, '{"publishedAt":"2018-03-06T01:43:44Z","channelId":"UCntGkLoFi4ccww93viAmwsw","title":"20 Minute Hip-Opening Sequence: Dawn Davis Yoga","description":"20 Minute Hip-Opening sequence.\nTight hips are a bummer. When tight, they reduce our mobility and compromise our performance. Well, say good-bye to those cranky hips with this short yoga video. Dawn Davis of Dawn Davis Yoga presents a steady stream of hip openers, including poses on our backs as well as standing poses, to help relieve even the tightest of hips. Great for anyone who has hips-- from beginners to seasoned practitioners.Sign up for live-streaming classes at www.dawndavis.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/BMMTbJUrKuA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/BMMTbJUrKuA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/BMMTbJUrKuA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/BMMTbJUrKuA/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/BMMTbJUrKuA/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Dawn Davis Yoga","tags":["Hips","Yoga","Short","Dawn Davis","Hip tight","Flexibility","Best Yoga","Yogafortighthips","Dawn Davis Yoga","Yogawithadriene","flowyoga","livestreamyoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"20 Minute Hip-Opening Sequence: Dawn Davis Yoga","description":"20 Minute Hip-Opening sequence.\nTight hips are a bummer. When tight, they reduce our mobility and compromise our performance. Well, say good-bye to those cranky hips with this short yoga video. Dawn Davis of Dawn Davis Yoga presents a steady stream of hip openers, including poses on our backs as well as standing poses, to help relieve even the tightest of hips. Great for anyone who has hips-- from beginners to seasoned practitioners.Sign up for live-streaming classes at www.dawndavis.com"}}', '{"duration":"PT22M40S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"365","favoriteCount":"0","commentCount":"0"}', '''20'':1A ''davi'':8A ''dawn'':7A ''hip'':4A ''hip-open'':3A ''minut'':2A ''open'':5A ''sequenc'':6A ''yoga'':9A', '2020-07-02 06:13:48.352879', '2020-07-02 06:13:48.352879');
