INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17805, 'YwmJd1QsGj3O2MyIi3Hvh7TKd6Y', 'DbfCkRCAbr8', true, '{"publishedAt":"2020-06-26T06:53:07Z","channelId":"UCW-BDuC2hJ92nhIcWX1t4qQ","title":"Face Yoga | Yoga for Face Glow |  Yogi Barun","description":"Aaj ke live session me pahle suksham vyayam kiye gaye hain\nSharir ko yoga ke liye tayar Kiya gaya hai...\n\nFir Surya Namaskar ki practice ki gayi hai \n\nOr fir Asanas kiye gaye gaye hain jisme sabse pahle Padhastasan ki practice hai \nPractice me dilhayagaya hai ki apko face yoga ke liye kiye jane wale koi bhi asan khichkar nahi karna hai...\nFir Parwatasan ki practice ki gayi hai\nIs tarah se asan lagatar kiye gaye hain sabhi asano ka time apko dhyan rakhna hai \n\nHar asana ko apni kshamta ke anusar karna start karna hai or fir aage 1 minute tak rokna hai \nPura labh lene ke liye \nIsme dikhaye gaye asan se chehre par \nGlow badta hai \nChehre ka fat Kam hota hai \nOr kabj ya apach rahti hai to door hoti hai jisse chehre par kabj se aane wali jhhuriyan na aaye or chehra apka glow karta rahe..\n\nKuch bimariyo ke baare me bataya gaya hai jisme nahi karna hai\nPar agar kisi or bimari me isme dikhayi gayi asanas se problem lagta hai to wah asan nahi Karen \nYa Kam der ke liye Karen koi khichav na le \nUsme ...\nAgar koi bimari gambhir hai to apne Dr se Salah lekar hi Karen...\n\nThank you \n\nKeys\n#faceyoga #flowingface #yogaforface\n#rpy #rhythmicpoweryoga","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/DbfCkRCAbr8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/DbfCkRCAbr8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/DbfCkRCAbr8/hqdefault.jpg","width":480,"height":360}},"channelTitle":"Rhythmic Power Yoga","tags":["#yoga #poweryoga #yogaforface #faceyoga #glowingface #yogaindore #yogaindia"],"categoryId":"24","liveBroadcastContent":"none","localized":{"title"