INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17841, 'XFy04wUHEDGTrQpxMuITysW9Hy4', 'oESxFlh7wRA', true, '{"publishedAt":"2020-06-26T13:00:26Z","channelId":"UCymph_9uF6n2qezt6B7s5GQ","title":"3 Tips to Train Back Sleeping,  the Best Sleeping Style for Anti-aging","description":"Tip #1: 0:42\nTip #2: 1:57\nTip #3: 4:10\n\n#FaceYoga #FacialYoga #KokoFaceYoga\n\nFREE download the face yoga paper\nhttps://kokofaceyoga.com/yoga-poses\n\nAsk any questions to AI Koko\nhttps://kokofaceyoga.com/\n\nFace Yoga 101 available at Amazon Prime Video (available in USA and UK)\nhttps://kokofaceyoga.com/videos\n\nApply for Kokos mini session\nhttps://kokofaceyoga.com/mini-session\n\nFREE download our Face Yoga App\nhttps://kokofaceyoga.com/app\n\nProducts introduced (incl the sugar oil and pillow that I often mention)\nhttps://www.amazon.com/shop/kokohayashi\n\nWebsite\nhttp://www.kokofaceyoga.com/\nhttp://www.miraiclinical.com/\n\nInstagram\nhttp://instagram.com/kokohayashi/\nhttp://www.instagram.com/miraiclinical/\n\nTikTok\nhttps://vm.tiktok.com/J1V8dEx/\n@KokoFaceYoga\n\nFacebook\nhttp://www.facebook.com/KokoFaceYoga/\nhttp://www.facebook.com/MiraiClinical/\n\nPinterest\nhttps://www.pinterest.com/kokofaceyoga/\nhttps://www.pinterest.com/miraiclinical/\n\n\nBusiness inquiry\nsmile@kokofaceyoga.com\n(For exercise questions, please ask AI Koko and/or consider to take my private sessions.\nhttp://www.kokofaceyoga.com/sessions/)\n\nWhat is Face Yoga?\nFace Yoga is a great natural solution to regain your youthful appearance, a.k.a. natural alternative to botox or plastic surgery! We wake up sleeping facial muscles in the face to lift up the skin and relax over-working facial muscles for wrinkle reduction .\n\nBio:\nBorn and grown up in Japan where Face Yoga has been popular, I have been practicing facial exercises over a decade and started teaching since 2018.  (A study shows it works!)  My clients include Kim Kardashian, Khloe Kardashian, Kourtney Kardashin, and more!\n\nVoted #1 Popular Yoga Class at The Yoga Expo Los Angeles\nHave celebrity clients such as Kim Kardashian\nFeatured at Shark Tank, Good Morning America and more!\n\nHow did she get interested in Face Yoga?\nAt the age of 27, I was advised to add implant by a doctor, so did it, because the doctor told me that it can be easily removed if I dont like it. Unfortunately, the chin got distorted and I didnt like it, so obviously had it removed, but the chin has never been the same as before. It is distorted to a side (asymmetrical chin), which made me realize that I should have pursued more natural alternative such as Face Yoga! \n\n\nInterested in my private session ?\nLearn in a private session (one to one) so I can analyze your face thoroughly about room for improvement, your facial expression habits, your face posture, etc and provide specific exercises and tips only for you! Plus, you will receive a mini video of the exercises that we cover during the session, after the session, so you can review later. (In-Person or Online)\n\nMy Media Appearance:\nShark Tank, Keeping Up With The Kardashians, Good Morning America, Magic for Humans (Netflix), Pop Sugar, Vogue, Fox News, CBS Morning News, InStyle, Little Women LA, KTLA Morning News, KUSI Morning News, and more!\n\nCorporates that I have taught at: \nLinkedIn, California Skin Institute, Dr. Yoko Beauty Terrace Clinic, Goop, Athleta, Popsugar, HUM Nutrition, Lorna Jane, Beautibi, Uruoi Skincare, and more!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/oESxFlh7wRA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/oESxFlh7wRA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/oESxFlh7wRA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/oESxFlh7wRA/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/oESxFlh7wRA/maxresdefault.jpg"