INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17975, 'Et45aIbE_SKDL_U_jjJaUPQZ6VQ', 'Oyy2gnzJgas', NULL, '{"publishedAt":"2017-04-04T20:02:18Z","channelId":"UCGrUXxPkz_TuWy398_xTrjg","title":"Yin Yoga Class10 Min Deep Hips and Back Relaxation","description":"Yin Yoga can stimulatie Meridians , the life energy channels according to Traditional Chinese Medicine.\nIt targets to deep connective tissues, like ligaments, which usually cannot be stretched by doing  dynamic and muscular (yang) styles of exercises.\n\nWhile this style of yoga might seem boring, passive or soft at first, Yin can be quite tough because of the long duration of the poses. We remain almost up  to 3-5 minutes in each pose. By practicing this 10min intro class, You will know what Yin really is and realize how powerful this gentle style of yoga is, leaving the hips, pelvis and lower spine deeply relaxed.\n\nNamaste\nMandy","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/Oyy2gnzJgas/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/Oyy2gnzJgas/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/Oyy2gnzJgas/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/Oyy2gnzJgas/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/Oyy2gnzJgas/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Manchee Yoga","tags":["yoga","yinyoga","yogaclass","workout","london","yogalesson","sports","running","girls"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yin Yoga Class10 Min Deep Hips and Back Relaxation","description":"Yin Yoga can stimulatie Meridians , the life energy channels according to Traditional Chinese Medicine.\nIt targets to deep connective tissues, like ligaments, which usually cannot be stretched by doing  dynamic and muscular (yang) styles of exercises.\n\nWhile this style of yoga might seem boring, passive or soft at first, Yin can be quite tough because of the long duration of the poses. We remain almost up  to 3-5 minutes in each pose. By practicing this 10min intro class, You will know what Yin really is and realize how powerful this gentle style of yoga is, leaving the hips, pelvis and lower spine deeply relaxed.\n\nNamaste\nMandy"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT12M11S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1610","likeCount":"18","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''10'':4A ''and'':8A ''back'':9A ''class'':3A ''deep'':6A ''hips'':7A ''min'':5A ''relaxation'':10A ''yin'':1A ''yoga'':2A', '2020-07-02 06:17:20.83242', '2020-07-02 06:17:20.83242');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17976, 'xpt-xLg7JJ2d2WIea1hyYHd31j4', 'tPQm2UIxrrE', NULL, '{"publishedAt":"2020-06-30T13:30:09Z","channelId":"UCo9L06Ipw6-Mmkhxr9ORpAQ","title":"Architecture of Asana #1, Laying a Foundation - Yoga Flow with Jen Hilman","description":"JOIN JEN''S LIVE YOGA CLASSES ONLINE:\nhttps://www.jenhilman.com/\n\nHello, my friends!  Today we will be stretching and strengthening from the feet to the hips.  Laying a strong foundation is so important for your Yoga practice, and will help with all of your other techniques. Be well and Namaste. \n\nJEN HILMAN\nINSTAGRAM: https://www.instagram.com/jenhilman/\nFACEBOOK: https://www.facebook.com/jen.hilman\n\nLive Yoga Class for Flexibility here:\nhttps://studio.youtube.com/video/f2B9EIS3rlA/edit\n\nJoin our exclusive content community here:\nhttps://jenhilmancommunity.vhx.tv\n\nThanks for joining me. Namaste.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/tPQm2UIxrrE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/tPQm2UIxrrE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/tPQm2UIxrrE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/tPQm2UIxrrE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/tPQm2UIxrrE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Jen Hilman","tags":["yoga","jen hilman","yoga flow","free yoga","asana","asana tutorial","yoga asana","yoga with jen","yoga with jen hilman","yoga for flexibility","yoga for flexibility and strength","yoga for beginners","yoga at home","morning yoga","yoga for weight loss","online yoga","free yoga videos","beginners yoga","lululemon","spirituality","yoga for balance","bedtime yoga","wellness","yoga teacher","yoga girl","yoga for stress relief","yoga for anxiety and stress","yoga for stress"],"categoryId":"27","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"Architecture of Asana #1, Laying a Foundation - Yoga Flow with Jen Hilman","description":"JOIN JEN''S LIVE YOGA CLASSES ONLINE:\nhttps://www.jenhilman.com/\n\nHello, my friends!  Today we will be stretching and strengthening from the feet to the hips.  Laying a strong foundation is so important for your Yoga practice, and will help with all of your other techniques. Be well and Namaste. \n\nJEN HILMAN\nINSTAGRAM: https://www.instagram.com/jenhilman/\nFACEBOOK: https://www.facebook.com/jen.hilman\n\nLive Yoga Class for Flexibility here:\nhttps://studio.youtube.com/video/f2B9EIS3rlA/edit\n\nJoin our exclusive content community here:\nhttps://jenhilmancommunity.vhx.tv\n\nThanks for joining me. Namaste."},"defaultAudioLanguage":"en"}', '{"duration":"PT50M27S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"640","likeCount":"60","dislikeCount":"3","favoriteCount":"0","commentCount":"8"}', '''1'':4A ''a'':6A ''architecture'':1A ''asana'':3A ''flow'':9A ''foundation'':7A ''hilman'':12A ''jen'':11A ''laying'':5A ''of'':2A ''with'':10A ''yoga'':8A', '2020-07-02 06:17:20.83242', '2020-07-02 06:17:20.83242');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18006, 'JzKCFgmVrqMQDBGNMsV4eY_N8NM', 'vFfmL26jpC0', NULL, '{"publishedAt":"2019-01-19T04:30:21Z","channelId":"UCE6Y7fJCSeQEUaCxQPENjCg","title":"Power yoga flow weight lose  with Master Ajay in Jai yoga","description":"Practicing yoga can help improve the quality of your sleep. You may find that youre able to fall asleep more easily and sleep more deeply when you have a consistent yoga practice. Ideally, you should sleep between six and nine hours each night.\n\nQuality sleep is often associated with weight loss. A 2018 study found that people who had restricted sleep five times per week lost less fat than the group that followed their normal sleeping patterns. Both groups were limiting the number of calories they consumed, suggesting that sleep loss has an adverse effect on body composition, including fat loss.\n\nYoga nidra is a form of guided relaxation that you do lying down. The practice may help you to sleep more deeply and increase mindfulness. You can also set intentions during yoga nidra, which may help you to develop weight loss goals.\n\nA small 2018 study found that healthcare workers who did yoga nidra for eight weeks increased their levels of mindfulness. This mindfulness included acting with awareness and not judging inner experiences.\n\nTheir levels of sleepiness werent significantly different at the follow-up. However, this score improved the longer people did the practice. Larger, more in-depth studies are needed to expand on these findings.\n\n\nYoga and calorie burning\nWhile yoga isnt traditionally considered an aerobic exercise, there are certain types of yoga that are more physical than others.\n\nActive, intense styles of yoga help you burn the most calories. This may help prevent weight gain. Ashtanga, vinyasa, and power yoga are examples of more physical types of yoga.\n\nVinyasa and power yoga are usually offered at hot yoga studios. These types of yoga keep you moving almost constantly, which helps you to burn calories.\n\nPracticing yoga may also help you develop muscle tone and improve your metabolism.\n\nWhile restorative yoga isnt an especially physical type of yoga, it still helps in weight loss. One study found that restorative yoga was effective in helping overweight women to lose weight, including abdominal fat.\n\nThese findings are especially promising for people whose body weight may make more vigorous forms of yoga difficult.\n\nA review of studies from 2013 found that yoga is a promising way to help with behavioral change, weight loss, and maintenance by burning calories, heightening mindfulness, and reducing stress. These factors may help you to reduce food intake and become aware of the effects of overeating.\n\nMore in-depth, high-quality studies are needed to expand on these findings.\n\nHow often should you do yoga to lose weight?\nPractice yoga as often as possible in order to lose weight. You can do a more active, intense practice at least three to five times per week for at least one hour.\n\nOn the other days, balance out your practice with a more relaxing, gentle class. Hatha, yin, and restorative yoga classes are great options.\n\nIf youre a beginner, start slowly and gradually build up your practice. This allows you to build up your strength and flexibility and prevent injuries. If you dont have time for a full class on certain days, do a self-practice for at least 20 minutes. Allow yourself one full day of rest each week.\n\nCombine your yoga practice with activities such as walking, cycling, or swimming for added cardiovascular benefits.\n\nAs part of your routine, avoid weighing yourself directly after a yoga class, especially if its a hot yoga class, since you may lose water weight during the class. Instead, weigh yourself at the same time each day.\n\nPoses to do at home\nHere are a few yoga poses you can do at home if you dont have time for a full session.\n\nSun Salutations\nDo at least 10 Sun Salutations. You can increase the intensity by holding some of the positions for longer periods or by speeding up the pace.\n\n\nFrom standing, inhale as your lift your arms overhead.\nExhale as you swan dive down into a Forward Bend.\nJump, step, or walk your feet back into Plank pose.\nHold this position for at least five breaths.\nDrop your knees down and lower your body to the floor.\nExtend your legs, turn the tops of your feet to the mat, and place your hands under your shoulders.\nInhale to lift partway, halfway, or all the way up into Cobra pose.\nExhale to lower back down and then push up into Downward Facing Dog.\nHold this pose for at least five breaths.\nExhale as you jump, step, or walk your feet to the top of the mat and stand in a Forward Bend.\nThen inhale to lift up your arms overhead.\nExhale to lower your arms back down by your body.\nBoat pose\nThis pose engages your whole body, especially your core, and helps to reduce stress.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/vFfmL26jpC0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/vFfmL26jpC0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/vFfmL26jpC0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/vFfmL26jpC0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/vFfmL26jpC0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Jai Yoga Academy","tags":["power yoga","weight lose","lose","weight","power","yoga","flow weight lose","master Ajay","yoga power","lose weight in 10 mins","20 minutes weight lose","28 days fat lose"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Power yoga flow weight lose  with Master Ajay in Jai yoga","description":"Practicing yoga can help improve the quality of your sleep. You may find that youre able to fall asleep more easily and sleep more deepl