INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17987, 'ezvicOdP73ODJqmHwRmwQFiQUHY', 'EG6vJBlmZjs', NULL, '{"publishedAt":"2017-07-29T03:00:00Z","channelId":"UCm12heOZu12gossn8hwddhA","title":"Yoga Flow - Full Class 53 minutes  Twist and Bend","description":"A Yoga Flow class with lots of twists!\n\n\nSome of the poses used in this class\n\nSun Salutations\nSide Bends\nThree Legged Downward Facing Dog\nSimple Twist into Gecko variation\nIntense side stretch or pyramid pose\nChair flow\nChair twist flow\nWarrior one and twist flow\nCrescent lunge \nCrescent Twist\nLow Lunges\nWarrior Poses\nLizard/ Gecko/ Monkey Twist\nThread the Needle Pose\nDolphin Flow\nSquat Twist into Side Crow\nWheel of Life\nMermaid Pose\nEagle Twist\nBridge or Wheel Pose\nSavasana\n\n\n\n\n\n\n\n\n\n\n\n\nMusic:\nEastminster by Kevin MacLeod is licensed under a Creative Commons Attribution license (https://creativecommons.org/licenses/by/4.0/)\nSource: http://incompetech.com/music/royalty-free/index.html?isrc=USUAN1100719\nArtist: http://incompetech.com/\n\nWelcome to my yoga channel! \n\nConnect with me:\nfacebook - https://www.facebook.com/YogaWithSu/\ntwitter - https://twitter.com/YogaWithSu\ninstagram - https://www.instagram.com/yogawithsu/\n\nMy name is Su, and I teach yoga. I aim to provide you with free yoga. Please hang around, because I will be providing lots of different yoga classes for you to choose from. Yoga classes that will soon become available will include these yoga styles: Gentle Yoga, Hatha Yoga, Flow Yoga, Yin Yoga, Yin Yang Yoga, Restorative Yoga, Power Yoga and many more!\n\nI like to make sure that everyone from beginners to advance yogis can reap benefits from yoga. We will stretch our muscles, but also calm busy minds.\n\nCome yoga with me. See you on the mat!\n\nSu\n\nDisclaimer:\nInformation provided by Yoga Su are for educational and entertainment purposes only. All information pr