cription":"This 10-minute yoga video is perfect for helping you to ease tension in the lower back muscles. If you''re experiencing lower back tension due to sitting at a desk for a long time, driving, or maybe even from menstruation cramps, these yoga poses will help you to soothe lower back muscles in just 10-minutes.\n\nUnfortunately, most of the activities that we do these days lead to tension in the lower back. Whether it''s sitting for too long at a desk, standing too much, being overactive, or not being active enough! The lower back needs your love and yoga is a great way to give it the care it needs to soothe current pain and even to avoid future lower back pain.\n\nIf you experience regular lower back tension, make yoga your new best friend! A lot of lower back tension comes from the muscles in the body becoming tight from inactivity. This compresses the lower back which results in pain and reduced mobility over time. Through this 10-minute yoga practice, we can lengthen the muscles again and decompress the lower back. We''ll also do some gentle spinal twists to increase spinal mobility and flexibility.\n\n SUBSCRIBE to the channel for free yoga videos every week and to support free yoga + HIT   if you enjoyed this video. \n\n Please SHARE with a friend.\n\n YOU MIGHT ALSO ENJOY: \n\n  10-MINUTE HIP STRETCH: https://www.youtube.com/watch?v=vmGMzeiT2Jw&t=20s\n  10-MINUTE SHOULDER STRETCH: https://www.youtube.com/watch?v=o5pDHI44-lY&t=21s\n Yoga for Better Posture: https://youtu.be/_wIZjT_uBM4\n Yoga for the Back and Spine: https://youtu.be/VwjxA3GRjSA\n Deep Back Stretch: https://youtu.be/pZmu8Wusu3A\n\n  This PLAYLIST has more 10 Minute Yoga Videos:\nhttps://www.youtube.com/playlist?list=PL9mB1a-zyhI_kDKMpMbGrpUird16J9K0U\n\n LET''S CONNECT: \n Instagram: https://www.instagram.com/katiemcgrat...\n Facebook: https://www.facebook.com/katiemcgrath...\n\nMusic: Places, by Bloome \nhttps://bit.ly/3dCIjkW\n\n----------------------------------------\nKatie McGrath 