INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17998, 'qPfhjggBkXZSkC61dR3QcsTmoiU', 'fuQXJ-u7fro', NULL, '{"publishedAt":"2020-01-20T15:50:59Z","channelId":"UCJ59wmJwIa-XQsd8qIcYtgg","title":"Steady Heart Opening Yoga Flow | Yoga with Patrick Beach","description":"Hey everybody, happy Monday! In this weeks class we are exploring moving through the spine and side body to open the heart. Heart opening poses can be tricky because they are both physical and metaphorical. This class puts the primary focus on moving through the spine which will help you improve your posture. Always remember the yoga practice is your own, you don''t have to be able to do all the poses to enjoy the practice, take what you can today and keep growing! \n\n\n\n#yoga #poweryoga #patrickbeach\n\n\n\n\n\nfollow us on instagram! \r\npatrick beach - http://instagram.com/patrickbeach\r\ncarling harps - http://instagram.com/carlingnicole\r\n\r\nhttp://patrickbeach.com\r\nhttp://facebook.com/patrickandcarling","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/fuQXJ-u7fro/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/fuQXJ-u7fro/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/fuQXJ-u7fro/hqdefault.jpg","width":480,"height":360}},"channelTitle":"Patrick and Carling","tags":["patrick beach","heart opening yoga","backbending yoga flow"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Steady Heart Opening Yoga Flow | Yoga with Patrick Beach","description":"Hey everybody, happy Monday! In this weeks class we are exploring moving through the spine and side body to open the heart. Heart opening poses can be tricky because they are both physical and metaphorical. This class puts the primary focus on moving through the spine which will help you improve your posture. Always remember the yoga practice is your own, you don''t have to be able to do all the poses to enjoy the practice, take what you can today and keep growing! \n\n\n\n#yoga #poweryoga #patrickbeach\n\n\n\n\n\nfollow us on instagram! \r\npatrick beach - http://instagram.com/patrickbeach\r\ncarling harps - http://instagram.com/carlingnicole\r\n\r\nhttp://patrickbeach.com\r\nhttp://facebook.com/patrickandcarling"},"defaultAudioLanguage":"en"}', '{"duration":"PT26M52S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"18924","likeCount":"644","dislikeCount":"7","favoriteCount":"0","commentCount":"26"}', '''beach'':9A ''flow'':5A ''heart'':2A ''opening'':3A ''patrick'':8A ''steady'':1A ''with'':7A ''yoga'':4A,6A', '2020-07-02 06:17:22.989811', '2020-07-02 06:17:22.989811');
