INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18002, 'seEwJZWTij4a9VekELIpfGDhSAU', 'LhovzRMQs5g', NULL, '{"publishedAt":"2020-05-01T19:47:19Z","channelId":"UCE8wcq7h4Lo5kdB6McsMbog","title":"45 Minute Morning Yoga For Beginners","description":"#free yoga videos #yoga at home# morning yoga #home yoga practice 30 days of yoga #yoga for beginners #beginners yoga #yoga# free yoga #yoga with Rosie# yoga full body yoga #45 minute yoga  minute yoga practice#Morning Yoga for beginners#Morning Flow#morning flow yoga # yoga flow#yoga#morning yoga\n\n\n\nIf you want to feel better in your body this is the channel for you. Because when you practice yoga you feel better!\n\nDon''t worry if you''re not flexible or can''t do the poses perfectly. The motto of Yoga With Rosie is \"It''s not about the pose\". You don''t have to be perfect.\n\nAll you have to do is show up. When you make the decision to take care of yourself, all sorts of amazing things begin to happen. You have more energy. You become more patient. Your outlook on life becomes more positive. And all of these changes you will experience in this yoga journey will begin to affect those around you in ways you never dreamed possible. \n\nThis practice can bring loving, positive energy that will spread throughout your world. And as you deepen your yoga practice you will have the opportunity to meet many like-minded souls like yourself who are also laying down their mat and doing the work. \n\nConsider subscribing to this channel and become a part of making this world shine with more light!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/LhovzRMQs5g/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/LhovzRMQs5g/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/LhovzRMQs5g/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/LhovzRMQs5g/sddefault.j