are welcome and encouraged.\n\nNamaste,\nHope"}}', '{"duration":"PT1H2M1S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"68","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''1'':1A ''beach'':5A ''hope'':8A ''hr'':2A ''live'':3A ''with'':7A ''yin'':4A ''yoga'':6A', '2020-07-02 06:17:24.557446', '2020-07-02 06:17:24.557446');
