INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18040, '2P1VTjaxwd-pbrHVlRIglHyWKjE', 'd1mHJW3eaxw', NULL, '{"publishedAt":"2020-05-28T20:26:24Z","channelId":"UC7YTzhZhcp3MndAqSWdk-Hg","title":"45 minute Gentle Yoga","description":"This yoga class focuses on gentle stretches and twists synchronized with breath work. \nAfter some floor work gently warming up our muscles alongside our spine (Erector Spinae muscles), our hips, chest and upper back, we work on half sun salutations with lateral bends and gentle twists as well as forward folds. We then work on the Pyramid pose allows us to further open up our hamstrings and lower back muscles while working our core. Foundational poses such as Warrior 2 and triangle pose  prep us for some deeper forward fold stretches such as wide legged forward fold. We end our practice with floor work continuing with poses that open up our legs and hips.\nEnjoy your practice! \n~~~~~~~~\nScience Backed Yoga: Huma is a certified yoga teacher (Registered School of Yoga Alliance) and yoga therapist with over 800 hours of education and advanced training in yoga and yoga therapy and over 1000 hours of teaching experience. She has studied under leading medical doctors,  yoga therapists and visionary pioneers in the yoga world at Loyola Marymount University''s Advanced Clinical Yoga Therapy Program that integrates western medicine with 2000 year old yoga tradition.  She teaches Vinyasa, Hatha, Therapeutic, Yin and gentle yoga classes at some of the best yoga studios in Orange County that provide students an authentic yoga experience. \n~~~~~~~~\nFollow @Humayogaandart on Instagram for daily live stream yoga classes & inspiration.\n~~~~~~~~","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/d1mHJW3eaxw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/d1mHJW3eaxw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.yti