provide students an authentic yoga experience. \n~~~~~~~~\nFollow @Humayogaandart on Instagram for daily live stream yoga classes & inspiration.\n~~~~~~~~"}}', '{"duration":"PT47M24S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"45","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''45'':1A ''gentle'':3A ''minute'':2A ''yoga'':4A', '2020-07-02 06:17:24.557446', '2020-07-02 06:17:24.557446');
