the yoga posture in your body, you are doing it.\n\nTodays yoga class is designed for the absolute beginner. You can do this class if you have never done a yoga class before in your life. I will give you slow, easy to follow, step-by-step instructions and tell you exactly how to get in and out of each and every pose. Detailed instructions will be given for even the most basic poses and how to breathe. You will be given lots of cues of how to pay attention to your body and where to feel the effects of the yoga poses. You do not have to be athletic, flexible, strong, balanced, skinny or coordinated to do this class. The slow, step-by-step instructions will give you the confidence to let go of your self-judgment and stay focused with commitment and motivation.\n\nSign up for my 31 day beginner yoga challenge: http://www.melissawest.com/31-day-beginner-yoga-challenge/ \n\nRelated Videos: Yoga for Beginners: https://www.youtube.com/playlist?list=PL0343C65F2EEFE37E\n\nPlease Subscribe Here: http://bit.ly/RMV4hC\n\nHere''s my Website: http://www.melissawest.com/\nFacebook: https://www.facebook.com/yournamasteyoga\nFollow me on Twitter: https://twitter.com/drmelissa\nFollow me on Instagram: http://instagram.com/drmelissawest#\nFollow me on Pinterest: http://www.pinterest.com/drmelissawest/\nFollow me on Google+: https://plus.google.com/u/0/+DrMelissaWest/posts\n\nJoin our Membership Site:\nhttp://www.melissawest.com/membership/membership-sign-up/"}}', '{"duration":"PT1H2M59S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"3866","likeCount":"76","dislikeCount":"2","favoriteCount":"0","commentCount":"12"}', '''1'':9A ''272'':16A ''beginner'':4A ''beginners'':3A ''dr'':13A ''easy'':6A ''follow'':8A ''for'':2A ''hour'':10A ''melissa'':14A ''to'':7A ''west'':15A ''with'':12A ''yoga'':1A,5A,11A', '2020-07-02 06:17:26.262851', '2020-07-02 06:17:26.262851');
