INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18053, 'NgyNY4miH7N_GnpmcXBj8IfKMW8', 'pWyqdrlXu3Y', NULL, '{"publishedAt":"2020-06-28T00:30:01Z","channelId":"UCvDc7jgAYAjbNqvWjbovVQw","title":"Iyengar Yoga for Beginners. 20 minute class for lower back","description":"Iyengar Yoga for Beginners. 20 minute class for lower back. \nThis is a sequence to help a tight back after you have been working too much on the computer or in the garden. \nJoin Lin every Tuesday and and Saturday, Leo every Thursday at 18:00 GMT for a LIVE Zoom class! Click on the link for your Free Trial class. https://www.iyengar-yoga.co.uk/ . New classes for more advanced students available on Friday morning now. \nThis is an Iyengar Yoga Sequence for Beginners.  @Yoga with Lin and Leo   have changed the way we work due to the Covid-19 situation. We hope to be posting more frequently, but we will be teaching individually. \n\nThis yoga sequence, taught by Leo, is a shortened version of one of the virtual classes we are teaching at the Maidstone Yoga Centre, which is closed during this outbreak of Coronavirus. If you would like access to the full class, CLICK THIS LINK TO REGISTER AT THE CENTRE. https://www.iyengar-yoga.co.uk/ YOUR FIRST CLASS IS FREE when booking. We have a Zoom discussion for those who want to join us. \n\nThis sequence is Beginners yoga,  (for those who know the basics of the subject) but we will also be posting Complete Beginners Yoga routines, (for those who are new to the subject), Improvers classes, (for those who are working on their inversions and deepening their practice), and short Intermediate seqeunces, (for those who have an established, mature practice and are ready to tackle some of the more challenging poses).\n\nThis sequence comprises the following poses: \nGarudasana in Tadasana - Eagle pose in Mountain Pose\nParsvottanasana - Intense side stretch to wall\nParivrtta Trikonasana - Revolved Triangle pose to wall\nAdho Mukha Swanasana - Dog Head Down\nAdho Mukha Virasana - Forward fold in Hero Pose \nParvatasana in Tadasana\nPrasarita Padottanasana - Wide Legged forward bend to chair\nAdho Mukha Svanasana - Dog Head Down\nAdho Mukha Virasana - Forward bending Hero Pose\nSalamba Sarvangasana - Shoulder stand\nHalasana - Plough or Plow Pose\nBent leg Savasana\n\n\nYou just need your mat, and a chair. To make a platform for Sarvangasana and Halasana, use four foam pads and a cushion or folded blankets/towels.\n If you find any of the poses difficult, you can look the poses up in our Yoga Pose Directory, which we are adding to all the time.These tutorials will teach the poses in more detail and sometimes with extra props.\n\n\nIf you want to try Yoga with Lin and Leo''s  19 Days of Yoga series, check out our Playlist: \nhttp://bit.ly/2kf1Vou\nOr our 13 Days of yoga: \nhttp://bit.ly/2oYRTdc\nOr our latest, 18 Days of Yoga\nhttps://www.youtube.com/playlist?list=PLLTwDvdKnrC4Lq0GLKne5_3xC951vukoT\n\nYoga practice can improve strength and flexibility and yoga for back pain relief and the efficacy of long-term yoga practice for weight loss has been supported by many studies.\n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing.\n\n\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\nOr our latest ebook, \"Yoga for the Stressed Body.\" https://amzn.to/2XWp7q6\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n \n Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to increase mindfulness, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/pWyqdrlXu3Y/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/pWyqdrlXu3Y/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/pWyqdrlXu3Y/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/pWyqdrlXu3Y/sddefault.jpg","width":640,"height":480}},"channelTitle":"Yoga with Lin and Leo","tags":["iyengar yoga for beginners","halasana for beginners","iyengar yoga","iyengar class","iyengar lesson","    ","plow pose","yoga with lin and leo","yoga iyengar","yoga","     ","iyengar yoga class","yoga back pain","yoga at home","stretching","beginners yoga","parivrtta trikonasana","yoga for beginners","yoga class","Iyengar for beginners","iyengar poses for beginners","upper back pain","stiff shoulders","stretch shoulders","iyengar","Plough pose"],"categoryId":"24","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"Iyengar Yoga for Beginners. 20 minute class for lower back","description":"Iyengar Yoga for Beginners. 20 minute class for lower back. \nThis is a sequence to help a tight back after you have been working too much on the computer or in the garden. \nJoin Lin every Tuesday and and Saturday, Leo every Thursday at 18:00 GMT for a LIVE Zoom class! Click on the link for your Free Trial class. https://www.iyengar-yoga.co.uk/ . New classes for more advanced students available on Friday morning now. \nThis is an Iyengar Yoga Sequence for Beginners.  @Yoga with Lin and Leo   have changed the way we work due to the Covid-19 situation. We hope to be posting more frequently, but we will be teaching individually. \n\nThis yoga sequence, taught by Leo, is a shortened version of one of the virtual classes we are teaching at the Maidstone Yoga Centre, which is closed during this outbreak of Coronavirus. If you would like access to the full class, CLICK THIS LINK TO REGISTER AT THE CENTRE. https://www.iyengar-yoga.co.uk/ YOUR FIRST CLASS IS FREE when booking. We have a Zoom discussion for those who want to join us. \n\nThis sequence is Beginners yoga,  (for those who know the basics of the subject) but we will also be posting Complete Beginners Yoga routines, (for those who are new to the subject), Improvers classes, (for those who are working on their inversions and deepening their practice), and short Intermediate seqeunces, (for those who have an established, mature practice and are ready to tackle some of the more challenging poses).\n\nThis sequence comprises the following poses: \nGarudasana in Tadasana - Eagle pose in Mountain Pose\nParsvottanasana - Intense side stretch to wall\nParivrtta Trikonasana - Revolved Triangle pose to wall\nAdho Mukha Swanasana - Dog Head Down\nAdho Mukha Virasana - Forward fold in Hero Pose \nParvatasana in Tadasana\nPrasarita Padottanasana - Wide Legged forward bend to chair\nAdho Mukha Svanasana - Dog Head Down\nAdho Mukha Virasana - Forward bending Hero Pose\nSalamba Sarvangasana - Shoulder stand\nHalasana - Plough or Plow Pose\nBent leg Savasana\n\n\nYou just need your mat, and a chair. To make a platform for Sarvangasana and Halasana, use four foam pads and a cushion or folded blankets/towels.\n If you find any of the poses difficult, you can look the poses up in our Yoga Pose Directory, which we are adding to all the time.These tutorials will teach the poses in more detail and sometimes with extra props.\n\n\nIf you want to try Yoga with Lin and Leo''s  19 Days of Yoga series, check out our Playlist: \nhttp://bit.ly/2kf1Vou\nOr our 13 Days of yoga: \nhttp://bit.ly/2oYRTdc\nOr our latest, 18 Days of Yoga\nhttps://www.youtube.com/playlist?list=PLLTwDvdKnrC4Lq0GLKne5_3xC951vukoT\n\nYoga practice can improve strength and flexibility and yoga for back pain relief and the efficacy of long-term yoga practice for weight loss has been supported by many studies.\n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing.\n\n\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\nOr our latest ebook, \"Yoga for the Stressed Body.\" https://amzn.to/2XWp7q6\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n \n Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to increase mindfulness, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class."},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT20M30S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"995","likeCount":"47","dislikeCount":"1","favoriteCount":"0","commentCount":"11"}', '''20'':5A ''back'':10A ''beginners'':4A ''class'':7A ''for'':3A,8A ''iyengar'':1A ''lower'':9A ''minute'':6A ''yoga'':2A', '2020-07-02 06:17:26.262851', '2020-07-02 06:17:26.262851');
