INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18056, 'EfiWk2SVTeiiRt2tNWyRMsl3yqA', 'fp6siF7xdMU', NULL, '{"publishedAt":"2020-06-30T21:38:24Z","channelId":"UCueLp4RZvb5weSMkH2URs8A","title":"Happy Back Yoga - 45 minute practice","description":"This gentle yoga practice is perfect for beginners or experienced yogis. We will spend some time on the floor stretching the shoulders and upper back and then find connection to the breath and our center. Stay for end of the practice and experience a reset of the nervous system. Great for stress relief.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/fp6siF7xdMU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/fp6siF7xdMU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/fp6siF7xdMU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/fp6siF7xdMU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/fp6siF7xdMU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Shine On Wellness","tags":["yoga","gentle yoga","wellness coach","yoga for back pain","floor yoga","relaxation"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"Happy Back Yoga - 45 minute practice","description":"This gentle yoga practice is perfect for beginners or experienced yogis. We will spend some time on the floor stretching the shoulders and upper back and then find connection to the breath and our center. Stay for end of the practice and experience a reset of the nervous system. Great for stress relief."}}', '{"duration":"PT45M27S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2","likeCount":"0","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''45'':4A ''back'':2A ''happy'':1A ''minute'':5A ''practice'':6A ''yoga''