INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18059, 'BnwbzlHD5mJefYwdb2XLBWfkw8A', 'C0IQ6YQxQUs', NULL, '{"publishedAt":"2020-04-20T15:06:34Z","channelId":"UCeSuG1xEsEl-hl8mbl_txqw","title":"45 Minute Yoga at Home Balance Improvement","description":"Hey guys, I hope you are all well and staying safe.\n\nThis video is a sequence that will take you through some fun balance exercises.\n\nIf you like the video please like and share it to anyone you think may also enjoy it. \n\nFirstly a few safety point guys; \n\nIf you are going to try this video please check the area around you to make sure there are no obstacles or safety hazards. \n\nMake sure you are comfortable trying the exercises and take things at your own pace and feel free to pause the video if you need a break.\n\nNow the last and very important point, Have fun!\n\nDisclaimer: KT Wild of KT Wild''s Namaslay Yoga strongly recommends that you consult with your physician before beginning any exercise program. You should be in good physical condition and be able to participate in the exercise. You should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge\n\nThere will be more video''s to follow so please feel free to send me requests :)\n\nIf you would like to join me on this new journey please feel free to help on the link.\n\nhttps://www.facebook.com/kt.wild.3\nhttps://www.paypal.me/ktwild1\nhttps://www.instagram.com/kt_wild1\n\n#freeyogavideos #yogaforbeginners #yoga #yogaeveryday #yogalife","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/C0IQ6YQxQUs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/C0IQ6YQxQUs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/C0IQ6YQxQUs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/C0IQ6YQxQUs/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/C0IQ6YQxQUs/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"KT Wild''s Namaslay Yoga","tags":["KT Wild","Vinyasa","Vinyasa yoga","Flexibility","Namaslay","Stay At Home","Yoga","Yoga at home","StayAtHomeSaveLives","Beginners Yoga","KT Wilds Namaslay Yoga","CardiffTogether","Working at home","core strength","Upper body"],"categoryId":"26","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"45 Minute Yoga at Home Balance Improvement","description":"Hey guys, I hope you are all well and staying safe.\n\nThis video is a sequence that will take you through some fun balance exercises.\n\nIf you like the video please like and share it to anyone you think may also enjoy it. \n\nFirstly a few safety point guys; \n\nIf you are going to try this video please check the area around you to make sure there are no obstacles or safety hazards. \n\nMake sure you are comfortable trying the exercises and take things at your own pace and feel free to pause the video if you need a break.\n\nNow the last and very important point, Have fun!\n\nDisclaimer: KT Wild of KT Wild''s Namaslay Yoga strongly recommends that you consult with your physician before beginning any exercise program. You should be in good physical condition and be able to participate in the exercise. You should understand that when participating in any exercise or exercise program, there is the possibility of physical injury. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge\n\nThere will be more video''s to follow so please feel free to send me requests :)\n\nIf you would like to join me on this new journey please feel free to help on the link.\n\nhttps://www.facebook.com/kt.wild.3\nhttps://www.paypal.me/ktwild1\nhttps://www.instagram.com/kt_wild1\n\n#freeyogavideos #yogaforbeginners #yoga #yogaeveryday #yogalife"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT45M36S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"99","likeCount":"6","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''45'':1A ''at'':4A ''balance'':6A ''home'':5A ''improvement'':7A ''minute'':2A ''yoga'':3A', '2020-07-02 06:17:26.262851', '2020-07-02 06:17:26.262851');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18111, 'lCUfmCbZJzsvk96_PRQP77zSDME', 'pveO_UJYwOY', NULL, '{"publishedAt":"2018-06-09T23:53:12Z","channelId":"UC8xYrIpokk0g2QEAZp9Jp_w","title":"Yoga Recuperation My Daily 30 Minute Session, Week 6","description":"6 weeks ago I started trying to do a small set of flexibility improvement exercises hoping to get myself physically and mentally able to do some very basic beginners yoga, I will be sharing the videos of the first couple of weeks soon, i struggled so much both mentally and physically in the early days and that stuff is very hard to watch so that i can edit it.\n\nI have a massive task ahead of me here and it would be overwhelming to think of all at once, so i don''t look at the whole journey as most of it is in the future all i can do is focus on what needs done today, this routine here is the minimal I demand from myself each day, I often do more throughout my day but if I tried to motivate thinking about how I have to do loads of exercise everyday for the next 6 months to even make a dent it would be far too easy to lose hope, I am purposefully mindfully not doing that instead i am just promising myself that everyday I will do at the very least this little 30 minutes session, I see it as a free gift from myself in the present in the here and now to myself in the future.\n\nMy goal is to regenerate the muscular support of my spine  bringing it back to life and correcting the herniated discs in my lower lumbar region (the T12 and L1) , I want back my full range of pain free movement and the full reliable use of my legs again permanently, please check the first video of the playlist as I go into it all in detail.\n\nSo then, this is my current 30 minute daily session in full at week 6 since starting, if anyone is out there in a similar situation and wants to do so they can follow along all, if you do so please find your own flexibility and movement range in each posture, i am certainly not worrying about my weird form as I am flexing to my maximum comfort in each posture and i get more flexible everyday, once capable i''ll probably join up and do a local class to help my progression.\n\n#beginnersyoga #30minsdailyforlife #homeexercise #workoutathome #fattofit #immobiletoathlete #ggtbod #getmylifeback #mobilitymaintenanceschedule #geordieaccent #yoga","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/pveO_UJYwOY/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/pveO_UJYwOY/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/pveO_UJYwOY/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/pveO_UJYwOY/sddefault.jpg","width":640,"height":480}},"channelTitle":"Chronicles of Bodley","tags":["beginners yoga","yoga for beginners","from fat to fit","immobile to athlete","yoga power","power yoga","home exercise","work out at hyome","ggtbod","yoga","sciatica","herniated disc","spine injury","injured at work","spine injury recovery","geordie accent","newcastle upon tyne"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga Recuperation My Daily 30 Minute Session, Week 6","description":"6 weeks ago I started trying to do a small set of flexibility improvement exercises hoping to get myself physically and mentally able to do some very basic beginners yoga, I will be sharing the videos of the first couple of weeks soon, i struggled so much both mentally and physically in the early days and that stuff is very hard to watch so that i can edit it.\n\nI have a massive task ahead of me here and it would be overwhelming to think of all at once, so i don''t look at the whole journey as most of it is in the future all i can do is focus on what needs done today, this routine here is the minimal I demand from myself each day, I often do more throughout my day but if I tried to motivate thinking about how I have to do loads of exercise everyday for the next 6 months to even make a dent it would be far too easy to lose hope, I am purposefully mindfully not doing that instead i am just promising myself that everyday I will do at the very least this little 30 minutes session, I see it as a free gift from myself in the present in the here and now to myself in the future.\n\nMy goal is to regenerate the muscular support of my spine  bringing it back to life and correcting the herniated discs in my lower lumbar region (the T12 and L1) , I want back my full range of pain free movement and the full reliable use of my legs again permanently, please check the first video of the playlist as I go into it all in detail.\n\nSo then, this is my current 30 minute daily session in full at week 6 since starting, if anyone is out there in a similar situation and wants to do so they can follow along all, if you do so please find your own flexibility and movement range in each posture, i am certainly not worrying about my weird form as I am flexing to my maximum comfort in each posture and i get more flexible everyday, once capable i''ll probably join up and do a local class to help my progression.\n\n#beginnersyoga #30minsdailyforlife #homeexercise #workoutathome #fattofit #immobiletoathlete #ggtbod #getmylifeback #mobilitymaintenanceschedule #geordieaccent #yoga"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT30M8S","dimension":"2d","definition":"hd","caption":"true","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"48","likeCount":"4","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''30'':5A ''6'':9A ''daily'':4A ''minute'':6A ''my'':3A ''recuperation'':2A ''session'':7A ''week'':8A ''yoga'':1A', '2020-07-02 06:17:30.866011', '2020-07-02 06:17:30.866011');
