s","sarah shokraie yoga"],"categoryId":"22","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"10 Min Morning Yoga","description":"A morning stretch for all levels that''s only 10 minutes long! Woohoo! These stretches will focus more on opening the shoulders, hips and back, while not being too overly demanding or challenging.\nThese are my favourite stretches and asanas (poses) to do first thing in the morning that really help kick-start my day feeling all nice and loosy-goosey~\nAlso I apologize for the un-focusing in some parts, I''m still getting the hang of filming!\n\nP.s. Yes that is my cockatiel Pea being a creep on the side.\n\n Website: https://www.sarahshokraie.com/\n Instagram: https://www.instagram.com/sarahshokraie/\n\nCheck out our podcast!!! \n Ponder Lounge Channel: http://youtube.com/channel/UCzqOhgu9Ua1SFcyNrqbXPLw\n Ponder Lounge IG: https://www.instagram.com/ponderlounge/\n Listen via: https://anchor.fm/ponder-lounge"},"defaultAudioLanguage":"en"}', '{"duration":"PT11M59S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1418","likeCount":"17","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''10'':1A ''min'':2A ''morning'':3A ''yoga'':4A', '2020-07-02 06:17:26.262851', '2020-07-02 06:17:26.262851');
