INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18073, 'WSW8yMWrrV2C6Ctugt2D8fuvedM', 'AAMwYew5GNo', NULL, '{"publishedAt":"2020-06-23T13:33:00Z","channelId":"UCq8UGEYF0mL44A6LT7XoZJQ","title":"Hatha High 30 min Guided  Shoulder & Hip Opener Yoga Class","description":"Find relief for tight shoulders and hips and help to open up the spine in this 30 min Hatha High guides Yoga Class\n\nhttp://www.joyscola.com\nhttp://www.instagram.com/joyscola\nhttp://www.facebook.com/joyscola\n\nIn our hectic, modern lives, many of us focus so heavily on work and family commitments that we never seem to have time for pure fun. Somewhere between childhood and adulthood, we stopped playing. When we carve out some leisure time, were more likely to zone out in front of the TV or computer than engage in fun, rejuvenating play like we did as children. But play is not just essential for kids; it can be an important source of relaxation and stimulation for adults as well.\n\nWhile play is crucial for a childs development, it is also beneficial for people of all ages. Play can add joy to life, relieve stress, supercharge learning, and connect you to others and the world around you. Play can also make work more productive and pleasurable.\n\nPlay is fun and can trigger the release of endorphins, the bodys natural feel-good chemicals. Keep you feeling young and energetic. In the words of George Bernard Shaw, We dont stop playing because we grow old; we grow old because we stop playing. Play can boost your energy and vitality and even improve your resistance to disease, helping you function at your best.\n\nAlong with Restorative, Yin is the most accessible of the physical yoga systems, in that it can be practiced by anyone, regardless of age or ability. It doesnt even require a mat  a carpet or blanket will do just fine. In Yin, you hold deep, floor-based postures in stillness for between three and 20 minutes. Using very little muscular effort, each student is encouraged to find their own individual edge  the point of stress, but before pain  to the posture, as it is here at this precipice that we enable our bodies to begin to safely open.\n\nThe gentle traction created in Yin works not on the muscles and blood (our Yang tissues) but on our connective Yin tissues  tendons, ligaments, cartilage, fascia, and bone. When we talk about flexibility  particularly in yoga  the focus tends to be on the muscles: Lengthen your hamstrings, feel the stretch across your abdomen and so on. However, as Yin yoga and anatomy expert Bernie Clark explains, we hold only 41% of our bodily tension in our muscles. The remaining 57% is held in our connective tissues and joints (with a further 2% in our skin).\n\nYoga and breathing aids in relieving depression and anxiety. Steady breath stimulates our PNS which is our at response system responsible for digestion and healing. Our sympathetic nervous system is like Wario and our parasympathetic nervous system is like Mario. \n\nGet to know yoga from the comfort of home and a taste of what a class would be like. Or, if you''re too busy to commit a full hour then this is the morning routine for you. \n\nEach week will offer a new half-hour yoga flow to follow along from home that offers full body stretches and warm-up. Won''t make you dripping with sweat but will heat your body and focus your mind. \n\nInstructor: Joy Scola from the YouTube channel, Psychetruth.\n\nI wasn''t born \"bendy\". When I first started my health journey, I couldn''t touch my toes and backbends HURT! They gave me headaches and made me feel cranky. Since I thought backbends were the worst, I decided to make it a focus in my practice. So grunting and while silently cursing in my mind, I stretched. Now, I love backbends! \n\nI still find that if I don''t practice for a while, I get stiff in my body and remember why I started yoga in the first place. Some days you may not feel very up to it. Listen to and be gentle with your body when this arises. Go easy and move with your breath while we gently wake up the body and mind. Moving oxygen into the bloodstream to feel more refreshed, centered, and focused. \n\nYoga Tip: If you struggle with committing to a workout/Yoga practice, try telling yourself, just 5/10 mins and Im done. It takes a great weight off the ego and clears resistance which allows room for small changes and small changes lead to big growth.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/AAMwYew5GNo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/AAMwYew5GNo/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/AAMwYew5GNo/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/AAMwYew5GNo/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/AAMwYew5GNo/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Joy Scola","categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Hatha High 30 min Guided  Shoulder & Hip Opener Yoga Class","description":"Find relief for tight shoulders and hips and help to open up the spine in this 30 min Hatha High guides Yoga Class\n\nhttp://www.joyscola.com\nhttp://www.instagram.com/joyscola\nhttp://www.facebook.com/joyscola\n\nIn our hectic, modern lives, many of us focus so heavily on work and family commitments that we never seem to have time for pure fun. Somewhere between childhood and adulthood, we stopped playing. When we carve out some leisure time, were more likely to zone out in front of the TV or computer than engage in fun, rejuvenating play like we did as children. But play is not just essential for kids; it can be an important source of relaxation and stimulation for adults as well.\n\nWhile play is crucial for a childs development, it is also beneficial for people of all ages. Play can add joy to life, relieve stress, supercharge learning, and connect you to others and the world around you. Play can also make work more productive and pleasurable.\n\nPlay is fun and can trigger the release of endorphins, the bodys natural feel-good chemicals. Keep you feeling young and energetic. In the words of George Bernard Shaw, We dont stop playing because we grow old; we grow old because we stop playing. Play can boost your energy and vitality and even improve your resistance to disease, helping you function at your best.\n\nAlong with Restorative, Yin is the most accessible of the physical yoga systems, in that it can be practiced by anyone, regardless of age or ability. It doesnt even require a mat  a carpet or blanket will do just fine. In Yin, you hold deep, floor-based postures in stillness for between three and 20 minutes. Using very little muscular effort, each student is encouraged to find their own individual edge  the point of stress, but before pain  to the posture, as it is here at this precipice that we enable our bodies to begin to safely open.\n\nThe gentle traction created in Yin works not on the muscles and blood (our Yang tissues) but on our connective Yin tissues  tendons, ligaments, cartilage, fascia, and bone. When we talk about flexibility  particularly in yoga  the focus tends to be on the muscles: Lengthen your hamstrings, feel the stretch across your abdomen and so on. However, as Yin yoga and anatomy expert Bernie Clark explains, we hold only 41% of our bodily tension in our muscles. The remaining 57% is held in our connective tissues and joints (with a further 2% in our skin).\n\nYoga and breathing aids in relieving depression and anxiety. Steady breath stimulates our PNS which is our at response system responsible for digestion and healing. Our sympathetic nervous system is like Wario and our parasympathetic nervous system is like Mario. \n\nGet to know yoga from the comfort of home and a taste of what a class would be like. Or, if you''re too busy to commit a full hour then this is the morning routine for you. \n\nEach week will offer a new half-hour yoga flow to follow along from home that offers full body stretches and warm-up. Won''t make you dripping with sweat but will heat your body and focus your mind. \n\nInstructor: Joy Scola from the YouTube channel, Psychetruth.\n\nI wasn''t born \"bendy\". When I first started my health journey, I couldn''t touch my toes and backbends HURT! They gave me headaches and made me feel cranky. Since I thought backbends were the worst, I decided to make it a focus in my practice. So grunting and while silently cursing in my mind, I stretched. Now, I love backbends! \n\nI still find that if I don''t practice for a while, I get stiff in my body and remember why I started yoga in the first place. Some days you may not feel very up to it. Listen to and be gentle with your body when this arises. Go easy and move with your breath while we gently wake up the body and mind. Moving oxygen into the bloodstream to feel more refreshed, centered, and focused. \n\nYoga Tip: If you struggle with committing to a workout/Yoga practice, try telling yourself, just 5/10 mins and Im done. It takes a great weight off the ego and clears resistance which allows room for small changes and small changes lead to big growth."},"defaultAudioLanguage":"en"}', '{"duration":"PT27M20S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"424","likeCount":"19","dislikeCount":"1","favoriteCount":"0","commentCount":"4"}', '''30'':3A ''class'':10A ''guided'':5A ''hatha'':1A ''high'':2A ''hip'':7A ''min'':4A ''opener'':8A ''shoulder'':6A ''yoga'':9A', '2020-07-02 06:17:27.71925', '2020-07-02 06:17:27.71925');
