INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18082, 'z6Z6M8f5y3hF1XuKhhf0o37UMkE', 'VX7LnsxKFJk', NULL, '{"publishedAt":"2020-03-22T22:07:03Z","channelId":"UC0rnau3VbD8cORjJzdgWVdQ","title":"Yin Yoga class 1","description":"This 1 hour and 10 minute Yin yoga class is for everyone looking to release tension and develop flexibility. It targets the toes, feet, hamstrings, hips, shoulders , neck and lower and upper back. This practice is extremely relaxing and also effectively removing tension and tightness in the body.\nI hope you enjoy!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/VX7LnsxKFJk/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/VX7LnsxKFJk/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/VX7LnsxKFJk/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/VX7LnsxKFJk/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/VX7LnsxKFJk/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yogaaah","tags":["Yin yoga","Simple Yin Yoga","yin yoga overall practice","Yin Yoga for beginner''s","Beginner''s yoga","Yoga for Peace of Mind","Yoga for Flexibility","Yoga for hips and shoulders","Stretch Yoga","Yoga"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"Yin Yoga class 1","description":"This 1 hour and 10 minute Yin yoga class is for everyone looking to release tension and develop flexibility. It targets the toes, feet, hamstrings, hips, shoulders , neck and lower and upper back. This practice is extremely relaxing and also effectively removing tension and tightness in the body.\nI hope you enjoy!"}}', '{"duration":"PT1H11M41S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"63","likeCount":"1","dislikeCount":"0","favoriteCount":"0","c