INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18083, 'g9nTAhcfGq5pfPwE57m_izKPD64', 'qmTZUlTg4YE', NULL, '{"publishedAt":"2015-11-10T21:01:47Z","channelId":"UC0vSP_FSjyxvUtitBgDRTrQ","title":"Haley''s Hatha Yoga - 1 Hour Full Class","description":"Here is the music I suggest for this class.\n\nhttps://www.youtube.com/watch?v=18NHV4nJLQc\n\nToday''s class consists of Moon Salutations, Staff of Brahman and other fun poses. I hope you enjoy my class as well as the Savasana and meditative offerings made through out the hour. Phoenix also may or may not make an appearance ;) \n \nNamaste\n\nXOXO\n\nHaley Anne","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/qmTZUlTg4YE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/qmTZUlTg4YE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/qmTZUlTg4YE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/qmTZUlTg4YE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/qmTZUlTg4YE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Haley Anne","tags":["Hatha Yoga","Yoga (Sport)","Class","Dance","Hour","Hatha yoga","ashtanga yoga","kundalini yoga","full yoga class","yoga for beginners","vinyasa yoga","yoga for weight loss","yoga videos","yoga nidra","yoga asanas","pranayama","prenatal yoga","yoga class","morning yoga","yoga meditation","meditation","yoga","gentle yoga","relaxation yoga","kundalini","yoga pants","shaja yoga","types of yoga","shilpa shetty yoga","restorative yoga","beginners yoga","savasana","moon salutations","staff of brahman"],"categoryId":"23","liveBroadcastContent":"none","localized":{"title":"Haley''s Hatha Yoga - 1 Hour Full Class","description":"Here is the music I suggest for this class.\n\nhttps://www.youtube.com/watch?v=18NHV4nJLQc\n\nToday''s class consists of Moon Salutations, Staff of Brahman and other fun poses. I hope you enjoy my class as well as the Savasana and meditative offerings made through out the hour. Phoenix also may or may not make an appearance ;) \n \nNamaste\n\nXOXO\n\nHaley Anne"}}', '{"duration":"PT1H2M14S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"219","likeCount":"5","dislikeCount":"0","favoriteCount":"0"}', '''1'':5A ''class'':8A ''full'':7A ''haley'':1A ''hatha'':3A ''hour'':6A ''s'':2A ''yoga'':4A', '2020-07-02 06:17:27.71925', '2020-07-02 06:17:27.71925');
