INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18085, 'zRm_--n_xxzREPRAF7F36jEUbis', 'zVwIOFBPEgk', NULL, '{"publishedAt":"2019-01-18T14:01:12Z","channelId":"UCEIp4eYHWpjuhKv0nXxVV3A","title":"YOGA LESSON 4 : Arm Balance Yoga Flow","description":"Arm Balance Yoga Flow\n\n Practice more classes free for 10days at :  https://www.youtube.com/channel/UCEIp4eYHWpjuhKv0nXxVV3A \n\n  This  25-minute Vinyasa Yoga Flow class lead by Kim Navarra is geared at teaching the essential elements of the arm balance known as Bakasana or Crow pose! In this video Kim will lead you through a Yoga flow focused on developing & teaching you the beginner arm balance known as Crow pose or Bakasana and side Crow Parsva Bakasana. Get Ready to Fly and at times invert!\n\n  Please be advised to take the following program as a 10 class course as a complement to your yoga practice and always remember to listen to your body and rest anytime you need during the sequence. During the shooting of this 10 class Yoga series Kim was 6 months into her  sweet waiting and the excercises presented are not in anyway recommended for pregnant women in general.\n\nEnjoy & Namaste","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/zVwIOFBPEgk/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/zVwIOFBPEgk/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/zVwIOFBPEgk/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/zVwIOFBPEgk/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/zVwIOFBPEgk/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Kim Navarra","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"YOGA LESSON 4 : Arm Balance Yoga Flow","description":"Arm Balance Yoga Flow\n\n Practice more classes free for 10days at :  https://www.youtube.com/channel/UCEIp4eYHWpjuhKv0nXxVV3A \n\n  This  25-minute Vinyasa Yoga Flow class lead by Kim Navarra is geared at teaching the essential elements of the arm balance known as Bakasana or Crow pose! In this video Kim will lead you through a Yoga flow focused on developing & teaching you the beginner arm balance known as Crow pose or Bakasana and side Crow Parsva Bakasana. Get Ready to Fly and at times invert!\n\n  Please be advised to take the following program as a 10 class course as a complement to your yoga practice and always remember to listen to your body and rest anytime you need during the sequence. During the shooting of this 10 class Yoga series Kim was 6 months into her  sweet waiting and the excercises presented are not in anyway recommended for pregnant women in general.\n\nEnjoy & Namaste"}}', '{"duration":"PT25M59S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"5392","likeCount":"16","dislikeCount":"1","favoriteCount":"0","commentCount":"0"}', '''4'':3A ''arm'':4A ''balance'':5A ''flow'':7A ''lesson'':2A ''yoga'':1A,6A', '2020-07-02 06:17:27.71925', '2020-07-02 06:17:27.71925');
