ou like my video please subscribe to my channel! \n\nYou can follow me also on: \n\nInstagram: @martina__rando https://www.instagram.com/martina__rando\n\n@Ready_set_yoga\nhttps://www.instagram.com/ready_set_yoga\n\nFacebook: @martinarandoyoga https://www.facebook.com/martinarandoyoga"}}', '{"duration":"PT29M57S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"5005","likeCount":"140","dislikeCount":"0","favoriteCount":"0","commentCount":"16"}', '''beginners'':3A ''flow'':5A ''for'':2A ''hatha'':1A ''yoga'':4A', '2020-07-02 06:17:27.71925', '2020-07-02 06:17:27.71925');
