INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18089, '-EgM0OSCmrVcjQYghezzimcYYMU', 'sh27Wv-VVkE', NULL, '{"publishedAt":"2016-10-07T02:18:41Z","channelId":"UCo3GoRLFsOehQ4tIoKZHzNA","title":"30 Minute Vinyasa Flow Yoga","description":"30 ( Thirty ) Minute Vinyasa Flow Yoga\n\nIn this 30 minute vinyasa flow yoga class I emphasize shoulder opening.  So much of our time is spent with poor posture with the shoulders hanging down and in front of the chest.  The video starts with a few stretches to open up the pecs/chest so that the chest.  then we do a few exercises to strengthen the muscles in the upper back that help to hold the shoulder in a heathy position and open the chest better.  Often Yoga classes emphasize \"heart openers\" but don''t emphasize the proper work needed to strengthen the postural muscles so that we can train the body to hold this posture more frequently.  When these muscles are properly strengthened it will teach you how to keep the chest more open in all of the postures and most importantly make us more efficient breathers/ blood pumpers. Or energetically speaking, increase our ability to process prana.  Who wouldn''t like a little more life force energy out of their practice?  I hope this practice leaves you feeling strong, calm, refreshed and energized. \n Do you guys like the new intro? Hope you enjoy this 30 minute vinyasa flow yoga sequence.\n\nThank you for Watching! Be sure to check out my new website and make sure to SIGN UP https://www.theyogadose.com\n\nOn this yoga channel you will learn the foundational principles of vinyasa yoga that will help you achieve strength, flexibility, and balance. This practice is specifically designed to set you on a path to health, re-set your metabolism, and cleanse your body. \n\nNew yoga videos will be posted every Thursday! \nSubscribe to the channel here: \nhttp://tinyurl.com/m59tbb5\nhttps://www.theyogadose.com\n\n