ers. Or energetically speaking, increase our ability to process prana.  Who wouldn''t like a little more life force energy out of their practice?  I hope this practice leaves you feeling strong, calm, refreshed and energized. \n Do you guys like the new intro? Hope you enjoy this 30 minute vinyasa flow yoga sequence.\n\nThank you for Watching! Be sure to check out my new website and make sure to SIGN UP https://www.theyogadose.com\n\nOn this yoga channel you will learn the foundational principles of vinyasa yoga that will help you achieve strength, flexibility, and balance. This practice is specifically designed to set you on a path to health, re-set your metabolism, and cleanse your body. \n\nNew yoga videos will be posted every Thursday! \nSubscribe to the channel here: \nhttp://tinyurl.com/m59tbb5\nhttps://www.theyogadose.com\n\nIf you have a question regarding yoga or a request for a certain type of yoga class please leave a comment below and I will do my best to respond! I will respond to all comments left in the first 24 hours after posting.\n\nThanks again for the support!\n\nhttps://www.theyogadose.com"},"defaultAudioLanguage":"en-US"}', '{"duration":"PT29M44S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"24292","likeCount":"666","dislikeCount":"8","favoriteCount":"0","commentCount":"73"}', '''30'':1A ''flow'':4A ''minute'':2A ''vinyasa'':3A ''yoga'':5A', '2020-07-02 06:17:29.228894', '2020-07-02 06:17:29.228894');
