INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18114, 'eDy1ruDnEieodjYkH6usyaAAuNw', 'ISlDJzzayVg', NULL, '{"publishedAt":"2020-06-28T02:41:24Z","channelId":"UCW6CSSskvzYIUXBMj6dJOZQ","title":"Power Yoga with Amanda: Balance + Core [1 Hour Live Class - 5.1.2020]","description":"Join Amanda for a Power Yoga class! This is an invigorating hour that allows you to use your own body to create heat, strength, and balance. We will move faster in this class so make sure to have water nearby, breathe often, and take a childs pose whenever you need it - this is your class. \n\nPower Yoga is a dynamic, powerful class that will strengthen your body, stretch out your muscles, and refocus your mind. \n\nWe will open the front of our body with Bow pose, work on our balance in chair pose and half-moon, and strengthen our core with boat and side planks. We will do lots of sun salutations to work out our muscles and create warmth and strength within our body. \n\nWe will flow between multiple balance poses to deepen our connection between our two sides, as well as our bodies and minds. Grab a mat, a water, and get ready to move, breathe, sweat, and feel good!\n\nInstagram: @monetsays\nFacebook: Amanda Monet Bock\ntiny.cc/YogawithAmanda","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/ISlDJzzayVg/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/ISlDJzzayVg/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/ISlDJzzayVg/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/ISlDJzzayVg/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/ISlDJzzayVg/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Amanda Monet Bock","tags":["Yoga","Power Yoga","Yoga with Amanda","Yoga for everyone","Yoga for beginners","Beginning Yoga","Yoga for strength","Yoga for Core","Yoga for Balance","One hour yoga class","1 hour Yoga","60 minute yoga class","Free online yoga","Half-moon pose","Sun salutations","Chair pose","Bow pose"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Power Yoga with Amanda: Balance + Core [1 Hour Live Class - 5.1.2020]","description":"Join Amanda for a Power Yoga class! This is an invigorating hour that allows you to use your own body to create heat, strength, and balance. We will move faster in this class so make sure to have water nearby, breathe often, and take a childs pose whenever you need it - this is your class. \n\nPower Yoga is a dynamic, powerful class that will strengthen your body, stretch out your muscles, and refocus your mind. \n\nWe will open the front of our body with Bow pose, work on our balance in chair pose and half-moon, and strengthen our core with boat and side planks. We will do lots of sun salutations to work out our muscles and create warmth and strength within our body. \n\nWe will flow between multiple balance poses to deepen our connection between our two sides, as well as our bodies and minds. Grab a mat, a water, and get ready to move, breathe, sweat, and feel good!\n\nInstagram: @monetsays\nFacebook: Amanda Monet Bock\ntiny.cc/YogawithAmanda"}}', '{"duration":"PT1H1M26S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"14","likeCount":"0","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''1'':7A ''5.1.2020'':11A ''amanda'':4A ''balance'':5A ''class'':10A ''core'':6A ''hour'':8A ''live'':9A ''power'':1A ''with'':3A ''yoga'':2A', '2020-07-02 06:17:30.866011', '2020-07-02 06:17:30.866011');
