a\nEditing by Candice Polglase\n\n\nPlease support yoginimelbourne continue to make great content by becoming a Patreon: https://www.patreon.com/yoginimelbourne\nor donating via Paypal\nhttps://www.paypal.me/yoginimelbourne\n\nTo connect: \n\nhttps://www.instagram.com/yoginimelbo...\nhttps://www.facebook.com/paulalayyoga/\nhttp://paulalayyoga.com"}}', '{"duration":"PT17M","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"9751","likeCount":"300","dislikeCount":"3","favoriteCount":"0","commentCount":"29"}', '''15min'':5A ''flow'':4A ''hamstrings'':1A ''practice'':6A ''quads'':2A ''yoga'':3A', '2020-07-02 06:17:30.866011', '2020-07-02 06:17:30.866011');
