y and strong. See more of what we do www.hathayogaworks.com"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT34M43S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"600","likeCount":"11","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''30'':5A ''back'':11A ''beginners'':4A ''complete'':3A ''for'':2A,9A ''hathayogaworks'':12A ''minute'':6A ''the'':10A ''video'':8A ''yoga'':1A,7A', '2020-07-02 06:17:30.866011', '2020-07-02 06:17:30.866011');
