INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18125, '-bqUNiaRaKHdfDtDEaa8Ur92Iuk', 'T05rCS4vCzk', NULL, '{"publishedAt":"2016-10-12T02:47:56Z","channelId":"UC4A-FLGrvycSzM8dTYfo37Q","title":"ClimbFlow | 10 Minute Core Workout Flow | Yoga Fitness for Climbers | Tiffany Soi","description":"Sub 10 minute Core Yoga Fitness Workout Flow for Climbers by Tiffany Soi - Feel the burn fast!\nA dynamic paced flow to work your whole core, which is fundamental to a strong, stable and functional body that can generate power when you need it (exactly what we need for climbing). When you are short of time, this slots in perfectly post climbing session or at home. I would recommend trying this 3 times a week once you have warmed yourself up. \n\nI hope you do feel a burn moving in a different way!For some this will be a real challenge (for others less so, although bear in mind I have had some top notch climbers struggle with the floor sequence of movement much to my surprise!), but stick with it, you will get fitter!\n\nLet me know how you get along - Leave me a COMMENT! I would love to hear from you.\n\nShare the love, SUBSCRIBE to the channel, SHARE with friends.\n\nHere are some key notes below to keep in mind whenever you happen to move through any of these postures and sequences:\n\nDownward facing dog: Look at the thighs, relax the neck, press into the lengths of the fingers to support the wrists, push through the lengths of the arms to keep the shoulders strong and support the back. Draw up through the lower abdominals (gently pull the belly button towards the spine).\n\nPlank/front support: Shoulders above the wrists, the tail bone should be tucked under and glutes activates to switch on your core belt. Aim to draw the lower abdominals in. Dont let the lower back sag. This is a foundation for the other movements too-never let the bag sag!\n\nPush ups: Elbows graze the sides of the body, and aim to maintain the line of the body from the shoulders to the hips: You want to move in one piece. If you feel the lower back sagging, drop your knees to the ground for extra support and re set your form.\n\nSide plank: the aim is to lift the hips to make a long line from shoulder to foot. Use both feet if you need, or a flat foot for extra support,. When you get stronger you can stack the feet or float the leg, without letting the hips drop.\n\nFloor exercises: Keep the lower back pressed into the floor. This engages the core belt front to back. You shouldnt be able to fit your fingers underneath. If you notice this, stop and reset yourself. You don''t have to extend your heels towards the floor, if 45 degrees gets you working to begin with, stick with this til you get stronger. \n\nStar raises: Try not to let the shoulders touch the floor when you lower, draw up through the abdominals as you come up to your sit bones and twist, and dont let your lower back arch as you try to maintain balance. \n\nSupermen: Keep the hips low and level with the shoulders but dont let the back sag! Really reach out through the fingertips and the toes as you lift, this develops spinal stability. If you are finding this really challenging, only raise the hand/foot a few inches off the ground whilst still stretching out through the fingers/toes until you find your stability and strength improving.\n\nMountain climbers: Keep the hips low, the tailbone tucked, dont let the lower back arch, especially if you''re getting tired!\n\nRead the full article for Arch Climbing Wall here at http://www.archclimbingwall.com/journal/climbflow-movement-series-1\n\nYou are ultimately responsible for yourself and any movement you engage in. Always consult with your doctor/physician to ensure you are suitably able to practice any of the physical activity or exercises demonstrated.  \n.....\n\nAn established climber, Tiffany is the creator of ClimbFlow, the original dynamic yoga + functional movement method for climbers. Follow her on instagram @climbflow / @tiffany_soi or get in contact hello@tiffanysoi.com with your feedback, questions, and ClimbFlow requests.\n\nSupported by The Arch Climbing Wall, Rock On Climbing Shop, Blocfit, Obsession Climbing","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/T05rCS4vCzk/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/T05rCS4vCzk/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/T05rCS4vCzk/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/T05rCS4vCzk/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/T05rCS4vCzk/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Tiffany Soi","tags":["Yoga","climbing","rock climbing","yoga for climbing","functional fitness for climbing","climbing training","dynamic movement","fitness","Climbflow","The Arch Climbing Wall","climbing fitness","yoga for climbers","yoga for climbers with tiffany","yoga fitness","yoga fitness for climbers","bodyweight exercise","bodyweight training","bodyweight","fitness for climbers","Tiffany Soi"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"ClimbFlow | 10 Minute Core Workout Flow | Yoga Fitness for Climbers | Tiffany Soi","description":"Sub 10 minute Core Yoga Fitness Workout Flow for Climbers by Tiffany Soi - Feel the burn fast!\nA dynamic paced flow to work your whole core, which is fundamental to a strong, stable and functional body that can generate power when you need it (exactly what we need for climbing). When you are short of time, this slots in perfectly post climbing session or at home. I would recommend trying this 3 times a week once you have warmed yourself up. \n\nI hope you do feel a burn moving in a different way!For some this will be a real challenge (for others less so, although bear in mind I have had some top notch climbers struggle with the floor sequence of movement much to my surprise!), but stick with it, you will get fitter!\n\nLet me know how you get along - Leave me a COMMENT! I would love to hear from you.\n\nShare the love, SUBSCRIBE to the channel, SHARE with friends.\n\nHere are some key notes below to keep in mind whenever you happen to move through any of these postures and sequences:\n\nDownward facing dog: Look at the thighs, relax the neck, press into the lengths of the fingers to support the wrists, push through the lengths of the arms to keep the shoulders strong and support the back. Draw up through the lower abdominals (gently pull the belly button towards the spine).\n\nPlank/front support: Shoulders above the wrists, the tail bone should be tucked under and glutes activates to switch on your core belt. Aim to draw the lower abdominals in. Dont let the lower back sag. This is a foundation for the other movements too-never let the bag sag!\n\nPush ups: Elbows graze the sides of the body, and aim to maintain the line of the body from the shoulders to the hips: You want to move in one piece. If you feel the lower back sagging, drop your knees to the ground for extra support and re set your form.\n\nSide plank: the aim is to lift the hips to make a long line from shoulder to foot. Use both feet if you need, or a flat foot for extra support,. When you get stronger you can stack the feet or float the leg, without letting the hips drop.\n\nFloor exercises: Keep the lower back pressed into the floor. This engages the core belt front to back. You shouldnt be able to fit your fingers underneath. If you notice this, stop and reset yourself. You don''t have to extend your heels towards the floor, if 45 degrees gets you working to begin with, stick with this til you get stronger. \n\nStar raises: Try not to let the shoulders touch the floor when you lower, draw up through the abdominals as you come up to your sit bones and twist, and dont let your lower back arch as you try to maintain balance. \n\nSupermen: Keep the hips low and level with the shoulders but dont let the back sag! Really reach out through the fingertips and the toes as you lift, this develops spinal stability. If you are finding this really challenging, only raise the hand/foot a few inches off the ground whilst still stretching out through the fingers/toes until you find your stability and strength improving.\n\nMountain climbers: Keep the hips low, the tailbone tucked, dont let the lower back arch, especially if you''re getting tired!\n\nRead the full article for Arch Climbing Wall here at http://www.archclimbingwall.com/journal/climbflow-movement-series-1\n\nYou are ultimately responsible for yourself and any movement you engage in. Always consult with your doctor/physician to ensure you are suitably able to practice any of the physical activity or exercises demonstrated.  \n.....\n\nAn established climber, Tiffany is the creator of ClimbFlow, the original dynamic yoga + functional movement method for climbers. Follow her on instagram @climbflow / @tiffany_soi or get in contact hello@tiffanysoi.com with your feedback, questions, and ClimbFlow requests.\n\nSupported by The Arch Climbing Wall, Rock On Climbing Shop, Blocfit, Obsession Climbing"}}', '{"duration":"PT9M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"14424","likeCount":"164","dislikeCount":"3","favoriteCount":"0","commentCount":"2"}', '''10'':2A ''climbers'':10A ''climbflow'':1A ''core'':4A ''fitness'':8A ''flow'':6A ''for'':9A ''minute'':3A ''soi'':12A ''tiffany'':11A ''workout'':5A ''yoga'':7A', '2020-07-02 06:17:30.866011', '2020-07-02 06:17:30.866011');
