INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18130, 'evhplAw6K_0yOlzoUZu5e_7IBJs', 'y8wKG7NtEhw', NULL, '{"publishedAt":"2020-03-24T18:03:40Z","channelId":"UCLgSADvimW_SvF9Oov7SF_g","title":"Yoga Flow for Strong, Flexible Hips and Shoulders","description":"Welcome back! This under 40 minute Yoga flow takes simple postures but adds reps in to help build strength in your legs, hips and shoulders. You will help open those stiff joints, get the blood flowing, and build strength all at the same time.\n\nIntensity Level: 2/3\n\n*Scale is from 1 (its a breeze!) to 5 (are you kidding me?!)","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/y8wKG7NtEhw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/y8wKG7NtEhw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/y8wKG7NtEhw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/y8wKG7NtEhw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/y8wKG7NtEhw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Josh Kramer","tags":["yoga","stretch","vinyasa","flow","yogaflow","hips","shoulders","legs","quads","strength","strong","40mins"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga Flow for Strong, Flexible Hips and Shoulders","description":"Welcome back! This under 40 minute Yoga flow takes simple postures but adds reps in to help build strength in your legs, hips and shoulders. You will help open those stiff joints, get the blood flowing, and build strength all at the same time.\n\nIntensity Level: 2/3\n\n*Scale is from 1 (its a breeze!) to 5 (are you kidding me?!)"}}', '{"duration":"PT38M4S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"8346","likeCount":"373","dislikeCount":"1","favoriteCount":