INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18131, 'rR-ERya2tBNiWdPp68yemLQgkx4', 'HleKZudC4Ns', true, '{"publishedAt":"2017-10-12T18:09:58Z","channelId":"UC2AWbik5F3fEkNln-CCW5qQ","title":"Tight Hips Stretching Yoga Flow - Deep Hips & Glutes Stretching | Gayatri Yoga","description":"  Get my 24 Day Weight Loss Program for FREE  http://bit.ly/24dayweightloss (share with friends too!) \n  FREE 90 Min Yoga For Stress & Anxiety in Coronavirus Crises : https://bit.ly/90minflow\n  Gayatri Yoga Membership -  7 Day FREE Trial + Discount Offer {30 days of yoga challenge #RoadToBliss is live now}\nGet BLISSED OUT now : http://bit.ly/gayatritrial ~  hi yogis ~ Do you have tight hips & want to release built up tension? In today''s hips flexibility yoga flow we slowly warm up our legs, inner thighs, hips to increase flexibility & mobility in lower body.  After deep hip stretching flow you are offered to give a try to enter lotus pose in a safe way. As you go through the practice, breathe deeply through every stretch & connect to sensation. Try not to rush, listen to your body, observe limitations and just return to this practice as many times as needed to practice for your lotus pose. Don''t rush & enjoy the journey!   \n   \n#gayatriyoga #stretching #flexibilityroutine\n\n  Want MORE FREE yoga each week ? Click to subscribe:  http://bit.ly/gayatriyogachannel  \n Deepen your practice with exclusive members only content:  http://bit.ly/gayatri-patreon\nHi yogi, my name is Kristina. I''m a 200h certified yoga teacher,  Equinox Pilates MAT Certified trainer ,  I have continuing education hours in Yin Yoga & Anatomy Trains {Fascia} (by Tom Myers). I constantly educate myself on anatomy & physiology to deliver to you safe effective workouts .\nGayatri Yoga offers versatile intelligently sequenced & instructed yoga flows that are accessible to any level of yoga practitioner, be it beginner, intermediate or advanced. \nWith over 120 FREE online yoga classes you will find suitable for any level easy to follow along yoga flows. With these free home yoga workouts you will build strength & flexibility, tone legs, abs, arms, release any upperback tension or back pain,  sciatica or pregnancy back pain & more.\nEither you are looking for an easy morning yoga flow, power yoga flow,  may be 1 hour total body workout or gentle bedtime yoga stretches you can find it all here.  If you dont see a class that fits your need submit your request here or ask any questions:  http:/bit.ly/askgayatri\n\nIf you enjoyed this  1 hour yoga class, find more like this in this playlist : http://bit.ly/1hourgayatriyoga\nIt''s not a beginner yoga class, but you can start practicing 15-20 min of the class until you build up the strength to finish the whole class. \nSubscribe to never miss a new yoga class :  http://bit.ly/gayatriyogachannel \n\nFollow me on social media :\nInstagram : http://bit.ly/gayatriyogainsta\nFacebook: http://bit.ly/gayatriyogafacebook\nPinterest : http://bit.ly/gayatri-pinterest","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/HleKZudC4Ns/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/HleKZudC4Ns/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/HleKZudC4Ns/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/HleKZudC4Ns/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/HleKZudC4Ns/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Gayatri Yoga","tags":["vinyasa yoga","yoga flow","1 hour yoga","yoga for hips","1 hour yoga class","yoga stretch","yoga workout","gayatri yoga","gayatri yoga hips","gayatri yoga flow","flexibility routine","how to get more flexible","full body flexibility","yoga routine for beginners","hips flexibility","hips mobility","flexibility flow","stretching routine","morning stretch","flexibility yoga routine