INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18144, '4az0SpRZU6YusbeXneEKW0bC1Vk', 'S-4yeIr86-U', NULL, '{"publishedAt":"2020-07-19T10:46:21Z","channelId":"UCxYVPua6HC46HzgT8IIn3vg","title":"Beginners Yoga For Leg Flexibility | Flexibility Stretches For Beginners","description":"This is a 15 minute beginners yoga for leg flexibility routine.\n\nYoga is a great way to help beginners increase leg flexibility in a safe and accessible way.\n\nIn this flexibility routine we will work through beginner friendly stretches to help improve flexibility within the hips, hamstrings and calves using pillows or bolsters to help make each pose accessible.\n\nWhen beginning a flexibility journey it is important that we listen to our body and never exceed the sensation of just a stretch. When we listen to the body we can improve our flexibility at a healthy pace while truly feeling our best. With that being said, use props where and when needed.\n\nTimestamps:\n00:20 - Rock knees\n1:00 - Seated Forward Fold\n3:40 - Reclining Hand to Big Toe Pose\n7:00 - Supine Pigeon Pose\n10:30 - Supine Twist\n14:30 - Supine Rock Knees\n15:00 - Hug Knees\nNamaste\n\n#Yoga #Flexibility #BeginnersYoga\n\n***DONATE***\nDonation Link: https://www.paypal.me/yogawithbird\nBy donating to the Yoga With Bird YouTube channel you are helping in creating new content & keeping yoga free and accessible to all. \nGrateful for your generosity \n\nOutfit:\nhttps://RWRD.IO/8V1AAAO\n\nGet Your FREE Monthly Calendar!\nhttp://www.yogawithbird.com/calendars/\n\nMusic Used:\nhttps://www.epidemicsound.com/referral/qnrd89/\n\nJoin Honey to SAVE money while shopping online:\nhttps://www.joinhoney.com/ref/45p0vps\n\nAs with all physical activity, Yoga included, it is important to listen to your body at all times and never exceed the sensation of just a light stretch. If you feel pain or extreme discomfort do not do the yoga pose, movement or stretch and come to something that feels better for you. \nAlways consult your doctor about any physical activity.\n\nDISCLAIMER: \nSome links may be affiliate links that Yoga With Bird earns a small percentage of how ever each affiliate product is something she genuinely loves and has used herself. Please consult your physician before joining in on this practice. By participating in this activity you acknowledge that yoga is a physical discipline that requires a certain amount of mental concentration and physical strength and endurance. You agree to work according to your own limitations and take full responsibility for your own safety and well-being. Listen to your body at all times and never do anything that causes pain. You acknowledge that participation in this activity exposes you to a possible risk of personal injury. You are fully aware of this risk and hereby release Yoga With Bird/Francine Cipollone from any and all liability, negligence, or other claims, arising from, or in any way connected, with your participation in this activity.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/S-4yeIr86-U/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/S-4yeIr86-U/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/S-4yeIr86-U/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/S-4yeIr86-U/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/S-4yeIr86-U/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga With Bird","tags":["yoga","yoga for leg flexibility","yoga for flexibility","yoga for flexibility beginners","Beginners Yoga For Leg Flexibility","beginners flexibility stretches","flexibility","stretches","leg flexibility stretches","leg flexibility stretches for beginners","beginners yoga","yoga for beginners","flexibility stretches for beginners","flexibility stretches","beginners yoga for hips","beginner friendly stretches","leg flexibility","yoga with bird","stretch routine","leg stretches","leg stretching routine"],"categoryId":"26","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"Beginners Yoga For Leg Flexibility | Flexibility Stretches For Beginners","description":"This is a 15 minute beginners yoga for leg flexibility routine.\n\nYoga is a great way to help beginners increase leg flexibility in a safe and accessible way.\n\nIn this flexibility routine we will work through beginner friendly stretches to help improve flexibility within the hips, hamstrings and calves using pillows or bolsters to help make each pose accessible.\n\nWhen beginning a flexibility journey it is important that we listen to our body and never exceed the sensation of just a stretch. When we listen to the body we can improve our flexibility at a healthy pace while truly feeling our best. With that being said, use props where and when needed.\n\nTimestamps:\n00:20 - Rock knees\n1:00 - Seated Forward Fold\n3:40 - Reclining Hand to Big Toe Pose\n7:00 - Supine Pigeon Pose\n10:30 - Supine Twist\n14:30 - Supine Rock Knees\n15:00 - Hug Knees\nNamaste\n\n#Yoga #Flexibility #BeginnersYoga\n\n***DONATE***\nDonation Link: https://www.paypal.me/yogawithbird\nBy donating to the Yoga With Bird YouTube channel you are helping in creating new content & keeping yoga free and accessible to all. \nGrateful for your generosity \n\nOutfit:\nhttps://RWRD.IO/8V1AAAO\n\nGet Your FREE Monthly Calendar!\nhttp://www.yogawithbird.com/calendars/\n\nMusic Used:\nhttps://www.epidemicsound.com/referral/qnrd89/\n\nJoin Honey to SAVE money while shopping online:\nhttps://www.joinhoney.com/ref/45p0vps\n\nAs with all physical activity, Yoga included, it is important to listen to your body at all times and never exceed the sensation of just a light stretch. If you feel pain or extreme discomfort do not do the yoga pose, movement or stretch and come to something that feels better for you. \nAlways consult your doctor about any physical activity.\n\nDISCLAIMER: \nSome links may be affiliate links that Yoga With Bird earns a small percentage of how ever each affiliate product is something she genuinely loves and has used herself. Please consult your physician before joining in on this practice. By participating in this activity you acknowledge that yoga is a physical discipline that requires a certain amount of mental concentration and physical strength and endurance. You agree to work according to your own limitations and take full responsibility for your own safety and well-being. Listen to your body at all times and never do anything that causes pain. You acknowledge that participation in this activity exposes you to a possible risk of personal injury. You are fully aware of this risk and hereby release Yoga With Bird/Francine Cipollone from any and all liability, negligence, or other claims, arising from, or in any way connected, with your participation in this activity."},"defaultAudioLanguage":"en-CA"}', '{"duration":"PT16M2S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1306","likeCount":"96","dislikeCount":"2","favoriteCount":"0","commentCount":"21"}', '''beginners'':1A,9A ''flexibility'':5A,6A ''for'':3A,8A ''leg'':4A ''stretches'':7A ''yoga'':2A', '2020-07-24 09:35:22.027738', '2020-07-24 09:35:22.027738');
