INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18095, 'M5Ii7F8IzGL_W_oQBDgk6Dz4Q4I', 'sdYhi7n0Omk', true, '{"publishedAt":"2020-06-30T13:32:32Z","channelId":"UCtYdInxenGGNOCxWoA3ITTQ","title":"20 min Yoga Detox Flow || Twisting Poses For Weight Loss & Digestion | Full Body Sequence","description":"Hello and welcome to this 20 min Detox Yoga Flow! In this gentle yoga sequence we will focus on moving our body, speeding up our metabolism by incorporating gentle twisting postures, which directly stimulate our inner organs, such as our liver, stomach, kidneys and gut.    \n\nI will slowly walk you through the different poses and guide you through the yoga practice. If you need a break, feel free to pause at any time and focus on your breathing. Your breath is always your anchor. Find synchronicity in your movement and breath. Don''t push yourself and always listen to your body!\n\n                            \nMy name is Nathalie, I am a certified yoga teacher, traveler and self-love advocate. My vision is to inspire human souls to fall in love with themselves while practicing and teaching some yoga along the way. Thank you for tuning in and I really hope you enjoy this practice!\n#detoxyoga #yogafordigestion #yogaforweightloss #yogaclass #yogaflow#yogaforeverybody #yogatoglow\n\n                           \nInstagram: https://www.instagram.com/nathalieshanti \nFacebook: https://www.facebook.com/nathalieshantiyoga\nWebsite: https://www.yogatoglow.com \nE-Mail: nathalie@yogatoglow.com \n\nMy outfit is from https://vayumudra.com  I am wearing the Parchment set. You can use my discount code ''nathalie15'' for 15% off  \n#ad #yogavideo #yogamovements #yogaflows #homepractice \n\n                            \nDisclaimer - Always listen to your body and never force yourself to perform any kind of yoga pose. It''s best to always consult your doctor before starting any kind of new exercise regime or yoga program. All forms of physical exercises can possibly lead to injuries. By performing and using my videos (Nathalie Shanti), you are aware of the risks and take full responsibility for any injuries, which might be connected to any the videos I am posting.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/sdYhi7n0Omk/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/sdYhi7n0Omk/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/sdYhi7n0Omk/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/sdYhi7n0Omk/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/sdYhi7n0Omk/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Nathalie Shanti","tags":["yoga","detox yoga","yoga for detox","detox","yoga weight loss","loose weight yoga","metabolism yoga","yoga for weight loss","yoga detox","yogaflow","gentle yoga","20min yoga","easy yoga","yoga for beginners","loose fat yoga","yoga to loose fat","yoga for health","get healthy yoga","beginner yoga flow","yoga release stress","burn fat yoga","yoga zur entgiftung","krper entgiften yoga","yoga entgiften","yoga zum abnehmen","yoga zum fett verbrennen","kalorien verbrennen yoga","yoga fr anfnger"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"20 min Yoga Detox Flow || Twisting Poses For Weight Loss & Digestion | Full Body Sequence","description":"Hello and welcome to this 20 min Detox Yoga Flow! In this gentle yoga sequence we will focus on moving our body, speeding up our metabolism by incorporating gentle twisting postures, which directly stimulate our inner organs, such as our liver, stomach, kidneys and gut.    \n\nI will slowly walk you through the different poses and guide you through the yoga practice. If you need a break, feel free to pause at any time and focus on your breathing. Your breath is always your anchor. Find synchronicity in your movement and breath. Don''t push yourself and always listen to your body!\n\n                            \nMy name is Nathalie, I am a certified yoga teacher, traveler and self-love advocate. My vision is to inspire human souls to fall in love with themselves while practicing and teaching some yoga along the way. Thank you for tuning in and I really hope you enjoy this practice!\n#detoxyoga #yogafordigestion #yogaforweightloss #yogaclass #yogaflow#yogaforeverybody #yogatoglow\n\n                           \nInstagram: https://www.instagram.com/nathalieshanti \nFacebook: https://www.facebook.com/nathalieshantiyoga\nWebsite: https://www.yogatoglow.com \nE-Mail: nathalie@yogatoglow.com \n\nMy outfit is from https://vayumudra.com  I am wearing the Parchment set. You can use my discount code ''nathalie15'' for 15% off  \n#ad #yogavideo #yogamovements #yogaflows #homepractice \n\n                            \nDisclaimer - Always listen to your body and never force yourself to perform any kind of yoga pose. It''s best to always consult your doctor before starting any kind of new exercise regime or yoga program. All forms of physical exercises can possibly lead to injuries. By performing and using my videos (Nathalie Shanti), you are aware of the risks and take full responsibility for any injuries, which might be connected to any the videos I am posting."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT20M48S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"94","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''20'':1A ''body'':13A ''detox'':4A ''digestion'':11A ''flow'':5A ''for'':8A ''full'':12A ''loss'':10A ''min'':2A ''poses'':7A ''sequence'':14A ''twisting'':6A ''weight'':9A ''yoga'':3A', '2020-07-02 06:17:29.228894', '2020-07-02 06:17:57.868101');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (17977, 'ZD3R6xdMYmfeMg4wL8b99JN14OY', 'jmlbTbnHQXI', true, '{"publishedAt":"2017-06-12T18:36:03Z","channelId":"UChgYbfB-fIsvpXLMhcMlXng","title":"Beer Yoga + What''s next?!","description":"Join me for BEER YOGA!!! :) \n\nWelcome to my channel! Thanks for being here! \n***Please like and subscribe if you enjoy this content***\n\nToday I am finally doing beer yoga! Shout out to Boulevard Brewing Company (they sell my absolute favorite beer, the Hibiscus Gose) and Community Beer Company (they''re an awesome brewery in Dallas with a southern/chill atmosphere...being that I''m from Alabama, I REALYY miss that) \n\nMusic:\nDyalla - https://soundcloud.com/dyallas/be-with-you\nTHBD - http://stereoload.com/harryhuntmusic/rain\n\nIf you are looking for more yoga videos, Amy Dot is one of my favorites! She has a wonderful channel with super relaxing workouts in BEAUTIFUL locations! Check her out!:)\n\nThis may sound weird, but this beer yoga workout really was super calming!!! I might make it a weekly ritual!!! \nI hope you enjoy! Thank you again for checking out my channel!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/jmlbTbnHQXI/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/jmlbTbnHQXI/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/jmlbTbnHQXI/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/jmlbTbnHQXI/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/jmlbTbnHQXI/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Gloria Lisenbe","tags":["health","beer yoga","beer","yoga","beer yoga class","beer yoga workout","yoga workout","yoga class","flexibility","relaxing yoga","relax","stress relief","yoga for stress relief","wilderness and workout","gloria lisenbe","community beer co","community beer company","boulevard brewing co","boulevard brewing company","lawton oklahoma","dallas","healthy","wellness","fun workout","workout","workout for flexibility","plank","butt workout","destress","relaxation"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Beer Yoga + What''s next?!","description":"Join me for BEER YOGA!!! :) \n\nWelcome to my channel! Thanks for being here! \n***Please like and subscribe if you enjoy this content***\n\nToday I am finally doing beer yoga! Shout out to Boulevard Brewing Company (they sell my absolute favorite beer, the Hibiscus Gose) and Community Beer Company (they''re an awesome brewery in Dallas with a southern/chill atmosphere...being that I''m from Alabama, I REALYY miss that) \n\nMusic:\nDyalla - https://soundcloud.com/dyallas/be-with-you\nTHBD - http://stereoload.com/harryhuntmusic/rain\n\nIf you are looking for more yoga videos, Amy Dot is one of my favorites! She has a wonderful channel with super relaxing workouts in BEAUTIFUL locations! Check her out!:)\n\nThis may sound weird, but this beer yoga workout really was super calming!!! I might make it a weekly ritual!!! \nI hope you enjoy! Thank you again for checking out my channel!"}}', '{"duration":"PT25M46S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"24076","likeCount":"190","dislikeCount":"24","favoriteCount":"0","commentCount":"16"}', '''beer'':1A ''next'':5A ''s'':4A ''what'':3A ''yoga'':2A', '2020-07-02 06:17:20.83242', '2020-07-02 06:17:57.868101');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18015, 'AfaMLpoi-C95AELUzgrDIQXFKBs', 'QrhlaIQrtc0', true, '{"publishedAt":"2020-06-25T10:00:10Z","channelId":"UCYsGDdaYQYf6F-9QcOnqBZA","title":"30-Minute High-Intensity Mobility Workout (At Home, Full-Body Routine) | Polar","description":"This dynamic full-body mobility routine will improve your range of motion while building functional strength. You dont need any equipment for this at-home mobility workout and it only takes around 30 minutes.\n\nFind more at-home workouts: https://www.youtube.com/playlist?list=PLkSlTQOtDpKixscyXp9YfgakAfkaEEjR0\n\nThis full-body mobility routine, created by dance, fitness and movement coach, Polar Master Trainer Anniina Ala-Mattinen, keeps the intensity high with at-home exercises, such as bear walks, straight leg front kick, and cossack squats. This routine is suitable for all fitness levels and you can do it at home without any equipment. On the video, youll learn a 5-minute 5 move warm-up sequence followed by a workout block with 10 mobility exercises.\n  \n******* AT-HOME HIIT MOBILITY WORKOUT *******\n\n WORKOUT DURATION: 35 minutes\n\n AT-HOME WORKOUT: Apartment-friendly workout. No equipment needed. Suitable for all fitness levels.\n\n A COMPLETE WORKOUT: This workout contains instructions for both the warm-up and the workout. The aim is to complete 2 rounds (15 minutes per round) for 5-10 reps per movement with a 15-30 seconds rest in between movements.\n\n0:00 WARM-UP: 5 MINUTES\n0:10 Pelvis circles\n0:24 Wrist circles\n0:34 Reach with arm\n0:46 Deep squat\n0:55 Spinal twist\n\n1:08 WORKOUT: 2 ROUNDS, 30 MINUTES\n1:16 Swimmer\n1:31 Straight leg\n1:42 Scorpion & leg through\n1:58 Table pose & L press\n2:12 Dragon squat\n2:27 Bear walk\n2:38 Cossack squat\n2:58 Hardcore hip flexor teaser\n3:09 Lizard combo\n3:27 Half bridge\n\nMake fitness effective and fun! Find workout inspiration: https://www.polar.com/blog/category/fitness/\n \nFOLLOW Polar Fitness at https://www.instagram.com/polarglobalfitness\nFOLLOW Polar at http://instagram.com/polarglobal\nLIKE Polar at http://facebook.com/polarglobal\nFOLLOW Polar at http://twitter.com/polarglobal\nSUBSCRIBE at https://www.youtube.com/polar\nREAD all things Polar at https://www.polar.com/blog","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/QrhlaIQrtc0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/QrhlaIQrtc0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/QrhlaIQrtc0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/QrhlaIQrtc0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/QrhlaIQrtc0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Polar","tags":["mobility routine","stretching routine","flexibility routine","stretching routines","full body stretch routine","at home stretching exercises","stretch workout","full body stretch","at home stretch workout","stretching","flexibility","stretch","full body workout","full body workout at home","home exercises","at home workout","mobility routines","mobility","fitness","fitness video","workout","workout videos"],"categoryId":"17","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"30-Minute High-Intensity Mobility Workout (At Home, Full-Body Routine) | Polar","description":"This dynamic full-body mobility routine will improve your range of motion while building functional strength. You dont need any equipment for this at-home mobility workout and it only takes around 30 minutes.\n\nFind more at-home workouts: https://www.youtube.com/playlist?list=PLkSlTQOtDpKixscyXp9YfgakAfkaEEjR0\n\nThis full-body mobility routine, created by dance, fitness and movement coach, Polar Master Trainer Anniina Ala-Mattinen, keeps the intensity high with at-home exercises, such as bear walks, straight leg front kick, and cossack squats. This routine is suitable for all fitness levels and you can do it at home without any equipment. On the video, youll learn a 5-minute 5 move warm-up sequence followed by a workout block with 10 mobility exercises.\n  \n******* AT-HOME HIIT MOBILITY WORKOUT *******\n\n WORKOUT DURATION: 35 minutes\n\n AT-HOME WORKOUT: Apartment-friendly workout. No equipment needed. Suitable for all fitness levels.\n\n A COMPLETE WORKOUT: This workout contains instructions for both the warm-up and the workout. The aim is to complete 2 rounds (15 minutes per round) for 5-10 reps per movement with a 15-30 seconds rest in between movements.\n\n0:00 WARM-UP: 5 MINUTES\n0:10 Pelvis circles\n0:24 Wrist circles\n0:34 Reach with arm\n0:46 Deep squat\n0:55 Spinal twist\n\n1:08 WORKOUT: 2 ROUNDS, 30 MINUTES\n1:16 Swimmer\n1:31 Straight leg\n1:42 Scorpion & leg through\n1:58 Table pose & L press\n2:12 Dragon squat\n2:27 Bear walk\n2:38 Cossack squat\n2:58 Hardcore hip flexor teaser\n3:09 Lizard combo\n3:27 Half bridge\n\nMake fitness effective and fun! Find workout inspiration: https://www.polar.com/blog/category/fitness/\n \nFOLLOW Polar Fitness at https://www.instagram.com/polarglobalfitness\nFOLLOW Polar at http://instagram.com/polarglobal\nLIKE Polar at http://facebook.com/polarglobal\nFOLLOW Polar at http://twitter.com/polarglobal\nSUBSCRIBE at https://www.youtube.com/polar\nREAD all things Polar at https://www.polar.com/blog"},"defaultAudioLanguage":"en"}', '{"duration":"PT4M11S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"943","likeCount":"37","dislikeCount":"1","favoriteCount":"0","commentCount":"7"}', '''30'':1A ''at'':8A ''body'':12A ''full'':11A ''full-body'':10A ''high'':4A ''high-intensity'':3A ''home'':9A ''intensity'':5A ''minute'':2A ''mobility'':6A ''polar'':14A ''routine'':13A ''workout'':7A', '2020-07-02 06:17:22.989811', '2020-07-02 06:17:57.868101');
