INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18090, 'XXccZ7uUj1etzRoauZD5cGlL908', '2uDpymrWxn0', true, '{"publishedAt":"2019-02-15T07:00:02Z","channelId":"UCTe8ABP94FZadBA-TgpKKzA","title":"1 hour Vinyasa Flow Yoga | 60 minute | Dancer''s Pose","description":"Join me for 1 hour of Vinyasa Flow yoga building up and preparing the body for Dancer''s Pose. Dancer''s Pose is a wonderful pose for building strength in the core and the legs as well as improving balance and concentration. It is also a deep backbend, strengthening the spine and opening the rib cage and chest. \n\nI hope you enjoy this class and thank you for practising with me!\n\n~  y o g a m u s i c  ~\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://open.spotify.com/user/11170360156?si=dhMaGpXfSZWDOXRejtHAdA.\n\n~  f i n d m e  ~\n\ninstagram | https://www.instagram.com/ailsaburns/\nmy website | https://www.frostedfeather.com/\n\n~  a b o u t m e  ~\n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. I decided to start this YouTube channel because I love teaching yoga and I want to share my yoga classes with as many as people as possible.  \n\n~  s u p p o r t m e  ~\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. This is one of the ways that I plan to share my love of yoga beyond public classes. \n\nIf you are person of means and would like to support me to continue making videos for my channel, then please consider supporting me via PayPal: http://bit.ly/2IEx8dR\n\n~  f i l m i n g  ~\n\nThis video was filmed and edited by Foldout Films: https://www.foldoutfilms.co.uk/.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/2uDpymrWxn0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/2uDpymrWxn0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/2uDpymrWxn0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/2uDpymrWxn0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/2uDpymrWxn0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Ailsa","tags":["yoga","vinyasa","vinyasa yoga","flow yoga","vinyasa flow","vinyasa flow yoga","intermediate yoga","1 hour yoga","all levels yoga","beginners yoga","vinyasa yoga uk","vinyasa yoga flow","vinyasa yoga workout","vinyasa yoga 1 hour","vinyasa yoga class intermeditate","all levels vinyasa yoga","1 hour yoga class","1 hour yoga flow","1 hour yoga session","1 hour yoga at home","1 hour yoga class sequence","free yoga","yoga class","power yoga","60 minute yoga","yoga flow 60 min","60 min vinyasa"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"1 hour Vinyasa Flow Yoga | 60 minute | Dancer''s Pose","description":"Join me for 1 hour of Vinyasa Flow yoga building up and preparing the body for Dancer''s Pose. Dancer''s Pose is a wonderful pose for building strength in the core and the legs as well as improving balance and concentration. It is also a deep backbend, strengthening the spine and opening the rib cage and chest. \n\nI hope you enjoy this class and thank you for practising with me!\n\n~  y o g a m u s i c  ~\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://open.spotify.com/user/11170360156?si=dhMaGpXfSZWDOXRejtHAdA.\n\n~  f i n d m e  ~\n\ninstagram | https://www.instagram.com/ailsaburns/\nmy website | https://www.frostedfeather.com/\n\n~  a b o u t m e  ~\n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. I decided to start this YouTube channel because I love teaching yoga and I want to share my yoga classes with as many as people as possible.  \n\n~  s u p p o r t m e  ~\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. This is one of the ways that I plan to share my love of yoga beyond public classes. \n\nIf you are person of means and would like to support me to continue making videos for my channel, then please consider supporting me via PayPal: http://bit.ly/2IEx8dR\n\n~  f i l m i n g  ~\n\nThis video was filmed and edited by Foldout Films: https://www.foldoutfilms.co.uk/."}}', '{"duration":"PT1H3M17S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"403","likeCount":"15","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''1'':1A ''60'':6A ''dancer'':8A ''flow'':4A ''hour'':2A ''minute'':7A ''pose'':10A ''s'':9A ''vinyasa'':3A ''yoga'':5A', '2020-07-02 06:17:29.228894', '2020-07-02 06:17:57.868101');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18097, 'Ekk3nXI6ZCVI_S09JjC7gPG3DLg', 'ce1iN6drcvU', true, '{"publishedAt":"2020-06-23T17:00:21Z","channelId":"UCGIAW3lhKS5HuITDumjWVsg","title":"Feel good flow - 30 minute practice to help you feel your best | Amala Movement","description":"Join me in this 30 minute, energising practice that will give us a boost of positivity, energy and confidence.\n\nThis practice is a full body flow, drawing from our Prana (our energy and breath) that is already present inside of us. \nWe will delve into our inner strength to work and build upon our outer strength. Through the support of the ground beneath us, we can find stability - physically through strength and emotionally in our body and experiences. From this support, we can open and release our precious heart space. With an open heart we can fill ourselves with love, confidence, happiness ... and all the good stuff.\n\nMove mindfully, listen to your body, and flow with what FEELS GOOD!\n\nLet me know how you are feeling after this practice in the comments below!\n\nCharlotte x\n- - - - - - - - - -  \n\n Subscribe to Amala Movement for free weekly yoga videos\nhttps://www.youtube.com/channel/UCGIAW3lhKS5HuITDumjWVsg?view_as=subscriber\n\n - - - - - - - - - -  \n\n Instagram: @amalamovement\n Facebook: Amala Movement\n\n JOIN THE COMMUNITY: https://www.facebook.com/groups/869831086829349/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/ce1iN6drcvU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/ce1iN6drcvU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/ce1iN6drcvU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/ce1iN6drcvU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/ce1iN6drcvU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Amala Movement","tags":["Feel good flow","30 minute practice to help you feel your best","Feel good flow - 30 minute practice to help you feel your best","Feel good flow 2020","Yoga for confidence","Yoga for energy boost","Yoga for self love","Yoga for positivity","30 minute full body flow","Yoga for flexible hamstrings","Yoga for increasing confidence","Yoga for feeling your best","Feel your best yoga flow"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Feel good flow - 30 minute practice to help you feel your best | Amala Movement","description":"Join me in this 30 minute, energising practice that will give us a boost of positivity, energy and confidence.\n\nThis practice is a full body flow, drawing from our Prana (our energy and breath) that is already present inside of us. \nWe will delve into our inner strength to work and build upon our outer strength. Through the support of the ground beneath us, we can find stability - physically through strength and emotionally in our body and experiences. From this support, we can open and release our precious heart space. With an open heart we can fill ourselves with love, confidence, happiness ... and all the good stuff.\n\nMove mindfully, listen to your body, and flow with what FEELS GOOD!\n\nLet me know how you are feeling after this practice in the comments below!\n\nCharlotte x\n- - - - - - - - - -  \n\n Subscribe to Amala Movement for free weekly yoga videos\nhttps://www.youtube.com/channel/UCGIAW3lhKS5HuITDumjWVsg?view_as=subscriber\n\n - - - - - - - - - -  \n\n Instagram: @amalamovement\n Facebook: Amala Movement\n\n JOIN THE COMMUNITY: https://www.facebook.com/groups/869831086829349/"},"defaultAudioLanguage":"en"}', '{"duration":"PT28M54S","dimension":"2d","definition":"hd","caption":"true","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"188","likeCount":"20","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''30'':4A ''amala'':13A ''best'':12A ''feel''