INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18099, 'yRNayU4kjuvRiv8AvPY0y7SV4AA', 'q49QjLNeAx0', true, '{"publishedAt":"2020-06-27T14:28:52Z","channelId":"UCd676LpOiZ2fgLK97MfjNHA","title":"\"Just Joints\" and a Chair Yoga Dance Visit to 92-yr old Jim with Sherry Zak Morris","description":"Just Joints is a wonderful daily sequence to keep your joints strong and mobile. These movements get your joints moving in fun ways. Moving is like Oil to the Tin Man. Move what you can!  Stay until the end when the Chair Yoga Dancers venture out into our community to visit sequestered seniors delivering Joy on Wheels! We shared \"Everybody Wants to Go to Heaven\" standing Chair Yoga Dance with 92-yr old Jim!\n\nEnjoy the rest of this Garage Series class exclusively at https://watch.YogaVista.TV/programs/sherry-zak-morris-just-joints-better-mobility-flexibilty","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/q49QjLNeAx0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/q49QjLNeAx0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/q49QjLNeAx0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/q49QjLNeAx0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/q49QjLNeAx0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"YogaJP","tags":["chair yoga","free yoga videos","senior yoga","gentle yoga","chair dance","chair yoga dance","Sherry zak Morris","yogajp.tv","yoga vista","yogavista.tv","just joints"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"\"Just Joints\" and a Chair Yoga Dance Visit to 92-yr old Jim with Sherry Zak Morris","description":"Just Joints is a wonderful daily sequence to keep your joints strong and mobile. These movements get your joints moving in fun ways. Moving is like Oil to the Tin Man. Move what you can!  Stay until the end when the Chair Yoga Dancers venture out into our community to visit sequestered seniors delivering Joy on Wheels! We shared \"Everybody Wants to Go to Heaven\" standing Chair Yoga Dance with 92-yr old Jim!\n\nEnjoy the rest of this Garage Series class exclusively at https://watch.YogaVista.TV/programs/sherry-zak-morris-just-joints-better-mobility-flexibilty"},"defaultAudioLanguage":"en"}', '{"duration":"PT11M5S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"2486","likeCount":"117","dislikeCount":"1","favoriteCount":"0","commentCount":"8"}', '''92'':10A ''a'':4A ''and'':3A ''chair'':5A ''dance'':7A ''jim'':13A ''joints'':2A ''just'':1A ''morris'':17A ''old'':12A ''sherry'':15A ''to'':9A ''visit'':8A ''with'':14A ''yoga'':6A ''yr'':11A ''zak'':16A', '2020-07-02 06:17:29.228894', '2020-07-02 06:17:57.868101');
