lace or join our MEMBERSHIP at:\nhttps://www.lotusfloweryoga.co.uk\n\nYou can contact me at Website - www.lotusfloweryoga.co.uk \nInstagram - https://www.instagram.com/lotusflower... \nFacebook - https://www.facebook.com/lotusflowery...\n \nI recommend that you seek medical advice before attempting any of my Yoga sessions Together online live sessions because some sessions may not be suitable for your body. Its, therefore, important not to attempt any form of yoga without first consulting your doctor. You take full responsibility for yourself and anything you may do within the session or later during practice. You must be mindful and careful about your body so that you know when a position or movement may be unsuitable for you. I recommend that you do some research before attempting any of the postures.\n\nPlease take your doctors advice to confirm that you are healthy and well enough to do the yoga postures and movements demonstrated in this video before attempting anything shown in this video. The same goes for all other content provided by me, including my pre-recorded yoga videos and my live classes. By relying on this video or any content provided by Katya or Lotus Flower Yoga, you agree that you take full responsibility for your body and any consequences including injury that you may sustain as a result. This session should only be attempted after your doctor has assessed you. Not all exercises are suitable for everyone. Your doctor will advise you about which exercise you can or cannot do. I take no responsibility for your practice and any consequences.\n\nI hope you found this video helpful. Please hit Like if you liked the video and want more such videos. \n\nNote: This description may contain affiliate links to products that we use personally. If you click on these links, this channel may earn a small affiliate commission at no extra cost to you.\n\nThank you! Your support is highly appreciated.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/kcKb7