INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18141, 'NzE5VRL4yegOcHOR-QsS-IBLD2E', 'c6ulT3V3ub4', NULL, '{"publishedAt":"2020-02-22T17:55:52Z","channelId":"UCH-81uaxCwAAaSgxRtxMkxg","title":"Yoga for a Lazy Day  20 Minute Practice","description":"Join this 20 minute yoga for a lazy day to keep your yoga practice turned on during these days of quarantine lockdown.\n\nPractice with me on OmStars commercial free! Over 1000 classes and thousands of hours of content: http://www.omstars.com. If youre looking for yoga videos that will show you the perfect way for you to start your yoga journey then Kino MacGregors yoga channel is perfect for you! Whether you are new to yoga or an advanced yoga student you will find a full yoga library with all the yoga postures that you need to develop a complete yoga practice. Yoga is more than just a physical practice yoga is a lifestyle that includes living a peaceful life. Living the yoga lifestyle is about yoga practice, inner peace, yoga diet and being a good person on and off your yoga mat. Kino is a yoga teacher, author of three books, international teacher, writer, blogger, online yoga class teacher, IG yoga challenge host and much more. She co-founded Miami Life Center and Miami Yoga Magazine as well as produced six Ashtanga Yoga DVDs. Practice yoga, change your world one breath at a time. Kino believes that yoga is a vehicle for each student to experience the limitless potential of the human spirit. You dont have to be strong or flexible to begin the yoga practice, all you need is an open heart and the inspiration to practice yoga. Unroll your mat and do the practice!\r\n\r\nFacebook - http://www.facebook.com/KinoYoga\r\nInstagram - http://www.instagram.com/KinoYoga\r\nBlog - http://www.kinoyoga.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/c6ulT3V3ub4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/c