tice, all you need is an open heart and the inspiration to practice yoga. Unroll your mat and do the practice!\r\n\r\nFacebook - http://www.facebook.com/KinoYoga\r\nInstagram - http://www.instagram.com/KinoYoga\r\nBlog - http://www.kinoyoga.com"}}', '{"duration":"PT22M5S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"35410","likeCount":"687","dislikeCount":"14","favoriteCount":"0","commentCount":"51"}', '''20'':6A ''a'':3A ''day'':5A ''for'':2A ''lazy'':4A ''minute'':7A ''practice'':8A ''yoga'':1A', '2020-07-24 09:35:22.027738', '2020-07-24 09:35:22.027738');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18143, 'OYydrEAhzRo-HjdEmcx7S0dUAqM', 'O_tAzMOQnlw', NULL, '{"publishedAt":"2017-01-11T03:03:32Z","channelId":"UCcox27Gc-NGbb2-X9hdLaMw","title":"30 Minute Hatha Yoga Happiness: 4 locks and 4 keys Day 11 | Fightmaster Yoga Videos","description":"30 Minute Hatha Yoga Happiness: 4 locks and 4 keys Day 11. Today''s class is based on the Yoga Sutra 1:33: \"By cultivating attitudes of friendliness toward the happy, compassion for the unhappy, delight in the virtuous, and disregard toward the wicked (aka mean people), the mind-stuff retains its undisturbed calmness.\" This is another tool to remind us not to take others personally. Enjoy and keep up the great work!!\nTo support Fightmaster Yoga: https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=7S55BFQZA6PKS\n\nFor Amazon purchases please use this link http://www.amazon.com/?tag=fightyoga-20\n\nPlease subscribe! http://bit.ly/1mzfCpl\n\nAll your strength comes from the core. Get my free core class here https://www.myyogapal.com/core-sign-up and develop strength where you need it most.\n\nWelcome to the Fightmaster Yoga channel! \n\nYoga videos to make you feel better.\n\nLife is hard. \n\nI know what it feels like to be overwhelmed, overweight and either depressed or stressed out. I''ve been there.\n\nMy name is Lesley Fightmaster. I am a yoga teacher trainer. I have taught thousands of classes. I''ve seen amazing transformations in people just like you.\n\nNew to yoga? Try my 30 day yoga for beginners and beginners yoga playlists.\n\nFor a yoga workout try my hatha yoga happiness program or yogafix90. Also find yoga for weight loss, total body yoga, vinyasa yoga, and Ashtanga classes. Each class is a full body yoga stretch.\n\nYou might also enjoy my detox yoga, energizing yoga, morning yoga or yin yoga for deep stretching.\n\nIf you practice even 10 minutes a day I guarantee you will feel better. \n\nSubscribe to this channel because yogi''s around the world have changed their lives for the better and you can too.  #yoga #Hatha #vinyasa\n\nFilmed at http://www.pacificashtanga.com\n\nhttp://fightmasteryoga.com/\nhttps://www.facebook.com/fightmasteryoga\nFollow me on Twitter: https://twitter.com/fightmasteryoga\nFollow me on Instagram: http://instagram.com/fightmasteryoga\nFollow me on Google + :https://plus.google.com/u/0/b/108016366397735931600/+Fightmasteryoga","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/O_tAzMOQnlw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/O_tAzMOQnlw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/O_tAzMOQnlw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/O_tAzMOQnlw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/O_tAzMOQnlw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Fightmaster Yoga","tags":["30 minute workout","yoga","hatha yoga","yoga videos","free yoga videos","yoga (sport)","Fightmaster Yoga","yoga workout","hatha yoga happiness","hatha","vinyasa","yoga class","lesley fightmaster","yoga fightmaster","lesley fightmaster yoga","yoga for happiness","yoga hatha","hatha joga","hatha yoga for beginners","30 minute yoga","30 min yoga","30 min workout","hatha flow","yoga asana","yoga for posture","free yoga class","yoga channel","yoga for","full body yoga stretch"],"categoryId":"26","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"30 Minute Hatha Yoga Happiness: 4 locks and 4 keys Day 11 | Fightmaster Yoga Videos","description":"30 Minute Hatha Yoga Happiness: 4 locks and 4 keys Day 11. Today''s class is based on the Yoga Sutra 1:33: \"By cultivating attitudes of friendliness toward the happy, compassion for the unhappy, delight in the virtuous, and disregard toward the wicked (aka mean people), the mind-stuff retains its undisturbed calmness.\" This is another tool to remind us not to take others personally. Enjoy and keep up the great work!!\nTo support Fightmaster Yoga: https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=7S55BFQZA6PKS\n\nFor Amazon purchases please use this link http://www.amazon.com/?tag=fightyoga-20\n\nPlease subscribe! http://bit.ly/1mzfCpl\n\nAll your strength comes from the core. Get my free core class here https://www.myyogapal.com/core-sign-up and develop strength where you need it most.\n\nWelcome to the Fightmaster Yoga channel! \n\nYoga videos to make you feel better.\n\nLife is hard. \n\nI know what it feels like to be overwhelmed, overweight and either depressed or stressed out. I''ve been there.\n\nMy name is Lesley Fightmaster. I am a yoga teacher trainer. I have taught thousands of classes. I''ve seen amazing transformations in people just like you.\n\nNew to yoga? Try my 30 day yoga for beginners and beginners yoga playlists.\n\nFor a yoga workout try my hatha yoga happiness program or yogafix90. Also find yoga for weight loss, total body yoga, vinyasa yoga, and Ashtanga classes. Each class is a full body yoga stretch.\n\nYou might also enjoy my detox yoga, energizing yoga, morning yoga or yin yoga for deep stretching.\n\nIf you practice even 10 minutes a day I guarantee you will feel better. \n\nSubscribe to this channel because yogi''s around the world have changed their lives for the better and you can too.  #yoga #Hatha #vinyasa\n\nFilmed at http://www.pacificashtanga.com\n\nhttp://fightmasteryoga.com/\nhttps://www.facebook.com/fightmasteryoga\nFollow me on Twitter: https://twitter.com/fightmasteryoga\nFollow me on Instagram: http://instagram.com/fightmasteryoga\nFollow me on Google + :https://plus.google.com/u/0/b/108016366397735931600/+Fightmasteryoga"},"defaultAudioLanguage":"en"}', '{"duration":"PT35M46S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}',