INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18158, 'ux2S69ygwgEGlrLot5X74syT5H8', 'HfgKLzdXRt8', NULL, '{"publishedAt":"2018-07-22T00:30:00Z","channelId":"UCvDc7jgAYAjbNqvWjbovVQw","title":"Iyengar Yoga. 40 minute Restorative Sequence - (Suitable for Menstrual Cycle)","description":"Iyengar Yoga. 40 minute Restorative Sequence - Suitable for Menstrual Cycle . Ooops! Spot the blooper in the middle... Sorry guys. \nThis is a relaxing yoga class, which you can practice during your period, or when you need a calming practice to release tension, relieve stress and restore your equilibrium. \nThe poses we teach in this yoga routine are:\nSupta Baddha Konasana (Supine Bound Angle Pose)\nJanu Sirsasana (Head to Knee Pose - Forward Bend to chair)\nTriang Mukhaikapada Paschimottanasana (Three Limbed Forward Bend to Chair)\nArdha Baddha Padma Paschimottanasana (Half Bound Lotus Forward Bend to Chair)\nUpavistha Konasana (Seated WIde Angle Pose to Chair)\nParsva Upavistha Konasana (Side Seated WIde Angle Pose to Chair)\nChair Savasana (Corpse Pose with legs to Chair)\n\nFor this restorative sequence you will need:\nA yoga bolster (or use folded towels or blankets)\n2 blankets - one rolled\n2 foam yoga pads\n1 yoga belt\n1 yoga chair or kitchen/dining chair\n\nIt is not always appropriate to do a strong yoga workout. If you are tired, unwell, stressed or you have a period, demanding standing poses, extreme twists and abdominal poses are not always helpful. The poses in this restorative yoga practice soften the abdominal area, relieving period pains, menstrual cramps and other abdominal pain. They calm the nervous system, relieve tension and de-stress the mind.\n\n\n Yoga with Lin and Leo for free yoga classes. If you want to investigate our channel further, our Yoga Pose Directory offers both Beginners Yoga and poses for more Intermediate yoga students.\n See the Yoga for Beginners series for online yoga workouts specifically for Complete Beginners. See 30 days of yoga series for a 30 day yoga challenge. Yoga practice can improve strength and flexibility and yoga for back pain relief and yoga for weight loss has been supported by many studies. \n\nJoin Yoga with Lin and Leo for safe, detailed instruction from experienced Iyengar yoga teachers. Although we would always suggest that you find a certified Iyengar yoga teacher so that you can attend a class near you, this channel has yoga sequences to help you practice your yoga at home.\n\nYoga is not a sport but regular practice of yoga sequences can improve fitness levels. Practiced correctly, yoga will stretch muscles and strengthen joints, as well as helping with mental and physical wellbeing; indeed many studies have shown that yoga can have remarkable effects on problems with back pain, shoulder pain and neck pain as well as demonstrating positive effects on mental health problems such as depression, stress and general anxiety. http://www.huffingtonpost.com/2013/10/28/body-on-yoga_n_4109595.html?ncid=engmodushpmg00000004\n\nSubscribe to our channel; if you opt for notifications, you will be advised as new videos are launched. \n\n\nStay connected~\n\nFor more structured online yoga classes, visit My Yoga Tutor: http://myyogatutor.com/\n\nFor booking face to face Iyengar Yoga classes, with us at the Maidstone Yoga Centre in Kent, (first class free!): http://www.iyengar-yoga.co.uk/\n\nFacebook: https://www.facebook.com/MaidstoneYogaCentre/\n\nTwitter: https://twitter.com/MaidstoneYoga\n\nFor our ebook, \"Yoga for the Stiffer Body\": https://www.amazon.co.uk/Yoga-Stiffer-Body-Inspirational-Accessible-ebook/dp/B01IYO67M8\n\nPinterest: http://pinterest.com/craddock1310\n\nFor Iyengar yoga classes in the UK: https://iyengaryoga.org.uk/\n\n \nA yoga practice may give you a physical workout, but more importantly, all our programmes are designed to harmonise mind, body and breath. Yoga is not just to increase your flexibility, strength and the general tone of your body; it has the capacity to free your mind, improve your wellbeing and increase your mental resilience. Begin here to create a foundation for a home yoga practice. These free online yoga classes can be practiced at home; although we would always suggest you find a qualified Iyengar Yoga teacher near to you so you can attend a class.\n\n We will be posting videos for all levels but if you have never done yoga before or you want to re-visit some of the basics - then start with our Beginners series! Get out your mat and build the foundation of your own yoga practice with these short yoga videos to practice yoga at home. To do a different short practice each day, see our 30 Days of Yoga. For longer practice, look at our Beginners Yoga series. If you have a low back problem or need some yoga exercises for stiff shoulders or tight hamstrings, look at our 3 R''s series for Relief, Repair and Recovery.  Enjoy!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/HfgKLzdXRt8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/HfgKLzdXRt8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/HfgKLzdXRt8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/HfgKLzdXRt8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/HfgKLzdXRt8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Lin and Leo","tags":["iyengar yoga","iyengar yoga for beginners","restorative yoga","yoga for menstruation","yoga for period pain","period pain","restful yoga","quiet yoga practice","yoga to relieve tension","yoga for abdomen","yoga for women at home","womens yoga","restorative yoga class","relaxing yoga","yoga during periods","yoga poses for period","yoga poses for menstruation","yoga poses for menstrual cramps","yoga poses for menstrual pain","menstrual cramps","exercises for periods","yoga","pelvic pain","tumm