INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18152, '-eoakKOqIzz9duOUGruVYdMI3Ko', 'nVe6iYUtet0', NULL, '{"publishedAt":"2018-12-12T23:24:45Z","channelId":"UCp9Ea0vZPzJmxXqFVMXbiNw","title":"Vinyasa Yoga Flow","description":"Get ready for this full body Vinyasa Yoga flow class that will build heat in the body which will leave you feeling energised.  This class will allow you to find space and balance in the body while building strength into the legs, shoulders and core while stretching the hamstrings and hips. \n\nAlways listen to your body, deeply focus on the breath, take breaks if you need them and go with the flow.   I invite you to practice with an open mind and open heart.  \n\nEnjoy, let me know how you get on in the comments below   \n\n\nStay Connected: https://www.melissainglesyoga.com/\nFacebook: @melissainglesyoga\nInstagram: @melissainglesyoga","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/nVe6iYUtet0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/nVe6iYUtet0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/nVe6iYUtet0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/nVe6iYUtet0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/nVe6iYUtet0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Melissa Ingles Yoga","tags":["Yoga","British Yoga","Yoga Flow","all levels flow","English Yoga","Leamington","4k Yoga","beginners yoga","weightloss","fitness","yoga for core","vinyasa yoga","yoga for side body strength","vinyasa yoga flow","yoga for power","yoga for weightloss","yoga for flexibility","strong body yoga"],"categoryId":"26","liveBroadcastContent":"none","defaultLanguage":"en-GB","localized":{"title":"Vinyasa Yoga Flow","description":"Get ready for this full body Vinyasa Yoga flow class that will build heat in the body which will leave you feeling energised.  This class will allow you to find space and balance in the body while building strength into the legs, shoulders and core while stretching the hamstrings and hips. \n\nAlways listen to your body, deeply focus on the breath, take breaks if you need them and go with the flow.   I invite you to practice with an open mind and open heart.  \n\nEnjoy, let me know how you get on in the comments below   \n\n\nStay Connected: https://www.melissainglesyoga.com/\nFacebook: @melissainglesyoga\nInstagram: @melissainglesyoga"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT59M33S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"138","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''flow'':3A ''vinyasa'':1A ''yoga'':2A', '2020-07-24 09:35:22.027738', '2020-07-24 09:35:22.027738');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18153, 'RyFAPHbWBsu__OVlXu303TWigTE', 'RAWwAbG1dEY', NULL, '{"publishedAt":"2020-07-24T03:47:48Z","channelId":"UCVL-HsQ9wqqmZ7R6seCZZLg","title":"Day 33 Session 02: An Evening Yoga Flow for Sound Sleep by Ketki Gokhale","description":"#GlobalFestivalOfYoga\n\nAbout the Session\n\nThis evening yoga sequence is designed to calm your nervous system, reduce anxiety and stresses of the day and enjoy some \"me\" time to help you wind down before sleeping.\nThis session will help to achieve a relaxing and meditative state of body and mind resulting in better restorative sleep and feeling fresh the next day. The session will also benefit those who are suffering from sleep disorders.\nWe will focus on:\n1. Moon Salutations\n2. Asanas and breathing techniques to relax body and mind\n3. Quick Relaxation Technique\n\nAbout the Presenter\n\nKetki Gokhale is Founder-Director of Atman Yoga Consultancy and has been teaching Yoga in UK for more than 10 years focusing on Hatha Yoga, Power Yoga, Pregnancy Yoga and Children''s Yoga.\nShe has worked with corporate clients such as National Grid and provided tailored Well-being programs to manage stress and anxiety at workplace. She was a visiting faculty at Cambridge University Yoga Society and London Ayurveda University. She has been conducting yoga therapy in addition to private and group classes. \n\nShe has done Yoga Therapy and Masters degree in Yogic Science from SVYASA, Bangalore, Yoga Teacher''s training from Yoga Vidya Niketan, Mumbai and Diploma in Yoga Philosophy from Mumbai University. Her Yoga philosophy is all about inclusion, expansion and evolution within and she loves working with people to create yoga journeys that motivate towards fulfilling their ambitions.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/RAWwAbG1dEY/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/RAWwAbG1dEY/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/RAWwAbG1dEY/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/RAWwAbG1dEY/sddefault.jpg","width":640,"height":480}},"channelTitle":"Indica Yoga","categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Day 33 Session 02: An Evening Yoga Flow for Sound Sleep by Ketki Gokhale","description":"#GlobalFestivalOfYoga\n\nAbout the Session\n\nThis evening yoga sequence is designed to calm your nervous system, reduce anxiety and stresses of the day and enjoy some \"me\" time to help you wind down before sleeping.\nThis session will help to achieve a relaxing and meditative state of body and mind resulting in better restorative sleep and feeling fresh the next day. The session will also benefit those who are suffering from sleep disorders.\nWe will focus on:\n1. Moon Salutations\n2. Asanas and breathing techniques to relax body and mind\n3. Quick Relaxation Technique\n\nAbout the Presenter\n\nKetki Gokhale is Founder-Director of Atman Yoga Consultancy and has been teaching Yoga in UK for more than 10 years focusing on Hatha Yoga, Power Yoga, Pregnancy Yoga and Children''s Yoga.\nShe has worked with corporate clients such as National Grid and provided tailored Well-being programs to manage stress and anxiety at workplace. She was a visiting faculty at Cambridge University Yoga Society and London Ayurveda University. She has been conducting yoga therapy in addition to private and group classes. \n\nShe has done Yoga Therapy and Masters degree in Yogic Science from SVYASA, Bangalore, Yoga Teacher''s training from Yoga Vidya Niketan, Mumbai and Diploma in Yoga Philosophy from Mumbai University. Her Yoga philosophy is all about inclusion, expansion and evolution within and she loves working with people to create yoga journeys that motivate towards fulfilling their ambitions."}}', '{"duration":"PT1H56M24S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"28","likeCount":"1","dislikeCount":"1","favoriteCount":"0","commentCount":"0"}', '''02'':4A ''33'':2A ''an'':5A ''by'':12A ''day'':1A ''evening'':6A ''flow'':8A ''for'':9A ''gokhale'':14A ''ketki'':13A ''session'':3A ''sleep'':11A ''sound'':10A ''yoga'':7A', '2020-07-24 09:35:22.027738', '2020-07-24 09:35:22.027738');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18159, 'WEId3L0kAMH_OxQFeWQaOR-96xw', '8Tah6Oujqbw', NULL, '{"publishedAt":"2020-06-30T18:03:59Z","channelId":"UCH-81uaxCwAAaSgxRtxMkxg","title":"One Hour Active Yoga  Full Body Power Flow","description":"Practice with me on OmStars commercial free! Over 1000 classes and thousands of hours of content: http://www.omstars.com. If youre looking for yoga videos that will show you the perfect way for you to start your yoga journey then Kino MacGregors yoga channel is perfect for you! Whether you are new to yoga or an advanced yoga student you will find a full yoga library with all the yoga postures that you need to develop a complete yoga practice. Yoga is more than just a physical practice yoga is a lifestyle that includes living a peaceful life. Living the yoga lifestyle is about yoga practice, inner peace, yoga diet and being a good person on and off your yoga mat. Kino is a yoga teacher, author of three books, international teacher, writer, blogger, online yoga class teacher, IG yoga challenge host and much more. She co-founded Miami Life Center and Miami Yoga Magazine as well as produced six Ashtanga Yoga DVDs. Practice yoga, change your world one breath at a time. Kino believes that yoga is a vehicle for each student to experience the limitless potential of the human spirit. You dont have to be strong or flexible to begin the yoga practice, all you need is an open heart and the inspiration to practice yoga. Unroll your mat and do the practice!\r\n\r\nFacebook - http://www.facebook.com/KinoYoga\r\nInstagram - http://www.instagram.com/KinoYoga\r\nBlog - http://www.kinoyoga.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/8Tah6Oujqbw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/8Tah6Oujqbw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/8Tah6Oujqbw/hqdefault.jpg","w