INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18162, 'OSx2VfPAFAAWMHbV55iBCf-uISY', 'AYSR2n4TCws', NULL, '{"publishedAt":"2017-04-07T09:30:00Z","channelId":"UC6Yqaa8pk80KBwKX2EAyedw","title":"Full Hour Yoga Class on Upward Facing Dog (urdhva mukha svanasana)","description":"Dive into this fill hour class on Upward Facing Dog (urdhva mukha svanasana). We''ll do lots of preparatory postures to make sure your low back is nice and warmed up for this flow. \n\nUp dog in yoga is a pose that is frequently overlooked. We flow through our sun salutations so quickly that we forget that each pose in that sequence is an individual pose. \n\nUrdhva Mukha Svanasana also tends to be a difficult pose to hold for any given length of time because we often want to collapse into that low back. It''s important to lift UPWARD so you don''t put too much stress on that lower back.\n\nHave you heard about the membership?\nhttps://yogawithlandon.com/youtube/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/AYSR2n4TCws/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/AYSR2n4TCws/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/AYSR2n4TCws/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/AYSR2n4TCws/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/AYSR2n4TCws/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Landon Slaughter","tags":["Upward Facing Dog","urdhva mukha svanasana","how to do upward facing dog","how to do updog","how to do upward dog","up dog yoga","upward facing dog yoga","1 hour yoga","one hour yoga class","yoga class full hour"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Full Hour Yoga Class on Upward Facing Dog (urdhva mukha svanasana)","description":"Dive into this fill hour class on Upward Facing Dog (urdhva mukha svanasana). We''ll do lots of preparatory postures to make sure your low back is nice and warmed up for this flow. \n\nUp dog in yoga is a pose that is frequently overlooked. We flow through our sun salutations so quickly that we forget that each pose in that sequence is an individual pose. \n\nUrdhva Mukha Svanasana also tends to be a difficult pose to hold for any given length of time because we often want to collapse into that low back. It''s important to lift UPWARD so you don''t put too much stress on that lower back.\n\nHave you heard about the membership?\nhttps://yogawithlandon.com/youtube/"},"defaultAudioLanguage":"en"}', '{"duration":"PT53M37S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"73","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"5"}', '''class'':4A ''dog'':8A ''facing'':7A ''full'':1A ''hour'':2A ''mukha'':10A ''on'':5A ''svanasana'':11A ''upward'':6A ''urdhva'':9A ''yoga'':3A', '2020-07-24 09:35:22.027738', '2020-07-24 09:35:22.027738');
