INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18166, '3GUwpg2_WjUlCW8Mdkz_DAl8UTU', '2JvcwqPFdhc', NULL, '{"publishedAt":"2019-01-17T01:27:58Z","channelId":"UC2AWbik5F3fEkNln-CCW5qQ","title":"Weight Loss Yoga Workout |  Burn Fat, Tone Legs & Glutes","description":" FREE Weight Loss Program  http://bit.ly/24dayweightloss\n\n#gayatriyoga #yogaworkout #poweryoga ~ This vinyasa yoga for weight loss workout will build lots of heat, and promote fat burn. We stretch and tone our legs, practice deep hip stretches, some backbends & twists - perfect flow to feel energized & rejuvenated. This is a total body yoga workout with a nice sculpt to your thighs, glutes & deep juicy stretches for tight hips. Give it a try and let me know how you feel after the practice! it can be a good wake up yoga flow for men & women! Namaste!\n\n Want MORE FREE yoga each week ? Click to subscribe:  http://bit.ly/gayatriyogachannel  \n\n\nHi yogi, my name is Kristina. I''m a 200h certified yoga teacher,  Equinox Pilates MAT Certified trainer ,  I have continuing education hours in Yin Yoga & Anatomy Trains {Fascia} (by Tom Myers). I constantly educate myself on anatomy & physiology to deliver to you safe effective workouts .\nGayatri Yoga offers versatile intelligently sequenced & instructed yoga flows that are accessible to any level of yoga practitioner, be it beginner, intermediate or advanced. \n\nWith over 120 FREE online yoga classes you will find suitable for any level easy to follow along yoga flows. With these free home yoga workouts you will build strength & flexibility, tone legs, abs, arms, release any upperback tension or back pain,  sciatica or pregnancy back pain & more.\n\nEither you are looking for an easy morning yoga flow, power yoga flow,  may be 1 hour total body workout or gentle bedtime yoga stretches you can find it all here. \n\n If you dont see a class that fits your need submit your request here or ask any questions:  http:/bit.ly/askgayatri\n\nIf you enjoyed this 1 hour yoga class, find more like this in this playlist : http://bit.ly/1hourgayatriyoga\nIt''s not a beginner yoga class, but you can start practicing 15-20 min of the class until you build up the strength to finish the whole class. \nSubscribe to never miss a new yoga class :  http://bit.ly/gayatriyogachannel \n\nhttp://instagram.com/_kristinamatskevich   Make sure to follow & tag me on your pic or video on Instagram , so that I could see your progress and give you a thumbs up!!! \n\nDon''t forget to comment and like this workout.  The more likes I get the more classes like this you will see! \n\nMUSIC \nYouTube http://bit.ly/songs-of-eden\nSpotify bit.ly/songsofeden\n","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/2JvcwqPFdhc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/2JvcwqPFdhc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/2JvcwqPFdhc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/2JvcwqPFdhc/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/2JvcwqPFdhc/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Gayatri Yoga","tags":["yoga","vinyasa yoga","power yoga","yoga for weight loss","intermediate","1 hour yoga","intense yoga","yoga fat burn","gayatri yoga","morning yoga","weight loss yoga","yoga workout","yoga flow","yoga for flexibility","power yoga workout","fat burning yoga","kristina matskevich","morning yoga stretch","home yoga","yoga 1 hour","yoga workout to burn fat","yoga to tone up","yoga for thighs","gayatri yoga power","power vinyasa yoga","power flow","power yoga weight loss"],"categoryId":"26","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"Weight Loss Yoga Workout |  Burn Fat, Tone Legs & Glutes","description":" FREE Weight Loss Program  http://bit.ly/24dayweightloss\n\n#gayatriyoga #yogaworkout #poweryoga ~ This vinyasa yoga for weight loss workout will build lots of heat, and promote fat burn. We stretch and tone our legs, practice deep hip stretches, some backbends & twists - perfect flow to feel energized & rejuvenated. This is a total body yoga workout with a nice sculpt to your thighs, glutes & deep juicy stretches for tight hips. Give it a try and let me know how you feel after the practice! it can be a good wake up yoga flow for men & women! Namaste!\n\n Want MORE FREE yoga each week ? Click to subscribe:  http://bit.ly/gayatriyogachannel  \n\n\nHi yogi, my name is Kristina. I''m a 200h certified yoga teacher,  Equinox Pilates MAT Certified trainer ,  I have continuing education hours in Yin Yoga & Anatomy Trains {Fascia} (by Tom Myers). I constantly educate myself on anatomy & physiology to deliver to you safe effective workouts .\nGayatri Yoga offers versatile intelligently sequenced & instructed yoga flows that are accessible to any level of yoga practitioner, be it beginner, intermediate or advanced. \n\nWith over 120 FREE online yoga classes you will find suitable for any level easy to follow along yoga flows. With these free home yoga workouts you will build strength & flexibility, tone legs, abs, arms, release any upperback tension or back pain,  sciatica or pregnancy back pain & more.\n\nEither you are looking for an easy morning yoga flow, power yoga flow,  may be 1 hour total body workout or gentle bedtime yoga stretches you can find it all here. \n\n If you dont see a class that fits your need submit your request here or ask any questions:  http:/bit.ly/askgayatri\n\nIf you enjoyed this 1 hour yoga class, find more like this in this playlist : http://bit.ly/1hourgayatriyoga\nIt''s not a beginner yoga class, but you can start practicing 15-20 min of the class until you build up the strength to finish the whole class. \nSubscribe to never miss a new yoga class :  http://bit.ly/gayatriyogachannel \n\nhttp://instagram.com/_kristinamatskevich   Make sure to follow & tag me on your pic or video on Instagram , so that I could see your progress and give you a thumbs up!!! \n\nDon''t forget to comment and like this workout.  The more likes I get the more classes like this you will see! \n\nMUSIC \nYouTube http://bit.ly/songs-of-eden\nSpotify bit.ly/songsofeden\n"},"defaultAudioLanguage":"en"}', '{"duration":"PT1H14M39S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"12499","likeCount":"373","dislikeCount":"1","favoriteCount":"0","commentCount":"84"}', '''burn'':5A ''fat'':6A ''glutes'':9A ''legs'':8A ''loss'':2A ''tone'':7A ''weight'':1A ''workout'':4A ''yoga'':3A', '2020-07-24 09:35:23.966504', '2020-07-24 09:35:23.966504');
