oga","Free Yoga","Power Yoga","back strengthening yoga","full body flow","full body yoga","stretches for the lower back","yoga for back strength","excercises for lower back","relieve lower bain pain","strengthen back muscles","joga","lower back yoga","yoga every damn day","yoga at home","free yoga videos","yoga on youtube","Essential oils and yoga","northern lights black spruce","30 minute yoga"],"categoryId":"26","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"Power Vinyasa Yoga - Back Strengthening (30 Min Full Body Flow)","description":"Even though this class focuses on back strengthening, we still find a way to squeeze in a full body flow. This 30 minutes of power vinyasa yoga is sure to help strengthen your lower back, mid and upper back, and build your core power through each vinyasa.  We will feel a little taller and a lot more relaxed after this class.  Grab your Northern Lights Black Spruce and head on over to your mat!  From my  and hO''Me to yours, enjoy! \n\nBecome an O''Mie with our Newsletter - http://eepurl.com/c1YkVP\nFacebook - https://www.facebook.com/omyogalove/ \nInstagram - https://www.instagram.com/maryom4love/\nhO''Me website - https://www.essentiallyom.com\nNeed oils - https://goo.gl/xaisxh\n\nRelated Videos:\n----------------------------------------------------------------------------------------------------------------\nCore Power Yoga - Full Body Flow (Core, Hamstrings, Upper Back)\nhttps://youtu.be/G38KzI-7rS0\n\nCore Power Yoga - Love Your Core (Strengthening Flow).\nhttps://youtu.be/hIq4vb_CXVk"},"defaultAudioLanguage":"en"}', '{"duration":"PT34M13S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1485","likeCount":"65","dislikeCount":"1","favoriteCount":"0","commentCount":"18"}', '''30'':6A ''back'':4A ''body'':9A ''flow'':10A ''full'':8A ''min'':7A ''power'':1A ''strengthening'':5A ''vinyasa'':2A ''yoga'':3A', '2020-0