INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18172, 'vpcweaWBdytXLmz9LbMIbXu3VPk', 'wUPtGcAqr_Y', NULL, '{"publishedAt":"2019-06-09T15:18:37Z","channelId":"UCE6Y7fJCSeQEUaCxQPENjCg","title":"Yoga with Stick / Jai yoga with Master Ajay","description":"What is Stick-Yoga?\n\nStick-Yoga is an innovative, gentle and effective approach to total fitness and body awareness. Warming up, stretching, and toning utilizing a stick as a prop and a tool for support and leverage is very effective. The stick is used like a third leg.\n\nWhat conditions does Stick-Yoga help?\n\nStick-Yoga increases your bodys flexibility while improving balance, coordination and strength. It can rehab your injuries, improve your posture, and enhance your brain function by integrating the right and left hemispheres. The stick helps maintain proper shape with greater ease in holding stretch positions while conserving energy. Whether you are someone just starting to exercise, a well seasoned athlete or you fall somewhere in between, Stick-Yoga will inspire creative and dynamic ways to stretch your body and increase range of motion while releasing tension in your spine\n\nFor More  Videos \n \n1. 30 Minutes Hip Opening Yoga Pose     https://youtu.be/mETlfOoZqpM\n2. 50 yoga pose in 5 Minutes https://youtu.be/m14g5wi14xU\n3. Power and weight lose yoga flow https://youtu.be/RFxyX3AT2n8\n4. 40 Minutes Intensive yoga flow https://youtu.be/EEBL2R54gDU\n5. Beautiful outdoor yoga https://youtu.be/Wu2uXr_jaY8\n6. Sequences of Classic Standing pose https://youtu.be/27h5tVosgPg\n7. Learn Advance yoga https://youtu.be/BTZZ9VuV1CA\n8. Yoga Dance https://youtu.be/3BiByILsKbw\n9. Reduce fat and lose weight https://youtu.be/OnlF-vk_iG0\n10. Shoulder opening and Twisting https://youtu.be/sDhsQ_OSWmY\n11. Body Balancing https://youtu.be/GQkM9cw1VbU\n12. Yoga with Stick https://youtu.be/wUPtGcAqr_Y\n13. Yoga Dance Tu Aati hai some me htt