omewhere in between, Stick-Yoga will inspire creative and dynamic ways to stretch your body and increase range of motion while releasing tension in your spine\n\nFor More  Videos \n \n1. 30 Minutes Hip Opening Yoga Pose     https://youtu.be/mETlfOoZqpM\n2. 50 yoga pose in 5 Minutes https://youtu.be/m14g5wi14xU\n3. Power and weight lose yoga flow https://youtu.be/RFxyX3AT2n8\n4. 40 Minutes Intensive yoga flow https://youtu.be/EEBL2R54gDU\n5. Beautiful outdoor yoga https://youtu.be/Wu2uXr_jaY8\n6. Sequences of Classic Standing pose https://youtu.be/27h5tVosgPg\n7. Learn Advance yoga https://youtu.be/BTZZ9VuV1CA\n8. Yoga Dance https://youtu.be/3BiByILsKbw\n9. Reduce fat and lose weight https://youtu.be/OnlF-vk_iG0\n10. Shoulder opening and Twisting https://youtu.be/sDhsQ_OSWmY\n11. Body Balancing https://youtu.be/GQkM9cw1VbU\n12. Yoga with Stick https://youtu.be/wUPtGcAqr_Y\n13. Yoga Dance Tu Aati hai some me https://youtu.be/vT_s2CaV3o0\n14. Full Body yoga workout https://youtu.be/Djc_rt-mM5Q\n15. Yoga for Obesity https://youtu.be/Ify3bfsJC-A\n\nSubscribe my you tube channel : \n\nhttps://www.youtube.com/channel/UCE6Y7fJCSeQEUaCxQPENjCg\n\nFollow me on facebook :\nhttps://m.facebook.com/jai.yog.007#_=_\n\nFollow my page :\nhttps://m.facebook.com/jaiyogindia/?ref=bookmarks\n\nEmail : yogamasterjai@gmail.com\nContact : \nWhats app : +84382089666\n\nJAI YOGA PRESENTING \nYOGA TEACHER TRAINING COURSE 200 HRS\n( YTTC 2 ) [YOGA Alliance USA ]\nWITh INTERNATIONAL STANDARD TEACHERS"}}', '{"duration":"PT26M26S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"114971","likeCount":"2545","dislikeCount":"55","favoriteCount":"0","commentCount":"63"}', '''ajay'':8A ''jai'':4A ''master'':7A ''stick'':3A ''with'':2A,6A ''yoga'':1A,5A', '2020-07-24 09:35:23.966504', '2020-07-24 09:35:23.966504');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18173, 'vP9CHjgq4_aUQhTDdQ1MPEo0mrc', 'remM5EgSnWw', NULL, '{"publishedAt":"2020-07-16T22:00:18Z","channelId":"UC-7UzTng6nBozIbT_aC_GUQ","title":"45-Minute Power Yoga | Feel Strong, Vibrant, Alive | Yoga with Heather","description":"45-Minute Power Yoga to feel Feel Strong, Vibrant, and Alive. This 45 minute Power Flow class with Heather is designed to build and strengthen your total body while getting you to connect with your breath and work up a sweat!\n\nWhether you''re newer to yoga or want to focus on the foundations of the asanas (poses), this is a intermediate to advanced vinyasa flow class to practice. \n\nDo what feels good in your body! Everything is optional and you can take a break in childs pose at any time. Be sure to listen to your body, breathe, and take breaks when you need them.  \n\nIf there are too many downdogs or chaturangas then, skip them!\n \nLets flow smoothly and sweetly to build strength, flexibility, balance, and stamina all in one session to feel blissful and strong. Wishing you radiant health, serenity, & well-being. Heather\n\n\n\nAlways seek the advice of your physician brother qualified professional before starting or changing any new exercise program or making a lifestyle change or making any changes to existing treatment. This is particularly important if you are pregnant, nursing, overweight, taking medications or have any existing medical or health conditions. Do not delay seeking or disregard medical advice or are medical diagnoses. This video may not match your fitness or energy level. If you are concerned about any exercises in this video than do not do themeless and until you have talked with a doctor.\n\nIf you feel sick, dizzy, faint, light-headed, or pain then discontinue the exercise.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/remM5EgSnWw/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/remM5EgSnWw/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/remM5EgSnWw/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/remM5EgSnWw/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/remM5EgSnWw/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Heather","tags":["45 minute power yoga"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"45-Minute Power Yoga | Feel Strong, Vibrant, Alive | Yoga with Heather","description":"45-Minute Power Yoga to feel Feel Strong, Vibrant, and Alive. This 45 minute Power Flow class with Heather is designed to build and strengthen your total body while getting you to connect with your breath and work up a sweat!\n\nWhether you''re newer to yoga or want to focus on the foundations of the asanas (poses), this is a intermediate to advanced vinyasa flow class to practice. \n\nDo what feels good in your body! Everything is optional and you can take a break in childs pose at any time. Be sure to listen to your body, breathe, and take breaks when you need them.  \n\nIf there are too many downdogs or chaturangas then, skip them!\n \nLets flow smoothly and sweetly to build strength, flexibility, balance, and stamina all in one session to feel blissful and strong. Wishing you radiant health, serenity, & well-being. Heather\n\n\n\nAlways seek the advice of your physician brother qualified professional before starting or changing any new exercise program or making a lifestyle change or making any changes to existing treatment. This is particularly important if you are pregnant, nursing, overweight, taking medications or have any existing medical or health conditions. Do not delay seeking or disregard medical advice or are medical diagnoses. This video may not match your fitness or energy level. If you are concerned about any exercises in this video than do not do themeless and until you have talked with a doctor.\n\nIf you feel sick, dizzy, faint, light-headed, or pain then discontinue the exercise."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT45M51S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"739","likeCount":"10","dislikeCount":"1","favoriteCount":"0","commentCount":"1"}', '''45'':1A ''alive'':8A ''feel'':5A ''heather'':11A ''minute'':2A ''power'':3A ''strong'':6A ''vibrant'':7A ''with'':10A ''yoga'':4A,9A', '2020-07-24 09:35:23.966504', '2020-07-24 09:35:23.966504');
