INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18175, 'bVDDv27Bzkn_ghk6_z2GbSWJO6E', 'L96zO0LYDQ8', NULL, '{"publishedAt":"2019-10-24T09:51:52Z","channelId":"UCPdb58AJIC6oJuREIBj8ixA","title":"Yoga for the Spine |  45 Minutes Vinyasa Krama Class to Half Lord of the Fishes Pose","description":"Hello Beautiful Souls,\n\nI have a class for your spine. For your sweet, beautiful, strong spine. \n\nJust imagine what your life would be life without a spine! You would flop forward and all you could see is the floor, in best case. Or you would be head butting the floor every time you step.\n\nOur spines are the reason we can stand up tall and straight, lifting up and looking ahead. So let''s take care of them to our best capabilities!\n\nI love rotations, they are excellent for our internal organs, spine, liver, kidney. They are great to aid digestion problems and they are such heart openers. We need to lift the chest, keeping our spine straight and use the core to support the pine.\n\nEverything is working real hard in a rotation, usually this is the part of my practice where I start dropping sweat down my nose. Probably because it is the most challenging part for me. We may be different thought, yet I guarantee you you will feel the benefits of a good rotation class.\n\nI love how rotations make my back feel. Especially my spine! I always feel I have created more room in my back and that my spine can be more erect and straight after. So I highly recommend working on your rotations and deepening them along the way.\n\nPlease make sure thought that you don''t push yourself too hard and that you don''t practice them if you have any back or spine injuries such as slipped disk or any other problems. In this case consult with your doctor and real life teacher what is safe for you to practice.\n\nBut I really hope you enjoy this class, if you did, make sure to like and share it so others can do too.\n\n Thank you for sharing your practice with me today. \n\nTake very good care of yourself and I shall see you in the next class!\n\nVeronika\n\n\n\nTUSCANY Yoga Retreat with Karuna Yoga\n\nDates: \n 21st-28th September, 2020\n 1st-8th October, 2020\n\nDetails of retreat: www.kraunayogauk.com\n\n Book your place now with  30% non-refundable but transferrable deposit. \n Flexible payment plans are available, just message me on karuna.yoga.uk@gmail.com \n\n\n\nFOLLOW ME ON:\n\n Instagram: https://www.instagram.com/karuna.yoga.uk\n\nCHECK OUT MY WEBSITE:\n\n Website: https://www.karunayogauk.com\n\nGIVE A LIKE AND FOLLOW ON:\n\n Facebook: https://www.facebook.com/karuna.yoga.uk\n\nGIVE SOME SUPPORT ON:\n\n Patreon: https://www.patreon.com/karunayogauk","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/L96zO0LYDQ8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/L96zO0LYDQ8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/L96zO0LYDQ8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/L96zO0LYDQ8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/L96zO0LYDQ8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Karuna Yoga HU","tags":["yogaforthespine","spineyoga","yogaclassforthespine","yogaspine","yogaspineexercises","yogaspineworkout","spineworkoutyoga","howtoexercisethespineyoga","spineexercisesyoga","beginnersspineyoga","yogaclassspine","spineyogaclass","spineyogalesson","yogalessonspine","yogaspinehealth","yogaspinerotations","yogarotationsspine","howtoexercisethespine","healthyspineyoga","yogaandspine","spineandyoga","yogaspinemovements","yogarotatethespine","yogaspinerotate","strongspineyoga","yogastrongspine","freespineyogaworkout","movethespineyoga","yogaclassforspine"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Yoga for the Spine |  45 Minutes Vinyasa Krama Class to Half Lord of the Fishes Pose","d