eposit. \n Flexible payment plans are available, just message me on karuna.yoga.uk@gmail.com \n\n\n\nFOLLOW ME ON:\n\n Instagram: https://www.instagram.com/karuna.yoga.uk\n\nCHECK OUT MY WEBSITE:\n\n Website: https://www.karunayogauk.com\n\nGIVE A LIKE AND FOLLOW ON:\n\n Facebook: https://www.facebook.com/karuna.yoga.uk\n\nGIVE SOME SUPPORT ON:\n\n Patreon: https://www.patreon.com/karunayogauk"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT46M17S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"43","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''45'':5A ''class'':9A ''fishes'':15A ''for'':2A ''half'':11A ''krama'':8A ''lord'':12A ''minutes'':6A ''of'':13A ''pose'':16A ''spine'':4A ''the'':3A,14A ''to'':10A ''vinyasa'':7A ''yoga'':1A', '2020-07-24 09:35:23.966504', '2020-07-24 09:35:23.966504');
