INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18187, 'f7JtF4tDiQR8P4NK_cvpPWMuRF8', '_BR7nj3DPSk', NULL, '{"publishedAt":"2018-12-10T13:15:00Z","channelId":"UCcox27Gc-NGbb2-X9hdLaMw","title":"Fun-Loving Full Body Yoga Stretch (20 min routine)","description":"Fun-loving Full Body Yoga Stretch is a 20 min class for flexibility and stretching that will make you feel good. For another full body stretch that will make you feel great click here https://www.youtube.com/watch?v=EZfRR19MMpo&list=PLEs9dX8UXFZq97dEPT0UzWSw8M6npoWiE&index=2&t=18s These 20 minute yoga classes are the easiest way to fit a yoga practice into your busy schedule. No matter how busy you are you can always fit in a full body yoga stretch.\n\nGet extra strength to perform yoga poses you never thought possible by strengthening your core by clicking here  https://www.myyogapal.com/core-sign-up and see how I started youtube https://www.youtube.com/watch?v=N6PyK19jPas&t=5s\n\nTo try MyYogaPal for 7 days for just $1 click here https://www.myyogapal.com/offers/H5VRN4Sj\n\n#fullbodyyoga #fullbodyyogastretch #fightmasteryoga\n\nIf you want to feel better in your body this is the channel for you. Because when you practice yoga you feel better!\n\nDon''t worry if you''re not flexible or can''t do the poses perfectly. The motto of Fightmaster Yoga is \"It''s not about the pose\". You don''t have to be perfect.\n\nAll you have to do is show up. When you make the decision to take care of yourself, all sorts of amazing things begin to happen. You have more energy. You become more patient. Your outlook on life becomes more positive. And all of these changes you will experience in this yoga journey will begin to affect those around you in ways you never dreamed possible. \n\nThis practice can bring a loving, positive energy that will spread throughout your world. And as you deepen your yoga practice you will have the opportunity to me