steryoga\nInstagram - http://instagram.com/fightmasteryoga\nTwitter - https://twitter.com/fightmasteryoga"},"defaultAudioLanguage":"en"}', '{"duration":"PT24M33S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"65143","likeCount":"2964","dislikeCount":"20","favoriteCount":"0","commentCount":"190"}', '''20'':8A ''body'':5A ''full'':4A ''fun'':2A ''fun-loving'':1A ''loving'':3A ''min'':9A ''routine'':10A ''stretch'':7A ''yoga'':6A', '2020-07-24 09:35:23.966504', '2020-07-24 09:35:23.966504');
