INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18189, 'Kd9jOWBb-j6lIyqAuhNfK2KJfP8', '1DNOjq5ZImo', NULL, '{"publishedAt":"2019-04-06T15:36:50Z","channelId":"UCxXSonb3zhnlI-MGcD3eotw","title":"Post Workout Yoga | Relaxing Yoga Flow | Yoga for BJJ","description":"MORE OF THIS? Join us \nLockdown special: https://yogaforbjj.live/special Ever wondered what you should do after jiu jitsu, how to stretch your sore limbs? \nThis video is perfect to do after training, if you are feeling too sore to do anything or if you want a nice relaxed yoga flow to do before bed.\nWe got your back! - and legs, shoulders, hips...the whole thing. This is the short version of our official cool down routine. Simply hit play and enjoy the good pain. In yoga we would call this a yin stretching session so just take a minute to breath relax and stretch\nThese are great stretches to do after a workout and do get a good post workout stretching routine. Yoga stretching can be chilled if you want it to be, just be calm and breath. This is great to do as an after the gym yoga session too and will help you cooldown after jiu jitsu class.\n\n\nYoga for BJJ is designed to help people improve themselves on and off the mats. Using yoga specific stretches and flows that are relevant to jiu jitsu to help you increase your flexibility, rate of motion, balance and injury prevention. \nWhether you are grappling once or twice a week or a full time athlete we like to make sure we have videos for everyone so if you need the complete startup program or our \"yoga for rocks\" program or even our yoga for 40+ series we have it waiting for you.\n\nWe offer 300+ videos organized into programs. They include tutorials and they cover all of those areas that grapplers need to work on the most. Stiffness in the lower back, hips, hamstring, shoulders, neck, legs... can all be a thing of the past.\n\nWe don''t offer magical results, but feedback from 1000+ members and our experience makes us confident that you can extend your career on the mats with consistent yoga practice.\n\nTry one of the free classes on our channel then head over to www.yogaforbjj.net and sign up to unlock video programs specific to your needs and start improving yourself today.\n\nNew videos every week for grapplers that want to optimize the body for BJJ and life!\n- Train smart - Fight Forever","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/1DNOjq5ZImo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/1DNOjq5ZImo/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/1DNOjq5ZImo/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/1DNOjq5ZImo/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/1DNOjq5ZImo/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga for BJJ","tags":["BJJ","brazilian jiu-jitsu","jiujitsu","yoga","yoga for bjj","stretching","flexibility","stretching for jiu jitsu","bjj stretching","after training stretching","after bjj stretch","yoga after bjj","yoga after training","bjj cooldown","bjj post training stretch","yoga flow","free yoga class","yoga chill","yin yoga","easy yoga","beginner yoga","yoga before bed","yoga for stress","post workout yoga","post workout stretches","yoga for sore muscles","yoga after gym","yoga for after weights"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Post Workout Yoga | Relaxing Yoga Flow | Yoga for BJJ","description":"MORE OF THIS? Join us \nLockdown special: https://yogaforbjj.live/special Ever wondered what you should do after jiu jitsu, how to stretch your sore limbs? \nThis video is perfect to do after training, if you are feeling too sore to do anything or if you want a nice relaxed yoga flow to do before bed.\nWe got your back! - and legs, shoulders, hips...the whole thing. This is the short version of our official cool down routine. Simply hit play and enjoy the good pain. In yoga we would call this a yin stretching session so just take a minute to breath relax and stretch\nThese are great stretches to do after a workout and do get a good post workout stretching routine. Yoga stretching can be chilled if you want it to be, just be calm and breath. This is great to do as an after the gym yoga session too and will help you cooldown after jiu jitsu class.\n\n\nYoga for BJJ is designed to help people improve themselves on and off the mats. Using yoga specific stretches and flows that are relevant to jiu jitsu to help you increase your flexibility, rate of motion, balance and injury prevention. \nWhether you are grappling once or twice a week or a full time athlete we like to make sure we have videos for everyone so if you need the complete startup program or our \"yoga for rocks\" program or even our yoga for 40+ series we have it waiting for you.\n\nWe offer 300+ videos organized into programs. They include tutorials and they cover all of those areas that grapplers need to work on the most. Stiffness in the lower back, hips, hamstring, shoulders, neck, legs... can all be a thing of the past.\n\nWe don''t offer magical results, but feedback from 1000+ members and our experience makes us confident that you can extend your career on the mats with consistent yoga practice.\n\nTry one of the free classes on our channel then head over to www.yogaforbjj.net and sign up to unlock video programs specific to your needs and start improving yourself today.\n\nNew videos every week for grapplers that want to optimize the body for BJJ and life!\n- Train smart - Fight Forever"},"defaultAudioLanguage":"en"}', '{"duration":"PT13M55S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"15137","likeCount":"399","dislikeCount":"7","favoriteCount":"0","commentCount":"22"}', '''bjj'':9A ''flow'':6A ''for'':8A ''post'':1A ''relaxing'':4A ''workout'':2A ''yoga'':3A,5A,7A', '2020-07-24 09:35:23.966504', '2020-07-24 09:35:23.966504');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18190, 'X7kXkrWw1zlVIpW6lIHekYUQekA', '8775t65Zkao', NULL, '{"publishedAt":"2020-07-19T13:00:55Z","channelId":"UCn_bzvTCpkq5soaBjo1lciQ","title":"30-Minute Journey into Power Flow | All-Levels Yoga Sequence","description":"I''m heading to Iceland this weekend! I''ll be in transit on Sunday at 9am, when I usually go LIVE. Enjoy this 30-minute Journey into Power inspired flow and stay tuned for lots more to come. Subscribe to the channel and hit the notification bell so you know when new videos are uploaded. ;)\n\nFind me on social media, Patreon or check out my website!\nhttps://linktr.ee/MoveNourishHeal\nhttps://www.MikeMurdoch.ca \nhttps://www.youtube.com/c/MoveNourishHeal\nhttps://www.patreon.com/move_nourish_heal\nhttps://www.instagram.com/move_nourish_heal\nhttps://www.facebook.com/mike.d.murdoch","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/8775t65Zkao/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/8775t65Zkao/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/8775t65Zkao/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/8775t65Zkao/sddefault.jpg","width":640,"height":480}},"channelTitle":"Move. Nourish. Heal. with Mike","tags":["journey into power sequence","baptiste yoga","yoga class","vinyasa yoga sequence","move nourish heal","journey into power baptiste","power yoga sequence","journey into power","JIP","power yoga workout","yoga workout","gay yoga","gay","lbgtq","30-minute workout","30 minute yoga flow","30 minute journey into power","shortened journey into power","quick yoga flow","vinyasa yoga workout","full body yoga stretch","sweaty yoga","yoga","baron baptiste journey into power"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"30-Minute Journey into Power Flow | All-Levels Yoga Sequence","description