INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18199, 'dD5cMKenlgdTGPc9U0Rq0pSd6FU', '2y75XjUsbRs', NULL, '{"publishedAt":"2020-05-18T21:00:00Z","channelId":"UC1vTlARSd51P8neARPucMsQ","title":"1 Hour Yin Yoga Class with Minimal Cues | Full Body Deep Stretch | Yinster Series","description":"Dear Yinsters, \n\nWelcome to a one hour full body yin yoga practice with minimal cues and minimal chatter. It''s time to chill and be still. \n\nI would not recommend this class if you are brand new to yin yoga. \n\nPractice Outline:\nButterfly\nCaterpillar\nMelting Heart/Child''s Pose\nOpen Wing\nDragon\nSupported Bridge\nFigure 4 R into Twist\nFigure 4 L into Twist\nCorpse\n\nI will be using 2 blocks, a blanket and bolster...but please feel free to use whatever props are appropriate for your practice.\n\nThank you for subscribing and sharing with friends\n\nNamaste,\n\nBrittany Timberlake\n\n#yinyoga #yinster #timberlakeyoga\n\n\n Prefer music when practicing with me? Feel free to listen to my \"Yin Vibes\" playlist on Spotify:\n\nhttps://open.spotify.com/playlist/27ldweGwyJgc6UVJSex6x5?si=RDfKM1p8TXCevcYTlmFPWQ\n\n\n\nTimberlake Yoga - Disclaimer:\nPlease consult with your physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Timberlake Yoga from any and all claims or causes of action, known or unknown, arising out of Timberlake Yogas negligence.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/2y75XjUsbRs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/2y75XjUsbRs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/2y75XjUsbRs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/2y75XjUsbRs/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/2y75XjUsbRs/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Timberlake Yoga","tags":["yin yoga","advanced yin yoga","yinster series","yoga for teachers","minimal cues yoga","minimal cues yin yoga","minimal talking yoga","1 hour yoga","1 hour yin yoga","full body deep stretch","deep stretches","full body yin","morning yin","bedtime yin","yin yoga without props","yin yoga bolster","yin yoga for hips","yin yoga for lower back","yin yoga it band","yin yoga glutes","yin yoga for stress","yin yoga for anxiety","yin yoga for legs","yoga for upper body","yin for shoulders"],"categoryId":"22","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"1 Hour Yin Yoga Class with Minimal Cues | Full Body Deep Stretch | Yinster Series","description":"Dear Yinsters, \n\nWelcome to a one hour full body yin yoga practice with minimal cues and minimal chatter. It''s time to chill and be still. \n\nI would not recommend this class if you are brand new to yin yoga. \n\nPractice Outline:\nButterfly\nCaterpillar\nMelting Heart/Child''s Pose\nOpen Wing\nDragon\nSupported Bridge\nFigure 4 R into Twist\nFigure 4 L into Twist\nCorpse\n\nI will be using 2 blocks, a blanket and bolster...but please feel free to use whatever props are appropriate for your practice.\n\nThank you for subscribing and sharing with friends\n\nNamaste,\n\nBrittany Timberlake\n\n#yinyoga #yinster #timberlakeyoga\n\n\n Prefer music when practicing with me? Feel free to listen to my \"Yin Vibes\" playlist on Spotify:\n\nhttps://open.spotify.com/playlist/27ldweGwyJgc6UVJSex6x5?si=RDfKM1p8TXCevcYTlmFPWQ\n\n\n\nTimberlake Yoga - Disclaimer:\nPlease consult with your physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Timberlake Yoga from any and all claims or causes of action, known or unknown, arising out of Timberlake Yogas negligence."}}', '{"duration":"PT56M17S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"533","likeCount":"38","dislikeCount":"0","favoriteCount":"0","commentCount":"12"}', '''1'':1A ''body'':10A ''class'':5A ''cues'':8A ''deep'':11A ''full'':9A ''hour'':2A ''minimal'':7A ''series'':14A ''stretch'':12A ''with'':6A ''yin'':3A ''yinster'':13A ''yoga'':4A', '2020-07-24 09:35:25.915024', '2020-07-24 09:35:25.915024');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18200, 'o9ixAMddAQJGaM1GwbzvP6oA_g8', '8cQIZVAdQg4', NULL, '{"publishedAt":"2020-05-03T12:30:00Z","channelId":"UC_d-bQRNCF7WiizUUsTToxA","title":"45 Minute Strong Yoga Flow - Intermediate - Advanced","description":"In this 45 Minute Strong flow we will move quickly with breath, through many strong and challenging postures including Warrior II & lll, Flying Pigeon, Side Plank and Wheel. This is an intermediate - advanced class so some yoga experience is recommended. Enjoy \n\nSubscribe to my channel so you dont miss any new classes!\n\nConnect with me :)\nInstagram: https://www.instagram.com/yogamethyst\nFacebook:https://www.facebook.com/Yogamethyst-106068147745991/?__tn__=%2Cd%2CP-R&eid=ARBK_jzLP4R03goabtPN2kEGcoOE93SbczJ-EpxSRYjvw6BXlW7OJZFrhby65AZpQaXdsdPT7fYsAYQ7\n\nIf you enjoyed this class please like the video and leave a comment below! Maybe share with a friend too :)\n\nIf You''re interested in learning Acroyoga check out my online course:\nhttps://www.udemy.com/course/acro-yoga-for-beginners/?referralCode=E50FA3B98470924BB97D\n\n-\n\nAmethyst is a 500 hour certified yoga instructor. She took her first yoga teacher training at the Sivananda and Vedanta Centre in Neyyar Dam, India in 2009. Since then she has taught thousands of classes in Edmonton, Alberta. Other trainings she has taken include: Ayurvedic Yoga Therapy Course, Taste of YogaKids, Acro-Muse Acroyoga teacher training and many other yoga workshops. Her goal is to get more people trying yoga and living healthier and happier lives!\n\nLEGAL DISCLAIMER:\n \nAll information provided by Amethyst Ward is solely for entertainment purposes and may not be used as a substitute for professional advice as circumstances will vary from person to person. Do not attempt any of the actions or instructions found in this video without first consulting with a qualified professional. Pleas