INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18204, 'hDeLzMBowu4EBaWYSXAFtWxcY-M', 'nhu-Hrd94j8', NULL, '{"publishedAt":"2016-06-26T17:08:34Z","channelId":"UC1UJD-XF_5hcrQ5hwrcPCOQ","title":"SUP Yoga 10 minute Beginner Yoga","description":"Hey there! The distracting sound of boats, and kids playing are natural occurring sounds of fun on the lake! Although I made a few attempts to record without distractions, inevitable the boats, sea doo''s and kids playing continued!  When out on the lake practicing, often the distracting sounds are a great way to \"go within\" and learn to focus with the business of life naturally occurring around us. Have fun with it, and remember to follow safety rules, and have a PDF on your board when practicing. Here, I was only 3-5 feet from shore for filming, otherwise always have mine on board! Namaste, Angie","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/nhu-Hrd94j8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/nhu-Hrd94j8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/nhu-Hrd94j8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/nhu-Hrd94j8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/nhu-Hrd94j8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Angie Milner","tags":["iMovie"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"SUP Yoga 10 minute Beginner Yoga","description":"Hey there! The distracting sound of boats, and kids playing are natural occurring sounds of fun on the lake! Although I made a few attempts to record without distractions, inevitable the boats, sea doo''s and kids playing continued!  When out on the lake practicing, often the distracting sounds are a great way to \"go within\" and learn to focus with the business of life naturally occurring around us. Have fun with it, and remember to follow safety rules, and have a PDF on your board when practicing. Here, I was only 3-5 feet from shore for filming, otherwise always have mine on board! Namaste, Angie"}}', '{"duration":"PT14M4S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"3743","likeCount":"45","dislikeCount":"2","favoriteCount":"0","commentCount":"2"}', '''10'':3A ''beginner'':5A ''minute'':4A ''sup'':1A ''yoga'':2A,6A', '2020-07-24 09:35:25.915024', '2020-07-24 09:35:25.915024');
