INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18215, 'Vb6hy5M-Ggh2XOxPItCKMHQidVo', 'eCCxw1RDw-Q', NULL, '{"publishedAt":"2016-04-24T15:00:01Z","channelId":"UCsksmxdgJtJp18iMYQpJg0A","title":"Strengthen and Stabilize: Free Yoga Flow with Dylan Werner","description":"This is a preview of Dylan Werners True Strength Evolution yoga classes. You can get his full course of True Strength Evolution yoga classes online here: https://www.codyapp.com/plans/true-strength-evolution?utm_source=cody_youtube_preview_tse&utm_medium=cody_social&utm_campaign=tse\n\nThis 15-minute class will work your back and stabilizing muscles to increase your strength. You will need a yoga mat, and if you are tight, grab a few yoga blocks to assist you!\n\nTrue Strength Evolution is a yoga-based fitness program designed to take you to the brink of your ability and teach you how to go even one step further. Dylan took everything that was great about the original True Strength series and made it better. \n\nThis complete 6-stage workout will maximize the development of your strength, flexibility, and endurance  all within thirty minutes!\nIn each stage youll work strength and endurance until you reach absolute exhaustion. When you hit that point, youll move to a different muscle group so you are always pushing your limit. \n\nBetween each stage, youll work into deep flexibility, increasing your range of motion and decreasing muscle resistance, while providing time to recuperate and get you ready for the next stage of strength and endurance movements.\n\nDid you like this yoga video? You can get the full month-long yoga workout video plan here: https://www.codyapp.com/plans/true-strength-evolution?utm_source=cody_youtube_preview_tse&utm_medium=cody_social&utm_campaign=tse\n\nComment below to let us know what you thought about this yoga video, and subscribe to our channel for more yoga classes with Dylan Werner! \n\nW