erything that was great about the original True Strength series and made it better. \n\nThis complete 6-stage workout will maximize the development of your strength, flexibility, and endurance  all within thirty minutes!\nIn each stage youll work strength and endurance until you reach absolute exhaustion. When you hit that point, youll move to a different muscle group so you are always pushing your limit. \n\nBetween each stage, youll work into deep flexibility, increasing your range of motion and decreasing muscle resistance, while providing time to recuperate and get you ready for the next stage of strength and endurance movements.\n\nDid you like this yoga video? You can get the full month-long yoga workout video plan here: https://www.codyapp.com/plans/true-strength-evolution?utm_source=cody_youtube_preview_tse&utm_medium=cody_social&utm_campaign=tse\n\nComment below to let us know what you thought about this yoga video, and subscribe to our channel for more yoga classes with Dylan Werner! \n\nWebsite: https://www.codyapp.com/?utm_source=cody_youtube_preview_tse&utm_medium=cody_social&utm_campaign=tse\nCody App iOS: https://itunes.apple.com/us/app/cody-fitness-video-training/id601617403?mt=8\nCody App Android: https://play.google.com/store/apps/details?id=com.cody.cody&hl=en\nInstagram: https://instagram.com/codyapp/"},"defaultAudioLanguage":"en"}', '{"duration":"PT15M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"95089","likeCount":"1321","dislikeCount":"17","favoriteCount":"0","commentCount":"16"}', '''and'':2A ''dylan'':8A ''flow'':6A ''free'':4A ''stabilize'':3A ''strengthen'':1A ''werner'':9A ''with'':7A ''yoga'':5A', '2020-07-24 09:35:28.272232', '2020-07-24 09:35:28.272232');
