INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18224, 'XwOKz8sXJcqoKhixhSIxE0pp8l4', 'rx__7CmFo5Y', NULL, '{"publishedAt":"2020-07-23T10:30:03Z","channelId":"UCUhEwSeUtHpf-2--yWrWvOQ","title":"30 Minute Vinyasa Yoga - Dynamic Cardio Yoga Flow for Beginner/Intermediate","description":"Join me in this 30 Minute Dynamic Vinyasa Yoga Flow.  This vinyasa yoga practice raises the heart beat and heat in the body using fast transitions between different asana''s, while using vinyasa''s between sequences.  Work your way through various planks, twists and full body opening poses.  Class begins with a warm up and follows with a cool down in Reclined Bound Angle and Savasana.\nAsana''s include Cat/Cow, Downward Facing Dog, Revolved Half Moon, Standing Split, Side Plank, Tree Pose, Eagle Pose, Pigeon Pose, Crow Pose and many more!\nThis class is great for strong beginners to intermediate.  Make sure to modify and pause the video if needed.  Listen to your body, this is your journey, your practice.  \nThere is no music during this practice, so feel free to use your own!\nIf you enjoy this video, give it a thumbs up and let me know what you think in the comments!\nCan''t wait to see you on the mat!\n\n\nFollow me on Instagram:  @one_conscious_body\nContact me:  oneconsciousbody@gmail.com\n\nDisclaimer:  You are held solely responsible for any injury or benefit you incur during participation of this practice.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/rx__7CmFo5Y/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/rx__7CmFo5Y/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/rx__7CmFo5Y/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/rx__7CmFo5Y/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/rx__7CmFo5Y/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"One Conscious Body Yoga","tags":["Dynamic Yoga","Vinyasa Flow","Intermediate Yoga","30minyoga","Conscious"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"30 Minute Vinyasa Yoga - Dynamic Cardio Yoga Flow for Beginner/Intermediate","description":"Join me in this 30 Minute Dynamic Vinyasa Yoga Flow.  This vinyasa yoga practice raises the heart beat and heat in the body using fast transitions between different asana''s, while using vinyasa''s between sequences.  Work your way through various planks, twists and full body opening poses.  Class begins with a warm up and follows with a cool down in Reclined Bound Angle and Savasana.\nAsana''s include Cat/Cow, Downward Facing Dog, Revolved Half Moon, Standing Split, Side Plank, Tree Pose, Eagle Pose, Pigeon Pose, Crow Pose and many more!\nThis class is great for strong beginners to intermediate.  Make sure to modify and pause the video if needed.  Listen to your body, this is your journey, your practice.  \nThere is no music during this practice, so feel free to use your own!\nIf you enjoy this video, give it a thumbs up and let me know what you think in the comments!\nCan''t wait to see you on the mat!\n\n\nFollow me on Instagram:  @one_conscious_body\nContact me:  oneconsciousbody@gmail.com\n\nDisclaimer:  You are held solely responsible for any injury or benefit you incur during participation of this practice."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT36M45S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"32","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''30'':1A ''beginner/intermediate'':10A ''cardio'':6A ''dynamic'':5A ''flow'':8A ''for'':9A ''minute'':2A ''vinyasa'':3A ''yoga'':4A,7A', '2020-07-24 09:35:28.272232', '2020-07-24 09:35:28.272232');
