":["yoga at home","free yoga videos","free yoga","online yoga","yoga practice","online yoga class","yoga for beginners","yoga for strength","yoga for flexibility","home yoga practice","at home yoga","yoga flow","30 minute yoga","yoga for mental health","yoga for hips","yoga flow vinyasa","30 days of yoga","yoga","annie clarke","mind body bowl","annie clarke yoga","annie clarke yoga class","annie clark yoga","beginners yoga","home yoga"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Home Yoga | Hip & Heart Opening Flow with Annie Clarke","description":"This home yoga class is a great way to create space in your body. Focussing on opening up the hips and the heart in a short but full yoga flow practice. Whether you are an experienced yogi or just exploring yoga at home for the first time, there is something for you here! I hope you enjoy practicing with me.\n\nLOOKING FOR LONGER CLASSES OR A LITTLE MORE GUIDANCE IN YOUR PRACTICE?\nJoin my online studio - The Practice by Annie Clarke. You''ll get monthly classes all created in line with an intention, as well as guided meditations and a growing library of practices to choose from. The community is growing and I''d love to share it with you. Come and discover The Practice by Annie Clarke: https://annieclarke.com/\n\nI''m wearing lululemon. The link to the trousers is here: https://www.lululemon.co.uk/p/Royal-Ballet-Collection/Principal-Dancer-Pant/_/prod12260510?rcnt=13&N=7sdZ1z136tb&cnt=14&color=LW5BIWS_035449\n\nThis is the mat I use:\nhttps://www.lululemon.co.uk/p/women-yoga-mats-and-props/The-Reversible-Mat/_/prod12020266?rcnt=2&N=7u7&cnt=13&color=LU9A75S_025559\n\nAudio by Rich Sharrock berlinaudiowork@gmail.com"},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT35M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"6891","likeCount":"115","dislikeCount":"2","favoriteCount":"0","commentCount":"1"}', 