INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18240, 'EL7JVvbw5nCWfA5q0o_bIbXRMpU', 'ddJLoDWFm9Q', NULL, '{"publishedAt":"2020-05-16T06:07:17Z","channelId":"UCFOqj-U8DQkblo20aGyrOLg","title":"45 minute Yoga for Neck, Shoulders, Low Back and Hips - Ashes Yoga","description":"Join Ashes Yoga Virtual Yoga Studio today and join in live during lessons like this at http://ashesyogastudio.com/virtual\n\nMy favorite products: http://kit.co/ashesyoga\n\nAshley Hagen (E-RYT), started practicing yoga in 2010 to help improve her performance as a college athlete. In 2013, after experiencing the benefits of a daily yoga practice, she received her 200-hr yoga teacher certification and began teaching vinyasa yoga, the most accessible style of power yoga. Her classes are fun, yet challenging with focus on finding the yogi warrior within. She also mentors new yoga teachers develop confidence to teach with ease and authenticity. Find more at http://ashleyrosehagen.com\n\nFind me on the socials:\nInstagram: http://instagram.com/ashesyoga\nFacebook: http://facebook.com/ashesyoga\n\nPractice at your own risk. Consult your doctor before starting any new exercise routines.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/ddJLoDWFm9Q/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/ddJLoDWFm9Q/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/ddJLoDWFm9Q/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/ddJLoDWFm9Q/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/ddJLoDWFm9Q/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Ashley Hagen - Ashes Yoga","categoryId":"27","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"45 minute Yoga for Neck, Shoulders, Low Back and Hips - Ashes Yoga","description":"Join Ashes Yoga Virtual Yoga Studio today and join in live during lessons like this at http://ashesyogastudio.com/virtual\n\nMy favorite products: http://kit.co/ashesyoga\n\nAshley Hagen (E-RYT), started practicing yoga in 2010 to help improve her performance as a college athlete. In 2013, after experiencing the benefits of a daily yoga practice, she received her 200-hr yoga teacher certification and began teaching vinyasa yoga, the most accessible style of power yoga. Her classes are fun, yet challenging with focus on finding the yogi warrior within. She also mentors new yoga teachers develop confidence to teach with ease and authenticity. Find more at http://ashleyrosehagen.com\n\nFind me on the socials:\nInstagram: http://instagram.com/ashesyoga\nFacebook: http://facebook.com/ashesyoga\n\nPractice at your own risk. Consult your doctor before starting any new exercise routines."},"defaultAudioLanguage":"en"}', '{"duration":"PT48M35S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"136","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''45'':1A ''and'':9A ''ashes'':11A ''back'':8A ''for'':4A ''hips'':10A ''low'':7A ''minute'':2A ''neck'':5A ''shoulders'':6A ''yoga'':3A,12A', '2020-07-24 09:35:30.307792', '2020-07-24 09:35:30.307792');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18242, 'XxFw9lvu2H45XsX14D379cyE2_k', 'P2u5yjWoFKQ', NULL, '{"publishedAt":"2020-04-14T08:00:11Z","channelId":"UCxXSonb3zhnlI-MGcD3eotw","title":"Live Lockdown Yoga Class | Yoga for BJJ | Stay At Home Yoga","description":"Here is the full body flow class from the live session Sebastian did on Easter monday. We have more flow classes available at www.yogafrobjj.net \nThis is a full body yoga flow and is a great class to use on a day off, as a warm up before training or a cooldown for after. Stretching tight muscles and sore areas feels amazing and will help you as an athlete. If you have any questions please leave them in the comments.\n\n\nYoga for BJJ is designed to help people improve themselves on and off the mats. Using yoga specific stretches and flows that are relevant to jiu jitsu to help you increase your flexibility, rate of motion, balance and injury prevention. \nWhether you are grappling once or twice a week or a full time athlete we like to make sure we have videos for everyone so if you need the complete startup program or our \"yoga for rocks\" program or even our yoga for 40+ series we have it waiting for you.\n\nWe offer 300+ videos organized into programs. They include tutorials and they cover all of those areas that grapplers need to work on the most. Stiffness in the lower back, hips, hamstring, shoulders, neck, legs... can all be a thing of the past.\n\nWe don''t offer magical results, but feedback from 1000+ members and our experience makes us confident that you can extend your career on the mats with consistent yoga practice.\n\nTry one of the free classes on our channel then head over to www.yogaforbjj.net and sign up to unlock video programs specific to your needs and start improving yourself today.\n\nNew videos every week for grapplers that want to optimize the body for BJJ and life!\n- Train smart - Fight Forever","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/P2u5yjWoFKQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/P2u5yjWoFKQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/P2u5yjWoFKQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/P2u5yjWoFKQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/P2u5yjWoFKQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga for BJJ","tags":["yoga for bjj","yoga for jiu jitsu","jiu jitsu stretches","free yoga class","free yoga","full body yoga","yoga for stress","yoga for relaxing","jiu jitsu","bjj","stretch","jiu jitsu workout","bjj workout","bjj warm up","bjj cooldown","yoga for men","yoga for athletes","yoga for athletes beginners","yoga for athletes hips","athletes stretch","athletes stretching","good stretches for athletes","lockdown yoga","stay at home yoga","home yoga","lockdown","brazilian jiu-jitsu","range of motion"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Live Lockdown Yoga Class | Yoga for BJJ | Stay At Home Yoga","description":"Here is the full body flow class from the live session Sebastian did on Easter monday. We have more flow classes available at www.yogafrobjj.net \nThis is a full body yoga flow and is a great class to use on a day off, as a warm up before training or a cooldown for after. Stretching tight muscles and sore areas feels amazing and will help you as an athlete. If you have any questions please leave them in the comments.\n\n\nYoga for BJJ is designed to help people improve themselves on and off the mats. Using yoga specific stretches and flows that are relevant to jiu jitsu to help you increase your flexibility, rate of motion, balance and injury prevention. \nWhether you are grappling once or twice a week or a full time athlete we like to make sure we have videos for everyone so if you need the complete startup program or our \"yoga for rocks\" program or even our yoga for 40+ series we have it waiting for you.\n\nWe offer 300+ videos organized into programs. They include tutorials and they cover all of those areas that grapplers need to work on the most. Stiffness in the lower back, hips, hamstring, shoulders, neck, legs... can all be a thing of the past.\n\nWe don''t offer magical results, but feedback from 1000+ members and our experience makes us confident that you can extend your career on the mats with consistent yoga practice.\n\nTry one of the free classes on our channel then head over to www.yogaforbjj.net and sign up to unlock video programs specific to your needs and start improving yourself today.\n\nNew videos every week for grapplers that want to optimize the body for BJJ and life!\n- Train smart - Fight Forever"}}', '{"duration":"PT37M46S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"7315","likeCount":"235","dislikeCount":"1","favoriteCount":"0","commentCount":"39"}', '''at'':9A ''bjj'':7A ''class'':4A ''for'':6A ''home'':10A ''live'':1A ''lockdown'':2A ''stay'':8A ''yoga'':3A,5A,11A', '2020-07-24 09:35:30.307792', '2020-07-24 09:35:30.307792');
