INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18247, 'nW8tThg6VTbaJI-1Il3ZFGckHm0', 'N27fH-iwcYo', NULL, '{"publishedAt":"2020-05-25T16:12:42Z","channelId":"UCyGbd8ODqBvlfiRdxZJGhfw","title":"VinYin Yoga Class - 1 Hour - Recorded Live 5/24/2020","description":"VinYin Yoga Class - This first half of this class you can expect to move dynamically as we breathe and flow. The second half, we slow down and find deep release as we hold poses in a yin style. \n\nPlease excuse the sound quality as this video was recorded during a live Zoom class.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/N27fH-iwcYo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/N27fH-iwcYo/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/N27fH-iwcYo/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/N27fH-iwcYo/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/N27fH-iwcYo/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Temper Yoga","tags":["iMovie","VinYin Yoga","Vinyasa Yoga","Yoga Class"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"VinYin Yoga Class - 1 Hour - Recorded Live 5/24/2020","description":"VinYin Yoga Class - This first half of this class you can expect to move dynamically as we breathe and flow. The second half, we slow down and find deep release as we hold poses in a yin style. \n\nPlease excuse the sound quality as this video was recorded during a live Zoom class."}}', '{"duration":"PT52M56S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"18","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''1'':4A ''5/24/2020'':8A ''class'':3A ''hour'':5A ''live'':7A ''recorded'':6A ''vinyin'':1A ''yoga'':2A', '2020-07-24 09:35