INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18248, 'hJyHZce33ZwQpDpk7sOMDfIV0Ds', 'FblpQ7QH47I', NULL, '{"publishedAt":"2020-07-08T11:15:00Z","channelId":"UCcox27Gc-NGbb2-X9hdLaMw","title":"Hatha Yoga For Weight Loss (45-min)","description":"Hatha yoga for weight loss is a 45 minute flow that will get you in touch with your body. For another great hatha yoga flow click here https://www.youtube.com/watch?v=bkbtXQrUl_w&list=PLEs9dX8UXFZoeOphyszV_ZS6vl9afIXjU&index=2\n\n45 Minute Hatha playlist here https://www.youtube.com/playlist?list=PLEs9dX8UXFZoeOphyszV_ZS6vl9afIXjU\n\nGet extra strength to perform yoga poses you never thought possible by strengthening your core by clicking here  https://www.myyogapal.com/core-sign-up and see how I started youtube https://www.youtube.com/watch?v=N6PyK19jPas&t=5s \n\nTo try MyYogaPal for 7 days for just $1 click here https://www.myyogapal.com/offers/H5VRN4Sj\n\n#45minutehathayoga #45minuteyoga #fightmasteryoga\n\nIf you want to feel better in your body this is the channel for you. Because when you practice yoga you feel better!\n\nDon''t worry if you''re not flexible or can''t do the poses perfectly. The motto of Fightmaster Yoga is \"It''s not about the pose\". You don''t have to be perfect.\n\nAll you have to do is show up. When you make the decision to take care of yourself, all sorts of amazing things begin to happen. You have more energy. You become more patient. Your outlook on life becomes more positive. And all of these changes you will experience in this yoga journey will begin to affect those around you in ways you never dreamed possible. \n\nThis practice can bring a loving, positive energy that will spread throughout your world. And as you deepen your yoga practice you will have the opportunity to meet many like minded souls like yourself who are also laying down their mat and doing the work. \n\nConsider subscribing to this channel a