INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18250, 'yqi_OYpBb5xGfYy64ZTk0zUL4WQ', 's0WCKQ3VXTM', NULL, '{"publishedAt":"2020-06-21T06:01:56Z","channelId":"UCvccWZV7XYNIW7DdlNFYfVw","title":"30-minute WAKE ME UP Yoga (any time of the day) I Nourishing & Revitalising","description":"This 30-minute yoga practice is perfect for when you first wake up - or for when you need a little wake-up any time of day! \n\nStart your day off right with intention, efficient movement, and mindful breath work. It will gently awaken your body, improve your energy and focus your mind.\n\nIt''s also a great way to take time out to re-focus, get moving and feel rejuvenated! You can do this practice anytime and anywhere.\n\nMove, breathe, enjoy! Have a sip of water before we start, hop on your mat and lets flow! \n\nNamaste.\nElise\n\nInstagram: @elise_rousse\nFacebook: Yoga with Elise - Brussels\nwebsite: www.eliserousse.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/s0WCKQ3VXTM/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/s0WCKQ3VXTM/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/s0WCKQ3VXTM/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/s0WCKQ3VXTM/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/s0WCKQ3VXTM/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Elise Rousse","tags":["Brussels Yoga loft","gentle yoga","morning yoga","wake me up yoga","pick me up yoga","energising yoga","nourishing yoga","any time yoga"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"30-minute WAKE ME UP Yoga (any time of the day) I Nourishing & Revitalising","description":"This 30-minute yoga practice is perfect for when you first wake up - or for when you need a little wake-up any time of day! \n\nStart your day off right with intention, efficient movement, and mindful breath work. It will gently awaken your body, improve your energy and focus your mind.\n\nIt''s also a great way to take time out to re-focus, get moving and feel rejuvenated! You can do this practice anytime and anywhere.\n\nMove, breathe, enjoy! Have a sip of water before we start, hop on your mat and lets flow! \n\nNamaste.\nElise\n\nInstagram: @elise_rousse\nFacebook: Yoga with Elise - Brussels\nwebsite: www.eliserousse.com"},"defaultAudioLanguage":"en"}', '{"duration":"PT30M55S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"102","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''30'':1A ''any'':7A ''day'':11A ''i'':12A ''me'':4A ''minute'':2A ''nourishing'':13A ''of'':9A ''revitalising'':14A ''the'':10A ''time'':8A ''up'':5A ''wake'':3A ''yoga'':6A', '2020-07-24 09:35:30.307792', '2020-07-24 09:35:30.307792');
