ence"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"20 min Shoulder and Chest Opening Yoga","description":"This 20 minute Yoga Class for upper body is going to be fully targeted on releasing tension and stiffness in the neck, shoulders, chest and upper back. \n\nThis class is suitable for all levels, and is an excellent sequence if you are someone that spends a lot of time seated, driving, or carry tension in the upper body and shoulders. \n\nMake sure you comment below and let me know what you thought, and drop me any requests you would like to see! Yoga videos are released weekly and I would much rather make the sequence that you guys want! \n\nInstagram: https://www.instagram.com/julesyoga_/\nFacebook: https://www.facebook.com/Jules-Yoga-114163706953056"}}', '{"duration":"PT23M18S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"14","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''20'':1A ''and'':4A ''chest'':5A ''min'':2A ''opening'':6A ''shoulder'':3A ''yoga'':7A', '2020-07-24 09:35:30.307792', '2020-07-24 09:35:30.307792');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18257, 'Fcq4bGYzNJWKj4b83q7a9fetgUA', 'sqUYHsgOEv8', NULL, '{"publishedAt":"2015-06-23T21:18:02Z","channelId":"UCHzCYIqj11wguf-Gfq8YhpQ","title":"Yoga To Release Neck & Shoulder Tension | 15 Min Yoga for Neck Pain and Headache Relief","description":"Yoga To Release Neck & Shoulder Tension | 15 Min Yoga for Neck Pain and Headache Relief \n JOIN MY YOGA HABIT: https://chriskayoga.vhx.tv/\n\n\n TONS OF YOGA RESOURCES: https://www.chriskayoga.com/\n JOIN MY YOGA HABIT: https://chriskayoga.vhx.tv/\n\nHi! I''m Christina, and welcome to my yoga YouTube channel, ChriskaYoga! Today I''ll be sharing a 15 minute yoga sequence to release neck and shoulder tension. This is great for after a long day of sitting at a computer or at a desk. It''s also great if you''re really stressed out and looking to reduce the tension you hold in your neck and shoulder area. As usual, please practice with caution. \n\nI hope you enjoy it! Thank you so much for watching! :)\n\n\nMake Yoga A Habit In Your Life:  https://chriskayoga.vhx.tv/  \n\n \n Don''t forget to subscribe for more yoga classes every Monday & Wednesday! \n \n SUBSCRIBE: http://bit.ly/ChriskaYoga  \n \n VISIT MY WEBSITE: http://chriskayoga.com\n \n  S T A Y  I N  T O U C H   \n INSTAGRAM:  http://bit.ly/ChriskaYogaOnInstagram\n FACEBOOK:  http://bit.ly/ChriskaYogaOnFacebook\n PINTEREST:  http://bit.ly/ChriskaYogaOnPinterest\n TWITTER: http://bit.ly/ChriskaYogaOnTwitter\n \n E Q U I P M E N T   I   U S E: \n  Yoga Mat: http://amzn.to/2iEtO39\n Camera: http://amzn.to/2uRdK7x\n Sound Recorder: http://amzn.to/2lPXsXe\n Lavalier Mic: http://amzn.to/2l8gSIi\n Lighting Kit: http://amzn.to/2j7gKqr\n Foam Yoga Blocks: http://amzn.to/2occ4yp\n Cork Yoga Block: http://amzn.to/2pTkKym\n Yoga Blanket: http://amzn.to/2o9VH6e\n Yoga Strap: http://amzn.to/2qsh9IH\n Yoga Bolster: http://amzn.to/2qbK8Mf\n \n YOGA CHALL