INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18259, 'sD_a2P6o0BblaCiThXMLq6Q8P8s', 'jAVzK9pSCZU', NULL, '{"publishedAt":"2020-06-21T22:08:55Z","channelId":"UCtYdInxenGGNOCxWoA3ITTQ","title":"45 min Hip Opening LIVE Yoga Class || For Tight Hips & Hamstrings | Beginner Friendly","description":"Hello and welcome to this 45 min LIVE Hip Opening Yoga Sequence! This video was streamed on June 21th 2020 on international yoga day (and had to be edited due to Wifi issues; the audio quality is suffering a bit too, so sorry about that).\n\nJoin my weekly online classes here: https://www.eversports.at/scl/nathali...\n\n HAPPY INTERNATIONAL YOGA DAY \n\nIn this mindful hip opening yoga practice we will focus on releasing any stress and tension in our lower body, keep our awareness on our breath & work on our flexibility as well! \nI will slowly walk you through the different poses and guide you through the yoga practice. If you need a break, feel free to pause at any time and focus on your breathing. Your breath is always your anchor. Find synchronicity in your movement and breath. Don''t push yourself and always listen to your body!\n\n                            \n\nMy name is Nathalie, I am a certified yoga teacher, traveler and self-love advocate. My vision is to inspire human souls to fall in love with themselves while practicing and teaching some yoga along the way. Thank you for tuning in and I really hope you enjoy this practice!\n#liveyogaclass #hipopeningyoga #yogafortighthips #yogatoreleasetension #beginneryoga #yogaforbackpain #yogaflow #yogatutorial #yogaforeverybody \n\n                           \n \nInstagram: https://www.instagram.com/nathalieshanti \nFacebook: https://www.facebook.com/nathalieshan...\nWebsite: https://www.yogatoglow.com \nE-Mail: nathalie@yogatoglow.com \n#yogavideo #yogamovements #yogaflows #homepractice #yogatoglow\n\nMy mat is from https://eu.manduka.com/    I practice on the eKO lite 4mm mat in the color Charcoal. You can use my code NATHALIESHANTI for 10% off their products! #manduka #ad\n\n                            \n\nDisclaimer - Always listen to your body and never force yourself to perform any kind of yoga pose. It''s best to always consult your doctor before starting any kind of new exercise regime or yoga program. All forms of physical exercises can possibly lead to injuries. By performing and using my videos (Nathalie Shanti), you are aware of the risks and take full responsibility for any injuries, which might be connected to any the videos I am posting.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/jAVzK9pSCZU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/jAVzK9pSCZU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/jAVzK9pSCZU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/jAVzK9pSCZU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/jAVzK9pSCZU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Nathalie Shanti","tags":["yoga","liveyoga","yoga for beginners","yoga for tight hips","hip opening yoga","hip opening","live yoga class","live yoga stream","hip release yoga","flexibility","increase flexibility","gain flexibility","get flexible yoga","yoga flexible","yoga for splits","learn splits","train for splits","yoga hip opening","hip opening flow","hip openers","yog for hips","hip yoga","yoga for stress","yoga for beginner","beginner yoga","live yoga flow","yoga for hips and hamstrings","hamstring yoga","hips release"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"45 min Hip Opening LIVE Yoga Class || For Tight Hips & Hamstrings | Beginner Friendly","description":"Hello and welcome to this 45 min LIVE Hip Opening Yoga Sequence! This video was streamed on June 21th 2020 on international yoga day (and had to be edited due to Wifi issues; the audio quality is suffering a bit too, so sorry about that).\n\nJoin my weekly online classes here: https://www.eversports.at/scl/nathali...\n\n HAPPY INTERNATIONAL YOGA DAY \n\nIn this mindful hip opening yoga practice we will focus on releasing any stress and tension in our lower body, keep our awareness on our breath & work on our flexibility as well! \nI will slowly walk you through the different poses and guide you through the yoga practice. If you need a break, feel free to pause at any time and focus on your breathing. Your breath is always your anchor. Find synchronicity in your movement and breath. Don''t push yourself and always listen to your body!\n\n                            \n\nMy name is Nathalie, I am a certified yoga teacher, traveler and self-love advocate. My vision is to inspire human souls to fall in love with themselves while practicing and teaching some yoga along the way. Thank you for tuning in and I really hope you enjoy this practice!\n#liveyogaclass #hipopeningyoga #yogafortighthips #yogatoreleasetension #beginneryoga #yogaforbackpain #yogaflow #yogatutorial #yogaforeverybody \n\n                           \n \nInstagram: https://www.instagram.com/nathalieshanti \nFacebook: https://www.facebook.com/nathalieshan...\nWebsite: https://www.yogatoglow.com \nE-Mail: nathalie@yogatoglow.com \n#yogavideo #yogamovements #yogaflows #homepractice #yogatoglow\n\nMy mat is from https://eu.manduka.com/    I practice on the eKO lite 4mm mat in the color Charcoal. You can use my code NATHALIESHANTI for 10% off their products! #manduka #ad\n\n                            \n\nDisclaimer - Always listen to your body and never force yourself to perform any kind of yoga pose. It''s best to always consult your doctor before starting any kind of new exercise regime or yoga program. All forms of physical exercises can possibly lead to injuries. By performing and using my videos (Nathalie Shanti), you are aware of the risks and take full responsibility for any injuries, which might be connected to any the videos I am posting."},"defaultAudioLanguage":"en-US"}', '{"duration":"PT51M13S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"213","likeCount":"4","dislikeCount":"1","favoriteCount":"0","commentCount":"3"}', '''45'':1A ''beginner'':12A ''class'':7A ''for'':8A ''friendly'':13A ''hamstrings'':11A ''hip'':3A ''hips'':10A ''live'':5A ''min'':2A ''opening'':4A ''tight'':9A ''yoga'':6A', '2020-07-24 09:35:30.307792', '2020-07-24 09:35:30.307792');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18260, 'aVuDJLtTBnxw59iI7kTef9bGVtc', '-LHKmsbrUfE', NULL, '{"publishedAt":"2020-07-20T16:38:50Z","channelId":"UC2XNpyFeGhepfNX9EF_ji5w","title":"GENTLE WAKE UP FLOW // 30 min Hatha Morning Flow Yoga Class","description":"This is a 30-min gentle morning yoga sequence. The postures are simple, the movements are slow  perfect for when you have just woken up and need a relaxing and at the same time energizing start into your day. \n\nThis practice is suitable for all levels of practitioners. Move with full awareness through the whole practice. \n\nSee you on the mat my beautiful yoga friends. Have a beautiful day. \nJanice \n\n-----\n Check out my playlists on Spotify if you like to be accompanied by music during your yoga practice: https://open.spotify.com/user/1214995... \n(for this class I would recommend RSS  Relax Slow Sad, Yin or even my Savasana-Playlist)\n\n-----\nIf you enjoyed the practice leave a like, a comment and subscribe to my channel. \nYou can also support me by leaving a donation: https://paypal.me/janiceallermannyoga?locale.x=de_DE \n\nShare the good vibes  \n\n\nAlso check out my other platforms: \nWeb: https://www.cominghometoyourself.net/\nInstagram: https://www.instagram.com/janice_allermann/ \nFacebook: https://www.facebook.com/janiceallermannyoga/ \n\n-----\nYoga means to me? ''coming home to yourself''\nSelf-sensitivity. Developing awareness and thereby a feeling for oneself  for the body, thoughts and emotions  recognising ones own needs and giving them space.\nChange of perspective. Instead of looking outwards, looking inwards  reviewing expectations (ones own and those of others)  discovering what matters most in life.\nSelf-love. Accepting oneself  getting in touch with ones own life-themes  developing a loving attitude towards oneself and others.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/-LHKmsbrUfE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/-LHKmsbrUfE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/-LHKmsbrUfE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/-LHKmsbrUfE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/-LHKmsbrUfE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Janice Allermann Yoga","tags":["yoga","yoga flow","yoga class","30 min yoga class","30 min yoga flow","30 min morning yoga","30 min morning yoga flow","hatha","hatha flow","slow flow","flow","mindful yoga flow","gentle yoga flow","calm yoga flow","morning yoga practice","yoga practice","Janice Allermann","Janice Allermann yoga","coming home to yourself"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"GENTLE WAKE UP FLOW // 30 min Hatha Morning Flow Yoga Class","description":"This is a 30-min gentle morning yoga sequence. The postures are simple, the movements are slow  perfect for when you have just woken up and need a relaxing and at the same time energizing start into your day. \n\nThis practice is suitable for all levels of practitioners. Move with full awareness through the whole practice. \n\nSee you on the mat my beautiful yoga friends. Have a beautiful day. \nJanice \n\n-----\n Check out my playlists on Spotify if you like to be accompanied by music during your yoga practice: https://open.spotify.com/user/1214995... \n(for this class I would recommend RSS  Relax Slow Sad, Yin or even my Savasana-Playlist)\n\n-----\nIf you enjoyed the practice leave a like, a comment and subscribe to my channel. \nYou can also support me by leaving a donation: https://paypal.me/janiceallermannyoga?locale.x=de_DE \n\nShare the good vibes  \n\n\nAlso check out my other platforms: \nWeb: https://www.cominghometoyourself.net/\nInstagram: https://www.instagram.com/janice_allermann/ \nFacebook: https://www.facebook.com/janiceallermannyoga/ \n\n-----\nYoga means to me? ''coming home to yourself''\nSelf-sensitivity. Developing awareness and thereby a feeling for oneself  for the body, thoughts and emotions  recognising ones own needs and giving them space.\nChange of perspective. Instead of looking outwards, looking inwards  reviewing expectations (ones own and those of others)  discovering what matters most in life.\nSelf-love. Accepting oneself  getting in touch with ones own life-themes  developing a loving attitude towards oneself and others."}}', '{"duration":"PT35M8S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"41","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"5"}', '''30'':5A ''class'':11A ''flow'':4A,9A ''gentle'':1A ''hatha'':7A ''min'':6A ''morning'':8A ''up'':3A ''wake'':2A ''yoga'':10A', '2020-07-24 09:35:30.307792', '2020-07-24 09:35:30.307792');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18262, '4FYErfBrbKBZl_6gwTcIBSnqbtY', 'OIO2bmhIOjE', NULL, '{"publishedAt":"2020-07-22T11:00:07Z","channelId":"UCARaEaUjNIzpbXkm9ZTxfMw","title":"20 Minute Deep Hip Opening Yoga Practice | Yoga With Alina","description":"20 minute deep hip opening yoga practice is the class that has all the best and the most functional hip openers a yoga class can offer.\n\nThis hip opening flow features hip opening exercises and hip opening stretches that create change not only in the body, but also in the mind, allowing for an emotional release and the feeling of deep relaxation after the practice, which yoga for hips is known for.\n\nHip opening yoga practice includes all levels of hip stretches. The class begins with gentle hip opening flow and gradually progresses into deeper hip opening yoga asanas as your body begins to open up.\n\nWhether you are looking for yoga for flexibility or yoga for tight hips this 20 minute yoga practice is the answer. The flow is accessible for all level practitioners. Props are optional, but recommended for you to get the most out of the practice. If you feel unsure about how to use props, check out tutorials about how to use blocks for beginners (https://www.youtube.com/watch?v=J5uK3kKnbVY&t=20s) and how to use block for intermediate and advanced practitioners (https://www.youtube.com/watch?v=0VYUnJtW950)\n\nFind a comfortable place, roll out your mat, set an intention and get flowing through this 20 minute yoga class and get ready to feel your best!\n\nINSTAGRAM for daily yoga inspiration: https://www.instagram.com/allie_alina/\nSPACE https://amperstudios.com \n\nP.S. For more information about what to expect from the flow, check out this deep hip opening sequence in the pinned comment below.\n\n#Yoga #Stretch #Hips","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/OIO2bmhIOjE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/OIO2bmhIOjE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/OIO2bmhIOjE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/OIO2bmhIOjE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/OIO2bmhIOjE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga With Alina","tags":["hip openers","hip opening","yoga for hips","yoga for hip flexibility","deep hip opening","gentle hip opening","yoga for flexibility","yoga for tight hips","20 minute yoga","hip opening yoga","yoga hip openers","yoga hips","sarah beth yoga","20 minute yoga practice","20 minute yoga practice hip opening","hip opening yoga practice","sarahbethyoga flexibility","hip opening stretches","hip opening flow","hip opening exercises","deep hip opening sequence","hip yoga","hip stretches","yoga practice"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"20 Minute Deep Hip Opening Yoga Practice | Yoga With Alina","description":"20 minute deep hip opening yoga practice is the class that has all the best and the most functional hip openers a yoga class can offer.\n\nThis hip opening flow features hip opening exercises and hip opening stretches that create change not only in the body, but also in the mind, allowing for an emotional release and the feeling of deep relaxation after the practice, which yoga for hips is known for.\n\nHip opening yoga practice includes all levels of hip stretches. The class begins with gentle hip opening flow and gradually progresses into deeper hip opening yoga asanas as your body begins to open up.\n\nWhether you are looking for yoga for flexibility or yoga for tight hips this 20 minute yoga practice is the answer. The flow is accessible for all level practitioners. Props are optional, but recommended for you to get the most out of the practice. If you feel unsure about how to use props, check out tutorials about how to use blocks for beginners (https://www.youtube.com/watch?v=J5uK3kKnbVY&t=20s) and how to use block for intermediate and advanced practitioners (https://www.youtube.com/watch?v=0VYUnJtW950)\n\nFind a comfortable place, roll out your mat, set an intention and get flowing through this 20 minute yoga class and get ready to feel your best!\n\nINSTAGRAM for daily yoga inspiration: https://www.instagram.com/allie_alina/\nSPACE https://amperstudios.com \n\nP.S. For more information about what to expect from the flow, check out this deep hip opening sequence in the pinned comment below.\n\n#Yoga #Stretch #Hips"},"defaultAudioLanguage":"en-US"}', '{"duration":"PT20M53S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"84","likeCount":"5","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''20'':1A ''alina'':10A ''deep'':3A ''hip'':4A ''minute'':2A ''opening'':5A ''practice'':7A ''with'':9A ''yoga'':6A,8A', '2020-07-24 09:35:32.256802', '2020-07-24 09:35:32.256802');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18263, 'kLh1W9_l2jyXYPFMZPVHthrlfEg', 'JZ2_e0JW10I', NULL, '{"publishedAt":"2017-07-27T19:29:41Z","channelId":"UCrtTMWDx4u1dVKMpXNhjwpA","title":"Flow in the Forest Yoga Class - Five Parks Yoga","description":"This is an interesting yoga flow, which builds upon itself throughout the length of class. Some yoga experience is recommended since it requires you to move around on your mat a lot and offers a wide variety of postures. Enjoy this time in the woods with me!\n\nWant to help support Five Parks Yoga create even more classes? Consider becoming a supporter at: \nhttps://FiveParksYoga.com/Support \n\nUp for a challenge? This yoga class is a part of our 30 Days of Traveling Flow Yoga Series! Be sure to check out all of our free 30-day Yoga Challenges at https://FiveParksYoga.com/Challenges\n\n#yoga #homeyoga #30dayYogaChallenge #yogatravel\n\nYoga Instructor: Erin Sampson\nLocation: Sedalia, Colorado\n\nVisit us Online: http://FiveParksYoga.com\nFollow us on Facebook: https://www.facebook.com/FiveParksYoga\nFollow us on Instagram: https://www.instagram.com/fiveparksyoga/\n\nDo you have a class request for Erin? Let her know!\nhttp://fiveparksyoga.com/classrequest/\n\nInterested in a Yoga Retreat to Costa Rica? \nLearn More: http://fiveparksyoga.com/yoga-retreats/\n\nWant to know Erin''s favorite Yoga Mat? Favorite Yoga Pants?\nhttp://fiveparksyoga.com/reviews/\n\nProduced by Tamarindo Films: http://tamarindofilms.com/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/JZ2_e0JW10I/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/JZ2_e0JW10I/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/JZ2_e0JW10I/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/JZ2_e0JW10I/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/JZ