INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18264, 'E7XpH2A_fL-zQ_H8-0WvlKgdOGg', 'HaNhQXMETQ4', NULL, '{"publishedAt":"2020-03-28T07:02:01Z","channelId":"UCM-2bczOrmeHz5Jdu_SF-Sg","title":"Hatha Yoga  | Strength & Detox (Full 1 Hour Class)","description":"This class is designed (as the title suggests) to strengthen the body and to detox the organs through twisting asanas and deep breathing. This class is an all levels practice that can be done from the comfort of your home. \n\nWhat you are recommended to have for this practice:\n1) Yoga mat (or carpet/any comfortable surface)\n2) Block (or a thick book)\n3) Strap (or just use the modifications offered)\n4) Blanket (just to be a little more warm/cozy at the end during relaxation, Savasana)\n5) Pillow (to sit on during seated postures if you have lower back issues)\n6) Gratitude (well... because we can always find something to be grateful for)","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/HaNhQXMETQ4/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/HaNhQXMETQ4/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/HaNhQXMETQ4/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/HaNhQXMETQ4/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/HaNhQXMETQ4/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Nicole Morrissey","tags":["free yoga","hatha yoga","free yoga class","yoga detox","yoga for strength"],"categoryId":"24","liveBroadcastContent":"none","localized":{"title":"Hatha Yoga  | Strength & Detox (Full 1 Hour Class)","description":"This class is designed (as the title suggests) to strengthen the body and to detox the organs through twisting asanas and deep breathing. This class is an all levels practice that can be done from the comfort of your home. \n\nWhat you are recommended to have for this practice:\n1) Yoga mat (or carpet/any comfortable surface)\n2) Block (or a thick book)\n3) Strap (or just use the modifications offered)\n4) Blanket (just to be a little more warm/cozy at the end during relaxation, Savasana)\n5) Pillow (to sit on during seated postures if you have lower back issues)\n6) Gratitude (well... because we can always find something to be grateful for)"},"defaultAudioLanguage":"en-CA"}', '{"duration":"PT1H9M4S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"106","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''1'':6A ''class'':8A ''detox'':4A ''full'':5A ''hatha'':1A ''hour'':7A ''strength'':3A ''yoga'':2A', '2020-07-24 09:35:32.256802', '2020-07-24 09:35:32.256802');
