INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18267, 'G2CE8LdZbL3cVMfbRpWJdjhTZz0', 'jVJuF9qsYg8', NULL, '{"publishedAt":"2018-11-14T13:32:16Z","channelId":"UCn8Nn4x4kVKI9Y4VpVwGZAA","title":"Yoga Flow for Autumn, Benefiting the Lungs & Large Intestines, 30 min","description":"The Lungs are the major organs for breathing.  In Chinese Medicine, they are paired with the excretion system of the Large Intestine.  Without getting to geeky here, both are responsible for taking in the good and releasing the unneeded.  \n\nThis yoga practice includes some Chinese Medicine sound healing to relieve any stagnation or built-up emotions in the lungs (like grief, sadness, or depression) while balancing the meridians that influence the lungs and large intestine.  \n\nThis practice will help to relieve grief and depression while improving lung function and healthy elimination.  For those who feel balanced already, this practice will help to strengthen the lung system and bringing more centering and balance during Autumn.\n\nNote: This practice is not prescriptive in nature.  Nor do the comments or descriptions act as any medical advice or treatment.  Practice mindfully and with discernment.   Most importantly, remember YOU ARE AMAZING and BE KIND TO YOURSELF.  \n\nFollow me on IG @AlohaAcuYogi or contact me on my website at www.qiandprana.com\n\nFrom my heart to yours, \nAloha & Namaste","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/jVJuF9qsYg8/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/jVJuF9qsYg8/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/jVJuF9qsYg8/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/jVJuF9qsYg8/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/jVJuF9qsYg8/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Qi & Prana - Yoga with Haunani","tags":["yoga","asana","yoga for autumn","seasonal yoga","seasonal wisdom","ayurveda","chinese medicine","sound healing","yoga for grief","yoga for depression","yoga for asthma","yoga for allergies","yoga for digestion","yoga for recovery","yoga for better breathing","boost lung qi","large intestine meridians","lung meridians","yoga for health","meridians and yoga","healing yoga","yoga for healing","live your yoga","yoga for yoga teachers","yoga heals","meridian yoga"],"categoryId":"27","liveBroadcastContent":"none","defaultLanguage":"en","localized":{"title":"Yoga Flow for Autumn, Benefiting the Lungs & Large Intestines, 30 min","description":"The Lungs are the major organs for breathing.  In Chinese Medicine, they are paired with the excretion system of the Large Intestine.  Without getting to geeky here, both are responsible for taking in the good and releasing the unneeded.  \n\nThis yoga practice includes some Chinese Medicine sound healing to relieve any stagnation or built-up emotions in the lungs (like grief, sadness, or depression) while balancing the meridians that influence the lungs and large intestine.  \n\nThis practice will help to relieve grief and depression while improving lung function and healthy elimination.  For those who feel balanced already, this practice will help to strengthen the lung system and bringing more centering and balance during Autumn.\n\nNote: This practice is not prescriptive in nature.  Nor do the comments or descriptions act as any medical advice or treatment.  Practice mindfully and with discernment.   Most importantly, remember YOU ARE AMAZING and BE KIND TO YOURSELF.  \n\nFollow me on IG @AlohaAcuYogi or contact me on my website at www.qiandprana.com\n\nFrom my heart to yours, \nAloha & Namaste"}}', '{"duration":"PT31M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"293","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''30'':10A ''autumn'':4A ''benefiting'':5A ''flow'':2A ''for'':3A ''intestines'':9A ''large'':8A ''lungs'':7A ''min'':11A ''the'':6A ''yoga'':1A', '2020-07-24 09:35:32.256802', '2020-07-24 09:35:32.256802');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18268, '54a2u5n1QXFC2wg8nzXcHM_rJIQ', '21u9a7bdPfI', NULL, '{"publishedAt":"2020-07-03T10:00:01Z","channelId":"UC2AWbik5F3fEkNln-CCW5qQ","title":"45 Min Yoga Flow [ Total Body Workout ] Awaken, Build Heat & Energy","description":"This 45 min total body yoga flow will slowly awaken your full body,  back muscles, hips, hamstrings, as you connect to your breath & sensations. And the slowly we build up the pace to cultivate lots of heat & energy moving through our vinyasas. \nYou will strengthen your core, arms, glutes & legs . Your whole body will be engaged, lengthened , energized & most likely you will break a sweat. \n\n NEW !!  ROADTOSPLITS Yoga Program http://bit.ly/exclusivegayatriyoga\n NEW !!  TONE+BURN+SCULPT  Yoga Workouts - http://bit.ly/beachreadyin30days \n  30 Day  ROADTOBLISS Yoga Challenge - https://bit.ly/roadtobliss \n\n\n  FREE 24 Day Weight Loss HIIT Program  https://bit.ly/24dayweightloss (share with friends too!)\n Support & subscribe for MORE FREE yoga each week :  http://bit.ly/gayatriyogachannel  \n\n  S U P P O R T   M Y   W O R K:\n\n  DONATE https://www.paypal.me/gayatriyoga\n\n\n\n\n\n\n\n\n #yoga #gayatriyoga #yogaworkout\n\n___________________________\n\n Leave me a like  &  comment !!! \n\n___________________________\n\n\n // A B O U T   I N S T R U C T O R\n\nHi yogi, my name is Kristina. I''m a 200h certified yoga teacher,  Equinox Pilates MAT Certified trainer,  I have continuing education hours in Yin Yoga & Anatomy Trains {Fascia} (by Tom Myers). \n\nI constantly educate myself on anatomy & physiology to deliver to you safe effective workouts .\n\nGayatri Yoga offers versatile intelligently sequenced & clearly instructed yoga flows that are accessible to any level of yoga practitioner, be it beginner, intermediate or advanced. \n\nWith over 120 FREE online yoga classes you will find suitable for any level easy to follow along yoga flows. With these free home yoga workouts you will build strength & flexibility, tone legs, abs, arms, release any upperback tension or back pain,  sciatica or pregnancy back pain & more.\n\nEither you are looking for an easy morning yoga flow, power yoga flow,  may be 1 hour total body workout or gentle bedtime yoga stretches you can find it all here. \n\n___________________________\n\n// W A T C H  M O R E \n\n  If you enjoyed this yoga class, find more like this here | http://bit.ly/1hourgayatriyoga\n\n___________________________\n\n\n//  F O L L O W \n\n instagram | http://instagram.com/_kristinamatskevich\n facebook | http://facebook.com/gayatriyogaco\n twitter | http://twitter.com/gayatriyogaco\n pinterest | http://pinterest.com/gayatriyogaco\n\n___________________________\n\n// D I S C L A I M E R\n\n All information is for educational purposes only. Please consult your doctor about participating in any activities suggested in Gayatri Yoga videos. You should be in good physical condition and be able to participate in the exercise without a guidance of a personal instructor. By taking part in these activities you acknowledge the risk of testing your mental & physical limits, which carries the potential for injury. By proceeding to participate in the activities presented in the video you represent & warrant that you are physically fit & have no medical condition that would prevent your full participation in the activity. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume full responsibility for all & any risks , injuries to yourself, damages, known or unknown,  and agree to release and discharge.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/21u9a7bdPfI/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/21u9a7bdPfI/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/21u9