INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18335, 'goI1LzSqT-9TE8Xwj4jBqfKfNL4', 'V2CO7X7Mi2c', NULL, '{"publishedAt":"2020-07-01T05:00:04Z","channelId":"UCTe8ABP94FZadBA-TgpKKzA","title":"1 hour Intermediate Vinyasa Flow Yoga | 60 minutes | Yoga with Ailsa","description":"1 hour Intermediate Vinyasa Flow Yoga.  This 60 minute yoga class is suitable for anyone who has been practising yoga for a wee while.  This yoga sequence will energise you whilst calming the mind and relaxing the body.  I hope you enjoy!\n\n#vinyasayoga #vinyasaflow #intermediateyoga\n\n~  f i n d m e  ~ \n\ninstagram | https://www.instagram.com/ailsaburns/ \nfacebook | https://www.facebook.com/yogawithailsa\nmy website | https://www.frostedfeather.com/ \n\n~  a b o u t m e  ~ \n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. My channel is the place for longer yoga classes (30min, 45min and 60min). I also record guided meditations and Yoga Nidra as well as videos where we discuss everything to do with yoga and mindfulness. \n\n~  s u p p o r t m e  ~\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. If you are a person of means and would like to support me to continue offering free content on my YouTube channel, then please consider becoming a Patron of my channel by supporting me on a monthly basis. I have a number of pricing options on my website (including 3, 7, 10, 15 and 25 per month): https://bit.ly/2WSMNfJ or you can send me a one-off contribution via PayPal: http://bit.ly/2IEx8dR.\n\n~  s a v a s a n a s o n g  ~\n\nThere Are Many Different Kinds of Love by Chris Zabriskie is licensed under a Creative Commons Attribution licence (https://creativecommons.org/licenses/by/4.0/)\nSource: http://chriszabriskie.com/vendaface/\nArtist: http://chriszabriskie.com/\n\n ~  y o g a m u s i c  ~\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://spoti.fi/2VVjtqz \n\n~  f i l m i n g  ~ \n\nThis video was filmed and edited by me. \n\nYoga with Ailsa - Disclaimer \nPlease consult with your Doctor/physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Yoga with Ailsa from any and all claims or causes of action, known or unknown, arising out of Yoga with Ailsas negligence.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/V2CO7X7Mi2c/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/V2CO7X7Mi2c/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/V2CO7X7Mi2c/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/V2CO7X7Mi2c/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/V2CO7X7Mi2c/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Ailsa","tags":["yoga","vinyasa","vinyasa yoga","flow yoga","vinyasa flow","vinyasa flow yoga","intermediate yoga","1 hour yoga","vinyasa yoga uk","vinyasa yoga flow","vinyasa yoga workout","vinyasa yoga 1 hour","vinyasa yoga class intermeditate","all levels vinyasa yoga","1 hour yoga class","1 hour yoga flow","1 hour yoga session","1 hour yoga at home","1 hour yoga class sequence","free yoga","yoga class","power yoga","60 minute yoga","yoga flow 60 min","60 min vinyasa","intermediate vinyasa flow yoga"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"1 hour Intermediate Vinyasa Flow Yoga | 60 minutes | Yoga with Ailsa","description":"1 hour Intermediate Vinyasa Flow Yoga.  This 60 minute yog