. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Yoga with Ailsa from any and all claims or causes of action, known or unknown, arising out of Yoga with Ailsas negligence."},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT1H1M19S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"231","likeCount":"17","dislikeCount":"0","favoriteCount":"0","commentCount":"8"}', '''1'':1A ''60'':7A ''ailsa'':11A ''flow'':5A ''hour'':2A ''intermediate'':3A ''minutes'':8A ''vinyasa'':4A ''with'':10A ''yoga'':6A,9A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
