INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18284, 'Jtvw-Bph5smDn68K3CPYdM5vZ3o', 'tWR4kpwe2b4', NULL, '{"publishedAt":"2020-07-21T17:00:26Z","channelId":"UCqfNZgbeudf3rVN0jsSqmwg","title":"FLOW TO CROW pose - arm balance prep yoga class","description":"Welcome to today''s FLOW to CROW pose arm balance prep yoga class! In this free online yoga class, we will work on opening up the hips and engaging the core to build up strength to work our way to one of my favorite beginner arm balances. Have fun with it and don''t forget that I have a tutorial linked right below to help if you need additional practice with this one! \n\nCrow Pose Tutorial  https://youtu.be/CctLB8QyC9M\n\n SUBSCRIBE here for more free yoga   http://bit.ly/subscribehdy \n\n FREE Guide - \"The Secret to Building Your Core\"   http://bit.ly/freecoreguide \n\n  Beginner Yoga Playlist: http://bit.ly/beginyogaplaylist \n  Full Body Yoga Playlist: http://bit.ly/fullbodyplaylist\n  Yoga for Core Playlist: https://bit.ly/coreyogaplaylist\n\nWelcome to the High Desert Yogi channel for yoga and modern mindfulness! Whether you have never tried yoga before or are further along your journey, all are invited. Dont be shy, because you can do this from home! Throw on some clothes you can move in and I''ll see you on the mat.  \n\n  Dont forget to hit the bell on my page to turn on post notifications! \n \nThank you for watching, Heather \n\n\n\n YOGA ESSENTIALS  \n\n Mat: https://amzn.to/2KLZh3d\n Block: https://amzn.to/3elkJZB\n Blanket: https://amzn.to/2TgObY2 \n Strap: https://amzn.to/2Tm2hqU \n Bolster: https://amzn.to/2Yjlca7\n\n  Check out my Build a Practice Yoga Cards! \n72 Yoga Cards to build a mindful, healthy at home practice. Use as an educational guide or start creating your own sequences, notebook included. Unique tarot inspired design!   http://bit.ly/hdyyogacards \n\n\n\n  https://highdesertyogi.com/  \n  Business 