 Vinyasa Flow Yoga.  Crow Pose (or Bakasana) is a very difficult pose to master but I will lead you through a sequence that prepares your body for this arm balance as well as offering you a number of tips.  This class will strengthen the core, the wrists and shoulders whilst building strength and flexibility in the hips.  I hope you enjoy! \n\n#crowpose #1houryoga #vinyasaflow\n\n~  f i n d m e  ~ \n\ninstagram | https://www.instagram.com/ailsaburns/ \nfacebook | https://www.facebook.com/yogawithailsa\nmy website | https://www.frostedfeather.com/ \n\n~  a b o u t m e  ~ \n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. My channel is the place for longer yoga classes (30min, 45min and 60min). I also record guided meditations and Yoga Nidra as well as videos where we discuss everything to do with yoga and mindfulness. \n\n~  s u p p o r t m e  ~\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. If you are a person of means and would like to support me to continue offering free content on my YouTube channel, then please consider becoming a Patron of my channel by supporting me on a monthly basis. I have a number of pricing options on my website (including 3, 7, 10, 15 and 25 per month): https://bit.ly/2WSMNfJ or you can send me a one-off contribution via PayPal: http://bit.ly/2IEx8dR.\n\n ~  y o g a m u s i c  ~\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://spoti.fi/2VVjtqz \n\n~  s a v a s a n a m u s i c  ~\n\nThere Are Many Different Kinds of Love by Chris Zabriskie is licensed under a Creative Commons Attribution licence (https://creativecommons.org/licenses/by/4.0/)\nSource: http://chriszabriskie.com/vendaface/\nArtist: http://chriszabriskie.com/\n\n~  f i l m i n g  ~ \n\nThis video was filmed and edited by me. \n\nYoga with Ailsa - Disclaimer \nPlease consult with your Doctor/physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Yoga with Ailsa from any and all claims or causes of action, known or unknown, arising out of Yoga with Ailsas negligence."},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT56M21S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"132","likeCount":"8","dislikeCount":"0","favoriteCount":"0","commentCount":"4"}', '''1'':1A ''crow'':7A ''flow'':5A ''hour'':2A ''pose'':8A ''power'':3A ''vinyasa'':4A ''yoga'':6A', '2020-07-24 09:35:34.100616', '2020-07-24 09:35:34.100616');
