INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18299, 'GO-Fqfd9TdL7QGE0P7qD3tOSu0w', 'g6Rwxmm-RQU', NULL, '{"publishedAt":"2020-07-21T20:30:01Z","channelId":"UCWgPqzhktCm7Ky2d9y1OotQ","title":"6-Minute Yoga Class with Colleen Saidman Yee to Relieve Anxiety & Create Inner Peace","description":"On our mats we find what we need, when we need it, whether thats a work-in or a workout. Showing up is the most important part. \n\nCommunes 10-Day Yoga Challenge is a free online event featuring 16 of the worlds best yoga teachers. Each day introduces you to new teachers and three different classes, from beginner level to intermediate-advanced, and spanning styles from vigorous vinyasa to restorative. All are encouraged to join this collective celebration of mindful movement, getting us back on our mats, and into the flow  together. \n\nLearn more at www.onecommune.com/yoga \n\nCommune has created a new online virtual studio with over 300 premium yoga classes for all levels: beginner, intermediate, and advanced.\n\nABOUT COMMUNE: \nCommune is a course platform for personal and societal well- being. We create video courses with the worlds leading teachers across yoga and fitness, mindfulness, food and health, sustainability, and civic engagement. Commune courses are designed for people to learn together, connect, and bring their best selves into the world. Learn more at onecommune.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/g6Rwxmm-RQU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/g6Rwxmm-RQU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/g6Rwxmm-RQU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/g6Rwxmm-RQU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/g6Rwxmm-RQU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Commune","tags":["wellness","well-being","commune courses","commune","online learning"],"categoryId":"27","liveBroadcastContent":"none","localized":{"title":"6-Minute Yoga Class with Colleen Saidman Yee to Relieve Anxiety & Create Inner Peace","description":"On our mats we find what we need, when we need it, whether thats a work-in or a workout. Showing up is the most important part. \n\nCommunes 10-Day Yoga Challenge is a free online event featuring 16 of the worlds best yoga teachers. Each day introduces you to new teachers and three different classes, from beginner level to intermediate-advanced, and spanning styles from vigorous vinyasa to restorative. All are encouraged to join this collective celebration of mindful movement, getting us back on our mats, and into the flow  together. \n\nLearn more at www.onecommune.com/yoga \n\nCommune has created a new online virtual studio with over 300 premium yoga classes for all levels: beginner, intermediate, and advanced.\n\nABOUT COMMUNE: \nCommune is a course platform for personal and societal well- being. We create video courses with the worlds leading teachers across yoga and fitness, mindfulness, food and health, sustainability, and civic engagement. Commune courses are designed for people to learn together, connect, and bring their best selves into the world. Learn more at onecommune.com"},"defaultAudioLanguage":"en"}', '{"duration":"PT6M6S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"62","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''6'':1A ''anxiety'':11A ''class'':4A ''colleen'':6A ''create'':12A ''inner'':13A ''minute'':2A ''peace'':14A ''relieve'':10A ''saidman'':7A ''to'':9A ''with'':5A ''yee'':8A ''yoga'':3A', '2020-07-24 09:35:34.100616', '2020-07-24 09:35:34.100616');
