INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18303, '33R2wJNJUe4CT4wLZYLSmK309N4', 't4pB0QS4C6k', NULL, '{"publishedAt":"2020-04-24T13:11:28Z","channelId":"UCvccWZV7XYNIW7DdlNFYfVw","title":"45-minute Vinyasa, Standing sequence for Strong Legs I The Confinement Yoga classes (#32)","description":"I hope you enjoy this 45-minute standing sequence for strong, toned and lean legs! We start in a standing position with a quick grounding, then some Sun Salutations (A & B), and a bunch of standing poses (Warriors, Triangle, Airplane, Goddess, etc.). We end up with a quick Savasana so you can integrate all the benefits of your practice. \n\nThe pace is quite fast so you''ll also have your heart rate increase.\n\nRemember to be mindful and to listen to your body. If something feels wrong, it means that it is wrong. So hit pause, take a child''s pose, and start again when you''re ready. \n\nHop on your mat, and enjoy the burn! \n\nInstagram: @elise_rousse\nFacebook: Yoga with Elise - Brussels\nwebsite: www.eliserousse.com","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/t4pB0QS4C6k/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/t4pB0QS4C6k/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/t4pB0QS4C6k/hqdefault.jpg","width":480,"height":360}},"channelTitle":"Yoga with Elise Rousse","tags":["Standing yoga","45-minute yoga","warrior yoga","fast yoga","cardio yoga","standing vinyasa yoga","yoga class","elise rousse","elise yoga bruxelles","strong legs yoga","lean legs yoga","yoga for legs"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"45-minute Vinyasa, Standing sequence for Strong Legs I The Confinement Yoga classes (#32)","description":"I hope you enjoy this 45-minute standing sequence for strong, toned and lean legs! We start in a standing position with a quick grounding, then some Sun Salutations (A & B), and a bunch of standing poses (Warriors, Triangle, Airplane, Goddess, etc.). We end up with a quick Savasana so you can integrate all the benefits of your practice. \n\nThe pace is quite fast so you''ll also have your heart rate increase.\n\nRemember to be mindful and to listen to your body. If something feels wrong, it means that it is wrong. So hit pause, take a child''s pose, and start again when you''re ready. \n\nHop on your mat, and enjoy the burn! \n\nInstagram: @elise_rousse\nFacebook: Yoga with Elise - Brussels\nwebsite: www.eliserousse.com"},"defaultAudioLanguage":"en"}', '{"duration":"PT44M59S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"95","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''32'':14A ''45'':1A ''classes'':13A ''confinement'':11A ''for'':6A ''i'':9A ''legs'':8A ''minute'':2A ''sequence'':5A ''standing'':4A ''strong'':7A ''the'':10A ''vinyasa'':3A ''yoga'':12A', '2020-07-24 09:35:34.100616', '2020-07-24 09:35:34.100616');
