INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18313, '0A0LFTSNBwlidHYJ35rP3GmJ_vQ', 'DlDBHaGLhvY', NULL, '{"publishedAt":"2017-02-21T16:24:44Z","channelId":"UCU7ZIP2KKrcOwOuSbaaITnQ","title":"Yin / Yang Yoga Flow 1","description":"This is a 75-minute yin yang yoga practice. Includes some vinyasa flow, yin yoga, pranayama, mindfulness, and mind/body awareness. Beginners may find this a little challenging. Intermediate yogis may find this practice moderately challenging. Advanced yogis are likely to find this practice to be gentle. This yoga practice is intended to be therapeutic for mind and body, please avoid poses or shapes that are painful in any way (uncomfortable-as-cuss is not the same as painful, try to stick with it if you are not in pain).","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/DlDBHaGLhvY/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/DlDBHaGLhvY/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/DlDBHaGLhvY/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/DlDBHaGLhvY/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/DlDBHaGLhvY/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"MedicYine Yoga","categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Yin / Yang Yoga Flow 1","description":"This is a 75-minute yin yang yoga practice. Includes some vinyasa flow, yin yoga, pranayama, mindfulness, and mind/body awareness. Beginners may find this a little challenging. Intermediate yogis may find this practice moderately challenging. Advanced yogis are likely to find this practice to be gentle. This yoga practice is intended to be therapeutic for mind and body, please avoid poses or shapes that are painful in any way (uncomfortable-as-cuss is not the same as painful, try to stick with it if you are not in pain)."}}', 