INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18323, 'sGSfR6tQwPQiiIbZrV96sz_JlWY', 'kDVy40ItO4o', true, '{"publishedAt":"2019-12-14T09:05:53Z","channelId":"UCudQzAVsu1J1Pzv3oEXHPDw","title":"1hour yoga | beginner flow | full yoga class [60min]","description":"60 min hatha yoga flow\nThis 60 min yoga practice is for all level of students even you are brand new to yoga never had done any yoga class. this is perfect opportunity to you to learn yoga in your favourite place. \nThe yoga class including with nice warm up and 2 rounds of hatha yoga sun salutation and 3 rounds of ashtanga vinyasa sun salutation to improve flexibility and strength in practice. All the yoga poses are easy and safe to practice if you are new. Avoid inversion yoga asana if you are heaving any neck injury, heart, high bp and mensuration. Follow the modification yoga pose. 60 min hatha yoga flow will give you good amount of flexibility and strength my intention to make this 60 min hatha yoga flow is to balance the flexibility and strength in yoga practice. There are good bend forwards and backwards yoga pose. We include some good amount of twisting yoga pose and for the strength we added some plank pose and chaturanga which can help you to develop the arm strength. To get batter result we include some inversion yoga pose which is very beneficial yoga pose for body. I hope you will enjoy 60 min hatha yoga flow. Please do like share and subscribe the channel for future updates. \nKeep breathing throughout the practice. \nJust do your best, dont do over.\nBreath is the tool. \nSending love and lights\nMASTER D \n\nif you like the information please hit the LIKE \nSHARE with your friends and family \nFor further information subscribe the channel \n\nCheck my other videos- \n\nThis is YOGA WITH MASTER D. there is so much more to learn about this yoga pose.\n\nWatch some of my ashtanga sun salutation videos.\n\nSun salutation A, ashtanga vinyasa , beginners and advance\nhttps://youtu.be/wzJxij82bbE\n\nFor my other one-hour yoga practice video you can check the link below.\n1hour yoga | beginner flow | full yoga class [60min]\nhttps://youtu.be/kDVy40ItO4o\n\n1 Hour yoga practice for everyone | yoga for beginner [ 60 min]\nhttps://youtu.be/-GlC7pvWkwY\n\n30 min universal yoga sequence, for everyone\nhttps://youtu.be/s57rpm9zFtY\n\nHanumanasana | hanumanasana for beginners | How to do Hanumanasana (complete front split)\nhttps://youtu.be/dFHMg1Tzp-A\n\nWheel pose|Chakrasana|How to do wheel pose|yoga tutorial\nhttps://youtu.be/Ebd_w7hmBoM\n\nHow To Do Headstand For Beginner | Headstand for Beginners (Sirsasana)\nhttps://youtu.be/Qg-CazNh2aI\n\n\nSending love and lights\nMASTER  D \nRishikesh yogkulam\nYoga teacher training school, Rishikesh, India\nRYS 200, RYS 300\n\nstay connected\nFacebook - https://www.facebook.com/dheru.bisht\nFacebook page- yogawithdheru\nInstagram - @yogabydheru\n\nFor yoga teacher training in Rishikesh, India,\nconnect with us\nFor #onlineyogaclass subscribe the channel\nFor yogateachertraining at rishikesh india \n\n              Rishikesh Yogkulam \n        #yogateachertraining  \n\nTo know more about our up-coming yoga courses & retreats:-\nvisit us - https://www.rishikeshyogkulam.com\nEmail us - rishikeshyogkulam@gmail.com\nContact us - +918979596944\n\nOur courses link:-\n100 Hour TTC Course -https://www.rishikeshyogkulam.com/100-hour-yoga-teacher-training-course-in-rishikesh-india.php\n\n200 Hour TTC Course - https://www.rishikeshyogkulam.com/200-hour-yoga-teacher-training-course-in-rishikesh-india.php\n\n300 Hour TTC Course - https://www.rishikeshyogkulam.com/300-hour-yoga-teacher-training-course-in-rishikesh-india.php\n\n500 Hour TTC Course -https://www.rishikeshyogkulam.com/500-hour-yoga-teacher-training-course-in-rishikesh-india.php\n\nOur Blog - https://www.rishikeshyogkulam.com/blog/\n\n\nRishikesh yogkulam \nYoga teacher training school \nFaceboo