s://www.instagram.com/headstandsaroundtheworld\n\nTwitter: http://www.twitter.com/therashmiramesh \n\nFacebook: https://www.facebook.com/therashmiramesh\n\nWebsite: https://www.therashmiramesh.com\n\nCREDITS \nDirection, Camera, Sound & Editing: Malay Vadalkar\n\n#withme #yogaforperiods #yoga #yogaathome #stayhome #rashmiramesh #athome"},"defaultAudioLanguage":"en"}', '{"duration":"PT27M42S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"6300","likeCount":"279","dislikeCount":"0","favoriteCount":"0","commentCount":"47"}', '''days'':8A ''during'':2A,6A ''easy'':4A ''menstruation'':7A ''periods'':3A ''practice'':5A ''rashmi'':11A ''with'':10A ''yoga'':1A ''yogalates'':9A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18331, 'Nrs23uAA_OYGJ_ERHp4vxCJGhoM', 'bR4cO5K6fPU', NULL, '{"publishedAt":"2020-04-29T18:39:04Z","channelId":"UCb8bi069_ATXFCJjmdtlp0w","title":"Balance | 45 Minute Yoga Flow","description":"This is a 45 minute (including savasana) practice that is all about cultivating balance. Our practice includes some balance poses, but we also approach balance through the breath. We begin our practice by establishing an even, counted breath to balance our inhales and our exhales - and then we revisit this counted/balanced breath multiple times in our flow. Our physical practice is a slow flow, with pacing established by your breath, and includes lunges and warrior poses that flow into tree pose and warrior 3. We integrate some malasana/squat work, with opportunities for crow pose, and end with some seated and supine hip and spine release before settling into savasana.  \n\nThis is a level 1-2 yoga class, mostly because there is very little instruction into and within the poses. However, pacing and options would allow for this to be an all levels class if you have familiarity with the poses. Yoga is about listening to your body and choosing the best pose options for you. So do more of what feels good in this flow, and skip the poses or movements that don''t. By practicing with this video, you assume all risk and liability. \n\nIf you enjoyed this practice and would like to give a token of gratitude, you can send it via Venmo: @thanksforyoga or PayPal: mikkitrow@gmail.com. Every little bit helps to keep the creation of these practices sustainable. \n\nI chose not to add music so that yogis who prefer not to practice with music would also enjoy. All of my yoga playlists on Spotify are public, so feel free to tap into those: \nhttp://open.spotify.com/user/mikkitrow","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/bR4cO5K6fPU/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/bR4cO5K6fPU/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/bR4cO5K6fPU/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/bR4cO5K6fPU/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/bR4cO5K6fPU/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Mikki Trowbridge Yoga","tags":["Yoga (Sport)","yoga","yoga flow","slow flow yoga","morning yoga class","yoga video","all levels yoga flow","intermediate yoga flow","mixed levels yoga flow","am yoga","vinyasa yoga","mikki trowbridge yoga","salem oregon yoga","oregon yoga","yoga class","level 1 yoga","level 2 yoga","yoga at home","home practice yoga","feel good yoga flow","45 minute yoga class","45 minute yoga practice","yoga for balance","grounding yoga","all levels yoga"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Balance | 45 Minute Yoga Flow","description":"This is a 45 minute (including savasana) practice that is all about cultivating balance. Our practice includes some balance poses, but we also approach balance through the breath. We begin our practice by establishing an even, counted breath to balance our inhales and our exhales - and then we revisit this counted/balanced breath multiple times in our flow. Our physical practice is a slow flow, with pacing established by your breath, and includes lunges and warrior poses that flow into tree pose and warrior 3. We integrate some malasana/squat work, with opportunities for crow pose, and end with some seated and supine hip and spine release before settling into savasana.  \n\nThis is a level 1-2 yoga class, mostly because there is very little instruction into and within the poses. However, pacing and options would allow for this to be an all levels class if you have familiarity with the poses. Yoga is about listening to your body and choosing the best pose options for you. So do more of what feels good in this flow, and skip the poses or movements that don''t. By practicing with this video, you assume all risk and liability. \n\nIf you enjoyed this practice and would like to give a token of gratitude, you can send it via Venmo: @thanksforyoga or PayPal: mikkitrow@gmail.com. Every little bit helps to keep the creation of these practices sustainable. \n\nI chose not to add music so that yogis who prefer not to practice with music would also enjoy. All of my yoga playlists on Spotify are public, so feel free to tap into those: \nhttp://open.spotify.com/user/mikkitrow"}}', '{"duration":"PT45M56S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"250","likeCount":"6","dislikeCount":"0","favoriteCount":"0","commentCount":"5"}', '''45'':2A ''balance'':1A ''flow'':5A ''minute'':3A ''yoga'':4A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
