INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18333, 'Dlisc_BqDWlhuEhvEbN9W8B7MKg', 'bZeZxvXE_Vs', NULL, '{"publishedAt":"2020-03-31T15:19:55Z","channelId":"UCsJ5vreTeNxQ86s7fZtwbJQ","title":"Hands to Heart Center: 45-minute Beginner Yoga Practice","description":"Hands to Heart Center - Yoga for the People is a nonprofit organization that shares the healing practice of yoga with people affected by addiction, poverty, and trauma in Greater Boston.\n \nThis beginner yoga session is led by one of our Community Yoga Teachers, Kristin O''Donnell, who has taught 7 free, trauma-informed HTHC yoga classes since January 2017.\n \nHTHC would like to thank the Boston Public Library for partnering with us on this virtual yoga project.\n \nHTHC is grateful to our Community Yoga Teachers and Community Partners for supporting our mission of increasing access to yoga for all! \n \nPlease feel free to share your experiences, thoughts, questions, and suggestions regarding our online yoga classes in the comment section below. \n \nNamaste.\n \n- - - - - - - - - - \n \nSupport Hands to Heart Center! \nhttp://www.handstoheartcenter.org/donate/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/bZeZxvXE_Vs/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/bZeZxvXE_Vs/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/bZeZxvXE_Vs/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/bZeZxvXE_Vs/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/bZeZxvXE_Vs/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Hands to Heart Center - Yoga for the People","tags":["beginner yoga","trauma-informed yoga","Boston Public Library","Hands to Heart Center","yoga","45 minute yoga"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Hands to Heart Center: 45-minute Beginner Yoga Practice","description":"Hands to Heart Center - Yoga for the People is a nonprofit organization that shares the healing practice of yoga with people affected by addiction, poverty, and trauma in Greater Boston.\n \nThis beginner yoga session is led by one of our Community Yoga Teachers, Kristin O''Donnell, who has taught 7 free, trauma-informed HTHC yoga classes since January 2017.\n \nHTHC would like to thank the Boston Public Library for partnering with us on this virtual yoga project.\n \nHTHC is grateful to our Community Yoga Teachers and Community Partners for supporting our mission of increasing access to yoga for all! \n \nPlease feel free to share your experiences, thoughts, questions, and suggestions regarding our online yoga classes in the comment section below. \n \nNamaste.\n \n- - - - - - - - - - \n \nSupport Hands to Heart Center! \nhttp://www.handstoheartcenter.org/donate/"},"defaultAudioLanguage":"en-US"}', '{"duration":"PT46M58S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"146","likeCount":"2","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''45'':5A ''beginner'':7A ''center'':4A ''hands'':1A ''heart'':3A ''minute'':6A ''practice'':9A ''to'':2A ''yoga'':8A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
