INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18337, 'coH3L6Ldnt9u0c19irVr8oW5i-4', 'zumB7nZyWvQ', NULL, '{"publishedAt":"2020-07-22T19:03:39Z","channelId":"UCJ7lUNlPMuJzdcxj2QRTpoA","title":"Yoga With Kate - 10 Minute Abdominal Core Workout | Beginners to Advanced | Yoga Tone","description":"Hello and thank you for visiting my YouTube channel - Yoga with Kate.\n\nTodays practice will be a 10-minute abdominals/Core class for beginners to advanced. There are many yoga postures that focus on your core. When your core is weak you can end up with back issues as your spine over compensates. Practicing these abdominal asanas on a regular basis will not only help tone your abdominals, but will improve your strength and ability dramatically in other areas of your yoga practice.\n\nI would recommend warming up before this practice. You can find my warm up video here: https://youtu.be/lfJKV_Lrx1s\n\nI hope you enjoy the class, as always, comments are welcome down below and Ill happily respond if you have any questions or you have any suggestions for future classes. Im very sociable, so feel free to drop me a message and let me know how you got on.\n\nEnjoy your practice!\n\nOm Shanti, Kate\n\nFacebook: https://www.facebook.com/PowerYogaWithKate\nTwitter: @yogawithkate\nInstagram: @poweryogawithkate\n\nDisclaimer:\nPlease consult with your doctor before participating in this yoga class or before starting any new fitness regime. Please do not participate in this class if you are pregnant. If you are post pregnancy please consult with your doctor or midwife before participating. There is a possibility of risk of injury whilst participating in any form of exercise.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/zumB7nZyWvQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/zumB7nZyWvQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/zumB7nZyWvQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/zumB7nZyWvQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/zumB7nZyWvQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Kate","tags":["yogaabs","yogaforbeginners","yogacore","yogaabdominals","poweryoga","yogacoreworkout","yogaabscore","10minutecoreworkout","yogastrength","yogaworkout","yogaadvanced","yogatone","yogatotoneyourabs"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga With Kate - 10 Minute Abdominal Core Workout | Beginners to Advanced | Yoga Tone","description":"Hello and thank you for visiting my YouTube channel - Yoga with Kate.\n\nTodays practice will be a 10-minute abdominals/Core class for beginners to advanced. There are many yoga postures that focus on your core. When your core is weak you can end up with back issues as your spine over compensates. Practicing these abdominal asanas on a regular basis will not only help tone your abdominals, but will improve your strength and ability dramatically in other areas of your yoga practice.\n\nI would recommend warming up before this practice. You can find my warm up video here: https://youtu.be/lfJKV_Lrx1s\n\nI hope you enjoy the class, as always, comments are welcome down below and Ill happily respond if you have any questions or you have any suggestions for future classes. Im very sociable, so feel free to drop me a message and let me know how you got on.\n\nEnjoy your practice!\n\nOm Shanti, Kate\n\nFacebook: https://www.facebook.com/PowerYogaWithKate\nTwitter: @yogawithkate\nInstagram: @poweryogawithkate\n\nDisclaimer:\nPlease consult with your doctor before participating in this yoga class or before starting any new fitness regime. Please do not participate in this class if you are pregnant. If you are post pregnancy please consult with your doctor or midwife before participating. There is a possibility of risk of injury whilst participating in any form of exercise."}}', '{"duration":"PT9M41S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"76","likeCount":"9","dislikeCount":"0","favoriteCount":"0","commentCount":"5"}', '''10'':4A ''abdominal'':6A ''advanced'':11A ''beginners'':9A ''core'':7A ''kate'':3A ''minute'':5A ''to'':10A ''tone'':13A ''with'':2A ''workout'':8A ''yoga'':1A,12A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18339, '99fdNn4Y4-N0ToNFc4AqgDJ-5z8', 'MVJhKl9uQ9A', NULL, '{"publishedAt":"2016-06-20T23:41:18Z","channelId":"UC7J1isQp4juuErr4XkO88Ow","title":"Ashtanga Vinyasa Yoga Class - Flow with Breath","description":"The word Vinyasa means the connection of breath to movement. Thus in Vinyasa yoga all movements are synchronized with the breath, creating a practice that is both dynamic and flowing. The asanas, or postures, are derived from the Ashtanga system. The difference between the two styles is that in Ashtanga yoga one performs the same asanas in the same sequence every time, while in Vinyasa yoga one has more freedom to improvise sequences of asanas.\n\nwww.AyamaYoga.com/classes","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/MVJhKl9uQ9A/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/MVJhKl9uQ9A/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/MVJhKl9uQ9A/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/MVJhKl9uQ9A/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/MVJhKl9uQ9A/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Ayama Yoga & Healing Arts","tags":["Vinyasa","Yoga"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Ashtanga Vinyasa Yoga Class - Flow with Breath","description":"The word Vinyasa means the connection of breath to movement. Thus in Vinyasa yoga all movements are synchronized with the breath, creating a practice that is both dynamic and flowing. The asanas, or postures, are derived from the Ashtanga system. The difference between the two styles is that in Ashtanga yoga one performs the same asanas in the same sequence every time, while in Vinyasa yoga one has more freedom to improvise sequences of asanas.\n\nwww.AyamaYoga.com/classes"}}', '{"duration":"PT23S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"1564","likeCount":"1","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''ashtanga'':1A ''breath'':7A ''class'':4A ''flow'':5A ''vinyasa'':2A ''with'':6A ''yoga'':3A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18341, 'EA3QGCbgBLki3tWqnM7Oigsf3G8', 'W7_fvtOSuFE', NULL, '{"publishedAt":"2016-07-20T19:26:22Z","channelId":"UCOrJyEwU0kj3OGO0tn8lUpA","title":"Super Simple 15 Minute Yoga for Flexibility","description":"This yoga video is for flexibility, most specifically the hamstrings and hip flexors. This sequence can be used as a preparation into the splits. You will need a blanket (or two), two blocks, and a strap.\n\n-----\n\nHi everyone. This is Sam from Healthy Hints, and, today, I will be bringing you a sequence for flexibility. This sequence will be focusing on lengthening and opening up the hamstrings and hip flexors to help you get into a split comfortably. Grab a blanket, 2 blocks, a strap, and get on your mat. Lets get started. \n\nStart with a strap and lay down on your back. Bring the right leg up and place the strap around the ball of the foot. Straighten the leg to, it doesnt have to be 90 degrees, but to where your hamstring is comfortable. Flex your left foot. Press up into the strap to help lengthen those hamstrings. Switch sides. Place your left foot in the strap. Right leg goes nice and long. Press the ball of the foot up into that strap. Again, your leg does not have to be straight 90 degrees. Go as far as your hamstring will let you, but dont pass 90 degrees, toward your face. \n\nBend the knee and come on up. You can get rid of the strap now. And come on over onto hands and knees and do a tabletop position. Hands are underneath the shoulders, knees underneath the hips. Lift the hips up and back, downward facing dog. Draw your stomach in. Get comfortable. Then, lift your right leg up. Bring it to the outside of your hands into a lizard lunge. Press those hips forward. If you want, you can bring your hands down and rest on your forearms. Youll feel that stretch in the outer hip, as well as the hip flexor on the back leg. You are also welcome to lower the back knee to intensify the stretch. Walk your hands back up and straighten your leg this time. Hands on either side of the leg. Flex the foot. Bring your head down if you can. If this is too far for you, you can bring blocks underneath your hands. Were just doing half splits to get the hamstrings to loosen up. Hinge forward. Slide that right foot back into downward facing dog, again. \n\nThen, bring the left leg up. Bring it to the outside of the hands, a lizard lunge on this side. And you can always bring your elbows down, or you can use blocks, depending on how tight you are. And you can lower the back knee down. Sink into those hips. This lizard pose will help you in the splits, help you lengthen out the inner thighs and the hip flexors. Hinge back. Straighten that leg. Flex the toes. Curl the toes back toward your face, and forward fold over your leg. Hinge forward again. Bring that left foot back into downward facing dog. Stretch out those hamstrings.\n\nLift that right leg up, and, then, bring it in between the hands this time. Keep that back leg nice and strong. Bring your right hand to the knee, then the left hand. If you want, you can lift the left arm up, and then the right arm up. Arch back, lifting your chest, crescent pose. If your balance is shaky, you are more than welcome to keep your hands down at the knee. Back into downward facing dog.\n\nLift the left leg up. Bring it forward in between the hands. Then, bring the left hand to the knee, right hand to the knee, and, if you want, right and left arm can go up, all depending on your balance. Keep that back leg nice and strong, so youre stretching out that hip flexor and arching up and back. Hinge forward. Slide the left foot back, downward facing dog. \n\nWalk, step, or jump to standing, and then grab both of your blocks. Have your feet be hip width distance apart, as well as your blocks in front of your toes. Hinge at your hips and bring your hands right underneath your shoulders at the blocks at any level. Shift your weight into your toes so it feels like youre falling forward, really lifting the tailbone up. Bring the blocks to any level that is comfortable to you. And, then, slowly come all the way up to standing. \n\nGrab just one block, now, and turn longways on your mat, taking a nice wide stance. Turn your left toes in, right toes out. Right arm reaches up above as you hinge forward on those hips. Legs stay straight. Were going to triangle pose, lifting that left arm up. You can lower the block down to whatever level is comfortable to you. Make sure your legs are straight and your sides are long. Coming back up, well switch sides, right toes in, left toes out. Block is in the left hand now as you reach up and forward fold over those legs. Hand comes underneath the shoulder. Right arm comes all the way up to the sky.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/W7_fvtOSuFE/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/W7_fvtOSuFE/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/W7_fvtOSuFE/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/W7_fvtOSuFE/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/W7_fvtOSuFE/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Healthy Hints","tags":["yoga for flexibility","flexibility","yoga","healthy hints yoga","healthy hints"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Super Simple 15 Minute Yoga for Flexibility","description":"This yoga video is for flexibility, most specifically the hamstrings and hip flexors. This sequence can be used as a preparation into the splits. You will need a blanket (or two), two blocks, and a strap.\n\n-----\n\nHi everyone. This is Sam from Healthy Hints, and, today, I will be bringing you a sequence for flexibility. This sequence will be focusing on lengthening and opening up the hamstrings and hip flexors to help you get into a split comfortably. Grab a blanket, 2 blocks, a strap, and get on your mat. Lets get started. \n\nStart with a strap and lay down on your back. Bring the right leg up and place the strap around the ball of the foot. Straighten the leg to, it doesnt have to be 90 degrees, but to where your hamstring is comfortable. Flex your left foot. Press up into the strap to help lengthen those hamstrings. Switch sides. Place your left foot in the strap. Right leg goes nice and long. Press the ball of the foot up into that strap. Again, your leg does not have to be straight 90 degrees. Go as far as your hamstring will let you, but dont pass 90 degrees, toward your face. \n\nBend the knee and come on up. You can get rid of the strap now. And come on over onto hands and knees and do a tabletop position. Hands are underneath the shoulders, knees underneath the hips. Lift the hips up and back, downward facing dog. Draw your stomach in. Get comfortable. Then, lift your right leg up. Bring it to the outside of your hands into a lizard lunge. Press those hips forward. If you want, you can bring your hands down and rest on your forearms. Youll feel that stretch in the outer hip, as well as the hip flexor on the back leg. You are also welcome to lower the back knee to intensify the stretch. Walk your hands back up and straighten your leg this time. Hands on either side of the leg. Flex the foot. Bring your head down if you can. If this is too far for you, you can bring blocks underneath your hands. Were just doing half splits to get the hamstrings to loosen up. Hinge forward. Slide that right foot back into downward facing dog, again. \n\nThen, bring the left leg up. Bring it to the outside of the hands, a lizard lunge on this side. And you can always bring your elbows down, or you can use blocks, depending on how tight you are. And you can lower the back knee down. Sink into those hips. This lizard pose will help you in the splits, help you lengthen out the inner thighs and the hip flexors. Hinge back. Straighten that leg. Flex the toes. Curl the toes back toward your face, and forward fold over your leg. Hinge forward again. Bring that left foot back into downward facing dog. Stretch out those hamstrings.\n\nLift that right leg up, and, then, bring it in between the hands this time. Keep that back leg nice and strong. Bring your right hand to the knee, then the left hand. If you want, you can lift the left arm up, and then the right arm up. Arch back, lifting your chest, crescent pose. If your balance is shaky, you are more than welcome to keep your hands down at the knee. Back into downward facing dog.\n\nLift the left leg up. Bring it forward in between the hands. Then, bring the left hand to the knee, right hand to the knee, and, if you want, right and left arm can go up, all depending on your balance. Keep that back leg nice and strong, so youre stretching out that hip flexor and arching up and back. Hinge forward. Slide the left foot back, downward facing dog. \n\nWalk, step, or jump to standing, and then grab both of your blocks. Have your feet be hip width distance apart, as well as your blocks in front of your toes. Hinge at your hips and bring your hands right underneath your shoulders at the blocks at any level. Shift your weight into your toes so it feels like youre falling forward, really lifting the tailbone up. Bring the blocks to any level that is comfortable to you. And, then, slowly come all the way up to standing. \n\nGrab just one block, now, and turn longways on your mat, taking a nice wide stance. Turn your left toes in, right toes out. Right arm reaches up above as you hinge forward on those hips. Legs stay straight. Were going to triangle pose, lifting that left arm up. You can lower the block down to whatever level is comfortable to you. Make sure your legs are straight and your sides are long. Coming back up, well switch sides, right toes in, left toes out. Block is in the left hand now as you reach up and forward fold over those legs. Hand comes underneath the shoulder. Right arm comes all the way up to the sky."}}', '{"duration":"PT15M30S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"464","likeCount":"18","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''15'':3A ''flexibility'':7A ''for'':6A ''minute'':4A ''simple'':2A ''super'':1A ''yoga'':5A', '2020-07-24 09:35:37.988618', '2020-07-24 09:35:37.988618');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18342, '9k9tDHlUKUac7LHc1H1WTZoQVKA', 'kKcptYExc54', NULL, '{"publishedAt":"2018-03-20T01:17:56Z","channelId":"UCXSGYCcwSmDSeb3gAyhrDQg","title":"Core Power Yoga Flow - Twisting & Shoulder Opening Detox (45 min)","description":"This 45 minute core power yoga flow was made to make the best of both worlds, twisting to detox and open our shoulders to release negative energy. We clear out junk with our twists making room for our soul to feel free.  Our heart chakra will be cracked open to shine our light bright.  We will stretch the shoulders, bring mobility into our neck and upper back, allowing us to expand out breath.  Designed for all levels, this is a fun heartwarming, but still strengthening flow.  Enjoy, from my and hO''Me to yours \n\n\n\nBecome an O''Mie with our Newsletter - http://eepurl.com/c1YkVP\nFacebook - https://www.facebook.com/omyogalove/ \nInstagram - https://www.instagram.com/maryom4love/\nhO''Me website - https://www.essentiallyom.com\nNeed oils - https://goo.gl/xaisxh\n\nRelated Videos:\n----------------------------------------------------------------------------------------------------------------\nYoga for Weight Loss - 45 Minute Twisting, Body Cleanse Vinyasa Flow\nhttps://youtu.be/y2rtnSnRcHU\n\nPower Vinyasa Yoga - 60 Minute Full Body Flow for Grounding & Balance\nhttps://youtu.be/YFKxEl2cJgA","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/kKcptYExc54/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/kKcptYExc54/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/kKcptYExc54/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/kKcptYExc54/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/kKcptYExc54/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"O''M Yoga W/ Mary OMeara","tags