INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18354, 'uCFak5Ow4XByDcMmlD3G6uQ00YE', 'U6FQC6CgTIA', NULL, '{"publishedAt":"2015-06-23T20:58:12Z","channelId":"UCV9NJpBV8sVDBT2-S4JErmw","title":"iLa Yoga: SUP Yoga Flow!","description":"We love taking yoga to the water! Stand Up Paddle yoga is a great way to get outside, in nature, and practice yoga in a new exciting way. \n\nBridget takes you through an all levels SUP Yoga flow in the beautiful Wenatchee/Colombia River Estuary. \n\niLa Yoga offers SUP Yoga classes and tours in the Wenatchee valley, as well as on our worldwide retreats. For more info visit iLaYoga.com or shoot us an e-mail info@ilayoga.com.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/U6FQC6CgTIA/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/U6FQC6CgTIA/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/U6FQC6CgTIA/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/U6FQC6CgTIA/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/U6FQC6CgTIA/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"iLa Life","tags":["sup yoga","yoga","stand up paddle yoga","stand up paddle","ila yoga","ila","ila yoga studio","bridget shae","Paddle Board Yoga","Standup Paddleboarding (Sport)","ila yoga retreats","vinyasa","yoga flow","outdoor yoga","yoga in nature"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"iLa Yoga: SUP Yoga Flow!","description":"We love taking yoga to the water! Stand Up Paddle yoga is a great way to get outside, in nature, and practice yoga in a new exciting way. \n\nBridget takes you through an all levels SUP Yoga flow in the beautiful Wenatchee/Colombia River Estuary. \n\niLa Yoga offers SUP Yoga classes and tours in the Wenatchee valley, as well as on our worldwide retreats. For more info visit iLaYoga.com