INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18355, '-ml3PctLFFP0S6UhEKWngTVHD_A', 'pmEahhe-bTc', NULL, '{"publishedAt":"2020-07-18T23:42:08Z","channelId":"UCuHpNRPfaDjdwGJeCpk-_Fw","title":"Power Flow & Recharge Yoga Class","description":"In this 30 minute yoga class you will get it all!  The first half of class we will work up a sweat as we flow quickly through a Power Yoga sequence.  The second half of class we will slow everything down  to get a great stretch and find some relaxation.  We will play with different variations of a Sun Salutation B adding in handstand hops for a bit of added cardio!  As always, go at your own pace and don''t worry about what your handstand hops look like- just keep moving!\n\nFor more Power yoga classes, check out this playlist https://www.youtube.com/watch?v=Tv72P...\n\nComment below to let me know how you liked this yoga session!  \n\nShare with someone who might benefit or enjoy yoga at home!\n\nNamaste.\n\n#yogaworkout, #EmilyShupeYoga, #poweryoga, \n\nSUBSCRIBE to the Emily Shupe Yoga channel for weekly free yoga videos!\nhttp://www.youtube.com/c/EmilyShupeYoga\n\n Instagram: @ejstave\n Facebook: Emily Shupe Yoga\n.\n.\n.\n.\n.\n.\n.\n.\n\nBefore participating in any yoga or exercise activity, I recommend that you consult your physician.  \nAs is the case with any physical activity, the risk of injury, even serious or disabling, is always present and cannot be entirely eliminated. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself. If you experience any pain or discomfort, you agree to listen to your body and stop activity if needed.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/pmEahhe-bTc/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/pmEahhe-bTc/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/pmEahhe-bTc/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/pmEahhe-bTc/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/pmEahhe-bTc/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Emily Shupe Yoga","tags":["Power flow and recharge yoga class","ab workout","weight loss work out","power yoga","yoga","core strength","cardio yoga","yoga for weight loss","vinyasa","gentle yoga","gentle stretches","yoga for legs","weight loss","yoga at home","yoga body","free yoga","yoga for a tone body","yoga workout","yoga for cardio","power yoga flow","power vinyasa","handstand","handstand hops"],"categoryId":"26","liveBroadcastContent":"none","localized":{"title":"Power Flow & Recharge Yoga Class","description":"In this 30 minute yoga class you will get it all!  The first half of class we will work up a sweat as we flow quickly through a Power Yoga sequence.  The second half of class we will slow everything down  to get a great stretch and find some relaxation.  We will play with different variations of a Sun Salutation B adding in handstand hops for a bit of added cardio!  As always, go at your own pace and don''t worry about what your handstand hops look like- just keep moving!\n\nFor more Power yoga classes, check out this playlist https://www.youtube.com/watch?v=Tv72P...\n\nComment below to let me know how you liked this yoga session!  \n\nShare with someone who might benefit or enjoy yoga at home!\n\nNamaste.\n\n#yogaworkout, #EmilyShupeYoga, #poweryoga, \n\nSUBSCRIBE to the Emily Shupe Yoga channel for weekly free yoga videos!\nhttp://www.youtube.com/c/EmilyShupeYoga\n\n Instagram: @ejstave\n Facebook: Emily Shupe Yoga\n.\n.\n.\n.\n.\n.\n.\n.\n\nBefore participating in any yoga or exercise activity, I recommend that you consult your physician.  \nAs is the case with any physical activity, the risk of injury, even serious or disabling, is always present and cannot be entirely eliminated. If you engage in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself. If you experience any pain or discomfort, you agree to listen to your body and stop activity if needed."}}', '{"duration":"PT33M13S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"39","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''class'':5A ''flow'':2A ''power'':1A ''recharge'':3A ''yoga'':4A', '2020-07-24 09:35:39.828201', '2020-07-24 09:35:39.828201');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18356, 'kMhWECa4HvOr9NfVxIf66wallck', 'KqcDfVbNkmo', NULL, '{"publishedAt":"2020-05-26T18:10:27Z","channelId":"UCH-81uaxCwAAaSgxRtxMkxg","title":"One Hour Morning Yoga Energizing Full Body Power Flow for Strength and Flexibility  Feel Good","description":"This is perfect morning yoga flow. Energizing Full Body Power Yoga for Strength and Flexibility  One Hour Feel Good Flow is good for intermediate students or anyone who enjoys a challenge.\n\nPractice with me on OmStars commercial free! Over 1000 classes and thousands of hours of content: http://www.omstars.com. If youre looking for yoga videos that will show you the perfect way for you to start your yoga journey then Kino MacGregors yoga channel is perfect for you! Whether you are new to yoga or an advanced yoga student you will find a full yoga library with all the yoga postures that you need to develop a complete yoga practice. Yoga is more than just a physical practice yoga is a lifestyle that includes living a peaceful life. Living the yoga lifestyle is about yoga practice, inner peace, yoga diet and being a good person on and off your yoga mat. Kino is a yoga teacher, author of three books, international teacher, writer, blogger, online yoga class teacher, IG yoga challenge host and much more. She co-founded Miami Life Center and Miami Yoga Magazine as well as produced six Ashtanga Yoga DVDs. Practice yoga, change your world one breath at a time. Kino believes that yoga is a vehicle for each student to experience the limitless potential of the human spirit. You dont have to be strong or flexible to begin the yoga practice, all you need is an open heart and the inspiration to practice yoga. Unroll your mat and do the practice!\r\n\r\nFacebook - http://www.facebook.com/KinoYoga\r\nInstagram - http://www.instagram.com/KinoYoga\r\nBlog - http://www.kinoyoga.com","thumbnails":{"default