author of three books, international teacher, writer, blogger, online yoga class teacher, IG yoga challenge host and much more. She co-founded Miami Life Center and Miami Yoga Magazine as well as produced six Ashtanga Yoga DVDs. Practice yoga, change your world one breath at a time. Kino believes that yoga is a vehicle for each student to experience the limitless potential of the human spirit. You dont have to be strong or flexible to begin the yoga practice, all you need is an open heart and the inspiration to practice yoga. Unroll your mat and do the practice!\r\n\r\nFacebook - http://www.facebook.com/KinoYoga\r\nInstagram - http://www.instagram.com/KinoYoga\r\nBlog - http://www.kinoyoga.com"}}', '{"duration":"PT1H1M12S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"16669","likeCount":"604","dislikeCount":"17","favoriteCount":"0","commentCount":"76"}', '''and'':12A ''body'':7A ''energizing'':5A ''feel'':14A ''flexibility'':13A ''flow'':9A ''for'':10A ''full'':6A ''good'':15A ''hour'':2A ''morning'':3A ''one'':1A ''power'':8A ''strength'':11A ''yoga'':4A', '2020-07-24 09:35:39.828201', '2020-07-24 09:35:39.828201');
