INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18357, '0_1jj-3rbzniLgPKNrLs7WcwXKc', '-GlC7pvWkwY', true, '{"publishedAt":"2019-11-23T12:06:24Z","channelId":"UCudQzAVsu1J1Pzv3oEXHPDw","title":"1 Hour yoga practice for everyone | yoga for beginner [ 60 min ]","description":"This 60 min of yoga practice is for all level of students even you are brand new to yoga never had done any yoga class. this is perfect opportunity to you to learn yoga in your favourite place. The practice is including basic joint movements which is very important for you to avoid injury throughout your yoga journey, also we include 5 rounds of hatha yoga sun salutation which give you good warm up and energy to practice whole sequence. All the other postures are well designed also including enough amount of counter pose which is very important. Some basic inversions are also included in sequence which will help you to bring the blood toward head will help you to rejuvenate your brain cells. If you are a new yoga teacher and after a teacher training looking for a sequence for your yoga students feel free to use this one and just let your student find their best position and let them feel their breath. If you are brand new to yoga and if you have any difficulties throughout practice any posture you cant do. Let me know I will explain it separately. If you can do this easily so keep practicing this for few weeks and then try my new a bit more advance sequence which will come after two weeks. \nKeep breathing throughout the practice. \nJust do your best, dont do over.\nBreath is the tool. \nSending love and lights\nMASTER  D \nif you like the information please hit the LIKE \nSHARE with your friends and family \nFor further information subscribe the channel \n\nCheck my other videos- \n\nThis is YOGA WITH MASTER D. there is so much more to learn about this yoga pose.\n\nWatch some of my ashtanga sun salutation videos.