INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18306, 'nmKbTKGQF8H9-thdfliRAOV7j-Y', 'lNcLwyxELQc', true, '{"publishedAt":"2020-07-21T09:45:01Z","channelId":"UC2AWbik5F3fEkNln-CCW5qQ","title":"1 Hour Yoga Flow | Release Sore Muscles | Gayatri Yoga","description":"  NEW! TONE+BURN+SCULPT Program - http://bit.ly/beachreadyin30days \nThis one hour  yoga flow will help you release tension in your tired or sore body. We find freedom in hips joint, groin, innner thighs, hamstrings, quads, chest, shoulders, activate the core & improve spine mobility . You will feel renewed & rejuvenated after this yoga practice. Connect to your breath & listen to your body, modify a needed. Namaste!\n\n\nW H A T  C A N   Y O U   D O   T O   S U P P O R T   M Y   W O R K:\n  BECOME a MEMBER & access over 100 exclusive videos -  http://bit.ly/gayatritrial\n  DONATE https://www.paypal.me/gayatriyoga\n\n SUBSCRIBE for MORE FREE yoga each week :  http://bit.ly/gayatriyogachannel \n\n SHARE, COMMENT & LIKE - let youtube know the class is worth showing to other people\n\n\n30 D A Y  P R O G R A M S :\n  New 30 Day # RoadToBliss Yoga Program - https://bit.ly/roadtobliss \n  TONE+BURN+SCULPT Program - http://bit.ly/beachreadyin30days\n\nF R E E   C O N T E N T :\n  FREE 24 Day Weight Loss Program   https://bit.ly/24dayweightloss (share with friends too!)\n  FREE Yoga For Stress & Anxiety in Coronavirus Crises  https://bit.ly/90minflow\n\n\n\n\n\n\n #1houryoga #gayatriyoga #yogaflow\n\n___________________________\n\n Leave me a like  &  comment !!! \n\n___________________________\n\n\n // A B O U T   I N S T R U C T O R\n\nHi yogi, my name is Kristina. I''m a 200h certified yoga teacher,  Equinox Pilates MAT Certified trainer,  I have continuing education hours in Yin Yoga & Anatomy Trains {Fascia} (by Tom Myers). \n\nI constantly educate myself on anatomy & physiology to deliver to you safe effective workouts .\n\nG