INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18374, 'zYIhFZCvNGJMWdZnn8sgy7x6rio', '4uAAeV696BQ', NULL, '{"publishedAt":"2016-09-28T17:35:53Z","channelId":"UCaAs1Rx8ubjOHfykJYrEZFw","title":"15 Minute Post-run Yoga","description":"This yoga practice is your \"go to\" post-run recovery tool. It will open and release key areas of your body that will be fatigued from your workout. You can also use this video on a rest day to get a little bit of movement and stretch in. Enjoy and let me know what you think!","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/4uAAeV696BQ/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/4uAAeV696BQ/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/4uAAeV696BQ/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/4uAAeV696BQ/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/4uAAeV696BQ/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Cara Gilman","tags":["yogaforrunners","yoga","Running","Recovery","Stretching","Marathontraining"],"categoryId":"1","liveBroadcastContent":"none","localized":{"title":"15 Minute Post-run Yoga","description":"This yoga practice is your \"go to\" post-run recovery tool. It will open and release key areas of your body that will be fatigued from your workout. You can also use this video on a rest day to get a little bit of movement and stretch in. Enjoy and let me know what you think!"}}', '{"duration":"PT15M57S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"12511","likeCount":"121","dislikeCount":"4","favoriteCount":"0","commentCount":"9"}', '''15'':1A ''minute'':2A ''post'':4A ''post-run'':3A ''run'':5A ''yoga'':6A', '2020-07-24 09:35:39.828201', '2020-07-24 09:35:39.828201');
