INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18376, 'E02nPjDYFWi833YUiTfEVl7e68Q', 'qLYPu7v0bWo', NULL, '{"publishedAt":"2020-04-26T19:58:24Z","channelId":"UCYC45sBm3t7g866NYSZN8EA","title":"Patience, Young Grasshopper - 45 Minute Yoga Class","description":"A yoga flow that culminates in grasshopper pose. But we are patient as we move into this pinnacle pose, building up by lengthening our outer hips, strengthening our shoulders, and practicing baby grasshopper. When we finally reach grasshopper pose, hopefully the patience you had while building up will allow you to enter the pose (or attempt it!) with ease. This is a moderately paced flow with variations to challenge yourself or ease back back. Namaste.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/qLYPu7v0bWo/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/qLYPu7v0bWo/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/qLYPu7v0bWo/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/qLYPu7v0bWo/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/qLYPu7v0bWo/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Helly","tags":["yoga","vinyasa","flow","workout","exercise","quarantine","challenging","all levels","arm balance","grasshopper","hip opening"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Patience, Young Grasshopper - 45 Minute Yoga Class","description":"A yoga flow that culminates in grasshopper pose. But we are patient as we move into this pinnacle pose, building up by lengthening our outer hips, strengthening our shoulders, and practicing baby grasshopper. When we finally reach grasshopper pose, hopefully the patience you had while building up will allow you to enter the pose (or attempt it!) with ease. This is a moderately paced flow with variations to challenge yourself or ease back back. Namaste."}}', '{"duration":"PT48M2S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"41","likeCount":"3","dislikeCount":"0","favoriteCount":"0","commentCount":"0"}', '''45'':4A ''class'':7A ''grasshopper'':3A ''minute'':5A ''patience'':1A ''yoga'':6A ''young'':2A', '2020-07-24 09:35:41.321668', '2020-07-24 09:35:41.321668');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18377, 'Q8Ed7nAfiAjoWGjY6TpHBzyBJHM', 'E917SUqlJ9Q', NULL, '{"publishedAt":"2020-06-06T15:02:03Z","channelId":"UCjeKKWoCH3nU30WQzPYkipA","title":"Yoga Honey Tapestry | Blissology Yoga 200-hr Graduate Class Bali 2020","description":"Enjoy this 90 minute Yoga Honey Tapestry class taught by the Blissology Yoga 200-hr graduate class from our 2020 Bali training. \n\nYoga Honey is a modification of the Ashtanga Yoga Primary Series meant for more modern bodies. Expect to strengthen and stretch into your front, back, and side body. This class will allow you to tap into the nectar of your being and leave you feeing blissed out afterwards!\n\nWe teach our students this sequence to provide a foundation of inspiration to create fiery or calming sequences. Graduates learn how to remix Yoga Honey to design beginner to intermediate classes that offer different physiological and psychological feelings. \n\nLearn more about upcoming Blissology Teacher Trainings here  https://blissology.com/training/200hr-ytt/","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/E917SUqlJ9Q/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/E917SUqlJ9Q/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/E917SUqlJ9Q/hqdefault.jpg","width":480,"height":360}},"channelTitle":"Blissology Yoga","tags":["blissology yoga","blissology eoin finn","vinyasa yoga","90 minute vinyasa class","flow yoga","free yoga","online yoga","power yoga","bali yoga","blissology teacher training","yoga teacher training","ashtanga yoga primary series","sun salutation","90 min yoga class","90 min yoga flow","yoga practice","beginners yoga","intermediate yoga","all levels yoga class","fun yoga class","feel good yoga","200 hour yoga training","200 hour yoga training bali","200 hour yoga training 2021"],"categoryId":"17","liveBroadcastContent":"none","localized":{"title":"Yoga Honey Tapestry | Blissology Yoga 200-hr Graduate Class Bali 2020","description":"Enjoy this 90 minute Yoga Honey Tapestry class taught by the Blissology Yoga 200-hr graduate class from our 2020 Bali training. \n\nYoga Honey is a modification of the Ashtanga Yoga Primary Series meant for more modern bodies. Expect to strengthen and stretch into your front, back, and side body. This class will allow you to tap into the nectar of your being and leave you feeing blissed out afterwards!\n\nWe teach our students this sequence to provide a foundation of inspiration to create fiery or calming sequences. Graduates learn how to remix Yoga Honey to design beginner to intermediate classes that offer different physiological and psychological feelings. \n\nLearn more about upcoming Blissology Teacher Trainings here  https://blissology.com/training/200hr-ytt/"},"defaultAudioLanguage":"en"}', '{"duration":"PT1H40M5S","dimension":"2d","definition":"hd","caption":"false","licensedContent":true,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"272","likeCount":"14","dislikeCount":"0","favoriteCount":"0","commentCount":"3"}', '''200'':6A ''2020'':11A ''bali'':10A ''blissology'':4A ''class'':9A ''graduate'':8A ''honey'':2A ''hr'':7A ''tapestry'':3A ''yoga'':1A,5A', '2020-07-24 09:35:41.321668', '2020-07-24 09:35:41.321668');
