INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18380, 'G4DCvBtimigRtqXTa9X6i1_MEZE', 'wzcazxkDuro', NULL, '{"publishedAt":"2020-07-15T16:59:55Z","channelId":"UCLu5DnAoQLVk6ueJaaQ6F8Q","title":"Yoga Sculpt Booty + Core 30 Minute Workout","description":"Booty & Core, only our two favorite things to workout ever! This class is a perfect balance of everything you need to feel strong, centered and energized for the rest of your day. We start class off with a yoga warmup, then move into the strength training part of class, where we mix resistance training with cardio and bodyweight exercises. You will get a full body workout but mostly isolating and focusing on building that booty and toning your core. \n\nAny level of yogi / exercise practitioner can enjoy this class and no weights are needed. \n\nIf you like class make sure to comment and SUBSCRIBE!\n\nWebsite - Training & Retreat offerings: https://yogakp.com\nFollow me on Instagram: @kierstie_payge\nFacebook : Kierstie Payge Porr","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/wzcazxkDuro/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/wzcazxkDuro/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/wzcazxkDuro/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/wzcazxkDuro/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/wzcazxkDuro/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga by Kierstie Payge","tags":["fitness","workout","yoga sculpt","core workout","booty workout","30 minute low intensity workout","30 minute workout","yoga","vinyasa","booty and core workout","workout yoga","hiit","no equipment workout","no weights workout","bodyweight workout","yoga and workout","yoga for beginners","workouts for beginners","workouts to sweat","meditation","yoga instructor","yoga classes","vinyasa class","yoga strength","build muscle workout","burn fat workout","calorie burn workout","workout to lose weight"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"Yoga Sculpt Booty + Core 30 Minute Workout","description":"Booty & Core, only our two favorite things to workout ever! This class is a perfect balance of everything you need to feel strong, centered and energized for the rest of your day. We start class off with a yoga warmup, then move into the strength training part of class, where we mix resistance training with cardio and bodyweight exercises. You will get a full body workout but mostly isolating and focusing on building that booty and toning your core. \n\nAny level of yogi / exercise practitioner can enjoy this class and no weights are needed. \n\nIf you like class make sure to comment and SUBSCRIBE!\n\nWebsite - Training & Retreat offerings: https://yogakp.com\nFollow me on Instagram: @kierstie_payge\nFacebook : Kierstie Payge Porr"}}', '{"duration":"PT37M11S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"83","likeCount":"9","dislikeCount":"0","favoriteCount":"0","commentCount":"2"}', '''30'':5A ''booty'':3A ''core'':4A ''minute'':6A ''sculpt'':2A ''workout'':7A ''yoga'':1A', '2020-07-24 09:35:41.321668', '2020-07-24 09:35:41.321668');
INSERT INTO public.videos (id, etag, video_id, deleted, snippet, content_details, statistics, tsv, created_at, updated_at) VALUES (18381, 'nXGbwYcet0mm4zTIfv2lc-1ncaA', 'd24pB8VnDJ0', NULL, '{"publishedAt":"2020-04-02T14:14:16Z","channelId":"UCTe8ABP94FZadBA-TgpKKzA","title":"45 minute Gentle Yoga Flow | Yoga with Ailsa","description":"45 minute Gentle Yoga Flow.  This class is perfect for when you are feeling a little bit low energy but you still want to stretch out your body.  I hope you enjoy!\n\n#beginnersyoga #gentleyoga #45minyoga\n\n~  f i n d m e  ~\n\ninstagram | https://www.instagram.com/ailsaburns/ \nmy website | https://www.frostedfeather.com/\n \n~  a b o u t m e  ~\n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. My channel is the place for longer Power and Vinyasa Flow yoga classes (30min, 45min and 60min). I also record guided meditations and Yoga Nidra as well as videos where we discuss everything to do with yoga and mindfulness.\n\n~  s u p p o r t m e  ~\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. If you are a person of means and would like to support me to continue offering free content on my YouTube channel, then please consider becoming a Patron of my channel by supporting me on a monthly basis. I have a number of pricing options on my website (including 3, 7, 10, 15 and 25 per month): https://bit.ly/2WSMNfJ or you can send me a one-off donation via PayPal: http://bit.ly/2IEx8dR.\n\n~  s a v a s a n a s o n g  ~\n\nCylinder Two by Chris Zabriskie is licensed under a Creative Commons Attribution licence (https://creativecommons.org/licenses/by/4.0/)\nSource: http://chriszabriskie.com/cylinders/\nArtist: http://chriszabriskie.com/\n \n~  y o g a m u s i c  ~\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://spoti.fi/2VVjtqz\n \n~  f i l m i n g  ~\n\nThis video was filmed and edited by me.\n\nYoga with Ailsa - Disclaimer \nPlease consult with your Doctor/physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Yoga with Ailsa from any and all claims or causes of action, known or unknown, arising out of Yoga with Ailsas negligence.","thumbnails":{"default":{"url":"https://i.ytimg.com/vi/d24pB8VnDJ0/default.jpg","width":120,"height":90},"medium":{"url":"https://i.ytimg.com/vi/d24pB8VnDJ0/mqdefault.jpg","width":320,"height":180},"high":{"url":"https://i.ytimg.com/vi/d24pB8VnDJ0/hqdefault.jpg","width":480,"height":360},"standard":{"url":"https://i.ytimg.com/vi/d24pB8VnDJ0/sddefault.jpg","width":640,"height":480},"maxres":{"url":"https://i.ytimg.com/vi/d24pB8VnDJ0/maxresdefault.jpg","width":1280,"height":720}},"channelTitle":"Yoga with Ailsa","tags":["Yoga","flow yoga","all levels yoga","free yoga","yoga class","45 min yoga","45 minute yoga","45 min yoga at home","45 minute yoga at home","45 min yoga flow","45 minute yoga flow","45 min total body yoga","total body yoga","full body yoga","45 minute yoga session","yoga 45 minute","45 min yoga class sequence","beginners yoga","yoga for beginners","full yoga class"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"45 minute Gentle Yoga Flow | Yoga with Ailsa","description":"45 minute Gentle Yoga Flow.  This class is perfect for when you are feeling a little bit low energy but you still want to stretch out your body.  I hope you enjoy!\n\n#beginnersyoga #gentleyoga #45minyoga\n\n~  f i n d m e  ~\n\ninstagram | https://www.instagram.com/ailsaburns/ \nmy website | https://www.frostedfeather.com/\n \n~  a b o u t m e  ~\n\nWelcome to my channel! My name is Ailsa and I am Vinyasa Flow and Restorative Yoga teacher based in Bristol in the UK. My channel is the place for longer Power and Vinyasa Flow yoga classes (30min, 45min and 60min). I also record guided meditations and Yoga Nidra as well as videos where we discuss everything to do with yoga and mindfulness.\n\n~  s u p p o r t m e  ~\n\nI believe that everyone, regardless of economic status, should be able to experience the benefits of yoga and therefore, I am offering free yoga classes on this YouTube channel. If you are a person of means and would like to support me to continue offering free content on my YouTube channel, then please consider becoming a Patron of my channel by supporting me on a monthly basis. I have a number of pricing options on my website (including 3, 7, 10, 15 and 25 per month): https://bit.ly/2WSMNfJ or you can send me a one-off donation via PayPal: http://bit.ly/2IEx8dR.\n\n~  s a v a s a n a s o n g  ~\n\nCylinder Two by Chris Zabriskie is licensed under a Creative Commons Attribution licence (https://creativecommons.org/licenses/by/4.0/)\nSource: http://chriszabriskie.com/cylinders/\nArtist: http://chriszabriskie.com/\n \n~  y o g a m u s i c  ~\n\nI love to accompany my classes with eclectic and thoughtfully selected music. You can find my playlists on my Spotify profile: https://spoti.fi/2VVjtqz\n \n~  f i l m i n g  ~\n\nThis video was filmed and edited by me.\n\nYoga with Ailsa - Disclaimer \nPlease consult with your Doctor/physician before beginning any exercise program. By participating in this exercise or exercise program, you agree that you do so at your own risk, are voluntarily participating in these activities, assume all risk of injury to yourself, and agree to release and discharge Yoga with Ailsa from any and all claims or causes of action, known or unknown, arising out of Yoga with Ailsas negligence."},"defaultAudioLanguage":"en-GB"}', '{"duration":"PT49M5S","dimension":"2d","definition":"hd","caption":"false","