ull","class","pamper","pajamas","stretch","relax","restore","rejuvenate"],"categoryId":"22","liveBroadcastContent":"none","localized":{"title":"PAJAMA YIN YOGA!  Relax, Meditate & Stretch Full 1HR Class #YOGAYIN #PAJAMAYIN  | One Yoga & Fitness","description":"Hello Everyone,\n\nThis is a full 1+ hour Yin Yoga class that targets the hips.  This is a relaxing flow where we hold poses from 3 to 5 minutes.  Find some pillows, 2 blocks and lets begin.  Featured poses are childs pose, low lunge, 1/2 split, pigeon, forward fold, bound angle, hero, wide leg up the wall, legs up the wall & savasana.  Do you want to relax, meditate and stretch?  Then this class is your class.  Pamper and nurture yourself!  Find the stillness and slow down.  Please like or subscribe and leave a comment if you have any requests.  Enjoy!   \n\nCheck out Amy Hagers book on amazon\n\nHealth Through Fruit:\n\nhttps://www.amazon.com/Health-Through-Fruit-Eliminate-Autoimmune-ebook/dp/B07YGRVDSR/ref=sr_1_2?dchild=1&keywords=health+through+fruit&qid=1585092762&sr=8-2\n\nCheck out my social media:\nWebsite: selfhealinginspiration.com\nFacebook: https://www.facebook.com/selfhealinginspiration/\nInstagram: https://www.instagram.com/selfhealinginspiration/\nPinterest: https://www.pinterest.com/selfhealinginspiration/"}}', '{"duration":"PT1H3M9S","dimension":"2d","definition":"hd","caption":"false","licensedContent":false,"contentRating":{},"projection":"rectangular"}', '{"viewCount":"146","likeCount":"7","dislikeCount":"0","favoriteCount":"0","commentCount":"1"}', '''1hr'':8A ''class'':9A ''fitness'':14A ''full'':7A ''meditate'':5A ''one'':12A ''pajama'':1A ''pajamayin'':11A ''relax'':4A ''stretch'':6A ''yin'':2A ''yoga'':3A,13A ''yogayin'':10A', '2020-07-24 09:35:37.988618', '2020-07-24 09:37:17.890841');
